INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここに困ってる人は\nいないよね…？\nよかった♪", 1, 1, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！", 1, 2, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1, 3, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここで特訓していい？\n物は壊さないように\n気をつけるね！", 1, 4, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？", 1, 5, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！", 1, 6, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 1, 7, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…", 2, 8, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！", 2, 9, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "えっとね…しっぽは\n触っちゃダメだよ？", 2, 10, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 2, 11, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～", 2, 12, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 2, 13, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよー！\n今日も元気に\nいっちゃうよー！", 2, 14, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 2, 15, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 2, 16, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちゃんとケアして\n傷が残らないように\nしないと…", 3, 17, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一回休むと\nこのままずるずる\nいきそう…", 3, 18, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 3, 19, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪", 3, 20, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい所に\nいると体が丸く\nなっちゃう…", 3, 21, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "いつ何が起きるか\n分からないし、\nもっと力をつけないと", 3, 22, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しいけど、\n食べ過ぎないように\nしないと…！！", 3, 23, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "文字が多いと\n眠くなっちゃう…\n危ない危ない！", 3, 24, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1, 26, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "のんびりするのって\n退屈かも…\n何かして遊ばない？", 1, 27, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん", 1, 28, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！", 1, 29, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや", 1, 30, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 1, 31, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…なんであたし\n騎士くんばっかり\n見てるんだろ…", 1, 32, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 2, 33, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "触るのって楽しい？\n…そっか\n少しだけだよ…？", 2, 34, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！", 2, 35, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？", 2, 36, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！", 2, 37, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 2, 38, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！", 2, 39, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 2, 40, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 2, 41, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "これでよし♪\n騎士くん\n気づくかな…？", 3, 42, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一回休むと\nこのままずるずる\nいきそう…", 3, 43, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 3, 44, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こういうの\nなんか気になって\nじーって見ちゃうんだ", 3, 45, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい所に\nいると体が丸く\nなっちゃう…", 3, 46, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "いつ何が起きるか\n分からないし\nもっと力をつけないと", 3, 47, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹が減ると\nなんか力が\n出ないんだよね…", 3, 48, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "色んなことを\n知っておくのは\n大事だよね！", 3, 49, 100102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな", 1, 51, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 1, 52, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 1, 53, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "戦いは\n得意じゃないけど\nお料理なら…！", 1, 54, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こういう平和な\n時間が、もっと\n続くといいな", 1, 55, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "わたし…\nもうちょっとだけ勇気\n出してみようかな", 1, 56, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！", 1, 57, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ひゃうっ！\nな、なに？\nびっくりしたぁ…", 2, 58, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…", 2, 59, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "困ったことが\nあったら\nいつでも話してね", 2, 60, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "え！　む、虫っ！？\n取って取って！\nはやく～！", 2, 61, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？", 2, 62, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 2, 63, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？", 2, 64, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼休みだね\nあの…良かったら\nお弁当…食べない？", 2, 65, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…", 2, 66, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "よし…\nこれなら\n褒めてもらえるかな？", 3, 67, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "がんばることも\n必要だけど、\nお休みも大切だよね", 3, 68, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…", 3, 69, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "戦う前にもこうやって\n落ち着けたら\nいいのに", 3, 70, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…はへっ？\nも、もしかして今\n寝ちゃってた…？", 3, 71, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 3, 72, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？", 3, 73, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…そっか\nこうすれば魔法が\nもっと強くなるんだ", 3, 74, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "洗濯と掃除\nどっちから\nはじめよう？", 1, 76, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな", 1, 77, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 1, 78, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日はどんな料理に\n挑戦しよう…♪", 1, 79, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 1, 80, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！", 1, 81, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士クンのそばに\nいられるだけで\n幸せだよ", 1, 82, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…", 2, 83, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "え！　む、虫っ！？\n取って取って！\nはやく～！", 2, 84, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない", 2, 85, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…", 2, 86, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 2, 87, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～", 2, 88, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪", 2, 89, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？", 2, 90, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい", 2, 91, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "よし…\nこれなら\n褒めてもらえるかな？", 3, 92, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "がんばることも\n必要だけど\nお休みも大切だよね", 3, 93, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい～♪\n騎士クンは\nこういうのって好き？", 3, 94, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "戦う前にもこうやって\n落ち着けたら\nいいのに", 3, 95, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あの…！\nよ、良かったら\n一緒に…！", 3, 96, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 3, 97, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？", 3, 98, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…やっぱり\n月刊恋愛指南は\nためになる…", 3, 99, 100202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "装備の手入れでも\nしようかな…", 1, 101, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？", 1, 102, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 1, 103, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "仲間なんていらない\nそう思ってた頃も\nあったな…", 1, 104, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "考えごとをしていると\nつい部屋中を\n歩いてしまうな", 1, 105, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "彼は\nどこまで強くなるのか\n私も負けられないな", 1, 106, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 1, 107, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ", 2, 108, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？", 2, 109, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なに？　私に相談？\n戦いについてなら\n喜んで", 2, 110, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！", 2, 111, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した", 2, 112, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 2, 113, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう\n今日も充実した\n一日にしていこう", 2, 114, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろ\nお茶の時間か\nキミも一緒にどう？", 2, 115, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 2, 116, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "戦いを経てもなお\n美しくあるように…\nこれでよし♪", 3, 117, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "戦ってばかりで\n休まないと、また\nユイに怒られるな", 3, 118, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 3, 119, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか", 3, 120, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "時々は落ち着いた\n時間を過ごすのも\n悪くない…", 3, 121, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 3, 122, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事は大切だけど\n食べ過ぎには\n注意しておこう…", 3, 123, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 3, 124, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう", 1, 126, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 1, 127, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "彼は\nどこまで強くなるのか\n私も負けられないな", 1, 128, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね", 1, 129, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい", 1, 130, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど", 1, 131, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 1, 132, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうしたの？\nなんでもない？\nそれなら良かった", 2, 133, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？", 2, 134, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう", 2, 135, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！", 2, 136, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ひょっとして\n今のも一本だなんて\n言わないよね？", 2, 137, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 2, 138, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ", 2, 139, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "休息も時には\n必要だと、仲間から\n教わったよ", 2, 140, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 2, 141, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！", 3, 142, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休息があってこそ\n万全な状態で\n戦えるんだ", 3, 143, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 3, 144, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "体と同様に\n心もほぐれるね…\nはぁ…", 3, 145, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…", 3, 146, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 3, 147, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "修行のせいか\n最近食べる量が\n増えてきたような…", 3, 148, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 3, 149, 100302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1, 151, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "落とし穴…どこに\n作ったんだっけ？", 1, 152, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 1, 153, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 1, 154, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "かくれんぼする人\nこの指、と～まれ！", 1, 155, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！", 1, 156, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ミソギと遊ぶ？\nミソギに遊ばれる？", 1, 157, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～", 2, 158, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？", 2, 159, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "にいちゃんの\n通りそうなところに\nバナナの皮を…", 2, 160, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 2, 161, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ここ、ミソギ探検隊の\n基地にしようよ！", 2, 162, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 2, 163, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪", 2, 164, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "にいちゃんが\n昼寝したら、\nイタズラし放題♪", 2, 165, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 2, 166, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "イタズラには\nお色気も必要…\nうん、完璧！", 3, 167, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪", 3, 168, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 3, 169, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 3, 170, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 3, 171, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "探検家は\n体力勝負だよー！", 3, 172, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！", 3, 173, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "こういう所に\n宝の地図が\n隠れてるんだよね～", 3, 174, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1, 176, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！", 1, 177, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 1, 178, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 1, 179, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "かくれんぼする人\nこの指、と～まれ！", 1, 180, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 1, 181, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？", 1, 182, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ミソギがしかけた\nイタズラ\n見つけられるかな？", 2, 183, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "探検する？\n冒険する？\nそれとも…\nイタズラされる？", 2, 184, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "将来の夢は探検家！\n探したい物はないけど", 2, 185, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！", 2, 186, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 2, 187, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ここ、ミソギ探検隊の\n基地にしようよ！", 2, 188, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！", 2, 189, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "にいちゃんが昼寝したら\nイタズラし放題♪", 2, 190, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 2, 191, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "イタズラには\nお色気も必要…\nうん、完璧！", 3, 192, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ゆっくりまったりして\n次のイタズラを\n考えよ～！", 3, 193, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 3, 194, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 3, 195, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 3, 196, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "探検家は\n体力勝負だよー！", 3, 197, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "探検のおやつに\nぴったりかも～！", 3, 198, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "こういう所に\n宝の地図が\n隠れてるんだよね～", 3, 199, 100402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな", 1, 201, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…", 1, 202, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ", 1, 203, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お姉ちゃんのマネ\nしちゃおうかな？", 1, 204, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "双子って、\n好みのタイプも\n似ちゃうのかな？", 1, 205, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんと私は\n相性抜群です♪", 1, 206, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 1, 207, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 2, 208, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？", 2, 209, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そんなところ\n触っちゃダメ♪", 2, 210, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃん、イジワル\nしないでください…", 2, 211, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！", 2, 212, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "コーチ、\n今日も特訓\nお願いします！", 2, 213, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 2, 214, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…", 2, 215, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜はこれからですよ\nお兄ちゃん♪", 2, 216, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "世界一、かわいく\nなるんだから♪", 3, 217, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気持ちいい♪\nもう立てないよ～", 3, 218, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nアカリのライバル\nだね", 3, 219, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 3, 220, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ…アカリ、\nとろけちゃう…", 3, 221, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！", 3, 222, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね", 3, 223, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この楽譜、\nサックスで吹いて\nみたいなぁ♪", 3, 224, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…", 1, 226, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習", 1, 227, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？", 1, 228, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…", 1, 229, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "双子って、\n好みのタイプも\n似ちゃうのかな？", 1, 230, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…", 1, 231, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 1, 232, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 2, 233, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…", 2, 234, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ", 2, 235, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃん、イジワル\nしないでください…", 2, 236, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…", 2, 237, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "コーチ、\n今日も特訓\nお願いします！", 2, 238, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 2, 239, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん", 2, 240, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね", 2, 241, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姉ちゃんのマネ\nしちゃおうかな？", 3, 242, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気持ちいい♪\nもう立てないよ～", 3, 243, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nアカリのライバル\nだね", 3, 244, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 3, 245, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい", 3, 246, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "汗をかくと\n気持ちいいですよね", 3, 247, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪", 3, 248, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この楽譜\nサックスで吹いて\nみたいなぁ♪", 3, 249, 100602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪", 1, 251, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "う～ら～め～し～や～\nなの～♪", 1, 252, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～", 1, 253, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "幽霊の正体見たり、\nミヤコなの～", 1, 254, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪", 1, 255, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アイツがいて、\nプリンもある。\nきっとここが天国なの", 1, 256, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 1, 257, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪", 2, 258, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 2, 259, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 2, 260, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 2, 261, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！", 2, 262, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～", 2, 263, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "う～　眠いの…\n二度目の二度寝を\nするの…", 2, 264, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～", 2, 265, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ディナーは豪華に、\nプリンのフルコース\nなの～♪", 2, 266, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "体が透けちゃうから\nうまく使えないの～", 3, 267, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "まったりなの～\nあとはプリンがあれば\n完璧なの～", 3, 268, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "む～…かわいいけど\nプリンは分けて\nあげないの～", 3, 269, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "は～　いい気分なの…\n成仏しそうなの…", 3, 270, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？", 3, 271, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "幽霊には、体力も\n筋力も関係ないの～！", 3, 272, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～", 3, 273, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "プリンの写真集が\nあればいいのに\nなの～", 3, 274, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うらめしや～…\n裏の飯より\nプリンがいいの～", 1, 276, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "プリン♪　プリン♪\nプリン♪　なの～♪　", 1, 277, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～", 1, 278, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～", 1, 279, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ", 1, 280, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "アイツがいて\nプリンもある\nきっとここが天国なの", 1, 281, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 1, 282, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 2, 283, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 2, 284, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日はオマエと\nプリンを買いに行くの\n強制なの～　", 2, 285, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 2, 286, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ", 2, 287, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ", 2, 288, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "う～　眠いの…\n二度目の二度寝を\nするの… ", 2, 289, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ", 2, 290, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪", 2, 291, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "体が透けちゃうから\nうまく使えないの～ ", 3, 292, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ", 3, 293, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "む～…かわいいけど\nプリンは分けて\nあげないの～　", 3, 294, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "は～　いい気分なの…\n成仏しそうなの…", 3, 295, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ", 3, 296, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "幽霊には、体力も\n筋力も関係ないの～！　", 3, 297, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ", 3, 298, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "プリンの写真集が\nあればいいのに\nなの～ ", 3, 299, 100702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！", 1, 301, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 1, 302, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 1, 303, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 1, 304, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？", 1, 305, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "このボクがいるだけで\nあの人への\nおもてなしだよね", 1, 306, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ボクの可愛さは、\nふふ…あの人の\nためのものさ", 1, 307, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆", 2, 308, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 2, 309, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？", 2, 310, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？", 2, 311, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人も今、\n可愛いボクのこと\n考えてるかな…", 2, 312, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ", 2, 313, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "美しいボクの\n美しい一日が\n始まるよ！", 2, 314, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪", 2, 315, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪", 2, 316, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 3, 317, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 3, 318, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！", 3, 319, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 3, 320, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "気安く触ったら\n火傷する…\n炎はボクに似ているね", 3, 321, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 3, 322, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ボクが食べると、\n食べ物まで\n可愛いなあ…", 3, 323, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ", 3, 324, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ボクの美しさは\nみんなのために\nあるんだよ！", 1, 326, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 1, 327, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！", 1, 328, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 1, 329, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ボクの可愛さについて\nみんな話し合わない\nのかな…？", 1, 330, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "このボクがいるだけで\nあの人への\nおもてなしだよね", 1, 331, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人も今\n可愛いボクのこと\n考えてるかな…", 1, 332, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 2, 333, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから", 2, 334, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ボクの化粧品使う？\n一緒に可愛くなろうよ", 2, 335, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！", 2, 336, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 2, 337, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ", 2, 338, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝日と共に\nボクの美しさも\n周りを照らすよ", 2, 339, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ", 2, 340, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪", 2, 341, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 3, 342, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 3, 343, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "可愛いものを\n可愛いって言える\nボクって可愛いよね！", 3, 344, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 3, 345, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！", 3, 346, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 3, 347, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ボクが食べると\n食べ物まで\n可愛いなあ…", 3, 348, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ", 3, 349, 100802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！", 1, 351, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今度シグルドに\n私の魔法を一つ\n伝授してやるか", 1, 352, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここでは風が\n吹いてこないな…\n換気したい！", 1, 353, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 1, 354, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "まずは包帯をとって\n手から龍の形の\n炎を出して…", 1, 355, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "シグルド…\n今頃何処で何を\nしているのだろう…", 1, 356, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "最近、彼の姿が\nまぶしく見える…\nどうして…？", 1, 357, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "辞書を知らないか？\n…探している\n理由は聞くな", 2, 358, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そうだ！\n貴様の技にも\n名前をつけてやろう！", 2, 359, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？", 2, 360, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "何事だ？\nまさか我が瞳に\n魅入られたのか？", 2, 361, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 2, 362, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 2, 363, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！", 2, 364, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ", 2, 365, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！", 2, 366, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 3, 367, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "くっ…！\n私を眠りの国へ\n誘うつもりか！", 3, 368, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このようなものに\n懐柔されるものか！\n…されるものか！", 3, 369, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 3, 370, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これが我らの求めた\n安寧か…\n悪くない…", 3, 371, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "この程度\n前世での激闘に\n比べれば…！", 3, 372, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "最近金欠でな…\nいやぁありがたい…", 3, 373, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ここにも\n前世の記憶が\n眠っていたとは…", 3, 374, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな", 1, 376, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？", 1, 377, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！", 1, 378, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 1, 379, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…", 1, 380, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 1, 0, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？", 1, 381, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…", 1, 382, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 8, 0, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？", 2, 383, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ", 2, 384, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？", 2, 385, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！", 2, 386, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 1, 0, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 2, 387, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 2, 388, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 8, 0, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！", 2, 389, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…", 2, 390, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜になると、力が\n増した気分になるな\n…なりませんか？", 2, 391, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 3, 392, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お、おのれ\nヒュプノス…\n私は負けないぞ…", 3, 393, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "くっくっくっ…\n貴様は特別団員に\nしてやろう", 3, 394, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 3, 395, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これが我らの求めた\n安寧か…\n悪くない…", 3, 396, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！", 3, 397, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事は魔力に\n変換する体力の\n元になるのだ！", 3, 398, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "フフフ…\nこれを覚えれば\nもっと強く…！", 3, 399, 100902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ", 1, 401, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪", 1, 402, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 1, 403, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 1, 404, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか", 1, 405, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや", 1, 406, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 1, 407, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 2, 408, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 2, 409, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "王子はんは、\n絵本から出てきた人\nみたいやね～", 2, 410, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うちの話し方\nのんびりしてます\nやろか？", 2, 411, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "マホ姫の手は\nつべたいから、\n王子はんが温めて？", 2, 412, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 2, 413, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 2, 414, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ", 2, 415, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ", 2, 416, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ", 3, 417, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ", 3, 418, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ", 3, 419, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "心地ええどす。まるで\nお花畑にいるようやね", 3, 420, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかどす。\n心まであったかく\nなりますわぁ", 3, 421, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～", 3, 422, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ", 3, 423, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "絵本、絵本～\n幸せやわぁ♪", 3, 424, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "王子はんにとって\n自慢の姫になるえ～", 1, 426, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ", 1, 427, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 1, 428, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 1, 429, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ", 1, 430, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "マホ姫と王子はん\n絵本の世界より\nベストカップルや", 1, 431, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 1, 432, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "たまには、王子はんの\n好きな絵本も\n知りたいな～", 2, 433, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 2, 434, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？", 2, 435, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "絵本読むんも\nええなぁ…", 2, 436, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 2, 437, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 2, 438, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 2, 439, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ", 2, 440, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ", 2, 441, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ", 3, 442, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "王子はんも一緒に\nゆっくりしていっても\nええんよ？", 3, 443, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？", 3, 444, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "癒しアイテムって\nほんま、好っきゃわぁ", 3, 445, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ", 3, 446, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ", 3, 447, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいひいわ～\nマホマホ王国には\nない味やわぁ", 3, 448, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ", 3, 449, 101002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1, 451, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！", 1, 452, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "い、いけない！\n縫い針落としちゃった", 1, 453, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！", 1, 454, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 1, 455, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 1, 456, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～", 1, 457, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？", 2, 458, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 2, 459, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "勉強、見てくれるん\nですか？　やった～♪", 2, 460, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "服がほつれてますよ？\n直してあげます！", 2, 461, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪", 2, 462, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪", 2, 463, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 2, 464, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼休憩に\n甘いものが\n食べたいです～", 2, 465, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ねむいです～\nでももうちょっと\n勉強しないと～…", 2, 466, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この服、かわいい♪\n今度作って\nみよっと～！", 3, 467, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "勉強で疲れたから\n休憩しよ～っと", 3, 468, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\n私が服を作って\nあげよっか？", 3, 469, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！", 3, 470, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "のんびりしたら、\nまた勉強しよっと！", 3, 471, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動すると勉強も\nはかどるよね！", 3, 472, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 3, 473, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？", 3, 474, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…", 1, 476, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1, 477, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "い、いけない！\n縫い針落としちゃった", 1, 478, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "笑う時には服着ます！", 1, 479, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 1, 480, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 1, 481, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？", 1, 482, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "勉強、見てくれるん\nですか？　やった～♪", 2, 483, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 2, 484, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おにいちゃん！\nそろそろ、おやつに\nしませんか？", 2, 485, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "勉強は…\n明日にしようっと", 2, 486, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "妹だけど、大人な\nレディですからね！", 2, 487, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "な、ナデナデとか\n恥ずかしいな～", 2, 488, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 2, 489, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼休憩に\n甘いものが\n食べたいです～", 2, 490, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お兄ちゃんは\n夜強いんですね\n私は眠くて…", 2, 491, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "服装や髪形が変わると\n気分も変わるよね", 3, 492, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここで寝ちゃったら\n受験勉強が～…\nぐーー", 3, 493, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\n私が服を作って\nあげよっか？", 3, 494, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いまならどんな試験も\n合格できそうです！", 3, 495, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "のんびりしたら\nまた勉強しよっと！", 3, 496, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！", 3, 497, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 3, 498, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本の服\nかわいいなぁ♪\n私に作れるかな？", 3, 499, 101102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1, 501, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～", 1, 502, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…はっ！？\nね、寝てないよ？\nホントだよっ", 1, 503, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 1, 504, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "もし、超能力のことが\nバレたら…ブルブル", 1, 505, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "テレパシーで\nキミの心を覗けたら\n…なんてね！", 1, 506, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミを抱き枕に…\nじょ、冗談冗談！", 1, 507, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん～、なになに？\n一緒にお昼寝する？", 2, 508, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？", 2, 509, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おおっ、相談ごと？\nなにかな\nなにかな～？", 2, 510, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！", 2, 511, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 2, 512, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆", 2, 513, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～", 2, 514, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 2, 515, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "どんなにお昼寝しても\n夜は眠いんだ～", 2, 516, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 3, 517, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 3, 518, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ…可愛い！\nシオリンに\n届けてあげたい！", 3, 519, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 3, 520, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！", 3, 521, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "眠くならないように、\n運動しよっと！", 3, 522, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹いっぱいになると\n眠くなるよね～", 3, 523, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 3, 524, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1, 526, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もっといっぱい\n超能力使えたら\nいいのにな～", 1, 527, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねえねえ、\n今から人助け、\n付き合ってほしいなー", 1, 528, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 1, 529, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！", 1, 530, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "キミと一緒なら、\nなんだって出来る！\n間違いない！", 1, 531, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミを抱き枕に…\nじょ、冗談冗談！", 1, 532, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？", 2, 533, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆", 2, 534, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "一緒に\nお出かけしたいなー\nデートしよっ！", 2, 535, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！", 2, 536, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 2, 537, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "う～だんだん眠く…\nねぇ一緒に寝よ？", 2, 538, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "キミって早起きだね！\n私は寝ようかな～", 2, 539, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 2, 540, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "どんなにお昼寝しても\n夜は眠いんだ～", 2, 541, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 3, 542, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 3, 543, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ…可愛い！\nシオリンに\n届けてあげたい！", 3, 544, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 3, 545, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…", 3, 546, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "よーし\n困ってる人のために\nパワーアップ☆", 3, 547, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～", 3, 548, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 3, 549, 101202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！", 1, 551, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 1, 552, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！", 1, 553, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここで撮影会、\nしようかな～♪", 1, 554, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 1, 555, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "やば…\nこのままじゃ、うち\nキュン死にかも…", 1, 556, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 1, 557, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うちの写真撮るの？\nどんなポーズ？", 2, 558, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる", 2, 559, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "宿題見てくんない？\nひとりじゃムリ～", 2, 560, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？", 2, 561, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 2, 562, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 2, 563, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい", 2, 564, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 2, 565, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 2, 566, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪", 3, 567, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 3, 568, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "きゃわたーん☆\n君もおしゃれしよっか", 3, 569, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？", 3, 570, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 3, 571, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "あはは、なんか\nウォーキングの練習\nしてるみたーい！", 3, 572, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 3, 573, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 3, 574, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！", 1, 576, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 1, 577, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　", 1, 578, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "体形維持とか\n気にしてるんだよ～", 1, 579, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 1, 580, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "やば…\nこのままじゃ、うち\nキュン死にかも…　", 1, 581, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 1, 582, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うちの写真撮るの？\nどんなポーズ？", 2, 583, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪", 2, 584, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この雑誌の服\nガチめにほしぃ～", 2, 585, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪", 2, 586, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 2, 587, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 2, 588, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？", 2, 589, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 2, 590, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 2, 591, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！", 3, 592, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 3, 593, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！", 3, 594, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪", 3, 595, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 3, 596, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "食べた分は\n消費しないとね～", 3, 597, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 3, 598, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 3, 599, 101602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やっさー\n踊ってると、どんどん\n楽しくなるさー！", 1, 601, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？", 1, 602, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハイターイ！　元気な\nあいさつが一番さ～！", 1, 603, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 1, 604, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "さぁ、みんなで歌って\n踊るさ～♪", 1, 605, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "毎日、最高に幸せさ～\nキミのおかげだねー", 1, 606, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミへの気持ちを\n踊りで表現\nしてみるさ～", 1, 607, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 2, 608, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～", 2, 609, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！", 2, 610, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "空手の型の\n練習するさー\nキミもどう？", 2, 611, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～", 2, 612, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー", 2, 613, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ハイターイ！\n今日も一日、\nがんばるさー！", 2, 614, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！", 2, 615, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ", 2, 616, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？", 3, 617, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～", 3, 618, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？", 3, 619, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆", 3, 620, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！", 3, 621, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！", 3, 622, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～", 3, 623, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！", 3, 624, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "焦らなくても\nなんくるないさ～\nなるようになるさ～", 1, 626, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さぁ、みんなで歌って\n踊るさ～♪", 1, 627, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "元気がないときは\n私のところに来るさー", 1, 628, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 1, 629, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！", 1, 630, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "毎日、最高に幸せさ～\nキミのおかげだねー", 1, 631, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "幸せすぎて踊らずには\nいられないさ～", 1, 632, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 2, 633, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～", 2, 634, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キミと一緒だから\n毎日楽しいこと\nばっかりさー", 2, 635, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハイターイ！　元気な\nあいさつが一番さ～！", 2, 636, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～", 2, 637, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ", 2, 638, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！", 2, 639, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ", 2, 640, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ", 2, 641, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？", 3, 642, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～", 3, 643, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ", 3, 644, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ", 3, 645, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！", 3, 646, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～", 3, 647, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…もっと\nおかわりがほしいさー", 3, 648, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ", 3, 649, 101702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1, 651, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪", 1, 652, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？", 1, 653, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "キンコンカンコ～ン♪\n授業をはじめま～す", 1, 654, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はー…\nちょっと肩が\nこっちゃった…", 1, 655, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 1, 656, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…", 1, 657, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 2, 658, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 2, 659, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 2, 660, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪", 2, 661, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～", 2, 662, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？", 2, 663, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "学校に\n遅刻しないように\n早く準備しないとね", 2, 664, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～", 2, 665, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 2, 666, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もしかして…\n少し露出多いかしら？", 3, 667, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "リラックスすると\nα波が出て、勉強が\nはかどるんですって", 3, 668, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪　あなたも\n私の生徒になる？", 3, 669, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "学院にもこういう\n安らぐ設備が\n必要かしらね？", 3, 670, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "まだ寒いわぁ\n誰か隣に\n来てくれたら…", 3, 671, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動部の顧問も\nできるかしら？", 3, 672, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "学校の給食でも\n食べたいわぁ～", 3, 673, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "いい参考書を\n見つけちゃった♪", 3, 674, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私の生徒に\n不良なんていないわ\nみーんないい子♪", 1, 676, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪", 1, 677, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？", 1, 678, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1, 679, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ", 1, 680, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 1, 681, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　", 1, 682, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 2, 683, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 2, 684, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪", 2, 685, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　", 2, 686, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…", 2, 687, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 2, 688, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の特別授業\nしてあげましょうか？", 2, 689, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪", 2, 690, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 2, 691, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もしかして…\n少し露出多いかしら？", 3, 692, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私の膝枕と、どっちが\nフカフカかしら？", 3, 693, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　", 3, 694, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　", 3, 695, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　", 3, 696, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動部の顧問も\nできるかしら？　", 3, 697, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あん！\nお胸にこぼしちゃった", 3, 698, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　", 3, 699, 101802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おにいちゃんは、\nにんじん食べられる？", 1, 701, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "えへへ、\nお絵かきしよ～♪", 1, 702, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あのね、ミミと\nあそんでほしいな～", 1, 703, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～", 1, 704, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うさぎさん、\nぴょんぴょん\nぴょーん♪", 1, 705, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにいちゃんの絵、\nかいてあげるね♪", 1, 706, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 1, 707, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふわぁ！\nおにいちゃんの手、\nおっきいね～", 2, 708, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "やった～！\nおにいちゃんが\nほめてくれた～", 2, 709, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねえねえ\nおにいちゃん、\n一緒にあそぼっ♪", 2, 710, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おにいちゃん、\n遊んでくれるの？\n　わぁい♪", 2, 711, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "わぁい！\nおにいちゃんだ～♪\nぎゅ～っ！", 2, 712, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あのねあのね、\nミミの頭ポンポンって\nしてほしいな", 2, 713, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おひさまさん、\nおはよ～！\n毎朝、早おきだね～", 2, 714, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "うわぁ！\nお日さまがすごーく\n高いところにある～", 2, 715, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おにいちゃん\nおやすみのご本\nよんで～", 2, 716, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ミミも、\nうさぎさんみたいに、\nかわいくなりたいな♪", 3, 717, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "のんびり～♪\nゆったり～♪\nまったり～♪", 3, 718, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わぁ～かわいい～♪\nミミ、幸せ～♪\n抱きついていいかな？", 3, 719, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにおい～♪\nお鼻ピクピク♪\nうさぎさんも喜ぶよ♪", 3, 720, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～♪\nぬくぬく～♪\nポカポカ～♪", 3, 721, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ふ、ふぇ～　ミミ、\n運動苦手だよ～", 3, 722, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむ♪　いっぱい\n食べて、はやく\nおっきくなりたいな～", 3, 723, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ミミね！\nこのお話だーい好き！", 3, 724, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぴょんぴょん\n跳ねるよ\nうっさぎっさ～ん♪", 1, 726, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うさぎさんの\nマネだよ～\n似てるかな～？", 1, 727, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "モフモフすると\nきもちい～よ", 1, 728, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ミソギちゃん\nキョウカちゃん\nあ～そ～ぼっ！", 1, 729, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おにいちゃん\nおやすみのご本\nよんで～", 1, 730, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ねえ、おにいちゃん\nミミのこと、すき？", 1, 731, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 1, 732, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やった～！\nおにいちゃんが\nほめてくれた～", 2, 733, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おにいちゃん\n遊んでくれるの？\nわぁい♪", 2, 734, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おにいちゃん\nあのね…\nいいこいいこして～", 2, 735, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あはは～\nくすぐったいよ～", 2, 736, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "おにいちゃんの\nおひざの上、とっても\n安心するんだ～！", 2, 737, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "わぁい♪\nおにいちゃんの\nなでなで\nうれし～な♪", 2, 738, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おひさまさん\nおはよ～！\n毎朝、早おきだね～", 2, 739, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼寝お昼寝～♪\nおにいちゃんと一緒に\nお昼寝～♪", 2, 740, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "眠くなっちゃった～\nおにいちゃん！\n今日は一緒に寝よ～", 2, 741, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ミミも\nうさぎさんみたいに\nかわいくなりたいな", 3, 742, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわふわ～モコモコ～\n気持ちいい～♪\nミミもゴロゴロ～ン♪", 3, 743, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わぁ～かわいい～♪\nミミ、幸せ～♪\n抱きついていいかな？", 3, 744, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにおい～♪\nお鼻ピクピク♪\nうさぎさんも喜ぶよ～♪", 3, 745, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～♪\nぬくぬく～♪\nポカポカ～♪", 3, 746, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁはぁ…\nふえ～ミミ\n疲れちゃうよ～！", 3, 747, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむ♪　いっぱい\n食べて、はやく\nおっきくなりたいな～", 3, 748, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ミミね！\nこのお話だーい好き！", 3, 749, 102002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はぅぅ…\n部屋のどこにいたら\nいいんだろう…", 1, 751, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お外より\nお部屋の中の方が\n落ち着くな…", 1, 752, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クッキー焼いたら\nみんな食べてくれる\nかなぁ…", 1, 753, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ、あめんぼあかいな\nあいうえお！", 1, 754, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お芝居には\n人間観察が大事…\nじーーーーーー…", 1, 755, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんを見ると、\n顔が赤くなっちゃうの\n…な、なんでかな？", 1, 756, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…", 1, 757, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こ、この本、とっても\nおもしろいんですよ♪", 2, 758, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "い、一緒に遊んで\nくれるんですか？\nや、やったぁ～♪", 2, 759, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ランドソルには\n慣れましたか？\nわ、私はまだ…", 2, 760, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お、お兄ちゃん、\nお、お話の練習に\n付き合って欲しいです", 2, 761, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ", 2, 762, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪", 2, 763, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日は一日、\n恥ずかしがらずに\n過ごせるかなあ…？", 2, 764, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯、どうぞ♪\nわ、私、お料理、\nうまくなったかな？", 2, 765, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おにいちゃんが\n帰ってくるまで、\nがんばって\n起きてました", 2, 766, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "可愛い女の子に変身！\n出来ますように…♪", 3, 767, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかで\nあったかくて…\nお兄ちゃんみたい♪", 3, 768, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子を相手に、\n演技の練習～", 3, 769, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リボンや服に\n染み込ませておこう。\nいつでもいい匂い♪", 3, 770, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "えへへ。\nぽっかぽかです…", 3, 771, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁはぁ…\nふひぃ…\nはうぅぅぅ～～", 3, 772, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…えへへ、\n美味しいものを\n食べてると幸せです", 3, 773, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "戯曲を読んで\n自分が演じるところを\n想像するの…", 3, 774, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "かわいいものを\nこうして並べて…\nはぁ…落ちつくぅ♪", 1, 776, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぁ～、この部屋は\n時間がゆったりと\n流れてるみたい", 1, 777, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この台本、感動…\n涙が止まらないよぉ\nいつか演じてみたいな", 1, 778, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お芝居には\n人間観察が大事…\nじーーーーーー…", 1, 779, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あえいうえおあお\nかけきくけ、かっ…\nむ、難しいですぅぅ", 1, 780, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "お、お腹が空いた時は\n言ってくださいね\nが、頑張って\n作ります！", 1, 781, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…", 1, 782, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こ、この本、とっても\nおもしろいんですよ♪", 2, 783, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お兄ちゃんと\nいっぱい話せた日は、\n嬉しくなっちゃいます", 2, 784, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何か私にできる事\n…そうだ！\nお掃除しますね！", 2, 785, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "私、ちょっとずつ、\n自分に自信が\nついてきたかもです…", 2, 786, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ", 2, 787, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪", 2, 788, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\n声出しして、お芝居の\n練習しなくちゃ", 2, 789, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お茶にしますか？\nクッキー焼いたので、\nよかったら…", 2, 790, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝る前に\n台本を読むと、\n覚えやすいんです", 2, 791, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "可愛い女の子に変身！\n出来ますように…♪", 3, 792, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぅ…\nフッカフカァ…\n癒されちゃいます…", 3, 793, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子を相手に\n演技の練習～", 3, 794, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リボンや服に\n染み込ませておこう\nいつでもいい匂い♪", 3, 795, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "えへへ\nぽっかぽかです…", 3, 796, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "え、演劇には\nた、体力も重要\nだから～", 3, 797, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "残さず\n食べますね…！", 3, 798, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "戯曲を読んで\n自分が演じるところを\n想像するの…", 3, 799, 102102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1, 801, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな", 1, 802, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？", 1, 803, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？", 1, 804, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "楽しいゲームって\nやめどきが\n見つからないわ", 1, 805, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 1, 806, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね", 1, 807, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！", 2, 808, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな", 2, 809, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…", 2, 810, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アンタは人見知り\nしないタチよね？\nいいなあ～…", 2, 811, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 2, 812, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！", 2, 813, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 2, 814, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 2, 815, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜はこれからよ！\n朝まで\nゲームするからね！", 2, 816, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アカリみたいに\n可愛くなるのは\n難しいかな", 3, 817, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "寝っ転がりながら\nゲームができれば\n気分が良さそう", 3, 818, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "可愛い…けど、\n私には似合わないかな", 3, 819, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はあ、リラックスして\nゲームができるわ", 3, 820, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ん…暖かくて、\n寝落ちしちゃいそう", 3, 821, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね", 3, 822, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 3, 823, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 3, 824, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さあ、今日は\n何のゲームで\n遊ぼうかな？", 1, 826, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…", 1, 827, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "レアカードをゲット！\nすごいでしょ！？", 1, 828, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…", 1, 829, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "楽しいゲームって\nやめどきが\n見つからないわ", 1, 830, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね", 1, 831, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ね、ねえ\nもう少しその…\n一緒にゲームしない？", 1, 832, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 2, 833, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "欲しいゲームが\n見つからなくて…\n探すの手伝って！", 2, 834, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねえ、見て！\n新しいゲームを\n買って来たの！", 2, 835, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！", 2, 836, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 2, 837, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ", 2, 838, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 2, 839, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 2, 840, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜はこれからよ！\n朝まで\nゲームするからね！", 2, 841, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 3, 842, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふああ…\n徹夜明けには\n辛い誘惑だな…", 3, 843, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "可愛い…けど、\n私には似合わないかな", 3, 844, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな", 3, 845, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "寒い日は\nここでゲームするのが\n最高のぜいたくよね", 3, 846, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "最近ゲームばかりだし\nたまにはいいかな？", 3, 847, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 3, 848, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 3, 849, 102202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』", 1, 851, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぷうきちがいれば、\nなんでも出来ちゃうよ", 1, 852, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "発声練習しよっと\nぷうきち\nフルスイ～ング！", 1, 853, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？", 1, 854, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この部屋、ぷうきちを\n置く場所はないのかな", 1, 855, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪", 1, 856, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～", 1, 857, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おやつは、\n私とぷうきちの\n二人分用意してね♪", 2, 858, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！", 2, 859, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』", 2, 860, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！", 2, 861, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと", 2, 862, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？", 2, 863, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～", 2, 864, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふぁ～…ぷうきちと\nお昼寝してくるね…", 2, 865, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…", 2, 866, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？", 3, 868, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？", 3, 869, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！", 3, 870, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽわぽわする～\nぷうきちも\n気持ちいい？", 3, 871, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい～\nぷうきちも\n食べてみる？", 3, 873, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ぷうきち！\nこの本、読んで～！", 3, 874, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 1, 901, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 1, 902, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうしたら転ばなく\nなるんでしょうか？", 1, 903, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！", 1, 904, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～", 1, 905, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おいしい料理で\nお出迎えしなくちゃ！", 1, 906, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "一生懸命\nご奉仕しますよ～♪", 1, 907, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "耳かきしましょうか？\nえ？　こわい？", 2, 908, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？", 2, 909, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おかえりなさいませ\nご主人さま♪", 2, 910, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すみません\nすみません\nすみません～～", 2, 911, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…", 2, 912, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私のこと、\n専属メイドと思って\n頼ってくださいね", 2, 913, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！", 2, 914, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 2, 915, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 2, 916, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 3, 917, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！", 3, 918, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nあとでお洗濯\nしてあげますね", 3, 919, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 3, 920, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここでお洗濯ものを\n乾かしましょうか", 3, 921, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "あわわわっ…\nこ、転びそうです～！", 3, 922, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これくらい\nおいしいものを\n作ってみたいです～", 3, 923, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 3, 924, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "失敗したら、この\nお部屋追い出され\nちゃうかも～？", 1, 926, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 1, 927, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうやったら、立派な\nメイドになれるのかな", 1, 928, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？", 1, 929, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ご用があれば\nなんでも言って\nくださいね", 1, 930, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう", 1, 931, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　", 1, 932, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪", 2, 933, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 2, 934, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私、またなにか\nやっちゃいましたか？", 2, 935, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？", 2, 936, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "転んだふりであの人に\n…って！\nなんでもないですよ！", 2, 937, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私、できることなら\nなんでもやりますよ\nあなたのためですから", 2, 938, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\n今日も一日がんば…\nう、うわあ！", 2, 939, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 2, 940, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 2, 941, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 3, 942, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪", 3, 943, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nあとでお洗濯\nしてあげますね", 3, 944, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 3, 945, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？", 3, 946, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動しようとすると\nいつも怪我するん\nですよね…", 3, 947, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こんなに美味しいもの\nメイドの私には\nもったいないです～！", 3, 948, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 3, 949, 102502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あの方と私だけの\n部屋にしたいですわ", 1, 951, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！", 1, 952, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "運命とは決して\n抗えないもの…\nクスクス…クスクス", 1, 953, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "部屋からあの方の\n香りが…\nああ、至福ですわ", 1, 954, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…", 1, 955, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 1, 956, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 1, 957, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？", 2, 958, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ", 2, 959, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お願いがあるのです。\n新しい研究の実験台に\n…", 2, 960, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 2, 961, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 2, 962, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…", 2, 963, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 2, 964, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…", 2, 965, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？", 2, 966, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…", 3, 967, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はっ！\nリラックスしたら\n閃きましたわ！", 3, 968, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あら、キメラの素体に\nぴったりですわ", 3, 969, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？", 3, 970, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あたたかい…\n加熱調合にも\n使えそうですわね", 3, 971, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 3, 972, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 3, 973, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 3, 974, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あの方と私だけの\n部屋にしたいですわ", 1, 976, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 1, 977, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しい薬\nどうやってあの方に\n飲ませようかしら", 1, 978, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "部屋からあの方の\n香りが…\nああ、至福ですわ", 1, 979, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 1, 980, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 1, 981, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…", 1, 982, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね", 2, 983, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！", 2, 984, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お願いがあるのです\n新しい研究の\n実験台に…", 2, 985, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません", 2, 986, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね", 2, 987, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 2, 988, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 2, 989, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…", 2, 990, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？", 2, 991, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私ももう少し\n外見に気を配る\nべきでしょうか…", 3, 992, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はっ！\nリラックスしたら\n閃きましたわ！", 3, 993, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！", 3, 994, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？", 3, 995, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような", 3, 996, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 3, 997, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 3, 998, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 3, 999, 102702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1, 1001, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね", 1, 1002, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね", 1, 1003, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お腹空いたわね、\n残り物で\n何か作ろうかしら", 1, 1004, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1, 1005, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1, 1006, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "焼きそばパンが\n食べたいな～\nあいつと…", 1, 1007, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねぇあんた、どこか\n安いお店知らない？", 2, 1008, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪", 2, 1009, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね", 2, 1010, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪", 2, 1011, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！", 2, 1012, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの", 2, 1013, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ", 2, 1014, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午後のティータイム\nとかどう？\n良いカフェがあるの♪", 2, 1015, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？", 2, 1016, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪", 3, 1017, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これで仕事は一段落ね\nちょっと休憩…", 3, 1018, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うふふ、\nかわいいものを\n見るのは幸せね～", 3, 1019, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 3, 1020, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "風邪を引かないように\n身体を温めなくちゃ", 3, 1021, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 3, 1022, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？", 3, 1023, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "知識から過去を学んで\n未来に活かすわよ", 3, 1024, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "安売りのお店の情報\n整理しないと…", 1, 1026, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ", 1, 1027, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "安く済んであいつが\n喜ぶ料理とか…\nないかしら", 1, 1028, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1, 1029, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1, 1030, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "焼きそばパンが\n食べたいな～\nあいつと…", 1, 1031, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつと一緒に…\n色々なところに\nいきたいな", 1, 1032, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今度買い物に\n付き合いなさい\nセールがあるのよ", 2, 1033, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪", 2, 1034, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね", 2, 1035, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あんたとこうして\nのんびりするのも\nいいものね", 2, 1036, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ", 2, 1037, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 2, 1038, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ", 2, 1039, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪", 2, 1040, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら", 2, 1041, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！", 3, 1042, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これで仕事は一段落ね\nちょっと休憩…", 3, 1043, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふふ\nずっと眺めてたく\nなっちゃうわね", 3, 1044, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 3, 1045, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "風邪を引かないように\n身体を温めなくちゃ", 3, 1046, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 3, 1047, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "しっかり食べて\n栄養補給、栄養補給！", 3, 1048, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "知識から過去を学んで\n未来に活かすわよ", 3, 1049, 102802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？", 1, 1051, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！", 1, 1052, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1, 1053, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "彼とデュエット\nしてみたいな～♪", 1, 1054, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～", 1, 1055, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1, 1056, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "写真集見なくても、\n本物がここに\nいるのにな～", 1, 1057, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "握手会の練習、\n付き合ってくれない？", 2, 1058, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "写真集のポーズ\n練習中～！\nど、どうかな？", 2, 1059, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！", 2, 1060, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！", 2, 1061, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ", 2, 1062, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪", 2, 1063, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 2, 1064, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ", 2, 1065, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。", 2, 1066, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 3, 1067, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 3, 1068, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい～♪\nこれは強力な\nライバル登場かな！", 3, 1069, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！", 3, 1070, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 3, 1071, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 3, 1072, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 3, 1073, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ステキなお話…\n新曲の作詞の\n参考になりそう♪", 3, 1074, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！", 1, 1076, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？", 1, 1077, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "みんながくれた\nファンレター…\n私の大事な宝物…", 1, 1078, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "彼とデュエット\nしてみたいな～♪", 1, 1079, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～", 1, 1080, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1, 1081, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな", 1, 1082, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 2, 1083, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？", 2, 1084, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！", 2, 1085, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～", 2, 1086, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪", 2, 1087, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？", 2, 1088, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 2, 1089, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！", 2, 1090, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ", 2, 1091, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 3, 1092, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 3, 1093, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい～♪\nこれは強力な\nライバル登場かな！", 3, 1094, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～", 3, 1095, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 3, 1096, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 3, 1097, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 3, 1098, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…", 3, 1099, 102902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？", 1, 1101, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1, 1102, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？", 1, 1103, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "むむ、アクダイカンの\n気配がするデース", 1, 1104, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クニトリ合戦、\n楽しみデース！", 1, 1105, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ショーグンと\n出会えて、\nワタシは果報者デス！", 1, 1106, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1, 1107, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！", 2, 1108, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？", 2, 1109, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "さ、さすが\nショーグンデス…\nいつの間に背後を！？", 2, 1110, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？", 2, 1111, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 2, 1112, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 2, 1113, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようデス！\n今日も一日\n忍法日和デス！", 2, 1114, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！", 2, 1115, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日もきっと\nいい日デスよ、\nショーグン！", 2, 1116, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちょんまげに\nしてみるのも\n面白いかもデス！", 3, 1117, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？", 3, 1118, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 3, 1119, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ワビサビというもの\nデスね！\n素晴らしいデス！", 3, 1120, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "身体を暖めて\nイクサに向かうデス！", 3, 1121, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！", 3, 1122, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うーん、\n美味しいデス…\n幸せデス～", 3, 1123, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これは…\nＢＵＳＨＩＤＯ…\nデスか？", 3, 1124, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～", 1, 1126, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1, 1127, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？", 1, 1128, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "むむ、アクダイカンの\n気配がするデース", 1, 1129, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クニトリ合戦\n楽しみデース！", 1, 1130, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1, 1131, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ショーグンの身は\n何があってもワタシが\n守るデス！", 1, 1132, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？", 2, 1133, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！", 2, 1134, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "さ、さすがショーグン\nデス…いつの間に\n背後を！？", 2, 1135, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！", 2, 1136, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 2, 1137, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 2, 1138, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！", 2, 1139, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もうお昼デス\nお昼寝するデスか？", 2, 1140, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろおネム\nデース…\n一緒に寝るデス？", 2, 1141, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス", 3, 1142, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？", 3, 1143, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 3, 1144, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ワビサビというもの\nデスね！\n素晴らしいデス！", 3, 1145, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "身体を暖めてイクサに\n向かうデス！", 3, 1146, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ショーグンのお役に\n立つため、修行\nあるのみデス！", 3, 1147, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しいデス…\n酢昆布を和えて\nみたいデス", 3, 1148, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "物事を知って\n来たるべきイクサに\n活かすデス", 3, 1149, 103002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1, 1151, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "父は、いつも男性に\nきびしいですね", 1, 1152, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "占ってほしい人は、\nいつでも言って\nください", 1, 1153, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1, 1154, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この部屋、風水的にも\n運気が上がりそうです", 1, 1155, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い", 1, 1156, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1, 1157, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "女難の相が\n出ていますね…\n気をつけてください", 2, 1158, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日のあなたの運勢は\n大きょ…\n大吉です", 2, 1159, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので", 2, 1160, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！", 2, 1161, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？", 2, 1162, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です", 2, 1163, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n今日の運勢を\n占いましょうか？", 2, 1164, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 2, 1165, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが", 2, 1166, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ", 3, 1167, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一休みしましょう。\n憑かれて疲れました", 3, 1168, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい…\n付喪神が宿らないかな", 3, 1169, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？", 3, 1170, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "気持ちいいです…\n極楽浄土みたい…", 3, 1171, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 3, 1172, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お父さんも\n食べたいの？\n死んでるのに？", 3, 1173, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本…\nもしかして予言書？", 3, 1174, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここにいる幽霊は\nみんな幸せそうです", 1, 1176, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています", 1, 1177, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね", 1, 1178, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも", 1, 1179, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1, 1180, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？", 1, 1181, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？", 1, 1182, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この部屋、風水的にも\n運気が上がりそうです", 2, 1183, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "シノブには指一本\n触れさせん！\nガブッ！！", 2, 1184, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 2, 1185, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ラップ音？\nいえ、父のいびきです", 2, 1186, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 2, 1187, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "前世って信じますか？\n私とあなたは\nもしかすると…", 2, 1188, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 2, 1189, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "明るい時間は\nあまり得意では\nないんです…", 2, 1190, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです", 2, 1191, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ", 3, 1192, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うとうと…\nあれ…\n走馬灯が見える…", 3, 1193, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい…\nお父さんみたい…", 3, 1194, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 3, 1195, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "快適です…\n幽霊もどんどん\n集まってきますね…", 3, 1196, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 3, 1197, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お父さんの分も、\n私が食べるね", 3, 1198, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本の占い\n私の占いと違う…", 3, 1199, 103102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1, 1201, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1202, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "一日も早く、\n一人前の商人に\nなりたいものです", 1, 1203, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "平和を買うのには\nどれほどのお金が\n必要なのかしら？", 1, 1204, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 1, 1205, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1, 1206, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1, 1207, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私と、庶民向けの\nお店へ一緒に\n参りませんか？", 2, 1208, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "資産運用？\nお幾らほど\n増やしたいのです？", 2, 1209, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 2, 1210, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お金で解決するのは\n悪いことでは\nありませんわよね？", 2, 1211, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "その、よろしければ\n私とお散歩など\nいかがです？", 2, 1212, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 2, 1213, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 2, 1214, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 2, 1215, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 2, 1216, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 3, 1217, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 3, 1218, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 3, 1219, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 3, 1220, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 3, 1221, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "健康はお金では\n買えませんが\n運動器具は別ですわ！", 3, 1222, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "なかなか\n美味ですわ\nシェフはどちらに？", 3, 1223, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "経済の仕組みを\nしっかりと\n学ばなくては…", 3, 1224, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1226, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ええと、これは\nおいくらで買ったん\nでしたっけ？", 1, 1227, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お金を見せたら\n態度が変わる人は\n信用できませんわ", 1, 1228, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 1, 1229, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この狭さも\n慣れれば\n快適ですわ♪", 1, 1230, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1, 1231, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1, 1232, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 2, 1233, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "幼い頃\nお店屋さんごっこを\nなさいましたか？", 2, 1234, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "資産運用？\nお幾らほど\n増やしたいのです？", 2, 1235, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度一緒に…\nパーティにでも\n行きませんこと？", 2, 1236, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "その、よろしければ\n私とお散歩など\nいかがです？", 2, 1237, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたさまの優しさは\nお金には\n代えられませんわね", 2, 1238, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "なぜだか\n眠り足りないような\n感じがしますわ…", 2, 1239, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 2, 1240, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 2, 1241, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 3, 1242, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こういったものに\n腰を沈めると…\nき、気が緩んで…", 3, 1243, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 3, 1244, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 3, 1245, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 3, 1246, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "目標は遠くに\n置いた方が励みに\nなりますわ！", 3, 1247, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "なかなか\n美味ですわ\nシェフはどちらに？", 3, 1248, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "商人って、物語では\n悪役にされやすいの\nですね…", 3, 1249, 103202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "家の中のものを使って\n物ボケ、考えるべ！", 1, 1251, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 1, 1252, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うちに塀ができたら、\nへー、って言いたい！", 1, 1253, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 1, 1254, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "エリザベスも\n連れてきてぇ～", 1, 1255, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 1, 1256, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 1, 1257, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 2, 1258, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 2, 1259, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 2, 1260, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 2, 1261, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 2, 1262, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 2, 1263, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！　一緒に\n牛の乳しぼりいくべ？", 2, 1264, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼だ～腹が減っては\n笑いはできぬ～！", 2, 1265, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 2, 1266, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 3, 1267, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ナイスなイスに\n座りたい、\nなんちゃって！", 3, 1268, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "めんこいのは、\nスベっても許される\nからずるいべな～？", 3, 1269, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "必要以上に\n癒されちまうべや～", 3, 1270, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかだ…\nウケた会場みてぇだ", 3, 1271, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "お笑い芸人は、\n体が資本だべさ～！", 3, 1272, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 3, 1273, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ネタ作りのヒントが\n載ってねぇか探すべ", 3, 1274, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さぁ今日も張り切って\n漫才の練習するべさ！", 1, 1276, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この部屋でも、商品\n売っていいんだべか？", 1, 1277, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 1, 1278, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 1, 1279, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "エリザベスも\n連れてきてぇ～", 1, 1280, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1, 1281, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 1, 1282, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 2, 1283, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あんちゃん、百連\nツッコミ特訓だ～！", 2, 1284, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 2, 1285, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 2, 1286, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 2, 1287, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 2, 1288, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\n今日もいい\nネタ作り日和だ！", 2, 1289, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼だな\nご飯を食べたら、\nネタの練習するべ！", 2, 1290, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間だべ\nネタ作りは\n明日にするべ…", 2, 1291, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うーん…衣装、\nずれてねぇべか？", 3, 1292, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ナイスなイスに\n座りたい\nなんちゃって！", 3, 1293, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はう～\nなまらめんこいべや～", 3, 1294, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "必要以上に\n癒されちまうべや～", 3, 1295, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "笑いをとることを\n忘れるほど\nあったけぇべ～", 3, 1296, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 3, 1297, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 3, 1298, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "幅広く教養を\n身につけて\nいいネタ作るべ！", 3, 1299, 103302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "通りにいる\nカップル…爆発\nすればいいのに…", 1, 1301, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "う～ん、仕事なんて\nしないで、\n飲んでたいな～", 1, 1302, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日は一日、\n外に出ない！\nもう決めたわ！", 1, 1303, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 1, 1304, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 1, 1305, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "デートとか…\n誘っても嫌がられ\nないかな…？", 1, 1306, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もしかして運命の\n相手だったり…\nするのかな", 1, 1307, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 2, 1308, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 2, 1309, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 2, 1310, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 2, 1311, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 2, 1312, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 2, 1313, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 2, 1314, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おっひるー♪\nなに食べよっかな～♪", 2, 1315, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 2, 1316, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 3, 1317, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 3, 1318, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうの男の子に\nプレゼントして\nもらいたいな…", 3, 1319, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うわあ、\nこれ、私の好きな\n香りだー！", 3, 1320, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 3, 1321, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 3, 1322, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nおーいしー！\n…太らないよね？", 3, 1323, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 3, 1324, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "仕事終わりの一杯の\nために、今日も\n頑張らないと", 1, 1326, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日は\nのんびり\n過ごそうかな～", 1, 1327, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ…\nお皿、洗って\nなかった…", 1, 1328, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "もう少し、大人の\n魅力が出せるように\nなりたいな", 1, 1329, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "素敵な彼氏…\n欲しいなぁ…", 1, 1330, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "彼と私\n釣り合うかな…\n大丈夫よね？", 1, 1331, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今後のために\nちょっとは花嫁修業\nしてみようかな…？", 1, 1332, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 2, 1333, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 2, 1334, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もう…\n構ってくれないと\n泣いちゃうぞ～？", 2, 1335, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お姉さんが～\n可愛がって\nあげようか～？", 2, 1336, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 2, 1337, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 2, 1338, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さーて、今日も\nいっちょやるぞー！", 2, 1339, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "後でのんびり\nストレッチでも\nしようっと♪", 2, 1340, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 2, 1341, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "仕事の前に、髪とか\n整えないと…", 3, 1342, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 3, 1343, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 3, 1344, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うわあ\nこれ、私の好きな\n香りだー！", 3, 1345, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかーい…\nだ、だらけ\nちゃいそう…", 3, 1346, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "地道な努力が\nリア充への\n第一歩！", 3, 1347, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おーいしっ♪\nこのために\n生きてるわねえ", 3, 1348, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 3, 1349, 103402);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1351, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 1, 1352, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1, 1353, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ちょっと、休憩…\n本でも読もうかな", 1, 1354, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "もっとたくさんの本に\n囲まれて生活したいな", 1, 1355, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "むかしむかしある所に\nシオリと\nあの人が…", 1, 1356, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 1, 1357, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 2, 1358, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ…お姉ちゃんと\n約束があったんだ…", 2, 1359, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 2, 1360, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 2, 1361, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 2, 1362, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 2, 1363, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 2, 1364, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 2, 1365, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 2, 1366, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "寝てばかりなので、\n髪が乱れてないかな\n…？", 3, 1367, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "少し休もう\n…やっぱり\nたくさん休もう", 3, 1368, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいものが\n枕元にあると\n安心できるんですよ", 3, 1369, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 3, 1370, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こうして温まって\nいると、病気も\n治る気がします", 3, 1371, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 3, 1372, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "少食ですけど\nこれならたくさん\n食べられそうです", 3, 1373, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "続きが気になって\n読むのを止める\nタイミングが…", 3, 1374, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "しっかり休まないと\n早く回復するように", 1, 1376, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 1, 1377, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "病室よりも…\nずっとこの部屋に\nいたいですね…　", 1, 1378, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1, 1379, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1380, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "むかしむかしある所に\nシオリと\nあの人が…", 1, 1381, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人の\nためにも早く\n病気を治さないと…", 1, 1382, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 2, 1383, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "新記録です！\n一週間連続、\n平熱を保ちました！", 2, 1384, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ…お薬の時間…\n苦いけど我慢しなきゃ　", 2, 1385, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 2, 1386, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 2, 1387, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 2, 1388, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 2, 1389, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 2, 1390, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 2, 1391, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "寝てばかりなので、\n髪が乱れてないかな\n…？　", 3, 1392, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "少し休もう\n…やっぱり\nたくさん休もう", 3, 1393, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子がいれば\n病室に一人でも\n寂しくないですね", 3, 1394, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 3, 1395, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こうして温まって\nいると、病気も\n治る気がします", 3, 1396, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "私も、少しは\n体力をつけないと\nいけませんよね　", 3, 1397, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いっぱい食べて\n健康な体にならないと", 3, 1398, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "続きが気になって\n読むのを止める\nタイミングが…", 3, 1399, 103802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1, 1401, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ、忘れずに\nお花に水を\nあげなきゃ…", 1, 1402, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 1, 1403, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 1, 1404, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 1, 1405, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ＢＢ団の活動日…\nまだかな…\nうふふふっ", 1, 1406, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1, 1407, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 2, 1408, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 2, 1409, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 2, 1410, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 2, 1411, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 2, 1412, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 2, 1413, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 2, 1414, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 2, 1415, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もう眠いかもです…\n明日は友達、\nできるといいなあ…", 2, 1416, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私がもっと\n可愛ければ、\n友達できるかなあ？", 3, 1417, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 3, 1418, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいなあ。\nこの子とも\n友達になりたい…", 3, 1419, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りです…\n精神統一して\n友達のイメトレ…", 3, 1420, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "灯りを見てると、\n心がなごみます～", 3, 1421, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 3, 1422, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいです…\n私に友達がいたら、\n分けてあげたいな", 3, 1423, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 3, 1424, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "友達作りは、焦らず\n慌てず、じっくりと…", 1, 1426, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ひとつ屋根の下\nって感じ…\nいいですねえ…", 1, 1427, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "煮汁、煮汁が\n噴きこぼれて\nいませんか～", 1, 1428, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度、みなさんと\nピクニックとか…\nいってみたいな", 1, 1429, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぼっちでもいい\nたくましく育てば\n…なんて", 1, 1430, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 1, 1431, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1, 1432, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 2, 1433, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 2, 1434, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 2, 1435, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 2, 1436, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 2, 1437, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 2, 1438, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ですね！\nこんないい朝は\n友達作りのチャンス！", 2, 1439, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 2, 1440, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もう眠いかもです…\n明日は友達\nできるといいなあ…", 2, 1441, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私…見た目\nそこまで変じゃ\nないですよね…？", 3, 1442, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ほわあ～…\nふかふかって\nいいものですね～", 3, 1443, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子みたいな\nあいくるしさを\n目指したいです！", 3, 1444, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "灯りを見てると\n心がなごみます～", 3, 1445, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぬくぬくで、なんだか\n眠くなっちゃいますね", 3, 1446, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "身体を鍛えて\nみなさんを\n守ります！", 3, 1447, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 3, 1448, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 3, 1449, 104002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1, 1451, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 1, 1452, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1, 1453, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "人々の平和を守る旅に\n同行してくれる人を\n探していて…", 1, 1454, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あとで曲を復習して\nおかないと…", 1, 1455, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 1, 1456, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1, 1457, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 2, 1458, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 2, 1459, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 2, 1460, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 2, 1461, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 2, 1462, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 2, 1463, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\n少し歌の練習を\nしてきますね", 2, 1464, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 2, 1465, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日の予定は…\nアイドルはやることが\n多いみたいで…", 2, 1466, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 3, 1467, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "歌の調子をよくする\nためには休息も\n必要ですよね…", 3, 1468, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子たちを\n相手に練習して\nみようかな…♪", 3, 1469, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 3, 1470, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここにいると\n穏やかな旋律が\n浮かんできます…", 3, 1471, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "歌うためには\n体力づくりは\n欠かせません", 3, 1472, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "歌った後は\nお腹が空いて\nしまうんです", 3, 1473, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "音楽について\n理論も勉強\nしないと…", 3, 1474, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1, 1476, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1, 1477, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 1, 1478, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 1, 1479, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "楽譜を買いました\n思いついた歌を\n書き留めておくために", 1, 1480, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1, 1481, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私の中にある\n私だけの歌…\n作ってみようかな？", 1, 1482, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 2, 1483, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 2, 1484, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魔物退治ですか！？\n…違います？\n良かった…", 2, 1485, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 2, 1486, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 2, 1487, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 2, 1488, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 2, 1489, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "少し休んだら\n午後の練習に\n行ってきますね", 2, 1490, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "曲を作っていたら\nもうこんな時間…\nおやすみなさい", 2, 1491, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 3, 1492, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 3, 1493, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 3, 1494, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 3, 1495, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここにいると\n穏やかな旋律が\n浮かんできます…", 3, 1496, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "もっと体力をつけて\n最高のライブを\nファンに届けます！", 3, 1497, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これでも一応\n体形には気をつけて\n食べてるんですよ？", 3, 1498, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "読書は歌に\n新しい風を\n吹き込んでくれます", 3, 1499, 104202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "店の新メニューでも\n考えるかな", 1, 1501, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしの店から、\n出前を届けようか？", 1, 1502, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "パトロール、\nパトロール…\nここは異常なしかな？", 1, 1503, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1, 1504, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "のんびりし過ぎるのも\n…性に合わねぇな", 1, 1505, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 1, 1506, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1, 1507, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 2, 1508, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "天気がいい日は\n外で運動したく\nならねぇか？", 2, 1509, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "腹減ったか？　なんか\n作ってやろうか？", 2, 1510, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 2, 1511, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 2, 1512, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 2, 1513, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 2, 1514, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 2, 1515, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 2, 1516, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "た、たまにはその…\nかわいい格好とか\nしても…", 3, 1517, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわぁ、\n一休みすっかなぁ～", 3, 1518, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うっ！　か、かわいい\nじゃねぇか", 3, 1519, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 3, 1520, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 3, 1521, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "オラオラオラーーー！\n燃えるぜーーー！", 3, 1522, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いい味してるぜ！\nうちの店でも\n出してみたいな", 3, 1523, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 3, 1524, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "パトロール終了～\n本日も異常なしっと！", 1, 1526, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしの店から\n出前を届けようか？", 1, 1527, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あいつ、早く\n帰ってこないかな", 1, 1528, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あいつ\n腹すかせてないと\nいいんだけど…", 1, 1529, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "のんびりし過ぎるのも\n…性に合わねぇな", 1, 1530, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？", 1, 1531, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1, 1532, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ", 2, 1533, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "天気がいい日は\n外で運動したく\nならねぇか？", 2, 1534, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "腹減ったか？　なんか\n作ってやろうか？", 2, 1535, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 2, 1536, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！", 2, 1537, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 2, 1538, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？", 2, 1539, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 2, 1540, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？", 2, 1541, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "た、たまにはその…\nかわいい格好とか\nしても…", 3, 1542, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ～♪\n疲れがとれるな～", 3, 1543, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うっ！　か、かわいい\nじゃねぇか", 3, 1544, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 3, 1545, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな", 3, 1546, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "オラオラオラーーー！\n燃えるぜーーー！", 3, 1547, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いい味してるぜ！\nうちの店でも\n出してみたいな", 3, 1548, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…", 3, 1549, 104302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "最近なにも\nしてくれません…\n焦らしてるんですね", 1, 1551, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが", 1, 1552, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ", 1, 1553, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ", 1, 1554, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1, 1555, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！", 1, 1556, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1, 1557, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "視線を感じると\n思ったら…やはり\nドＳさんでしたか", 2, 1558, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ", 2, 1559, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？", 2, 1560, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？", 2, 1561, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クウカにナニをする\nつもりですか…\n期待してしまいます！", 2, 1562, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？", 2, 1563, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます。\n朝からお盛んですね？\nぐふふ…", 2, 1564, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり", 2, 1565, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…", 2, 1566, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ", 3, 1567, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン", 3, 1568, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 3, 1569, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！", 3, 1570, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ああ、身体が\n火照って…\nぐふ、ぐふふ…", 3, 1571, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ", 3, 1572, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？", 3, 1573, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本の下に、\nそういう本を\nカムフラージュ？", 3, 1574, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…", 1, 1576, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "最近なにも\nしてくれません…\n焦らしてるんですね", 1, 1577, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "も、妄想が\n足りません…\n禁断症状がっ…！", 1, 1578, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1, 1579, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ", 1, 1580, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね", 1, 1581, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！", 1, 1582, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！", 2, 1583, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 2, 1584, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり", 2, 1585, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？", 2, 1586, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね", 2, 1587, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ドＳさんがお望みなら\nクウカは\nどんなことだって！", 2, 1588, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝だからこそ\nできる妄想が\nあります…ぐふふ", 2, 1589, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "こんな日の高いうち\nからドＳさんは…\nじゅるり", 2, 1590, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今夜は一晩中…\nなんですね？\nぐふふ…", 2, 1591, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…", 3, 1592, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "くつろいで油断\nしているスキに何を\nされるのでしょう！？", 3, 1593, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 3, 1594, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！", 3, 1595, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！", 3, 1596, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね", 3, 1597, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こんなにいっぱい\n入りません…\nお腹にっ！", 3, 1598, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "どんな本も\nよく見ると\nいやらしいです…！", 3, 1599, 104502);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪", 1, 1601, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…", 1, 1602, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪", 1, 1603, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？", 1, 1604, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…", 1, 1605, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪", 1, 1606, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪", 1, 1607, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うずうず…その指、\nじゃれついても\nいいかにゃ？", 2, 1608, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪", 2, 1609, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？", 2, 1610, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪", 2, 1611, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー", 2, 1612, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？", 2, 1613, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "いい朝にゃ！\n顔を洗ってくるにゃ！", 2, 1614, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…", 2, 1615, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ", 2, 1616, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "客商売では、\n外見のチェックも\n欠かせないのにゃ！", 3, 1617, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うにゃ～！\nお昼寝に\nぴったりにゃ", 3, 1618, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！", 3, 1619, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！", 3, 1620, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…", 3, 1621, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "本当は外で\n運動したいん\nだけどにゃ", 3, 1622, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！", 3, 1623, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…猫の\nしつけ方は、と…", 3, 1624, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪", 1, 1626, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪", 1, 1627, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！", 1, 1628, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…", 1, 1629, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…", 1, 1630, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？", 1, 1631, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…", 1, 1632, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？", 2, 1633, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしのこと…\nしっかり捕まえ\nといてにゃ？", 2, 1634, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪", 2, 1635, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！", 2, 1636, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？", 2, 1637, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！", 2, 1638, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "いい朝にゃ！\n顔を洗ってくるにゃ！", 2, 1639, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろおっひる～\nにゃーんか\n食べたい…", 2, 1640, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ", 2, 1641, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "にゃにゃ…\n髪が乱れてるにゃ", 3, 1642, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ", 3, 1643, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ、猫と匹敵する\nぐらいかわいいにゃ！", 3, 1644, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "猫でもこわくない\n優しい灯りにゃ！", 3, 1645, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽっかぽか\nしあわせな気分にゃ～", 3, 1646, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！", 3, 1647, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！", 3, 1648, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本を読んで\n猫の気持ちを\n勉強するのにゃ！", 3, 1649, 104602);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "内職手伝える人\nいないかしら？", 1, 1651, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "次の依頼は、\nこういう計画で…\nうん、完璧ね！", 1, 1652, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "次の特売セールに\n向けて、しっかり\n準備しないと！", 1, 1653, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね", 1, 1654, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "一日に受ける\nバイトの数、もう少し\n増やしたいわね", 1, 1655, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！", 1, 1656, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1, 1657, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？", 2, 1658, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "相談事かしら？\nそれくらいなら\n無料でいいわよ", 2, 1659, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "背後の気配なら\nすぐ分かるわ\n試してみる？", 2, 1660, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って", 2, 1661, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 2, 1662, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ", 2, 1663, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\n今日も朝から\nバイトよ！", 2, 1664, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼時ね。\n少し休憩したら、\nまた働くわよ！", 2, 1665, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 2, 1666, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "接客業の依頼が\nある時は、外見も\nキレイにしないとね", 3, 1667, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ～バイトで\n疲れたから癒される～", 3, 1668, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これを内職で\n作ったら\n儲かるかしら？", 3, 1669, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！", 3, 1670, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！", 3, 1671, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "働き続けるには\n健康第一！　それには\n運動が一番よ", 3, 1672, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！", 3, 1673, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "日々絶えず学んで、\n生活に活かすのよ！", 3, 1674, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね", 1, 1676, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "次の依頼は\nこういう計画で…\nうん、完璧ね！", 1, 1677, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ギルドの経費\nあとちょっとだけ\n削れそうね…", 1, 1678, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ", 1, 1679, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ", 1, 1680, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1, 1681, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…", 1, 1682, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ", 2, 1683, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？", 2, 1684, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今から\n休憩するところなの\n一緒にどう？", 2, 1685, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん？　どうしたの？\n私のことが\n気になるの？", 2, 1686, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ", 2, 1687, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 2, 1688, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？", 2, 1689, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼時ね\n少し休憩したら\nまた働くわよ！", 2, 1690, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 2, 1691, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "女の子らしく…\nどうも忘れちゃう\nのよね", 3, 1692, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここで少し\n休んだら\nまたバイトよ！", 3, 1693, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これを内職で\n作ったら\n儲かるかしら？", 3, 1694, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "仕事から帰ってきて\nこういうのがあると\n素敵ね", 3, 1695, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ", 3, 1696, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "これで休憩中も\n無駄なく\n鍛えられるわ♪", 3, 1697, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ", 3, 1698, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "日々絶えず学んで\n生活に活かすのよ！", 3, 1699, 104802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1, 1701, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1, 1702, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1, 1703, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん、\n弟くんのにおい…\n近くにいるね？", 1, 1704, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1, 1705, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この部屋を、\n私と弟くんの\n愛の巣に…", 1, 1706, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "はぁ～…弟くん\n禁断症状だよ～", 1, 1707, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 2, 1708, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 2, 1709, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "姉と弟の外出は\nデートって\nいうのかな？", 2, 1710, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "もう！\nイタズラする子には\nお姉ちゃんチョップ！", 2, 1711, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お姉ちゃんが\nぎゅ～ってして\nあげるね♪", 2, 1712, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 2, 1713, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 2, 1714, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "出かけるなら\n明るいうちに\n帰ってくるんだよ！", 2, 1715, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "まだ起きてるの？\nそれじゃあ、\nお姉ちゃんも\n夜更かししちゃお☆", 2, 1716, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "きれいなお姉ちゃん\n好きだよね♪", 3, 1717, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 3, 1718, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nお姉ちゃんチョップ！", 3, 1719, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り、\n弟くん好きかな？", 3, 1720, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これ、弟くんみたいに\nあったかいね～", 3, 1721, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 3, 1722, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あ、これ\n弟くんが好きな\n味付けだね！", 3, 1723, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "弟くんが読んでいいか\nお姉ちゃんが先に\n中を確認しなくちゃ！", 3, 1724, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1, 1726, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1, 1727, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "弟くんのお友達は\nみんな私の妹だよ♪", 1, 1728, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1, 1729, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はっ！\n弟くんが困ってる\n気がする！", 1, 1730, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "はぁ～…弟くん、\n禁断症状だよ～", 1, 1731, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1, 1732, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姉ちゃん\nキミのお願いなら\nなんでも聞いて\nあげちゃうぞっ", 2, 1733, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 2, 1734, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お姉ちゃんの胸に\n飛び込んでおいでっ♪", 2, 1735, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 2, 1736, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 2, 1737, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お風呂にする？\nごはんにする？\nそれとも…うふふ♪", 2, 1738, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 2, 1739, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お姉ちゃんが\nお昼ごはん\n作ってあげようか？", 2, 1740, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "眠れないの？\nお姉ちゃんが子守歌\n歌ってあげるね！", 2, 1741, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "弟くんを\n誘惑しちゃうぞ～♪", 3, 1742, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 3, 1743, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nお姉ちゃんチョップ！", 3, 1744, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お肌に潤いが\nでてきたみたい～♪", 3, 1745, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これ、弟くんみたいに\nあったかいね～", 3, 1746, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 3, 1747, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "弟くんの手作りなら\nもっとおいしくなると\n思うんだけどなぁ～", 3, 1748, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "弟くんをきちんと\n教育するために\nお姉ちゃんは勉強を\nかかさないのだ☆", 3, 1749, 104902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん～、エレガントで\n大人なお部屋ね！\nアタシにぴったり！", 1, 1751, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "身長とバスト以外は\n完璧な大人\nなのになぁ～", 1, 1752, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アタシの大人コーデで\nあいつも夢中ね♪", 1, 1753, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "朝顔の観察したら\n理系女子になれる\nかしら？", 1, 1754, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1, 1755, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "大人っぽい子が\n多いわね…アタシも\n負けてられないわ！", 1, 1756, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アタシが待ってる\nなんて、アイツは\n幸せものよねー", 1, 1757, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わーい、アメだー♪\n食べる食べるー♪", 2, 1758, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "熱いハニーラテが\n飲みたーい！\n淹れてー淹れてー！", 2, 1759, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なによ？　もしかして\n好きな子にイタズラ\nしたくなるってやつ？", 2, 1760, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ、\nデザインとかの話よ！", 2, 1761, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 2, 1762, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 2, 1763, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝のスキンケアは\n大事なの！", 2, 1764, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すいたー\nダイエット\nやめちゃおうかなー", 2, 1765, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "エイジングケアを\nしないとねー", 2, 1766, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この角度のほうが\n大人っぽく見えるかな\nそれともこっちかしら", 3, 1767, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 3, 1768, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい♪　けど\n大人はこんなもの…\nでも、かわいいし～！", 3, 1769, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "オシャレ～♪\n大人なレディって\n感じよね♪", 3, 1770, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかーい♪\nここで宿題\nしようかしら？", 3, 1771, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動したら成長\nしないかしら？\n背とか胸とか…", 3, 1772, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べすぎると\n太っちゃうな…\nでも、おいしいし～っ", 3, 1773, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 3, 1774, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1, 1776, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "恋人にするなら\nイケメンか\nただイケよね～", 1, 1777, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もう少し背が欲しいな\n…もっと牛乳を\n飲まなくちゃ！", 1, 1778, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "朝顔の観察したら\n理系女子になれる\nかしら？", 1, 1779, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こ、これは補習の\nお知らせプリント！\nアイツに見つかる前に\n隠さなくちゃ！", 1, 1780, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "アイツおっそいなー\n別に会いたいわけじゃ\nないけど…\n来ないと気になる…", 1, 1781, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アタシが待ってる\nなんて、アイツは\n幸せものよねー ", 1, 1782, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なーに？\nアタシに甘えたいの？", 2, 1783, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ\nデザインとかの話よ！", 2, 1784, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "頭撫でないで！\nお子様みたいに\nあつかわないでって\n言ってるのに～！", 2, 1785, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "壁ドンの練習…\nあれ？　壁ドンって\n男がするんだっけ？", 2, 1786, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 2, 1787, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 2, 1788, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "レディの朝は\n忙しいのよ", 2, 1789, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すいたー\nダイエット\nやめちゃおうかなー", 2, 1790, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "エイジングケアを\nしないとねー", 2, 1791, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "身だしなみチェック\nオッケー！　これで\nいつアイツが来ても\n大丈夫ね！", 3, 1792, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 3, 1793, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あたしがもっと\nオシャレにかわいく\nしてあげようか？", 3, 1794, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "オシャレ～♪\n大人なレディって\n感じよね♪", 3, 1795, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかーい♪\nここで宿題\nしようかしら？", 3, 1796, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動したら成長\nしないかしら？\n背とか胸とか…", 3, 1797, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "レディは、食べ物にも\n気を使うのよ", 3, 1798, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 3, 1799, 105002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔法と科学\nどっちも極めて\nみせるわ", 1, 1801, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "仕事も片付いたし\n部屋で\n実験実験…♪", 1, 1802, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "たまった治療代の\n請求書を\nまとめないと…", 1, 1803, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新薬が出来たし\nすぐに試したいけど…\n実験台がいないわ", 1, 1804, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "部屋にこもりすぎると\n曜日の感覚が\nなくなるわね", 1, 1805, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの子の記憶を\n取り戻せる薬…\n作れないものかしら", 1, 1806, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1, 1807, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あら、ヒマなら\n薬草の整理を\n手伝って", 2, 1808, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もしかして実験に\n付き合ってくれるの？\nえ？　違う？", 2, 1809, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "具合が悪い？\nなら診てあげる\nまずは触診から…", 2, 1810, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "植物に興味あるの？\nなら教えてあげるわ\n色々とね…", 2, 1811, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 2, 1812, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 2, 1813, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お昼までに調合用の\n花を集めたいの\n手伝ってくれる？", 2, 1814, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あら、もうお昼？\nそろそろ一息\n入れましょうか", 2, 1815, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜も更けて来たわね\n私は朝まで実験だけど\n見学していく？", 2, 1816, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "医者たるもの\nいつだって\n清潔に…♪", 3, 1817, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いいわねこれ\n仮眠の時に\n使わせてもらうわ", 3, 1818, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぬいぐるみなら\n動物も…", 3, 1819, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\n仕事場にも\n置いてみようかしら", 3, 1820, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここにいると\nついウトウト\nしちゃうわ…", 3, 1821, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "座ってる時間が多いと\n運動不足になるし\nたまにはいいわね", 3, 1822, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "研究していると\nつい食べるのを\n忘れちゃうのよね", 3, 1823, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "実験もいいけど\nいつか成果を\n本にしないと…", 3, 1824, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "徹夜はツラいけど\n集中すると時間の\n感覚がなくなって…", 1, 1826, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "痛みに悶える顔って\nどうしてあんなに\n興奮するのかしら？", 1, 1827, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "彼に罵られたら\nどんな気分かしら\n意外と快感かも？", 1, 1828, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "毒を薄めると\n薬になるのって\n今でも不思議だわ", 1, 1829, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "綺麗なバラには\nトゲがあるけど\n魅力の一つよね", 1, 1830, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "カレをさりげなく\n惚れさせる方法を\n研究するわよ…♪", 1, 1831, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1, 1832, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "構って欲しいの？\nじゃあ、君の体を\n調べさせて？", 2, 1833, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "実験に付き合って\n大丈夫よ、試すのは\nただの栄養剤だから", 2, 1834, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "欲しい薬が\nあったら言ってね\n調合してみるから", 2, 1835, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おしおきされたいの？\nキミにだったら\nいつでもしてあげる", 2, 1836, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 2, 1837, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 2, 1838, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝しか取れない\n植物があるの\n採取しに行くわよ", 2, 1839, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼時ってやけに\n眠たくなるわよね\n…調べたくなるわ", 2, 1840, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日くらいは\nゆっくり眠りたいわ\n…キミと一緒にね", 2, 1841, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "身なりについて\n研究するのも\n楽しそうね", 3, 1842, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休息に必要な道具は\n妥協せずに選ぶ！\nこれだけは譲れないわ", 3, 1843, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "たまにはこういう\n可愛らしいものに\n触れないとね♪", 3, 1844, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\n仕事場にも\n置いてみようかしら", 3, 1845, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "仕事がなかったら\nこのまますーっと\n眠りたいのに…", 3, 1846, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "運動しないと\n体型の維持が…", 3, 1847, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "適度な食事も\n大切よね", 3, 1848, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "まさか私が\n恋愛読本を読む\n日が来るなんて…", 3, 1849, 105102);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぺっぺっ！\n…い、いけないっ！", 1, 1851, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いっけな～い！\nひづめで床に傷が！", 1, 1852, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "太っちゃったかも～！\n伐採でダイエット\nしなくっちゃ！", 1, 1853, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "きちんと生活すると\n毛づやが良くなる\nみたいなのよね～", 1, 1854, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "みんな、体重\nどれくらいなのかな？", 1, 1855, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1, 1856, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつか人間の女の子\nみたいなデート、\nしてみたいな～♪", 1, 1857, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私ね「どこにでもいる\n普通の女の子」って\n言葉が憧れなんだ～♪", 2, 1858, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "チャームポイント？\n自分では分からない\nけど…まつげかなぁ？", 2, 1859, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "リマリマ～♪\nはっ！？\nわ、私ったら今何を？", 2, 1860, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "力仕事ならまかせて！", 2, 1861, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 2, 1862, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 2, 1863, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 2, 1864, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ランチは\nおしゃれなカフェで\nしてみたいな～♪", 2, 1865, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お肌のケアに\nパックしながら\n寝ようかな～", 2, 1866, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やだっ、\nまた寝ぐせついてる！\n直さないと！", 3, 1867, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ミシッっていった！\n私、重すぎるかも！？", 3, 1868, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ！　あなたも\n美人さんね～♪", 3, 1869, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁ、まったり…\n四足歩行しちゃい\nそうだわ…", 3, 1870, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い♪\n…私、毛皮だから\n暑すぎるかも", 3, 1871, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "な、なんだか野生に\n帰っちゃいそう！", 3, 1872, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ぱくぱく、もぐもぐ、\nぺっぺっ…\nやだ、はしたない！", 3, 1873, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 3, 1874, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "素敵ね～、居るだけで\n女子力があがりそうな\nお部屋だわ～", 1, 1876, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私、大丈夫かしら？\n他の子に怖がられたり\nしないかな…？", 1, 1877, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "動物苑…って\n嫌なギルド名ね…", 1, 1878, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "好き、嫌い、好き…\nあっ！　うっかりして\n花占いのお花\n食べちゃった！", 1, 1879, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここ、女の子らしい\nものでいっぱいね～！\nときめいちゃうわ～♪", 1, 1880, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1, 1881, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人が\n来てくれるまで薪割り\nでもしてよっかな？", 1, 1882, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "一緒にお出かけ？\nうれしいけど…\n心の準備が！\nはわわわ！", 2, 1883, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうしたの？\n急に抱きついてきて…\n癒されたいの？", 2, 1884, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぺっぺっ！\n…い、いけないっ！", 2, 1885, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "メタモルアップルを\nここで食べたら、\nみんな驚くわよね", 2, 1886, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 2, 1887, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 2, 1888, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 2, 1889, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ダイエット中だから\nお昼は抜いてるの～", 2, 1890, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お肌のケアに\nパックしながら\n寝ようかな～", 2, 1891, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちゃんとかわいく\nしてないと刈られ…\n狩られちゃうもんね！", 3, 1892, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ミシッっていった！\n私、重すぎるかも！？", 3, 1893, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ！　あなたも\n美人さんね～♪", 3, 1894, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～\n森の中にいるみたいに\nとっても落ち着く～", 3, 1895, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "素敵～♪　…\nきゃっ！　私の毛が\nたいへんなことに～！", 3, 1896, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "な、なんだか野生に\n帰っちゃいそう！", 3, 1897, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "何を食べるかより\n誰と食べるかが\n大事なのよね", 3, 1898, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 3, 1899, 105202);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ヴァイスフリューゲル\nを盛り上げる方法、\n共に語らおう！", 1, 1901, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私は子供ではない…！\nが、お菓子は\nいただこう！", 1, 1902, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "部屋はきちんと\n片づけておかなくては\n部屋の汚れは\n心の汚れだ", 1, 1903, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "むむむ…明日\n目が覚めたら、身長が\n伸びていないものか…", 1, 1904, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1, 1905, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつとの新たな\n鍛錬が\n待ち遠しいな…！", 1, 1906, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "最近、あいつと\n過ごしていて、毎日が\n充実しているな…", 1, 1907, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "軍人の本分は日々の\n研鑽にあるからな。\n今日も鍛錬に\n行かないか？", 2, 1908, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 2, 1909, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "貴公にも、飴をくれて\nやろうか？\nあまいぞ～！\n美味しいぞ～！", 2, 1910, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "私ともっと高く、\n共に飛ぼう！", 2, 1911, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "貴公は、本当に頼りに\nなる男だな…いや、\nふとそう思っただけだ", 2, 1912, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "貴公と共にいられる\nことは私の喜びだ。\nこれからも\nよろしく頼むぞ", 2, 1913, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "うむ、いい朝だ。\n本国の夜明けを\n思い出してしまうな！", 2, 1914, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろ昼食に\nするか。腹が減っては\n戦はできないからな", 2, 1915, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわああ…私は子供\nではないが…眠い時は\n眠いのだ…", 2, 1916, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "身だしなみは、心の\n在りようを映すから\n気をつけなくてはな", 3, 1917, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 3, 1918, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 3, 1919, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このともし火、戦いに\n明け暮れる我らの心を\n癒すものだな…", 3, 1920, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 3, 1921, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "うおおおおおっ！\n鍛錬、鍛錬、\n鍛錬っ！！", 3, 1922, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いつ戦いになっても\n困らぬように、\n腹八分目に\nしておくのだ！", 3, 1923, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これを読んで、新たな\n戦術を編み出すぞっ！", 3, 1924, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "たまには掃除でも\nするか。部屋が\n綺麗になるのは\n喜ばしいことだ", 1, 1926, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "部屋の中では\n剣を振り回せないのが\n玉に瑕だな…", 1, 1927, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1, 1928, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1, 1929, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "家庭を守れない者が\n国を守れるはずが\nない。この部屋も\n私が守るぞ！", 1, 1930, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あいつは今頃、何を\nしているのだろうな…\nふふっ", 1, 1931, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつと会える日が\nこんなにも待ち遠しく\nなるとはな…", 1, 1932, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "軍人の本分は日々の\n研鑽にあるからな\n今日も鍛錬に\n行かないか？", 2, 1933, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おお、今日も鍛錬の\n時間だったか！\nすまないな\nすぐ行く！", 2, 1934, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私は子供ではない！\nが…たまには童心に\n帰りたい時もある…", 2, 1935, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "貴公にも、飴を\nくれてやろうか？\nあまいぞ～！\n美味しいぞ～！", 2, 1936, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "私と歩きたいのか…？\nそうだな。二人で\n散歩でも行こうか", 2, 1937, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "貴公と共にいられる\nことは私の喜びだ\nこれからも\nよろしく頼むぞ", 2, 1938, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "うむ、いい朝だ\n本国の夜明けを\n思い出してしまうな！", 2, 1939, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろ昼時だな\n鍛錬の手を緩めて\n昼食にするか", 2, 1940, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝る前に…あと少し\nだけ、鍛錬を…", 2, 1941, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ヴァイス\nフリューゲルの一員と\nして恥ずかしくないよう\n身なりを整えなくては", 3, 1942, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 3, 1943, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 3, 1944, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このともし火\n戦いに明け暮れる\n我らの心を\n癒すものだな…", 3, 1945, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 3, 1946, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "うおおおおおっ！\n鍛錬、鍛錬\n鍛錬っ！！", 3, 1947, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いつ戦いになっても\n困らぬように\n腹八分目に\nしておくのだ！", 3, 1948, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "うむ…脳細胞が\n活性化してきたぞ\n読書は大事だな", 3, 1949, 105302);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私たちの騎空艇\nどんなデザインに\nしよう…？", 1, 1951, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "団員募集の\nポスター\n作ろうっと♪", 1, 1952, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "父さん…\n今頃どこで\n何してるんだろ？", 1, 1953, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "騎空艇に乗って、\n誰もいったことがない\n場所を見つけたいな", 1, 1954, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "父さん以上の\n世界一の\n騎空士になりたい！", 1, 1955, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "仲間と行く空の旅…\n何度想像しても\nドキドキするなぁ", 1, 1956, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "父さん…\n私にもね、大切な\n仲間ができたよ", 1, 1957, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "仕事の依頼？\nすぐに支度\nしてくるね！", 2, 1958, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ねえねえ！\n団員募集のポスター\n一緒に作ろうよ！", 2, 1959, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なーにー？\nどうしたの？\n今呼んだよね？", 2, 1960, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今は休憩中だよ？\nだからあなたも\nゆっくりしてて", 2, 1961, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私にとってあなたは\nとっても頼りになる、\n自慢の団員だよ！", 2, 1962, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お父さんに会えたら、\n大切な仲間として\nあなたを紹介するね！", 2, 1963, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\n体の調子はどう？\n今日は頑張れそう？", 2, 1964, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ねえねえ、お昼\n食べに行こうよ！\nお腹空いちゃった", 2, 1965, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "…あれ？\nおしゃべりしてたら\nもうこんな時間？", 2, 1966, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうせならオシャレな\n騎空士って\n呼ばれたいな", 3, 1967, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ、疲れた～…\nちょっとだけ\n休んじゃおっと", 3, 1968, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "よし！　キミは\n今から団長代理だ！\n…なんてね♪", 3, 1969, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～♪\n気持ちが\n落ち着く～…", 3, 1970, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これって\n騎空艇に\n置けるかな…？", 3, 1971, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "どんな仕事でも\nこなせるような\n体力がないとね…！", 3, 1972, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あむっ…うん！\n美味しい～！\n今度作ってみよう♪", 3, 1973, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "空を冒険するには\n色んなことを\n知っておかないと…", 3, 1974, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…戻らなくなったよ\nどうすれば元に\n戻る…？", 1, 1976, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "暇だよ…\nどこかに強い人は\nいないか？", 1, 1977, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ジョブチェンジ！\n…叫んでも\n戻らないよ", 1, 1978, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今のうちに、\n魔物退治の\n仕事に行くね！", 1, 1979, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ハァ～…\nうん、気の巡りは\n問題ないね！", 1, 1980, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "私の力の源は\n仲間との\n絆だよ！", 1, 1981, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつかこの拳を\n空を越えた、星まで\n届かせたいね", 1, 1982, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "功夫が足りない人は\nどうすればいいか？\nもちろん修行だよ！", 2, 1983, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私はいつも通りに\n喋ってるつもり\nだよ？", 2, 1984, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうした？\nもしかして手合せ\nしたいか？", 2, 1985, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "騎空士としても\n拳法家としても\n目指すは世界一ね！", 2, 1986, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "背中はあなたに\n預けたよ！\nよろしくね！", 2, 1987, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと一緒なら\nきっと、今よりもっと\n強くなれるよ！", 2, 1988, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ちゃんと起きてるか？\n寝ぼけてたら\nダメよ？", 2, 1989, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "腹減ったね…\nなにか食べに\n行くよ！", 2, 1990, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "修行のしすぎは\n良くないよ？\n気をつけるね", 2, 1991, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "美しい技は\n美しい体が\nあってこそ！", 3, 1992, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "よいしょっと…\nちょっとのんびり\nさせてもらうよ", 3, 1993, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…練習に\n使うのはさすがに\n可哀そうね", 3, 1994, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これは…\n瞑想の時にも\n使ってみたいね", 3, 1995, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "出来ればもっと\n熱いほうが\n嬉しいよ", 3, 1996, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "ここでも\n修行出来るなんて\n最高だよ！", 3, 1997, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "気力の源は体力！\n体力の源は\n健康とご飯！", 3, 1998, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "んー…\n難しいことは\nわかんないよ！", 3, 1999, 105702);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わたしたちの\nギルドハウスへ\nようこそ～！", 1, 2001, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぐるるる～…\nあ、お腹が\n鳴っちゃいました…", 1, 2002, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ん？\n食べ物のにおい？", 1, 2003, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みんなと仲良く食卓を\n囲みたいですね～", 1, 2004, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この部屋が、わたしの\n帰る場所です♪", 1, 2005, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人を見ると\n胸が満たされます～\nお腹は空いてますが！", 1, 2006, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人、\n大食いの子って\n嫌いかな？", 1, 2007, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "食べもの、くれるん\nですか？　わーい！\n恋しちゃいそう♪", 2, 2008, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "つ、つまみ食いなんて\nしてませんよ？\nこれは味見です！", 2, 2009, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おやつは別腹、\nごはんも別腹、\n魔物も別腹～", 2, 2010, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "好きなものを、\n好きな人達と食べる！\n最高の贅沢ですね☆", 2, 2011, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたは、\nごはん王子ですね～", 2, 2012, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "大好きです～\n愛してます～\nえへへ～♪", 2, 2013, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 2, 2014, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯、\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 2, 2015, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お夕飯も、晩ごはんも\n食べたし…さぁ！\nお夜食の時間ですよ☆", 2, 2016, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "身だしなみ、\n身だしなみ…\nきちんとしないとね♪", 3, 2017, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふい～\n消化中です～", 3, 2018, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おいしそ…\nか、かわいいです～", 3, 2019, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りですね～\n空気までおいしそう～\nじゅるり♪", 3, 2020, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ほっかほか～♪\n魔物の丸焼きが\n作れちゃいますね！", 3, 2021, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "走って食べて！\n走って食べて！\n\この無限ループです！", 3, 2022, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いくつでも\n食べられますよ！\n幸せ～☆", 3, 2023, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "料理の絵を\n見ているだけで、\nよ、よだれが～", 3, 2024, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この部屋が、わたしの\n帰る場所です♪", 1, 2026, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ギルドハウス\nどんどん素敵に\nなっていくな～♪", 1, 2027, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "「やばい」とか\n「おいっす」とか…\n民の言葉って難しい", 1, 2028, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お菓子の家に\n住みたいな～", 1, 2029, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あ、頼んでた出前が\n届いたかな？", 1, 2030, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "大切な人がいて\n大切な場所がある\nすごく幸せです♪", 1, 2031, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人\n大食いの子って\n嫌いかな？", 1, 2032, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ごはんに行きますか？\n作りましょうか？\n店屋物もいいですね～", 2, 2033, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "モグモグ…\nあげませんよ～", 2, 2034, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おやつは別腹\nごはんも別腹\n魔物も別腹～", 2, 2035, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "好きなものを\n好きな人達と食べる！\n最高の贅沢ですね☆", 2, 2036, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "大好きです～\n愛してます～\nえへへ～♪", 2, 2037, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "わたし食べても\n太らないんです♪\nほらほら～触って\nみてくださいよ～", 2, 2038, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 2, 2039, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 2, 2040, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お夕飯も、晩ごはんも\n食べたし～。さぁ！\nお夜食の時間ですよ☆", 2, 2041, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姫さまみたいに\nきれいに\nならないと…", 3, 2042, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "のんびりしていても\nお腹がすいちゃうん\nですよね～", 3, 2043, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おいしそ…\nか、かわいいです～", 3, 2044, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アップル系、ピーチ系\nオレンジ系…\n香りも色々ですね～", 3, 2045, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここでお魚を\n焼けたら\n最高ですね～♪", 3, 2046, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "身体も鍛えなきゃ～！\nお腹がすいちゃいます\nけど…", 3, 2047, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐもぐもぐもぐ\nもぐもぐもぐもぐもぐ\nもぐもぐもぐもぐ…", 3, 2048, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "流行語発表…\nこんな言葉遣いが！\nやばいですね", 3, 2049, 105802);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも", 1, 2051, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "んーー、あたし\nなんで、このギルドに\n入っちゃったんだろ？", 1, 2052, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あいつが来たら、\n尾行しなくちゃ♪", 1, 2053, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この部屋のどこかに、\nあいつの秘密が\n隠されてるかも？", 1, 2054, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ま、まずいわ…\nギルド活動、\nけっこう楽しい♪", 1, 2055, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつを監視してる\nと…な、なんか\n変な気分", 1, 2056, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さま…\nだ、誰も聞いてない\nわよね！？", 1, 2057, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "気まぐれは\nチャームポイント\nみたいなもんよ", 2, 2058, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うひゃっ！？\nど、どうしてあんたは\nいつも驚かせるのよ！", 2, 2059, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぎゃー！\n虫もって近づくなー！", 2, 2060, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この部屋って、\n野良猫を拾ってきたら\nだめかな？", 2, 2061, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "遊びにいくわよ！\nあんたはあたしの\n言うとおりにすれば\nいいの♪", 2, 2062, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんた、あたしに\n操られてみない？", 2, 2063, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "美食殿としては、\n朝食もこだわらないと\nねぇ～", 2, 2064, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ギルド活動だもん！\n美味しいランチを\n食べましょ♪", 2, 2065, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ディナーに行くわよ！\nギルドの目的、\n食べ歩きだもんね♪", 2, 2066, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日もしっぽが\nいい感じ♪", 3, 2067, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こういう所だと、\n丸くなっちゃうのよね\nうにゃぁ～～", 3, 2068, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ、あたしの能力で\n操れないかな？", 3, 2069, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うにゃぁ～♪\nにゃん、にゃお～ん♪", 3, 2070, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ～ゴロゴロ\nしたくなるわね", 3, 2071, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "特訓特訓！\nあたしは\nやればできる！", 3, 2072, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいものを\nたくさん食べる…\nギルド活動って\n楽しい～♪", 3, 2073, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "魔法を使うにも、\n知識が必要だものね", 3, 2074, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ま、まずいわ…\nギルド活動\nけっこう楽しい♪", 1, 2076, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも", 1, 2077, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "主さま…\nだ、誰も聞いてない\nわよね！？", 1, 2078, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "監視監視…\nうん！　あたしは\nなまけてないわよね", 1, 2079, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "へ、陛下に\nみつからないように\nしなくっちゃ…", 1, 2080, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "あいつが来たら、\n尾行しなくちゃ♪", 1, 2081, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつと会ってから\n調子くるったな…\n楽しいけどさ", 1, 2082, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "食わず嫌いって\nあるのよね\n食べ物もだけど\n人も…", 2, 2083, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うひゃっ！？\nど、どうしてあんたは\nいつも驚かせるのよ！", 2, 2084, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "話し相手になって\nやるわよ…情報\n聞き出せるかもだし", 2, 2085, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この部屋って\n野良猫を拾ってきたら\nだめかな？", 2, 2086, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "遊びにいくわよ！\nあんたはあたしの\n言うとおりにすれば\nいいの♪", 2, 2087, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんた、あたしに\n操られてみない？", 2, 2088, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "美食殿としては\n朝食もこだわらないと\nねぇ～", 2, 2089, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ギルド活動だもん！\n美味しいランチを\n食べましょ♪", 2, 2090, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ディナーに行くわよ！\nギルドの目的\n食べ歩きだもんね♪", 2, 2091, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日もしっぽが\nいい感じ♪", 3, 2092, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うにゃ～\nどんどん眠く\nなる～", 3, 2093, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ、あたしの能力で\n操れないかな？", 3, 2094, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あたし、みんなや\nあいつと同じ香りを\n身に着けてるんだ…", 3, 2095, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うっ、のんびり\nしたくなる…\n特訓しなきゃ\nいけないのに～", 3, 2096, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "特訓特訓！\nあたしは\nやればできる！", 3, 2097, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいものを\nたくさん食べる…\nギルド活動って\n楽しい～♪", 3, 2098, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "魔法を使うにも\n知識が必要だものね", 3, 2099, 106002);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この空間は主さまの\n香りがします\n…ふふふ♪", 1, 2101, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "炊事、洗濯、お掃除、\nお買いものもしなくて\nはいけませんね", 1, 2102, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アメスさまへの、\nお祈りができそうな\n場所は…", 1, 2103, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "さすが都会…\nおいしいものが\nたくさんあるのですね", 1, 2104, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "主さまが不自由なく\n使える部屋に\nしなくては…", 1, 2105, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "できるなら…\n主さまと二人だけの\n部屋の方が…", 1, 2106, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さまの隣には\nわたくしが…\nわたくしの隣には、\n主さまが…幸せです", 1, 2107, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わたくし、背が伸び\nましたでしょうか？\n…そうですか", 2, 2108, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もしお疲れでしたら\n肩でも\nお揉みしましょうか？", 2, 2109, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "主さま、なにか\nしてほしいことは\nありませんか？\n欲しいものは？", 2, 2110, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日のおこづかいです\n何かおいしいものを\n召し上がってください", 2, 2111, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "主さまのおてて\n温かいですね…♪", 2, 2112, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さまのおそばに\nいられて、わたくし、\n嬉しいです…", 2, 2113, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます。\n洗濯をしなければ…", 2, 2114, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろお昼ですね。\nおいしいものを\n食べましょう", 2, 2115, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おやすみになる時は、\nお声をかけてください\nお供致します", 2, 2116, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もう少し…\nおっきくなりたい\nです", 3, 2117, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このふかふかの優しさ\n主さまのようです", 3, 2118, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\n主さまにそっくり♪", 3, 2119, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "故郷の香りとは\n違いますが、これも\n心地よいものです…", 3, 2120, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここで洗濯物を\n乾かせるでしょうか", 3, 2121, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "都会の人々は\nこんなふうに\n運動を…！？", 3, 2122, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これは…主さまにも\n食べさせて\n差し上げたい…\nあーんって♪", 3, 2123, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "よく学んで、\n主さまのお役に\n立たなければ", 3, 2124, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "主さまがいつ戻って\n来ても平気なよう\n部屋を綺麗に保たねば", 1, 2126, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "節約のためにも\n自家菜園などするのは\nどうでしょう…　", 1, 2127, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アメスさまへの\nお祈りができそうな\n場所は…", 1, 2128, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "瞑想をすると\n心が安らぎます…", 1, 2129, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "都会の方の身なりを\n勉強した方が\n良いのでしょうか？", 1, 2130, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "わたくしの居場所は\n主さまのお傍です\nずっと、ずっと…♪", 1, 2131, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さまの隣には\nわたくしが…\nわたくしの隣には\n主さまが…幸せです", 1, 2132, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "主さま、なにか\nしてほしいことは\nありませんか？\n欲しいものは？", 2, 2133, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わたくし、背が伸び\nましたでしょうか？\n…そうですか", 2, 2134, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お出かけですか？\nわたくしもお供\nいたします", 2, 2135, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひゃん！\n主さま…\nいじわるです", 2, 2136, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 8, 0, "主さま、なにか御用は\nありませんか？\nわたくし、主さまの\nお役にたちたいのです", 2, 2137, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さまの優しさに\nわたくしはいつも\n癒されています…", 2, 2138, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\n主さまの可愛らしい\n寝顔、堪能致しました", 2, 2139, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "のんびりした時間帯\nですね…ふぁ～…\nし、失礼致しました", 2, 2140, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふむ、都会は夜でも\nこんなにも、にぎやか\nなのですね", 2, 2141, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "主さまに会う前に\n身なりを整えなくては\nいけませんね", 3, 2142, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このふかふかの優しさ\n主さまのようです", 3, 2143, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\n主さまにそっくり♪", 3, 2144, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この心地よさ…\n主さまのようです♪", 3, 2145, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここで洗濯物を\n乾かせるでしょうか　", 3, 2146, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 6, 0, 1, 0, "はぁっはぁっはぁっ\n…すべては\n主さまのため…", 3, 2147, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "都会の味…\nとてもおいしいです\n…もぐもぐもぐ", 3, 2148, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "都会のことを\n学ばないと…\nふむふむ", 3, 2149, 105902);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふぁ～…あっ\n見られちゃい\nましたか？", 2, 2151, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ギルドハウスの\n使い心地は\nどうですか？", 2, 2152, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ご用があれば\nなんでも言って\nくださいね～♪", 2, 2153, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ときどきみなさんと\nクエストに行きたいな\nって思っちゃいます", 2, 2154, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます！\nお掃除の方、\nはじめていきますね", 2, 2155, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "皆さん、お昼ごはんの\nご要望がありましたら\n用意致しますよ♪", 2, 2156, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ここは夜でも\nにぎやかですね", 2, 2157, 190801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…\n少しうとうと\nしてしまった", 1, 2158, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "室内だし兜を脱ぐか\n…いや\nやはりやめておこう", 1, 2159, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "部屋にいると\n鎧が蒸し暑くなるが\n我慢せねば…", 1, 2160, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "仕事が門番だからか\n部屋にいても\nじっとしてしまう…", 1, 2161, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "少年と会話したことを\n思いだすと\n自然と楽しくなるな", 1, 2162, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "少年のことを考えると\n顔がにやけてしまう", 1, 2163, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "少年は今頃\n平和に過ごせて\nいるかな…", 1, 2164, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん？　悪いが\n兜は脱がないぞ", 2, 2165, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私と遊びたいのか？\nそう言われても\n何をしていいやら…", 2, 2166, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "鎧が重くないかって？\n大丈夫。けっこう\n鍛えているからな", 2, 2167, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "少年、寒くはないか？\nいや自分がこうなので\n人が薄着に見えてね", 2, 2168, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君といると、兜の中が\nいつもより暑いんだ", 2, 2169, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私としゃべりたい？\n物好きだな\nでも、嬉しいよ", 2, 2170, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早いな少年\nえ？　私の仕事に\n合わせてくれたのか", 2, 2171, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食の誘い？\n嬉しいけど\n人前では食べないんだ", 2, 2172, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "王宮騎士団の\n日報を書かなければ…\n『何事もなし』、と", 2, 2173, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "鎧を着ているから\n感触が分かりづらい\nのが残念だ…", 3, 2175, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいいな…\n私には似合わないが\nぎゅ…ってしよう", 3, 2176, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "良い香りだ…\n普段はどうしても\n鉄くさくなるからな", 3, 2177, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "わかっていたけど\n鎧を着たまま暖炉に\nあたると暑い…", 3, 2178, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "兜を脱がずに食べる\nうん、段々コツが\n掴めてきた…", 3, 2180, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "兜があっても\n意外と本くらいは\n難なく読めるんだ", 3, 2181, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "居心地よくて\nゴロゴロしちゃうよ～\n…いつも通りだね", 1, 2183, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ドングリの木\n近くに生えてない？", 1, 2184, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "快適な寝床があれば\nそれだけで幸せだねぇ", 1, 2185, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あたしと一緒に\nだらけてくれる人が\nいそうだねぇ", 1, 2186, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここなら牧場よりも\n速く配達が\n届きそうだね～", 1, 2187, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんパン買ったし\nあいつにも\n分けてあげよう", 1, 2188, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつと一緒に\nだらけられたら\n最高に幸せだね", 1, 2189, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ドングリでも\nつまみながら\n一緒にゲームしようよ", 2, 2190, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "横になりたいから\n枕になっておくれよ～\nあんたあったかいしさ", 2, 2191, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ドングリあげるから\nあんパン買ってきて～", 2, 2192, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "う～\n疲れちゃったよ～\nおんぶして運んで～", 2, 2193, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたといると\nリア充って\n感じがするよ", 2, 2194, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたが一生\n世話してくれたら\n人生安泰なんだけどね", 2, 2195, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふわ～っ…\nおはよう…あたしは\nまだ眠いよ", 2, 2196, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろお昼寝でも\nしたい気分だねぇ", 2, 2197, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "徹夜でゲームするけど\nあんたもどうだい？\nあたしは強いよ", 2, 2198, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ…だめだこれ。\n気持ち良くて\n落ちそう…", 3, 2200, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいものに\n囲まれて寝るのも\nよさそうだねぇ…", 3, 2201, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "心身ともに\nリラックスした状態で\nぐうたら出来そうだね", 3, 2202, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふい～…\nごくらくごくらく…\n暖かいねぇ", 3, 2203, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べてすぐ寝ると\n牛になるって\n本当なのかな？", 3, 2205, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おー！　この本なら\nあたしも居眠りせずに\n読めそうだよ", 3, 2206, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ランドソル…\nおっきな街だなぁ…", 1, 2208, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ロザリア…\nきっと、いるよね？", 1, 2209, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "最近、弓の練習\nサボっちゃってるな…", 1, 2210, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日の私は\n森番じゃなくて\n家番だよ！", 1, 2211, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ちょっとだけ\n慣れてきたかも？", 1, 2212, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いつか、\nあの人と一緒に…", 1, 2213, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…なんか最近、\nあの人のこと\nばっかり…", 1, 2214, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もしよかったら\n街に出かけない？", 2, 2215, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この部屋、\n妖精さんも\n気に入るかも！", 2, 2216, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日は\nなににしよっか？", 2, 2217, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日はどこ行く？", 2, 2218, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "たまには二人で…\nな、なんちゃって！", 2, 2219, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "最近、\nずっと楽しいんだ！\nあなたのおかげかな", 2, 2220, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\n今日も一緒に\n頑張ろうね！", 2, 2221, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はどうする？\nあなたのオススメに\n連れて行って欲しいな", 2, 2222, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ランドソルは\n夜でも賑やかだね！", 2, 2223, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わぁっ！\nすっごく\nふわふわだよ！", 3, 2225, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわい～！\nぎゅってしたく\nなっちゃうかも！", 3, 2226, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん\nなんか…いい匂い？", 3, 2227, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "すっごいなー\nあったかいなー！", 3, 2228, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "わぁっ、おいしい！\nもっと食べたい\nかも…！", 3, 2230, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "も、文字は苦手…\nでも、頑張らないと\nだよね…！", 3, 2231, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "にんじんとピーマンを\n食べないでいい方法\nないかな…", 1, 2233, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "カップケーキが\n食べたいな…", 1, 2234, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "予習が終わりました！\nさて、次は復習を\nしないと…", 1, 2235, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あの人の部屋にいる\n私って…もしかして\nふしんしゃなんじゃ？", 1, 2236, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "男の人は、みんな\nへんたいだと\n聞きました…", 1, 2237, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人に、一緒に\n遊んでほしいけど…\nな、なんていえば？", 1, 2238, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "早く大人になりたいな\n…あの人と同じくらい", 1, 2239, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぼ、防犯魔石を\n鳴らしますよ！？", 2, 2240, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "へんたい！？　…\nあ、あなたでしたか～\nやっぱりへんたーい！", 2, 2241, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ宿題です\nやっておいて\nくださいね", 2, 2242, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ、遅刻ですよ\n待っていたんですから", 2, 2243, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "にらめっこですか？\nあ、あなたの前で変顔\nするのはちょっと…", 2, 2244, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの…何歳まで\n子供だと思いますか？", 2, 2245, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "顔を洗って、着替えて\n朝ごはんを食べて、\n歯を磨いて…", 2, 2246, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "て、鉄棒の練習！？　\nほ、他のことを\nしませんか？", 2, 2247, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ね、眠くないです\n子供ではありません\nから…ふわぁ", 2, 2248, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ひと休みしよっと\n………うん、\nひと休みおしまい♪", 3, 2250, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "つ、つぶらな瞳には\n弱いんです", 3, 2251, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リラックスできますね\n集中力も\n上がりそうです", 3, 2252, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいと\n眠くなっちゃうな…\n勉強しなくちゃなのに", 3, 2253, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ピーマンもこれくらい\nおいしければ\nいいのに…", 3, 2255, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本、むずかしい\n…もっと勉強\nがんばらなくちゃ", 3, 2256, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日はみんなに\nなにを読んで\nあげようかしら", 1, 2258, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "子どもたちと同じ\n目線で考えるのが\n大事よね", 1, 2259, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お天気が良い日は\nみんなでお散歩に\n行きたいわね～", 1, 2260, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "鬼ごっこにかくれんぼ\n…みんなは\nどっちが好きかしら", 1, 2261, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お遊戯会の配役、\n考え出すと\n大変だわ～", 1, 2262, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "彼は優しいから、\nきっと良い\nお父さんになるわね", 1, 2263, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼には私がいないと\n…っていうのは少し\n過保護すぎるかしら？", 1, 2264, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "保育園の行事を\n考えてるんだけど…\n良い案ないかしら？", 2, 2265, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今度、子どもたちと\nおやつを作るから、\n食べに来てね", 2, 2266, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "よかったら一緒に\n絵本を作らない？", 2, 2267, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたはいつも元気ね\n先生も見習わないと♪", 2, 2268, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "先生は\nずーっと、ずーっと、\nあなたの味方だからね", 2, 2269, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたみたいな\nいい子をお世話できて\n先生は幸せものだわ", 2, 2270, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう～\nちゃんと朝ごはんは\n食べた？", 2, 2271, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼寝の時間ね♪\nあなたも一緒に\n寝ましょうか", 2, 2272, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "すっかり真っ暗ね。\n今日も一日、\nよくできました♪", 2, 2273, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかねぇ♪\n年甲斐もなく、\n飛び跳ねちゃいそう", 3, 2275, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あらあら、かわいい！\n保育園のみんなに\n見せてあげたいわ", 3, 2276, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りね～\n保育園にも\n置こうかしら", 3, 2277, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "寒い日は、ここで\n子どもたちに絵本を\n読んであげましょ♪", 3, 2278, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しい～♪\n遠足に持っていったら\nみんな喜びそう", 3, 2280, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "みんなが\n楽しめる読み聞かせの\n方法特集♪　素敵ねぇ", 3, 2281, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "世界の前に、\nこの部屋を征服\nしてやろう♪", 1, 2283, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "拠点とはやはり\n斯くあるべきじゃの", 1, 2284, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "眷属の物はわらわの物\n故に、この部屋は\nわらわの部屋じゃな！", 1, 2285, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "永く眠っている間に\n随分と世界は変わった\nようじゃな…", 1, 2286, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うるさいのう～\nまったく、近頃の\n若いもんは…", 1, 2287, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あやつが来てから\n動悸が治まらぬ…\n如何ような病で\nあろうかの…", 1, 2288, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "眷属よ、どこに行った\nのじゃ？\nわらわの世話を\n許可するのじゃ", 1, 2289, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いずれ世界は\n我が手中に収まる\nふふふ、\n楽しみじゃのう", 2, 2290, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "眷属よ、わらわから\n離れてはならんぞ！\n子供に戻ってしまう\nではないか！", 2, 2291, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "トマトジュースが\n欲しいのじゃ！\n野菜ジュースでは\nダメだぞ！", 2, 2292, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "蚊にくわれたぞ！\nわらわの血を吸う\nとは～！", 2, 2293, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "こら、頭をなでるな\nお主はこの姿でも\n子供扱いするのか？", 2, 2294, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お主が望むなら世界の\n半分をくれてやっても\n良いのじゃぞ？", 2, 2295, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝早くから感心じゃの\nさすがわらわの\n眷属じゃ", 2, 2296, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "太陽は苦手じゃ…\nこの部屋の中で\n過ごそうぞ", 2, 2297, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜も更けてきた！\nわらわ達の時間は\nこれからじゃ～♪", 2, 2298, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "よい座り心地じゃ\nわらわの玉座としよう", 3, 2300, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "可愛いではないか\nわらわの眷属に\nしてやろうかのう", 3, 2301, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うむ、良い気持ちじゃ\nこれを作った者、\n褒めてつかわすぞ", 3, 2302, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あたたかい…\n身も心も\n浄化されるようじゃ", 3, 2303, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "吸血鬼のわらわが、\nこのようなもの…\nうまい♪", 3, 2305, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "このまま大人の姿を\n保つ方法…どこかに\n書いてないかのう", 3, 2306, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いろんな人がいて\nいろんな服を着てて…\n目の保養になります♪", 1, 2308, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "レイ様への新作\nどんな服にしよう…\n方向性が絞れない～！", 1, 2309, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "忘れないうちに\n隠し糸のメンテナンス\nやっておこうっと！", 1, 2310, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "むっ！　あの人の\nスリーサイズは…\nほほう…なるほど♪", 1, 2311, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ノゾミさんの\n衣装はああして\nチカさんのは…", 1, 2312, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私がアイドル…\n…実感ないけど\n精一杯やってみよう", 1, 2313, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "まさか私が\nアイドルになるなんて\n思ってなかったです", 1, 2314, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なんですかぁ？\n衣装作りで疲れて\n眠いんですぅ…", 2, 2315, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あーっ！　また\n服がほつれてる…\nしょうがないですね", 2, 2316, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はっ！　ちょうど今\n新しいデザインが\n思い浮かびました！", 2, 2317, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "暇そうですね？\n時間あるなら仕事\n手伝ってください！", 2, 2318, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "どうしました？\n新しい服が\n欲しくなりましたか？", 2, 2319, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士さんのおかげで\nカルミナでも\n頑張れてますよ！", 2, 2320, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます…\nなんで朝って毎日\nやってくるんでしょう", 2, 2321, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空きましたね\n騎士さんはちゃんと\n御飯食べましたか？", 2, 2322, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の方が\n作業が捗るのは\n私だけですかね？", 2, 2323, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このふかふか具合\nいい素材を\n使ってますね", 3, 2325, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "小さくて可愛い♪\nそうだ！　レイ様の\nぬいぐるみを…！", 3, 2326, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こういう時くらい\n何も考えずに\nリラックスしないと♪", 3, 2327, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "炎を使った服って\nカッコ良いかも…\nでも材料がな～…", 3, 2328, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "何をするにも\n食事は大切！\n体力が資本です！", 3, 2330, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "私もいつか\nデザインを\nまとめて本に…", 3, 2331, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "またお魚を\n捕りにいこうかな♪", 1, 2333, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そろそろみんなも\nお腹が空くころ\nじゃないですか～？", 1, 2334, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここなら、\n日焼けの心配は\nありませんね！", 1, 2335, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お刺身に焼き貝…\nお腹が魚介類を\n求めてますっ！", 1, 2336, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "泳ぐのも食べるのも\n大得意です！", 1, 2337, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人と二人で\n浜辺を散歩…\n素敵ですねぇ", 1, 2338, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人に水着を\n褒めてもらえたら、\nすごく嬉しいなぁ", 1, 2339, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "たまには釣りじゃなく\n一緒に素潜りでも\n行きませんか？", 2, 2340, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "男の子に水着を\n見られるのって\n少し緊張しちゃいます", 2, 2341, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ギルドハウスの\nみんなとも、\n海に行きたいですね！", 2, 2342, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたの水着、\n私が選んであげます！", 2, 2343, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "泳ぎの練習なら\n付き合いますよ！\n手取り足取り♪", 2, 2344, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着姿が好きなら\nいくらでも\n着てあげますよぉ♪", 2, 2345, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の海も\n幻想的で\nいいですよねぇ～！", 2, 2346, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はみんなで、\n海鮮バーベキューとか\nどうでしょう！", 2, 2347, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海は星が\nきれいですよ！\n見に行きましょう！", 2, 2348, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "泳ぎ疲れたので\nちょっと休憩です～", 3, 2350, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたにも、\n可愛い水着を\n着せてあげたいです", 3, 2351, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんだか、\nリゾート気分です…", 3, 2352, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふい～、泳ぎで冷えた\n身体を暖めましょう～", 3, 2353, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいひ～です～\nこれ、海水浴にも\n持っていきたいですね", 3, 2355, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "南国のフルーツ図鑑\n…じゅるり…", 3, 2356, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "わ～♪　おいしそ…\nか、かわいいですね～", 3, 2358, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "これくらい大きな貝…\n食べたいな～\n食べたいな～～", 3, 2359, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この格好で\n部屋をうろつくのは\n不思議な感じがします", 1, 2360, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "南国の果実を使って\n主さまにデザートを\nお作りしましょう", 1, 2361, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "せっかくの水着ですし\nこれから定期的に\n海水浴に行きたいです", 1, 2362, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海の生き物も、\n森の生き物に負けず\n可愛かったです…", 1, 2363, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クロールの練習なら、\n部屋でもできそうです", 1, 2364, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "主さまに、水着姿を\n褒めていただけた…\nえへへ♪", 1, 2365, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着で主さまの\nお世話をしたら、\n喜びますでしょうか…", 1, 2366, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お疲れでしたら\nわたくしの膝を\nお使いくださいね", 2, 2367, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "主さま、海の家で\nつかうおこづかいを\n渡しておきますね", 2, 2368, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海の美しさは、\n森とはちがう\n魅力がありました", 2, 2369, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この髪飾りですか？\n造花ですから\n水の中も平気です", 2, 2370, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "水着でくっついて\n眠ると、いつもより\n密着して暖かいです", 2, 2371, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "はじめての海が、\n主さまと一緒で\n幸せです♪", 2, 2372, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます。\n泳ぎに行く準備は\n万端です", 2, 2373, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午後は泳ぐのをやめて\nスイカ割りなど\nいかがでしょう？", 2, 2374, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜も更けてきました…\n波の音を聞きながら\n少しお話しませんか？", 2, 2375, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あぅ…この家具には、\n人をダメにする魔法が\nかけられています…", 3, 2377, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ♪\nあなたも、海水浴に\n行きますか？", 3, 2378, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…\nきっと主さまも\n気に入ります", 3, 2379, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これは暖かいです…\n後ほど主さまと一緒に\nあたりましょう", 3, 2380, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "泳いだ後の食事は\n一段と美味しく\n感じます", 3, 2382, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "深海魚の生態…\nこれは主さまにも\nお伝えしなくては…", 3, 2383, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "顔立ちが、主さまに\n似ております…\nかわいらしい♪", 3, 2385, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふかふかですね\n主さまのようです♪", 3, 2386, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お掃除、お掃除\nふんふふ～ん☆\nあ、聞かれてました？", 1, 2387, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "日焼けには回復魔法が\n効きますよ。どうして\n逃げるんですか～！", 1, 2388, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日はドジを\nしませんように！", 1, 2389, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "接客業を極めれば\nメイドとして\n成長できるかも？", 1, 2390, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水着って\n動きやすいんですけど\n人の目が気になります", 1, 2391, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人の気持ちを知る\n魔法とかあれば…\nな、なんでもないです", 1, 2392, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着でご奉仕したら、\nあの人は喜ぶかな？", 1, 2393, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "暑いのでしたら、\n私が魔法で涼しく…\nえ？　いらない？", 2, 2394, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "何か御用ですか？\n特にないのでしたら、\nお話ししましょう♪", 2, 2395, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "水着姿でも\nメイドはメイドです\nご奉仕しますよ！", 2, 2396, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひゃっ！　あ、危うく\n転ぶところでした…\n…きゃうっ！", 2, 2397, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "どうかしましたか？\nあなたの御用なら、\n喜んでお受けしますよ", 2, 2398, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着姿をあなたに\n見られると、\nドキドキしちゃいます", 2, 2399, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は暑くてやる気が\n出ない？　でしたら、\nえぇい、元気になぁれ", 2, 2400, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹がぺこぺこなら、\nお昼は海の家で\n食べましょう♪", 2, 2401, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の浜辺でお散歩も\nいいですね。たくさん\n転びそうですけど…", 2, 2402, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休憩しながら、\nお掃除すれば\n一石二鳥です！", 3, 2404, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "きれいにすれば\nかわいさも倍増\nですよ～♪", 3, 2405, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "素敵な香りです～\n救護院に置けば、\nみんな喜ぶかも～", 3, 2406, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいですね…\nはっ！　いけません！\nメイドがサボるなんて", 3, 2407, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "料理のできない\nメイドなんて…\nはぐはぐ、おいしい♪", 3, 2409, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "水着姿で接客をすると\n売り上げが倍になる\n…本当ですか、これ", 3, 2410, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "えへへ♪\n南の島まで\n乗せてください！", 3, 2412, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "なんだか、\n人魚姫に\nなった気分です♪", 3, 2413, 107701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みんなで過ごす\n休日っていいわよね…\nずっと続かないかな", 1, 2414, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海に浮輪でぷかぷか\n浮かぶのって\n癖になりそう", 1, 2415, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ビーチにいると\n日焼けが心配だわ", 1, 2416, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "水着姿って楽よね。\n室内だとちょっと\n落ち着かないけど…", 1, 2417, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お、泳ぎの練習なんて\nしないからね！", 1, 2418, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "楽しすぎて立場を\n忘れそう…あんたの\nせいなんだから！", 1, 2419, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "みんなで遊んで\n美味しいもの食べて\nほんっとに楽しいっ♪", 1, 2420, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "マジであっついわね…\nよっし！　海に入って\n涼みましょ！", 2, 2421, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "シャワー浴びたばかり\nなのに…また、遊び\nたくなってきたわ！", 2, 2422, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "遊び足りないって？\nしょうがないわね…\n付き合ってあげるわ♪", 2, 2423, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一応伝えておくけど\n猫って水が苦手なの！\nわかった！？", 2, 2424, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あたしと話したいの？\nふふ。\nまぁ、いいわよ。\nほら隣に座りなさい", 2, 2425, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "こんなに楽しいの\n初めてかも…\nずっと続けばいいのに", 2, 2426, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "は、早起きしたのは、\n楽しみで眠れなかった\nからじゃないわよ！", 2, 2427, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食後のストレッチ\n終わり！　さあ、\nビーチが待ってるわ！", 2, 2428, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海に散歩に\n行こうかな～\nあんたも来なさいよ☆", 2, 2429, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海ではしゃぎすぎて\n疲れたわ…ちょっと\n休もうかしら？", 3, 2431, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こんな魔物がいたら\n操るのも楽しいかも", 3, 2432, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "にゃう～♪\nまるで南国にいる\n気分ね♪", 3, 2433, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかぁい♪\n身体が冷えてきたから\n丁度いいわ！", 3, 2434, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "運動後のご飯って\nなんでこんなに\n美味しいんだろ♪", 3, 2436, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "どんなカナヅチでも、\n絶対必ず泳げる方法、\n書いてないかしら？", 3, 2437, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "あんたもあたしが\n操ってあげる！\nなんてね～♪", 3, 2439, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "リゾートリゾートっ\nのんびりしましょ♪", 3, 2440, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここなら思う存分\nデスクワークに\n励めるわね！", 1, 2441, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "武器のメンテナンスも\nしっかりしないと\n最高効率は望めないわ", 1, 2442, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "準備をしっかり整えて\nもっともっと\n稼がなくちゃね！", 1, 2443, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "少し休んだら\n次のバイトに\n行ってくるわね！", 1, 2444, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この格好でここに\nいるのって\n気恥ずかしいわね…", 1, 2445, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミが望むなら\n今日のバイト\n休んでもいいわよ？", 1, 2446, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミだけね…\n私のことをここまで\n理解してくれるのは", 1, 2447, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "普段と違う格好\nだからって\nそんなに見ないでよ…", 2, 2448, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キミを立派な\nバイト戦士にするのが\n師匠としての役目よね", 2, 2449, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そろそろ次のバイトに\n行かないと…\nキミも一緒に来る？", 2, 2450, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "効率は大事だけど\nゆっくりするのも\n悪くないわね", 2, 2451, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "一緒の時間が楽しくて\nバイトのことを\n忘れちゃいそうね", 2, 2452, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミと一緒なら\nどんなミッションも\n楽勝ね！", 2, 2453, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう、いい朝ね！\n今日もめいっぱい\n稼ぐわよ！", 2, 2454, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もうお昼だったのね…\n内職のバイトに\n集中しすぎちゃったわ", 2, 2455, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "スケジュールは、と…\nこういう管理の徹底が\n効率を生み出すのよ♪", 2, 2456, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "しっかり働いて休む…\n最高効率にまた一歩\n近づいたわね", 3, 2458, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なごんじゃうわね…\nよぉし、次のバイトも\n頑張らないと！", 3, 2459, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りね…\n働く意欲が\n湧いてくるわ", 3, 2460, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "身体が冷えたから\n助かるわ…冷えは\n女の天敵だもの", 3, 2461, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "海のバイトは\n体力勝負よ\nエネルギーはしっかり\n摂取しないとね！", 3, 2463, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "座学も大切ね\nもっと知識を\n身につけないと…", 3, 2464, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "海の楽園みたいね…\n今だけは効率を\n忘れちゃいそう…", 3, 2466, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "落ち着くわ…\n海とひとつになった\n気分ね！", 3, 2467, 108001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちょっと休憩にゃ～\n潮風は体に\n良くないにゃ～", 1, 2468, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "猫グッズで\n海の家を飾りたいにゃ", 1, 2469, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海の幸は美味しいけど\n水はイヤだにゃ…", 1, 2470, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "開店にゃ！\nこのたい焼きなら\nきっと大繁盛にゃ！", 1, 2471, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "海と言えば水着にゃ\n似合ってるかにゃ？", 1, 2472, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミが頼むなら\n手伝ってあげても\nいいにゃ", 1, 2473, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あたしの宝は\nここにあるにゃ～", 1, 2474, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "にゃ？\nそんなに見つめても\n何も出ないにゃ", 2, 2475, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今からキミを\nあたしの相棒に\n任命するにゃ！", 2, 2476, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これから\n開店の準備にゃ\nキミも手伝って\nくれるのかにゃ？", 2, 2477, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海の家で出す\n新しいメニューを\n考え中なのにゃ～", 2, 2478, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミと一緒なら\n売上げナンバーワンに\nなれるにゃ！", 2, 2479, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミと一緒にいると\n楽しくて、もっと\nいたくなるにゃ", 2, 2480, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようにゃ！\n今日も頑張って\nいくにゃー！", 2, 2481, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すいたにゃ～…\nお魚、ちょっとだけ、\nつまみ食いするにゃ", 2, 2482, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日の準備は万端にゃ\nいつでも\n出発できるにゃ", 2, 2483, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このふかふか具合\nまるで子猫の\n毛並みのようにゃ～", 3, 2485, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "にゃにゃ～\nなんてかわいさにゃ～", 3, 2486, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この匂い…\nもう少し香ばしいと\nいいかもしれないにゃ", 3, 2487, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "にゃ～…\nあったかくて\nぬくぬくだにゃ～", 3, 2488, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "働くにはまず体力にゃ\nしっかり食べて\nスタミナアップ\nだにゃ!", 3, 2490, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nここにお宝が\n眠ってるんだにゃ", 3, 2491, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "シードレイクにゃ！\n本物は怖かったけど、\nぬいぐるみなら\nかわいいにゃ～", 3, 2493, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "貝なのにふかふかの\nクッションにゃ！\n屋台の前にも\n置いてみたいにゃあ", 3, 2494, 107901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "人の家って、道場とは\n違った香りがするね", 1, 2495, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと退屈だね…\nあの人をからかいに\n行こうかな♪", 1, 2496, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "普通の女の子みたいに\n遊びたいって思う\nこともあるんだよね", 1, 2497, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "剣の手入れを怠らない\nようにしないと。\nいざという時、困るし", 1, 2498, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "もっと\n上手く立ち回って\n出世したいな", 1, 2499, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おかえりなさい！\nふふ、なんだか奥さん\nになった気分だよ♪", 1, 2500, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "恥ずかしくて、あなた\nを見られないよ…\n私らしくないなぁ…", 1, 2501, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私、お話好きなんだ。\nどうせなら楽しい話を\nしたいな♪", 2, 2502, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "女の子っぽい子と、\n男勝りな子、あなたは\nどっちが好き？", 2, 2503, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そろそろ見回りの\n時間かな。あなたも\n一緒に行く？", 2, 2504, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "構って欲しいのかな？\nそれじゃ一緒に\nランニングに行こうか", 2, 2505, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "二人で出かけるなら、\n手を繋がないとね。\nあはは、冗談冗談♪", 2, 2506, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねえ、あなた♪\nおや、顔が真っ赤だ！\n…ふふ、私も、かな？", 2, 2507, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "私は朝から鍛錬だよ。\n慣れてるけど大変だ。\nお互いに頑張ろうね", 2, 2508, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "鍛錬でお腹ぺこぺこ。\nお昼ごはんが\n楽しみだね", 2, 2509, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日も一日見回りと\n鍛錬を頑張ったよ。\nあなたもお疲れさま", 2, 2510, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いざという時のため\nにも、休憩は大事だね", 3, 2512, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうものには\n今まで\n縁がなかったけど。\nうん、可愛いね♪", 3, 2513, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "精神統一に通じる\nものがあるね。\nふぅ、癒されるなぁ", 3, 2514, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいなぁ。\nたまにはのんびり\nしようか", 3, 2515, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "鍛錬後はすごくお腹が\n空くんだよね。\nう～ん、おいしい♪", 3, 2517, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "剣術書だけで強くなる\nには飛びぬけた才能と\n努力が必要だよね", 3, 2518, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "正義の刃で\n悪を挫く！\n…キマったッス♪", 1, 2520, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ヒーローの\n秘密特訓を\n始めるッスよ～！", 1, 2521, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "正義の味方目指して\n今日も明日も\n全力ッスよ♪", 1, 2522, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一日一善！\nヒーローだったら\n当たり前ッス♪", 1, 2523, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "どうッスか\nこのポーズ！\nイイ感じッスか？", 1, 2524, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "た、たまには\nよく頑張ったねって\n褒めてほしいッス…", 1, 2525, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "自分を信じてくれる\nあんたと一緒なら\n何でもやれるッス！", 1, 2526, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おつかれッス♪\n冒険の準備は\nばっちりッスよ！", 2, 2527, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうしたんッスか？\n…はっ！　もしや敵が\n迫ってるんスかっ！？", 2, 2528, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "べ、別に\n頭を撫でてほしいとか\n思ってないッスよ？", 2, 2529, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "スーパーヒーロー\nトラタイガーは\n絶対無敵ッス！", 2, 2530, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたと自分で\n正義の心を燃やして\n悪を一網打尽ッス！", 2, 2531, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたと一緒だと\n幸せな気持ちに\nなるんッス…♪", 2, 2532, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お、早いッスね～♪\n今日も一日一善\nよろしくッス！", 2, 2533, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "一休みしながら\nヒーローについて\n語り合うッスよ～！", 2, 2534, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜のパトロールで\n一緒に平和を\n守るッス！", 2, 2535, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅぅ…\n落ち着くッスね\n戦士の休息ッス♪", 3, 2537, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "くぅぅ、可愛いッス…\nヒーローが守るべき\n愛らしさッスね！", 3, 2538, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんスかこの香り？\nすぅぅ…ふぅぅ…\n力がみなぎるッス！", 3, 2539, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "優しい光ッスね…\nヒーローの優しさ\nそのものッス！", 3, 2540, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あむあむあむ…\nんぅう、元気が溢れて\n止まらないッス！", 3, 2542, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "トラタイガーのお話は\n笑いあり涙ありで\n超おすすめッス！", 3, 2543, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ハッピーハロウィン\nお父さん、お菓子は…\n食べられないね", 1, 2545, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "トリックオアトリート\nお菓子をくれないと\n不吉な占いをします", 1, 2546, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、あなたの後ろで\n霊のみなさんが\n踊り始めました", 1, 2547, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "霊感がいつも以上に\n冴えているので\n占いの調子も良好です", 1, 2548, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "父はハロウィンが\n大好きだそうです\n大胆な格好をする子が\n多いので…", 1, 2549, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたは霊たちにも\n大人気ですよね\n私も見てほしいな…", 1, 2550, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ハロウィンの賑やかさ\n今は好きです…\nあなたといられるので", 1, 2551, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "霊のみなさんとの\nダンスパーティー…\n楽しみです", 2, 2552, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お父さん、元気だね\nえ？　ここは色んな\n女の子に会えて幸せ？", 2, 2553, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハロウィンのお菓子\n食べすぎちゃったな…\nでも、美味しかった…", 2, 2554, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたの女難の相…\n悪化していますね\nお祓いが必要かも", 2, 2555, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの、霊のみなさんが\nあなたと踊りたいと…\nえっと、私も…", 2, 2556, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと手を繋ぐと\n胸が苦しくなります\nでも、繋ぎたいな…", 2, 2557, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ハッピーハロウィン…\n父が元気なので\n今日の運気は良好です", 2, 2558, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "父はお昼寝中です\n本当に寝ているかは\n私にも分かりませんが", 2, 2559, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お父さん、\nもう眠っちゃったの？\n…眠れるんだったっけ", 2, 2560, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "落ち着きますね…\n霊のみなさんも\n喜んでいます", 3, 2562, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "つん、つん。ふふっ♪\n癒やされます…", 3, 2563, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "精神が研ぎ澄まされる\n香りですね…\n占いが捗ります", 3, 2564, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいね\nお父さん…\nえ？　分からない？", 3, 2565, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "霊のみなさんは\n食べられないので…\n私がいただきます", 3, 2567, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "お父さんを元に戻す\n手掛かり…\n書かれていないかな？", 3, 2568, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "わぁ、お菓子が沢山…", 3, 2570, 108101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "無料でプリンが\nもらえるなんて、\nハロウィンはすごいの", 1, 2572, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "生きてるときも、\nミヤコはハロウィンが\n好きだった気がするの", 1, 2573, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "みんなに仮装を\n見せつけて、\nプリンをもらうの～", 1, 2574, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この仮装で、\nみんなに恐怖を\n教えてやるの！", 1, 2575, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "アオーン、アオーン！\nミヤコ、狼女に\nなりきってるの～", 1, 2576, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アイツに秘密で、\nパーティーの\n飾り付けをするの♪", 1, 2577, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アイツが狼男の\n仮装をすれば、\nおそろいなの～", 1, 2578, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "プリンをくれなきゃ、\nオマエをカボチャに\nしてやるの～", 2, 2579, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ハロウィンは幽霊でも\n参加できるから\n楽しいの～！", 2, 2580, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "プリンがないなら\nカボチャプリンを\n食べればいいの！", 2, 2581, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "プリンの可能性は\n無限大なの～", 2, 2582, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "オマエの隣で\nプリンを食べると、\nいつもより美味しいの", 2, 2583, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "オマエが死んでも、\nミヤコはずーっと\n一緒にいてやるの～", 2, 2584, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ごはんは\nカボチャプリンなの！\nハロウィンっぽいの～", 2, 2585, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ランチは豪華に\nプリンアラモードなの", 2, 2586, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜は幽霊たちと\nハロウィンするの！\nオマエも来るの！", 2, 2587, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "幽霊にも休息は\n必要なの！\nプリンもってこいなの", 3, 2589, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "オマエもミヤコの\nパーティーに\n招待してあげるの～", 3, 2590, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "癒されるの～\nまるで天国なの～", 3, 2591, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここでなら、\n焼きプリンが\n作れるの！", 3, 2592, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "腹が減っては\nハロウィンは\nできぬなの！", 3, 2594, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "丸ごとカボチャ\nプリン特集！？\n美味しそうなの～♪", 3, 2595, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "お菓子がたくさんで、\nミヤコはとっても\nハッピーなの♪", 3, 2597, 108201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔女以外にも、\n色々な仮装を\nしてみたいわね", 1, 2599, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "チョコやアメよりも、\nアタシに相応しい\nスイーツがあるはず…", 1, 2600, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お菓子の食べ過ぎは、\nお母さんに\n怒られるかも…", 1, 2601, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この格好で学院に\n行ったら、\nみんな驚くかしら", 1, 2602, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "大人のレディは、\nどういうハロウィンを\n過ごすべきかしら…？", 1, 2603, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お菓子、アイツの分も\nとっといてあげよ！\n大人の余裕ってやつね", 1, 2604, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アイツを魅了する\n魔法とかないかしら？", 1, 2605, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おしゃれスイーツを\nくれなきゃ\nイタズラするわよ！", 2, 2606, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アタシの大人センスで\nアンタに似合う仮装を\n選んであげるわ！", 2, 2607, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "不気味よねぇ…\nジャックオーランタン\nこ、怖くないわよ？", 2, 2608, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハロウィンが楽しくて\n宿題やり忘れてたわ…\nて、手伝って～！", 2, 2609, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お菓子をもらうのも\nアンタと一緒なら\n恥ずかしくないわ！", 2, 2610, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アタシのエスコートを\n任せられるのは、\nアンタだけなんだから", 2, 2611, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝食はオシャレに\nグリーンスムージー！\n…に、にがぁ", 2, 2612, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼下がりはカフェで\n優雅なティータイム\n…憧れるわ～", 2, 2613, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ハロウィンナイトの\nはじまりよ！\n街に繰り出しましょ！", 2, 2614, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あう～、お菓子の\n食べすぎで\n動けな～い", 3, 2616, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アンタも仮装する？\nいまよりもーっと\nかわいくなるわよ！", 3, 2617, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "大人な香りに\n包まれてる～♪", 3, 2618, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポカポカね～♪\n…ああー！\nチョコが溶けてる！", 3, 2619, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい～♪\n…じゃなくて！\nび、美味ですわ～", 3, 2621, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この服かわい～♪\nって、なにこの値段！\nお小遣い何年分よ！？", 3, 2622, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "お、お菓子なんかで\n喜ぶほど、子供じゃ…", 3, 2624, 108301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "次はどんな策で団長を\nからかってみようか…", 1, 2626, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "む？\n血の臭いがするな\n祭りの時間か☆", 1, 2627, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "平和に飼い殺される\n前に、混沌の愛を\n育みたいね", 1, 2628, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "本気を出した団長と\nいつか手加減なしに\n殺り合いたいな", 1, 2629, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おばさん呼ばわりする\n新米騎士の小娘を\n懲らしめてやろうか", 1, 2630, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "胸を触られるまで\n誓約のことなど\nすっかり忘れていたな", 1, 2631, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "まさかこのワタシが\nプロポーズするとはな\n…笑えるじゃないか", 1, 2632, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "面白い暇つぶしを\n思いついたんだ\n戯れに付き合え☆", 2, 2633, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "退屈で死にそうだ\n愉しい話題を\nワタシに提供してくれ", 2, 2634, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんだ、暇なのか？\n心躍ることでも探しに\n出かけようではないか", 2, 2635, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このワタシを愉快に\nさせてくれる事でも\nあったのか？", 2, 2636, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ワタシに求婚した男の\n数だと？\nいちいち覚えてないな", 2, 2637, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "最強無敵の女と\n結婚できるんだ\n誇りに思えよ☆", 2, 2638, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "なにか愉快なことが\n起こりそうな朝だ☆\nワクワクするね", 2, 2639, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "うーむ、腹がすいたな\n愉快なことで\nこの空腹を満たしたい", 2, 2640, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "これからは大人の\n時間だ。愉しみ方を\n知りたいのかい？", 2, 2641, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このワタシとした事が\n穏やかな気分に\nなってしまうとは…", 3, 2643, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "可愛い姿をしたものが\n惨たらしい\n醜態を晒すのを\n想像してしまう", 3, 2644, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "悪くはない香りだ\nだが、ワタシは血の\n臭いを嗅ぎたいぞ☆", 3, 2645, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぬるい、ぬるすぎる！\n地獄の業火には\nほど遠い熱さだ！", 3, 2646, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ワタシの腕前に\n勝るとも劣らない\nなかなかの味だ", 3, 2648, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "意中の男性を絶対に\n落とす方法…？\nく、下らんっ！", 3, 2649, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "明日はあの釣り場に\n行くとしようかな\nあの子も誘ってみるか", 1, 2651, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぷはーっ！\n体を動かしたあとの\n一杯は格別だね", 1, 2652, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "天気が良いと\n昼寝か釣りかで\n迷っちまうな…", 1, 2653, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "大物が釣れたときの\n快感は、他じゃ\n味わえないね", 1, 2654, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふあぁ～…\n昼寝でもするか", 1, 2655, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふふっ…\nあの子、見た目より\n根性あるんだね", 1, 2656, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの子が強くなるには\nどんな魚を食べさせて\nあげればいいのやら…", 1, 2657, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "姉御って呼ぶんじゃ\nないよ。からかうと\nタダじゃおかないよ", 2, 2658, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "釣りのコツ？\n何事も経験が大事だ\n今から行くかい？", 2, 2659, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうしたのさ？\n助太刀が必要かい？\nアタシにまかせときな", 2, 2660, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "困ってる人がいたら\nまた力を貸しておくれ\n頼りにしてるよ", 2, 2661, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なにか困りごとかい？\nどうやら昼寝は\nまた今度だね", 2, 2662, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "よしよし！\nお人好しのお前さんを\n労ってあげるよ", 2, 2663, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう、お前さん\n魚屋は早起きでなきゃ\nつとまらないよ？", 2, 2664, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯かい？　今朝\n仕入れた魚があるんだ\n食べてみるかい？", 2, 2665, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜釣りにぴったりの\n月が出てるよ\nいい釣りが出来そうだ", 2, 2666, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "コイツに座って\nのんびり釣りが\nできりゃいいのにな", 3, 2668, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "よしよし…♪\nおっと、かわいい物も\nつい抱きしめちまうな", 3, 2669, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これで魚の臭いを\n消せれば、猫も\n寄らなくなるのかね", 3, 2670, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "冬場の釣りも\nこれくらい暖かけりゃ\nいいんだけどね", 3, 2671, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "腹が減っては\n釣りもできぬ、ってな\nまずは腹ごしらえだ", 3, 2673, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "へぇ…こんな魚が\nいたとは…いつか\n釣りたいもんだね", 3, 2674, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "流石に室内で\n魔法ぶっぱしたら\n怒られるよねぇ", 1, 2676, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "可愛い女の子が\nたくさんいる！\nここは楽園か！？", 1, 2677, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "みんなに漫画とか\n勧めてみようかな！\n布教用のがあるし！", 1, 2678, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わ、私一人の\n部屋じゃないから\n色々自重せねば！", 1, 2679, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "「ぬるぽ」\n…くっ、\n誰も反応なしか！", 1, 2680, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "次はどの漫画を\n貸そうかなー♪", 1, 2681, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次の定期巡回で\nとっておきの店に\n連れてってあげよう！", 1, 2682, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "君に似合いそうな\n衣装を買ったよ！\n君もいざ魔法少女に！", 2, 2683, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さあ！\n暇なら定期巡回に\nレッツラゴー！", 2, 2684, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "戦闘だけじゃなくて、\n日常にも役立つ\n魔法を習得したいね！", 2, 2685, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新魔法思いついた！\n私って天才！？", 2, 2686, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "決め台詞は超大事！\n君の決め台詞も\n私が考えてあげよう！", 2, 2687, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私ってもしやリア充？\n…そんなバカな！\n非リア代表のはずが！", 2, 2688, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよー…\n徹夜で本読んでたから\nまだ眠い～", 2, 2689, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯食べて、\n午後の定期巡回も\n頑張りましょー！", 2, 2690, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜からが、\nオタ活本番でしょ！", 2, 2691, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふいー！\nくつろいで本を読む！\n最高だねー！", 3, 2693, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "君、可愛いね～♪\n魔法少女の\n使い魔みたい！", 3, 2694, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "良い匂いに\n釣られてしまった…\nまさか、孔明の罠！？", 3, 2695, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かいけど、\nここで本を読むのは\nちょっち危ないかな", 3, 2696, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ウマ―！\nこれの詳細きぼんぬ！", 3, 2698, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "こ、古代語の本！？\n現代語でおk…", 3, 2699, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふふふっ♪\n次はどんな悪戯を\nしてやろうかしら♪", 1, 2701, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "幻影湖の霧を吸った\n人間たちの\nリアクションって、\nサイコーよねぇ～♪", 1, 2702, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "室内だけとはいえ…\n自由に動けるって、\nやっぱりいいわ～♪", 1, 2703, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "改めて見ると良い\n部屋ね…悪戯とか\nしやすそうだしぃ♪", 1, 2704, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "私を封じていた部屋\nなのに…急に居心地が\n良くなったわね♪", 1, 2705, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あんたの頭、座り心地\n良いわね…私専用の\n椅子にしてあげる♪", 2, 2706, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "外は大変みたいねぇ…\nまあ、私は好き勝手に\nやらせてもらうわ♪", 2, 2707, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "顔に落書された？\n誰か知らないけど、\n悪いことする奴も\nいるものねぇ～♪", 2, 2708, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "フィオのやつ…\nどこをウロチョロ\nしてるのかしら？", 2, 2709, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "人間の朝は大変ねぇ…\n私はその様を見ながら\nゆっくりするわね♪", 2, 2710, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "う～私も、お日様を\n浴びながら、お外を\nお散歩したーい！", 2, 2711, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "この暗さ…閉じ込め\nられていた時を\n思い出すわね…", 2, 2712, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "悪戯しすぎて\n疲れたから、ちょっと\n休憩しよっと♪", 3, 2714, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ガイド妖精たる私が、\nこんな造形物に\n惹かれる…わけが……\nかわいい♪", 3, 2715, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香りを囮にして、\n周りに悪戯を仕込む…\n完璧ね♪", 3, 2716, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "不思議ねぇ…私は\n温度とか関係ないのに\n離れられないわ", 3, 2717, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事の必要がない体…\nつまり、食べたければ\n食べていいのよね～♪", 3, 2719, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "へぇ…最近はこんな\n悪戯もあるのねぇ…\nあいつで試さないと♪", 3, 2720, 190901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス！\n歌で幸せを\n届けます…！", 1, 2722, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなたと出会えたのは\n偶然ではなくて…\nクリスマスの奇跡だと\n思うんです", 1, 2723, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クリスマスは華やかで\nつい子供のように\nはしゃいでしまいます", 1, 2724, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "曲が書けるのは\nあなたが側に\nいてくれるからです…", 1, 2725, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "感動を与えられる歌…\nあなたと一緒になら\n生み出せるはず…", 1, 2726, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クリスマスの幸せを\nあなたと\n感じ合えたらな…", 1, 2727, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたの幸せを願った\nクリスマスソング…\nいつか披露しますね", 1, 2728, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みなさんの笑顔を\n守りたいから…\n私は歌い続けます", 2, 2729, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "歌を届ける\nサンタさんに\nなりたいな…", 2, 2730, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お暇でしたら\nクリスマスのお祝いを\nしませんか？", 2, 2731, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ステージに立つ前に\n喉を整えないと…\n発声練習は念入りに…", 2, 2732, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "まわりはかわいい子\nばっかりだけど…\nこの服なら\nアピールになるかな？", 2, 2733, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "歌でならいくらでも\nあの人への気持ちを\n込められるのに…", 2, 2734, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日も一日\n幸せな歌で世界が\n包まれますように…", 2, 2735, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お茶を飲みながら\n好きな音楽を\n語り合いませんか？", 2, 2736, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふふ、寝かしつけの\n子守唄を\nお望みですか？", 2, 2737, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかですね\n心地良すぎて\n眠ってしまいそう…", 3, 2739, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "素敵…\n優しい歌みたいに\n気持ちが落ち着く…", 3, 2740, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "インスピレーションが\n溢れてくる…\nいい曲が書けそう…", 3, 2741, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この光みたいに\n灯火になるような\n歌を歌いたい…", 3, 2742, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "喉の健康のためにも\n食事はしっかり\nとるようにしています", 3, 2744, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "物語には\n曲作りのヒントが\n詰まっているんです", 3, 2745, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "絵が飛び出してくる\nなんて…精霊が宿って\nいるのでしょうか？", 3, 2747, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "か、可愛い…♪\nちょっとだけ触っても\nいいですよね…？", 3, 2748, 108401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "クリスマスでも、\n演劇の練習は\nしっかりやらないと！", 1, 2749, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あうぅ…\nクリスマスの準備が\n終わらないよぅ…", 1, 2750, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アヤネちゃんが\n摘み食いしないように\n見ておかないと…", 1, 2751, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "サンタさんみたいに、\n皆に笑顔で接する…\nうぅ…私には無理ぃ…", 1, 2752, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "新しいお洋服～♪\nスズメお姉ちゃんに\nお礼をいわないと♪", 1, 2753, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんの為に、\nプレゼントを\n用意しないと♪", 1, 2754, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "クリスマス…\n恋人の日…ひゃわっ！\nわ、私ってば何を…！", 1, 2755, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリー\nクリスマスです、\nお兄ちゃん♪", 2, 2756, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そ、そんなに\n見られると…\n恥ずかしいよぉ…", 2, 2757, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ひゃわぁっ！？\n急に触られると、\n驚くからやめてぇ…", 2, 2758, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ…クリスマスの\n準備を手伝って\nくれるんですか？", 2, 2759, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんと\n過ごすクリスマス、\n楽しみですぅ…♪", 2, 2760, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "クリスマスはその…\n二人で…あうぅ…\nなんでもないですぅ…", 2, 2761, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "うう…パーティーが\n楽しみで、あんまり\n眠れなかったよぅ…", 2, 2762, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ケーキを食べられなく\nなっちゃうから、\nお昼は軽めにしないと", 2, 2763, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ちょっと眠いけど…\n今日は少しだけ\n夜更かししたいです♪", 2, 2764, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかぁ…\nクリスマスの準備中に\n眠くなっちゃいますぅ", 3, 2766, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子と一緒に\nおままごとしたいな♪", 3, 2767, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂い…♪\nみんなで\nアロマパーティー\nしたいなぁ…♪", 3, 2768, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぬっくぬく…♪\nもう、ここから\n離れたくないよぉ…♪", 3, 2769, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむはむ…♪\nクリスマスのお料理\nより美味しいかも～♪", 3, 2771, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "すごい…\nクリスマスの\n演劇って、\nこんなにあるんだ…", 3, 2772, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "すごい…まるで、\nクリスマスの演劇を\n観てるようですぅ…♪", 3, 2774, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "とっても可愛いです♪\nお芝居の相手役に\nしたいなぁ…♪", 3, 2775, 108501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "甘ぁいケーキも、\nデッカイ七面鳥も、\nぜーんぶ私のだー♪", 1, 2776, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "毎日が\nクリスマスだったら\nいいのにな～♪", 1, 2777, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "プレゼントはあるし、\n料理は美味しいし、\nクリスマス最高ー♪", 1, 2778, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここでぷうきちの\nクリスマス一発芸♪\n『無茶ぶりするな！』", 1, 2779, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぷうきちがいつもより\n重いかも…太ったの？\n『衣装の重さだよ！』", 1, 2780, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんが\n一緒にいてくれると\nクリスマス楽しいね♪", 1, 2781, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんに抱きつく\nと、なんだかドキドキ\nする…なんでかな？", 1, 2782, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス♪\nプレゼントは、\nいつでも受付中だよ♪", 2, 2783, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このクマさん耳\n可愛いでしょ♪\nぷうきちと\nお揃いなんだー♪", 2, 2784, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お兄ちゃん…私、\n甘ぁいケーキが\n食べたいなぁ…♪", 2, 2785, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "クリスマスぷうきちは\nぬくぬく感が凄いよ！\nお兄ちゃんもさわる？", 2, 2786, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "えへへ…お兄ちゃんの\n手は、大きくて、\n暖かくて大好き～♪", 2, 2787, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年のクリスマスも、\nこうやって\nお兄ちゃんに\n甘えていたいな～♪", 2, 2788, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "あれぇ…\n私のケーキはぁ…？\n『ちゃんと起きろ』", 2, 2789, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はデッカイ\n七面鳥が食べたーい♪\n『夜まで我慢しろ』", 2, 2790, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "『もう寝る時間だぞ』\nサンタさんが来る\nまで起きてるぅ…", 2, 2791, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このふかふか具合…\nぷうきち！\n負けてられないよ！", 3, 2793, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子、\nすっごくかわいい～♪\n『ライバル登場か！』", 3, 2794, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "良い匂い…あっ！\nぷうきちにこの\n匂いを移せば…！\n『匂い袋にするな』", 3, 2795, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い♪\nえへへ、ぷうきちも\nあっためてあげる♪", 3, 2796, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ぷうきち！　これ、\nとってもおいしいよ♪\n『食べすぎるなよ』", 3, 2798, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "お、大人の私なら、\nこれぐらい…読め…\n『無理するな…』", 3, 2799, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "絵が飛び出す…\nぷうきちに絵本を\n入れれば、イタズラに\n使えるかも…♪", 3, 2801, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "か、可愛いけど…\nぷうきちサンタの方が\n可愛いんだからぁ…！", 3, 2802, 108601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "着物も慣れると\n動きやすいものさ", 1, 2803, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "鼻緒が緩んでしまった\n下駄で修業は\n無理があったかな…", 1, 2804, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "小腹が空いた…\nユイが作った餅、\nまだ食べられるかな？", 1, 2805, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "服装も変わったし\nいつもと違う戦い方を\n想定しないと…", 1, 2806, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…ヒヨリは動きすぎて\n着崩れしてないか\n心配だ", 1, 2807, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "これからもずっと\n仲間と、彼と\n一緒に…", 1, 2808, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "願いを叶えるために\nもっと自分を\n鍛えていかないと！", 1, 2809, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "頭の飾りがずれてた？\nそうか、直してくれて\nありがとう", 2, 2810, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "着物がそんなに\n珍しい？\nキミも着てみる？\n…冗談だよ", 2, 2811, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "肩掛けの触り心地が\n気に入った？\nならもっと触る？", 2, 2812, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ああ、この刀？\n釣り仲間に見繕って\nもらったんだ", 2, 2813, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミといると\n気持ちが段々と\n安らいでいくよ", 2, 2814, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミは私の行く先を\n照らしてくれる\n光のような存在だよ", 2, 2815, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう\n朝の修行を始めるけど\nキミもどう？", 2, 2816, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "この時間に軽く\n休憩をとるといい\n能率がよくなるよ", 2, 2817, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もう夜か…\n明日もまた頑張ろう\nそれじゃ、おやすみ", 2, 2818, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…疲れていたのかな\nもう少しで眠る\nところだった…", 3, 2820, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ、正月衣装を\n着せてやるのも\nよさそうだ", 3, 2821, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふぅ…いい香りだ\n慌ただしい日々から\n心が解放される", 3, 2822, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この心地よさ…\n寝てしまわないよう\n気をつけないと", 3, 2823, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいけど\n帯がきつくなる前に\n手を止めよう…", 3, 2825, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "外を出歩くのも\nいいけど、中で\n読書もありだな", 3, 2826, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…騎士クンって\nおせち料理で\n何が好きなんだろう？", 1, 2828, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "着物でお掃除や\nお洗濯するの\n慣れてきた♪", 1, 2829, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今年は\nどんな福袋を\n買おうかな…♪", 1, 2830, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お餅に使う調味料\nみんなで違うから\n色々用意しなきゃ", 1, 2831, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ほっぺがお餅みたいに\nぷにぷに…\n食べ過ぎちゃった…", 1, 2832, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "来年も、再来年も\nみんなで一緒に\n新年を迎えたいな", 1, 2833, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お願いです…\nいつかこの気持ちが\n伝わりますように…", 1, 2834, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "髪飾りが落ちそう？\nじゃあ…騎士クン\nつけ直してくれる？", 2, 2835, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "着物が着たいの？\nじゃあ今度一緒に\n買いに…行く？", 2, 2836, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あっ、騎士クン\nお雑煮のお餅\nいくつ入れたい？", 2, 2837, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "外、寒かったよね？\nはいこれ。熱い甘粥\n飲むと温まるよ", 2, 2838, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今年は騎士クンと…\nえっ？　騎士クン！？\nな、なんでもないよ！", 2, 2839, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士クンの願い事\nわたしが\n叶えてあげたいな…", 2, 2840, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう\n太陽の光に当たると\n元気が出るよ", 2, 2841, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはん\n作らなきゃ…\n騎士クンも食べる？", 2, 2842, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "一日が終わるのは\nあっという間だよね\n一年も同じなのかな？", 2, 2843, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…\n帯も少し\nゆるめちゃおう…", 3, 2845, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お正月用に\n着物を縫って\nあげたいな", 3, 2846, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これでお肌が\n保湿出来たら\nいいのになぁ", 3, 2847, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ん～…\nぬくぬくしてて\n動きたくないよ～", 3, 2848, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "…冬眠しないのに\n熊さんみたいに\n食べちゃいそう", 3, 2850, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "年末年始は\n告白のチャンス…\nむ、無理無理！", 3, 2851, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みんな忙しそう…\n待っててね、\nすぐ助けるから！", 1, 2853, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ユイちゃんと\nレイさん…よし！\nどっちも手伝おう！", 1, 2854, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あっ、着崩れてる！\nわわっ、どうしよ！\n帯が結べないよー！", 1, 2855, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "初詣楽しみー！\n出店はどこから\n行こうかな？", 1, 2856, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お正月だし\nみんなで楽しく\n遊んじゃおー！", 1, 2857, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "うーん…\n騎士くんはお正月\n何してるんだろ…", 1, 2858, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ううぅー…\n騎士くんを見てると\nドキってなっちゃう…", 1, 2859, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あたしから\nおいしそうな匂い？\nくんくん…ソースだ！", 2, 2860, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ヘアピンが…\n拾ってくれたんだ！\nありがとう騎士くん！", 2, 2861, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "髪飾りがかわいい？\n耳の近く触りたい？\n…優しくね？　", 2, 2862, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "グローブで食べるの\n大変そう？　特訓して\n今はお箸も使えるよ！", 2, 2863, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "えっ、ほっぺが赤い？\nそうかな…？\n気のせい気のせい！", 2, 2864, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士くんといるとね…\nなんでもない！\nまだ内緒っ！", 2, 2865, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよー！\n今日も明るく元気に\nがんばろー！", 2, 2866, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すいてない？\n一緒にご飯食べよ！\n何にしようかなー♪", 2, 2867, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日もいっぱい\nがんばったー！\nいつも？　…そう？", 2, 2868, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休憩休憩♪\nちょっと休んで\nガンガン動くぞー！", 3, 2870, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい♪\nでも、壊しそうで\nちょっと怖い…", 3, 2871, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁー♪\nいい香りー…\n気分スッキリ♪", 3, 2872, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ほっこりしてて\nぬくぬく…\n丸まりたい…", 3, 2873, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ど、どうしよう…！\n手が、止まんないよ！", 3, 2875, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "へー…お年玉って\n昔はお餅だったんだ\n…今のほうがいいね", 3, 2876, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "甘いチョコの香りを\n漂わせて…ふふっ\nこれで準備万端ですわ", 1, 2878, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここを私のチョコで\n埋め尽くしますわ", 1, 2879, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "エプロンを着て\nあの方を待つ私…\nまるで…クスクス", 1, 2880, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "キッチンはどこかしら\n今のうちに作って\nおきたいものが…", 1, 2881, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あのお方を私のチョコ\nなしでは生きられない\n体に…ふふっ\n冗談ですわ…", 1, 2882, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "このチョコは運命の味\n一口食べれば私の虜…\nそれも運命ですわ…", 1, 2883, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私ともあろうものが\nなんだかドキドキして\nきましたわ…", 1, 2884, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あなた様。私に\n隠しているものなど\nありませんよね…？", 2, 2885, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私の手作りチョコです\n味の方にも自信\nありますのよ？", 2, 2886, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "少し苦いのは\nチョコがビターなだけ\nお気になさらず…", 2, 2887, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "解毒薬はどこに\nいれたかしら…？", 2, 2888, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "運命で結ばれている\nあなた様と私…\nチョコも特別でないと\nいけませんわ", 2, 2889, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "チョコを食べた後は\nメインディッシュ…\nさぁ、私を召し上がれ", 2, 2890, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "目覚めのチョコですわ\nすっきり目が覚めます\nしばらく眠れなく\nなりますけど…", 2, 2891, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おやつのチョコですわ\nデザートにどうぞ\n空腹を感じなく\nなりますわ…クスクス", 2, 2892, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お夜食のチョコですわ\nとてもよく眠れます\nさ、溶けてしまう前に", 2, 2893, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この心地良さ…\n参考になりますわ\n次の薬は…クスクス", 3, 2895, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この中、何か\n入りそうですわね\n…チョコレート、とか", 3, 2896, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…この香りと\n同じものを調合して\n私も持っていたい", 3, 2897, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この暖かさ…\nチョコが溶けないよう\n気を付けなくては", 3, 2898, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いい味をしていますわ\n私も腕を磨きましょう\n料理と、調合の腕を…", 3, 2900, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "勉強になりますわ\n知識はいくらあっても\n困りませんもの\n特に、人体の知識は…", 3, 2901, 109001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "弟くんのことを\n考えると\nあっという間に時間が\n過ぎちゃう…", 1, 2903, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お姉ちゃんの\n元気の源は、弟くんの\n喜ぶ顔なんだから♪", 1, 2904, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "弟くんと会ったら\nまずは抱きしめて\nそれからそれから…", 1, 2905, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日のお姉ちゃんは\n昨日のお姉ちゃんより\nいいお姉ちゃんだよ♪", 1, 2906, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "弟くん、もっと\nお姉ちゃんに\n甘えてもいいのに♪", 1, 2907, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お姉ちゃんのチョコ\n食べさせてあげたい…", 1, 2908, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ドキドキしてきた…\nお姉ちゃんなのに\nどうしてかなぁ…", 1, 2909, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姉ちゃんを\n好きなだけ\n触っていいよ♪", 2, 2910, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そんなにお姉ちゃんの\nチョコが欲しいの？\n食いしん坊さん♪", 2, 2911, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ナデナデするのは\nお姉ちゃんの仕事！", 2, 2912, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ありがとうなんて…\nお姉ちゃんとして\n当たり前だよ♪", 2, 2913, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "どうしたのかなっ？\nお姉ちゃんはいつでも\n弟くんのそばにいるよ", 2, 2914, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "チョコを作ったよ\n隠し味は、たくさんの\n弟くんへの愛情♪", 2, 2915, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよ。お姉ちゃんが\n顔を洗うの\n手伝ってあげるね♪", 2, 2916, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ご飯を食べたら\n眠たくなるよね…\nお姉ちゃんと寝る？", 2, 2917, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ眠くなった？\nお姉ちゃんが添い寝\nしてあげるね♪", 2, 2918, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この気持ちよさは\nお姉ちゃんも太鼓判♪", 3, 2920, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このかわいさは\nお姉ちゃんも大満足♪", 3, 2921, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り、チョコに\n使えるかな…？", 3, 2922, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "弟くんと一緒に\nぬくぬくしたいな…♪", 3, 2923, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "すごくおいしいねっ♪\nあとで運動しなきゃ…", 3, 2925, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本を読んでる\n知的なお姉ちゃん\n素敵でしょ♪", 3, 2926, 109101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アタシって…\nここにいても\nいいのか…？", 1, 2928, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちゃんとした建物に\nいるのが久しぶりで\nそわそわする…", 1, 2929, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここで天楼覇断剣\n出す練習したら\nアイツら怒るかな？", 1, 2930, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ギルドハウスか…\nこういう隠れ家\n欲しかったんだよな", 1, 2931, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "めちゃくちゃ暇だ…\n…なんかやること\nないのか？", 1, 2932, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "みんなが早く\nアタシのこと\n思い出さないかな", 1, 2933, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アイツはいいヤツだし\n戦う時はアタシも\n協力してやるか！", 1, 2934, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちゃんはいらん！\nノウェムでいい！\n分かったか？", 2, 2935, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうした？\n戦うのか！？\n…なんだ、違うのか", 2, 2936, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "身長のことは\nあんまり言うな！\n気にしてるからな！", 2, 2937, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アタシの戦い方は\nなんでもアリだ！\nだから見習うなよ？", 2, 2938, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "オマエとの思い出か…\n敵として戦ってばっか\nだったな！", 2, 2939, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "オマエやオクトーと\n一緒に、あちこち\nいってみたいんだ！", 2, 2940, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "よっ！　おはよう！\n朝だぞー！\n起きてるかー？", 2, 2941, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "腹減ったー！\n飯食うぞ、飯！\nオマエも行くよな？", 2, 2942, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ…\nまだ起きてんのか？\n元気だなオマエ…", 2, 2943, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぃ～…\n極楽極楽…", 3, 2945, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おいオマエ！\n寝技の練習に\n付き合ってもらうぞ", 3, 2946, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん…\nたまにはこういうのも\n悪くないかもな", 3, 2947, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あー…\nもっと前にコイツと\n出会いたかった…", 3, 2948, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "VRでも飯はうまい！\n腹が減るのはちゃんと\n生きてる気がするな", 3, 2950, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "勉強は大事だな！\nうん！…だめだ！\n全然わからん！", 3, 2951, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "探偵というのは\n謎を追い求める\n生き物なのさっ！", 1, 2953, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "事件のオチは\n往々にして\n取るに足らないものさ", 1, 2954, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "読書で得る知識が\n探偵の\n血肉になるんだよ", 1, 2955, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この前の\n捜査資料…\nどこにあったかな？", 1, 2956, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "どんな小さな謎も\n私にとっては\n宝石みたいなものさ！", 1, 2957, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "助手くんと一緒だと\nよい発想が浮かぶ…\nどうしてだろうね？", 1, 2958, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "助手くんの好きな\nタイプって…\nす、推理してみるっ！", 1, 2959, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "珈琲、淹れたてだよ\n一杯どうだい？", 2, 2960, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "事件の考察を\nまとめてみたんだけど\n聞いてくれるかな？", 2, 2961, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "小さな違和感を\n見逃さない…\n探偵の心得だよ", 2, 2962, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "機能的な手帳とペン…\nこの仕事には\n欠かせないね！", 2, 2963, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "助手くんに\n珈琲…\n淹れてほしいなぁ～", 2, 2964, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "助手くんは\n私にとって\n最高の相棒だよ☆", 2, 2965, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝はいいひらめきが\n得られるんだ…\nさあ捜査を始めよう！", 2, 2966, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "一休みしたら\n推理の答え合わせを\nしてみようか？", 2, 2967, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の張りこみかい？\nなら私も\n同行させてほしいな！", 2, 2968, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "脳を酷使した後は\nゆっくり休む…\nこれも仕事だよ？", 3, 2970, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この愛らしさ…\n要捜査対象だね！", 3, 2971, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "思考が活性化される\n素敵な香りだね…", 3, 2972, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "くぅ、心地よすぎる…\n今だけは捜査も\n一休みだね♪", 3, 2973, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いっぱい食べて\nいっぱい考える\n探偵の本分だね！", 3, 2975, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "探偵だからね\nミステリには\n一家言あるんだ", 3, 2976, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "先輩、素敵だなぁ…\nもっと近づければ\nいいのに…", 1, 2978, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "せ、先輩がいた部屋！\n私には刺激が強い…", 1, 2979, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "先輩を観察しやすい\n場所はあるかな…", 1, 2980, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "バ、バイト代出たし、\nせ、先輩をご飯とかに\n誘いたい…な", 1, 2981, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "今頃先輩は\nあの辺かな…？\n見に行ってみよう！", 1, 2982, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私と先輩の出会いって\n思い返すと少女漫画\nみたい…えへへ", 1, 2983, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "せ、先輩になら\n観察されてもいいなぁ", 1, 2984, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "バイト先に新しい子が\n入って来たんです…\nわ、私、先輩です♪", 2, 2985, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "せ、先輩…？\nえっと、あの、その、\nあわわわわ…！", 2, 2986, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "えへへ…えへへ～\nせ、先輩から\n話しかけてくれました", 2, 2987, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ま、また…\n先輩と一緒に\nバイトしたい…です", 2, 2988, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私と先輩が同じ空間に\n…ゆ、夢みたいです", 2, 2989, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "せ、先輩のそばに\n居られて、私\n今、とっても\n幸せです…", 2, 2990, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "せ、先輩…！\nおひゃっ！\nおはようございます！", 2, 2991, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "先輩ランチに\n行きましょう！\nよし、練習はバッチリ", 2, 2992, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あ、せ、先輩。\nえと、そ、外…\nもう真っ暗ですねぇ", 2, 2993, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こ、ここで先輩も\n休んだり…はっ！\nわ、私ったらなにを！", 3, 2995, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいですねー\n君も一緒に、\n先輩を観察する？", 3, 2996, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここから先輩の\n香りがすればなあ", 3, 2997, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "先輩と一緒に\nぬくぬくできたら\n最高なんだけどなぁ", 3, 2998, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいし～\nこれは\n先輩も好きな味かな", 3, 3000, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "す、好きな人に\n近づく方法…", 3, 3001, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私の力は、大切な\n人たちを護るために\n役立てたいんだ", 1, 3003, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "きれいな景色と\n美味しいご飯！\nこの世界も素敵だね", 1, 3004, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この世界のみんなとも\nもっと仲良く\nなりたいな！", 1, 3005, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わー！\nあれもこれも\n気になっちゃうな！", 1, 3006, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "しっかりしなきゃって\n思ってても、\nグレアといるとつい\n甘えちゃうんだよね～", 1, 3007, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "違う世界でも\n友だちができて、\nすごくうれしいよ！", 1, 3008, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "みんなとも一緒に\n授業とか受けたいな～\n絶対楽しそうだもん！", 1, 3009, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "歩き方がきれい？\nえへへ、そうかな…？", 2, 3010, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "勉強は好きだよ！\n知識が増えていくのは\nやっぱり楽しいから", 2, 3011, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私たちの国マナリアは\n人々の間に魔法が\n伝えられた、その\n始まりの地なんだ！", 2, 3012, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この部屋にも、\nもっとたくさん本棚が\n増えないかな～…？", 2, 3013, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたも魔法、\n覚えてみる？\n私、教えるよ！", 2, 3014, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お茶の時間に\nしたいな～…\n一緒にどう？", 2, 3015, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようっ！\n今日も素敵な\n一日にしようね！", 2, 3016, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯は\nちゃんと食べた？\n午後も頑張ろうね！", 2, 3017, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "つい本の続きが\n気になって、夜更かし\nしちゃうんだよね～…", 2, 3018, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ、気持ちいい～…\nちょっとだけ\n眠っちゃおうかな…", 3, 3020, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わあ、これ可愛い！\nグレアにも見せて\nあげたいな", 3, 3021, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～！\nなんだか気持ちが\n落ち着くね", 3, 3022, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あぁ、あったかくて\n幸せ～♪　身体が\nポカポカしてきたよ！", 3, 3023, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こ、これ美味し～！\n止められないよー！", 3, 3025, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふんふん…\n…はっ！　む、夢中に\nなっちゃってた…", 3, 3026, 109201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新しい建物に入ると\n必ず一度は迷子に\nなっちゃうですよ…", 1, 3028, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おやつはどこですか？\nお腹が空いて\nきちゃったですぅ", 1, 3029, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "宿題、７つぐらい\n出しそびれたですけど\nまあ大丈夫ですぅ！", 1, 3030, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "不思議なこと\nばかりですけど…\nまぁ大丈夫です！\nこれもせいしゅんです", 1, 3031, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なにか面白そうなもの\nないですかね～？", 1, 3032, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ここのみんなとも\nもうお友だちですぅ！", 1, 3033, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おなかが減ったです…", 1, 3034, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ごはんも美味しいし\nここはいいところです\nルゥは幸せですぅ！", 2, 3035, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "魔法の話ですか？\nそれはアンせんぱいに\n聞いてほしいですぅ…", 2, 3036, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたもお勉強\n苦手ですか？", 2, 3037, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ルゥの帽子、\nかわいいです？\nお気に入りですぅ♪", 2, 3038, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お友だちいっぱいで、\nルゥはうれしいです♪", 2, 3039, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "一緒にお勉強…！？\nぐえぇ、イヤですぅ！", 2, 3040, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ですねぇ…ふわわ…\nルゥはまだ夢の中に\nいたいですぅ…", 2, 3041, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午後もいっぱい\n遊ぶですよ～！", 2, 3042, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜ふかしって\nドキドキするです！\nせいしゅんですぅ！", 2, 3043, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかですぅ～♪\nおひるねが\nしたくなるですぅ！", 3, 3045, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これふかふかですぅ！\n机でうとうとする時の\n枕によさそうですぅ", 3, 3046, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふぁぁ、いいにおい…\nなんだか気持ちが\nよくなってきたですぅ", 3, 3047, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽっかぽかですぅ～！\nあったまったら\nまた遊びにいくですぅ", 3, 3048, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お、おいしいですぅ！\n全部ルゥに\nくださいですぅ！", 3, 3050, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本は…読むと、\nすぐ眠気がぁ…\n…ぐぅ…", 3, 3051, 109301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ピアノ…\nどこかにないかな？", 1, 3053, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…\n落ち着くな…", 1, 3054, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "マナリアはいつも\n賑やかなんだ…", 1, 3055, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みんな…\n今頃何してるかな？", 1, 3056, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "まさか違う世界に\n来ちゃうなんて…\nびっくりだよね…", 1, 3057, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "人と話すのは\n得意じゃないな…", 1, 3058, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ここのみんなと一緒に\n学院に通えたら…\nちょっと面白いかも", 1, 3059, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やっぱり、私の翼や\n尻尾…気になる？", 2, 3060, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一番得意なのは、\nやっぱり炎魔法かな…\n加減は難しいけど…", 2, 3061, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私の故郷は竜の国…\n険しい山脈を\n越えた先にあるんだ", 2, 3062, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アン…？\nあっ、ご、ごめんね！\n間違えちゃった…", 2, 3063, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふん…ふん…♪\n…わっ！\n今の、聞いてた…？\nは、恥ずかしい…", 2, 3064, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私に手伝えること、\nなにかある…？\nなんでも言ってね", 2, 3065, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の空気って\nすごく\n静かで透き通ってて…\nなんだか落ち着くよね", 2, 3066, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "学院食堂のランチも\n美味しいけど…\nここのご飯も好きかな", 2, 3067, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろベッドに\n行かないとだね\n…寝相、今夜こそ\n気を付けよう…！", 2, 3068, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "羽を伸ばしたく\nなっちゃうね…ふふ", 3, 3070, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わ、私が持つには\nかわいすぎるかな…\nでも、素敵だね", 3, 3071, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\nこれ、\nアンも好きそう…", 3, 3072, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "火を見ていると\n少し落ち着くんだ…\nへ、変かな？", 3, 3073, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "わ、美味しい…！\nこれ、どうやって\n作ったのかな…？", 3, 3075, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本…アンにも\n見せてあげたら\n喜ぶかな、ふふっ", 3, 3076, 109401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "着物はきれいですが\n歩きにくいです…\nいっそ脱いで…ぐふふ", 1, 3078, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あっ、いけません\n着物がはだけて…はっ\nもしやドＳさんが…！", 1, 3079, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この部屋は妄想する\nのにうってつけです…\nぐふふ…じゅるり", 1, 3080, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "扇をゆっくりと開く\nこの感触…なぜだか\n艶めかしさを感じます", 1, 3081, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "「マッサージをすると\n言いながらドＳさんの\n手は次第に」…ぐふふ", 1, 3082, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…ドＳさんの視線を\n思い出しながら踊りの\n練習です…イイ！", 1, 3083, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "よいではないか\nよいではないか～\nいけませんご堪忍を～", 1, 3084, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ～れ～～～！\nドＳさんもお好きな人\nですねぇ…ぐふふ", 2, 3085, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どこにいてもドＳさん\nの気配を感じ取れる\nようになりました…", 2, 3086, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こんな場所で\nなんというプレイを！\n…妄想でした", 2, 3087, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "クウカを押し倒して\nそのまま…じゅるり\nああっ、着物が…！", 2, 3088, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ドＳさんは優しいです\n優しいのにドＳとは\nさすが人格破綻者…！", 2, 3089, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ドＳさんの考えている\nことが伝わってきます\nはい…クウカ脱ぎます", 2, 3090, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "眩しい朝日がクウカの\n体を焦がします\n…それもイイ！", 2, 3091, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼のランチは\nクウカがいいだなんて\n大胆過ぎです…じゅる", 2, 3092, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "…今夜のドＳさんは\n大胆です…ぐふふ…\nはっ、視線が…！？", 2, 3093, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この心地良さ、\n心が休まりすぎて\n体が疼いてきます…！", 3, 3095, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "すごく愛らしいです…\n妄想も出てこない\nくらい…じゅるり", 3, 3096, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香りに包まれて\nいると、いい気持ちに\nなって…いきますぅ…", 3, 3097, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "「熱を帯びた体は\nどうしようもなく\n誰かを求め…」ぐふふ", 3, 3098, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹が膨らんで\nいきます…それは\nまるで…ぐふふ", 3, 3100, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クウカの探している\nジャンルはどこに\nありますかね？", 3, 3101, 109501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "カチョーフーゲツは\nトーゴクの心を\n表した言葉デスね", 1, 3103, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "オー！　新しい忍法を\n思いついたデス！\nさっそく試すデス！", 1, 3104, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "トーゴクの天気には\n槍が降る日も\nあるそうデス…", 1, 3105, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "我がショーグンは\n永遠にフメツデース\nいざ出陣デース！", 1, 3106, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "壁に耳あり\n障子に…ん？\nメアリーって誰デス？", 1, 3107, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ショーグンがいれば\nワタシはどんな\n忍法も使いこなせマス", 1, 3108, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "不届き者はどこで\nゴザルデス？　忍法で\n退治してくれヨウ！", 1, 3109, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ショーグン！　新しい\n忍法を覚えたデス！\n見てほしいデース！", 2, 3110, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "レッツ手裏剣道デス！\n投げてソウロウで\nゴザルデース！", 2, 3111, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふりかかる火の粉は\nワタシが払うデス！\nバンバン！", 2, 3112, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "とっておきの忍法が\n吹き荒れるデス！\nよそ見はダメデスヨ？", 2, 3113, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ショーグンは\n何階建てのお城を\n建てたいデスか？", 2, 3114, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "テンシュカクから\n平和な城下町を\n眺めてみたいデス…", 2, 3115, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございマス！\n本日はオヒガラモヨク\n良い日になりそうデス", 2, 3116, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すいたデース…\nショーグンもご飯に\nしまショウ！", 2, 3117, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "闇討ちに遭わぬよう\n夜は気を付けて\n歩くデスよー？", 2, 3118, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "天下分け目の\n戦いに備えて…\nマッタリデース", 3, 3120, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "口寄せの術で\n召喚したいくらい\nかわいいデース", 3, 3121, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂いデ～ス\n香り玉の開発の\n参考になりそうデスね", 3, 3122, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ワタシの懐よりも\nゾーリが暖まりマス…\nライバル出現デス…！", 3, 3123, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "腹が減っては\n戦はできぬデース！\n天下統一に向けて\n腹ごしらえデス！", 3, 3125, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ムム、暗号文デス！？\n解読には時間が\nかかりそうデース…", 3, 3126, 109601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "掃除も終わりましたし\nそろそろ、食事の\n準備をしなくては", 1, 3128, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "異世界の演劇…\n許されるならば、\n観てみたいです", 1, 3129, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こちらの世界には、\nマヨネーズが普通に\n存在するのですね…", 1, 3130, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こちらの世界は食材も\n面白い物が多いですね\nなにかレシピを\n考えてみましょうか", 1, 3131, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "みょんみょんみょん…\n魔法の練習は\nこれぐらいですね", 1, 3132, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "倒木の撤去で思わぬ\n収入となりました\nサレン様に\nお渡ししておかないと", 1, 3133, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "料理を美味しく\n召し上がって頂けると\nメイド冥利につきます", 1, 3134, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お出かけでしたら、\nレムも同行\nさせてくださいね", 2, 3135, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "レムにできること\nでしたら、なんでも\nお申し付けください", 2, 3136, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "じーー。いえ、\nその髪の長さが少し、\nとても少し、かなり\n少し気になったもので", 2, 3137, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "鉄球ですか？\nあれは護身用ですので\n問題はありませんよ？", 2, 3138, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "計算の勉強は\n進んでおりますか？\nレムでよろしければ、\nいつでもお教えします", 2, 3139, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次はもっと、大きな\n魔物料理に挑戦します\nワイバーンの姿焼き\nなんてどうでしょうか", 2, 3140, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n朝食の準備が\nできておりますので、\n食卓におこしください", 2, 3141, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食の時間ですね\n何か食べたいものは\nありますか？", 2, 3142, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝ないのか、ですか？\nメイドの就寝は、\n屋敷で最後と\n決まっておりますので", 2, 3143, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふんわり…\nこのふんわりさは、\n鬼をも黙らせます…", 3, 3145, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ…異世界でも\nかわいいものは\n共通なのですね", 3, 3146, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "よい香りですね\n魔女教の悪臭とは\n大違いです", 3, 3147, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぬくぬくです…はっ！\nこれはいけません！\n人を…いえ、\n鬼をだめにします！", 3, 3148, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむはむ…美味しい！\nこの味を再現できたら\n褒めてもらえる\nかもしれません…！", 3, 3150, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "絵がいっぱい…\n異世界の本は\nとても面白いですね", 3, 3151, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "異世界であろうと、\nラムのやるべきことは\n変わらないわ\nまずは休憩するわよ", 1, 3153, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "マヨネーズがある\nということは、\nバルスの故郷が近い\nのかもしれないわね", 1, 3154, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この世界では、バルス\nの言う言葉が使われる\nときがあるのね\n忌々しいかぎりだわ", 1, 3155, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ラムたち以外にも\nメイドが居るのね\nラムが…いえ、\n仕事を押しつけるわ", 1, 3156, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…千里眼で視るかぎり\n周囲に異変はないわね\n危険がないなら、\nあとはレムに任せるわ", 1, 3157, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…ラムもまた、\n「お姉ちゃん」って\n呼ばれる日が\nくるのかしらね", 1, 3158, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ハッ！　ラムが作る\n蒸かし芋は完璧ね\n…気が向いたら、また\n作ってやろうかしら", 1, 3159, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ラムに構う暇が\nあるなら働きなさい\nそうすれば、\nラムが楽をできるわ", 2, 3160, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ラムに何かを\n期待しても無駄よ\nラムに命令できるのは\nロズワール様だけだわ", 2, 3161, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "暇なら買い物に\n付き合いなさい\n荷物を\n持たせてあげるわ", 2, 3162, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ラムになんの用？\nふざけた内容なら\nねじ切るわよ", 2, 3163, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "そういえば、あなたは\n記憶喪失だったわね…\n思い出す努力をなさい\n…家族が悲しむわよ", 2, 3164, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "蒸かし芋が欲しい？\n随分と厚かましいわね\n…まだ残りがあるから\n好きに食べなさい", 2, 3165, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "だらしない顔ね\n顔を洗って\nしゃんとなさい", 2, 3166, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹が空く時間ね\nラムの昼食を\n用意させてあげるわ", 2, 3167, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "メイドが寝るのは\n屋敷で最後…\nラムが寝るために、\nさっさと寝なさい", 2, 3168, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…ここから動かない\nという、誓いを\n立てたくなるわね", 3, 3170, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これは…かわいいわね\nもちろん、\nラムほどではないけど", 3, 3171, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…香炉かしら？\nこちらの世界にも\n質のよい物があるのね", 3, 3172, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "見つけてしまったの\nかもしれないわ…\nラムの楽園を！", 3, 3173, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "…はむっ\nラムの蒸かし芋ほど\nではないけど、\nなかなかいけるわね", 3, 3175, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "異世界ならではの\n面白い内容もあるわね\nとても興味深いわ", 3, 3176, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねえパック、\nにゃんにゃか\nにゃかにゃんしよっか", 1, 3178, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "時間もあるし、\nこっちの世界の石で\n石積みしようかな", 1, 3179, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私もお姉さんだし、\nサレンさんを\n見習わないと…うん！\n私、すごーく頑張る！", 1, 3180, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この世界は、銀髪で\nハーフエルフでも受け\n入れてくれるのね…\nなんだか嬉しいな", 1, 3181, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "今日のご飯…\nピーマルは\n入ってないわよね…？", 1, 3182, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "また、みんなで\n一緒に買い物に\n行きたいな", 1, 3183, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "パック以外から\n家族って呼ばれたの\n初めて…ふふっ♪\nちょっと嬉しいかも！", 1, 3184, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今からパックの\n毛繕いをするけど…\n一緒にする？", 2, 3185, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私も何かお手伝いを…\nあ、そうだ！\n料理とかどうかな！", 2, 3186, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねえ、ここで\n歌の練習って、\nしてもいいかな？", 2, 3187, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…あ、ごめんなさい！\n話しかけられるのって\nあまり慣れてなくて…", 2, 3188, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "すごーく頑張るから、\nこれからも勉強を\n手伝ってね", 2, 3189, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "せーの、びくとりー！\nふふっ…また、一緒に\nラジーオタイソー\nしようね♪", 2, 3190, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ちゃんと起きてる？\nふふっ…よかった。\nあ、べ、別に心配した\nわけじゃないからね？", 2, 3191, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯が楽しみね♪\nあ、こっちの世界って\nまよねーずはあるの？", 2, 3192, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ寝る時間よ。\n夜更かししたら、\nめっ！　だからね！", 2, 3193, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "勉強も終わったし…\nちょっ、ちょっとだけ\n休んでもいいよね…？", 3, 3195, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい…！\nパックのかわいさに\n匹敵するかも…！", 3, 3196, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "良い香り…\nロズワールの屋敷にも\nこういうのって\nあるのかな？", 3, 3197, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\nずっとここに…はっ！\nダメダメ！　王選の\nために勉強しないと！", 3, 3198, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あ…これ美味しい！\nこっちの世界は色んな\n食べ物があるのね。", 3, 3200, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "知らないことが\nいっぱい書いてある…\n異世界の本って、\n面白いのね", 3, 3201, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海ってマジ最高！\nビーチの撮影も\n超楽しいしー♪", 1, 3203, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "20パーって何パ？\n今度ヒデサイに\n聞いてみよっ！", 1, 3204, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "夏の思い出を\nヒデサイと一緒に\n作りたいな～", 1, 3205, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "テンションあがる\n水着ゲットして\n超ラッキーだよ～♪", 1, 3206, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "休憩が終わったら\n撮影にもどらないと！\n気合入れてこ♪", 1, 3207, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒデサイとビーチで\nパーティーしたいな～\n超楽しそうだよね！", 1, 3208, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒデサイといると\n楽しくてうれしくて…\nカレシってこんな感じ\nなのかなぁ？", 1, 3209, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "見て見て～！\n夏らしいネイルに\nしてみたんだ～♪", 2, 3210, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ヒデサイ～\nこの水着どうかな？\nイケてるっしょ♪", 2, 3211, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "水着姿の写真？\nもちいいよ！\nかわいく撮ってね！", 2, 3212, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うちだって\n夏の海みたいに\nキラキラしちゃうよ！", 2, 3213, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒデサイとうちの\nフィーリングって\nめっちゃエモいよね♪", 2, 3214, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねーねーヒデサイ！\n一緒に泳ぎにいこっ！\nほら、手繋いで♪", 2, 3215, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "水着オッケー！\nネイルもばっちり！\n朝から遊んじゃおー♪", 2, 3216, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼食べたら\n昼寝して\nリフレッシュしよー♪", 2, 3217, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "水着ってマジで\n最強かも…このまま\nお風呂にも入れるし♪", 2, 3218, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "マジ気持ちいいー♪\nおに癒やされるん\nですけど～！", 3, 3220, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "やばばばばー！\nかわいすぎだってば！\nマジらぶだよ～♪", 3, 3221, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ、この香り超好き！\nモデル仲間に\n教えたげよ～♪", 3, 3222, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い♪\n夏の太陽みたい！", 3, 3223, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "マジ美味しいねこれ♪\nビーチで\n流行っちゃうかも！", 3, 3225, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏のために\n最新ファッションを\n勉強ちう！", 3, 3226, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "なにコレもにカワ～♪\nなんて生き物？\nヒデサイ知ってる？", 3, 3228, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "うわっ超フカフカ～\nなんかうち眠く\nなってきちゃった…", 3, 3229, 110001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海の家でのんびり\n過ごしましょう\n熱中症には注意してね", 1, 3230, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ、どうやったら\n泳げるように\nなれるのかしら～", 1, 3231, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海で日焼け止めを\n塗らないと、あとで\n大変なことになるわよ", 1, 3232, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "久しぶりに水着を\n着たんだけど\n変じゃなかったかな…", 1, 3233, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "波の音って落ち着くわ\n授業中に聞いたら\nみんな寝ちゃうかも？", 1, 3234, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海が楽しいって\n思えたのも\nあの子のおかげね", 1, 3235, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの子と二人で海に\n来られてよかったわ\n一日があっという間ね", 1, 3236, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "男の子と海だなんて\n少女漫画みたいで\n憧れてたの～", 2, 3237, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏休みの宿題は\nちゃんとやった？\n遊んでばかりではダメ", 2, 3238, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "昼の海と夜の海\nどっちが好き？　私は\n君といる海が一番よ", 2, 3239, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふう、疲れたわ～\n冷たいジュースで\n元気回復ね！", 2, 3240, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海で見た君の背中\nすごく大きく見えたわ\nやっぱり男の子なのね", 2, 3241, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "君と一緒に見た\n夜の海…\n忘れられそうにないわ", 2, 3242, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "準備ができたら\n海に出かけようよ\n今日も楽しみましょう", 2, 3243, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あら、もうお昼？\n海の家でランチに\nしましょ♪", 2, 3244, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海岸についてきて\nくれる？　暗がりは\n一人じゃ怖くて…", 2, 3245, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "泳ぐ練習をしたら\n疲れちゃったわ～\nちょっと一休み…", 3, 3247, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいわね～\n浮き輪に乗せて\n海に浮かべたいわ～", 3, 3248, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この匂い…\nなんだか夏の海を\n思い出すわ～", 3, 3249, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "夜の海風で冷えない\nように、しっかりと\n身体を暖めましょうね", 3, 3250, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "海で遊ぶ前に\nしっかり食べて\n体力つけましょう", 3, 3252, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏休み中でも\nしっかりお勉強\nしないと！", 3, 3253, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この子に乗れば\n海の上でも\nすいすい進めるかしら", 3, 3255, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ビーナスの誕生！\n…なんちゃって\nはしゃぎすぎかしら？", 3, 3256, 110101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夏の海には商機が\nあるはず…\nのがす手はないわね♪", 1, 3257, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしが作った\n日焼け止め…\nこれは売れそうね！", 1, 3258, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "子どもたちのために\n浮き輪を用意して\nおかないと…", 1, 3259, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海っていいわよね！\nみんなで羽を伸ばしに\n行きたいわ！", 1, 3260, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "波の音を聞いて\nのんびりするのも\n悪くないわね…", 1, 3261, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ただの砂遊びも\nあんたと一緒なら\n楽しいから不思議ね…", 1, 3262, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたがあたしの\nなんであれ、大切な\n存在ではあるのよね…", 1, 3263, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夏の海って\nすごい人よね…\n迷子にならないでよ？", 2, 3264, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぼんやり海に浮かんで\n波に揺られるのも\n悪くないわよ？", 2, 3265, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ビーチで子どもたちと\n一緒に砂のお城を\n作りたいわ♪", 2, 3266, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海で食べる\n焼きそばパン…\nいいかもしれないわね", 2, 3267, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あたしの水着\n似合ってる？\nそう、ありがとう♪", 2, 3268, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたが居ると\nうれしい…って、\n子どもたちが\n言ってたわ！", 2, 3269, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の浜辺って\nいいわよね\n散歩しに行きたいわ", 2, 3270, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "海の家のご飯って\nなんであんなに\nおいしいのかしら♪", 2, 3271, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海って、\nロマンチックよね。\nずっと眺めてたいわ…", 2, 3272, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "やわらかくて\n気持ちいい…\nこのまま寝ちゃいそう", 3, 3274, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海に一緒に入れる\nぬいぐるみとか\nないかしら？", 3, 3275, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏らしい\nいい香りね…\nなんの香りかしら？", 3, 3276, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\n濡れた体を乾かすには\nちょうどいいわね♪", 3, 3277, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "泳いだ後の食事は\n普段の何倍も\nおいしく感じるわね！", 3, 3279, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "海に行く前にいろいろ\n調べなきゃね。備え\nあれば憂いなしよ！", 3, 3280, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "海の守り神？\nずいぶんかわいらしい\n神様ね♪", 3, 3282, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "このぐらい\n大きな貝があったら\n食費も浮くかしら？", 3, 3283, 110301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "浜辺で食うものって\nなんであんなに\nうまいのかな～", 1, 3284, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いてて…\nちょっと日焼け\nしすぎたかな", 1, 3285, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "砂浜で走ると\nいいトレーニングに\nなるんだぜ", 1, 3286, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏ならではの\n料理…か\n何がいいかな…", 1, 3287, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "やっぱりここは\n涼しくて快適だな", 1, 3288, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "泳ぎの練習だったら\nいつでも付き合って\nやるからな！", 1, 3289, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着で部屋の中に\nいるのって\n変な感じだな…", 1, 3290, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うおっ！\nきゅ、急に\n触るなって…\nびっくりした", 2, 3291, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "え、砂がついてた？\n払ってくれたのか\nありがとよ", 2, 3292, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "夏バテしてないか？\nここで休んでけよ", 2, 3293, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…そう見られると\n照れるっていうか…", 2, 3294, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "カキ氷とか\n食いたくないか？\n氷、削ってやるよ", 2, 3295, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おまえと\n夏の思い出ができて\nよかったよ", 2, 3296, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふう…\n朝一番で泳ぐの\nやっぱ気持ちいいな", 2, 3297, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "一番あちぃ時間だ\n水分補給は\nこまめにな！", 2, 3298, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日もお疲れ\n明日のパトロールも\nよろしくな", 2, 3299, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "泳ぎ疲れたからな\n少し休憩だ…", 3, 3301, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい…\nいや、なんでもねぇ！", 3, 3302, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り落ち着くな\nこういうのも\n悪くねーかも…", 3, 3303, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったけえ…！\n泳ぎ終わった後って\nけっこう体冷えてよ…", 3, 3304, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "海で食べると\nまた一味違うよな", 3, 3306, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏のサバイバル特集…\nちょっと読んでみるか", 3, 3307, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "へー！　こいつ、\nよくできてんな！\nいいなあ、実物も\n乗れたらいいのに", 3, 3309, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "か、かわ…！\nいや、じゃなくて\nあ、あたしがここに\n寝ていいのか…？", 3, 3310, 110401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "故郷の花を飾っても\nいいかな～？\n部屋が楽しくなるよ～", 1, 3311, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "水着で歩いてると\n泳ぎたくなるさ～\n我慢できないさ～！", 1, 3312, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "夏が眩しいのは\nてぃーだがにこにこ\n笑ってるからさ～！", 1, 3313, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "泳ぎ疲れたら\n涼しい木陰で\nお昼寝するさ～", 1, 3314, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クロールも\n犬かきも\n大得意さ～！", 1, 3315, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なんだか歌いたい\n気分さ～\nキミもどう～？", 1, 3316, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "海の近くに住んで\nキミと歌って踊って\nそれが理想さ～！", 1, 3317, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私とキミ\nどっちがたくさん\n泳げるか\n競争するさ～！", 2, 3318, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キミも三線に興味が\nあるのかな～？\n私が教えるさ～！", 2, 3319, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "嫌なことがあっても\n私と歌って踊れば\nなんくるないさー！", 2, 3320, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "たまには時間を忘れて\n私とのーんびり\n海を眺めるさ～", 2, 3321, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ぶるぶるぶるっ！\n毛が濡れちゃっても\nへっちゃらさ～！", 2, 3322, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "泳ぐ前は準備体操～！\n背中押してあげるから\nしっかりやるさ～！", 2, 3323, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の浜辺は\nちゅらさんよ～\n一緒に歩こうよー！", 2, 3324, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯は\n決まったかな～？\n私はタコライスさ～！", 2, 3325, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "星と波音の中で\n三線鳴らすのも\nオツなものさ～", 2, 3326, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょうどよかったさー\nゆっくり休んだら\nまた泳ぎに行くさ～！", 3, 3328, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "砂浜に飾って\nおきたいさ～\nきっとかわいいさ～！", 3, 3329, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん…はあ\n癒されるさ…\n故郷の夏の匂いさ～", 3, 3330, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おおー…！\n濡れた髪が\nみるみる乾いてくさ～", 3, 3331, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ん～！　これ、\n海で食べたら\nもっとおいしいさ～", 3, 3333, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "海の生物図鑑ね～\nこの前みかけた魚も\n載ってるかな～？", 3, 3334, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "わぁ～！　みてみて！\n背中に乗れるさー！\nキミと一緒に\n乗りたいさ～！", 3, 3336, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふかふかさ～\n海の底の\n人魚になった気分さ～", 3, 3337, 110501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あの人が\nわたしの騎士だったら\nいいのにな…", 1, 3338, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あなたのおかげで\nわたしの心はいつも\nお腹いっぱいです♪", 2, 3339, 105801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "許されるのならば、\n今すぐにでも、\n主さまのおそばに\n行きたいです…", 1, 3340, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "主さま…\nお慕いしております…\nいつまでも、おそばに\n居させてください…", 2, 3341, 105901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "なんか最近、\nあいつのことしか\n考えてない…\nあたし…どうしよう…", 1, 3342, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "そ、外に行くなら、\n連れていきなさいよね\nその…あたしが\n守ってあげるから…", 2, 3343, 106001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "部屋の中は涼しくて\n気持ちええどすなぁ\n天国やわぁ", 1, 3344, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クラゲはんって\nフリルいっぱいの\nドレスみたいやねぇ", 1, 3345, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "外でセミはんが\n元気に鳴いてはるねぇ\n今日もええ天気やわぁ", 1, 3346, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こないに暑いと\n海に入って\n涼みたくなるわぁ", 1, 3347, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "いつか\nマホマホ王国にも\n海の家作りまひょ♪", 1, 3348, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "うちも\n付き合いますえ\n泳ぎの練習しまひょ♪", 1, 3349, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うちの里帰り\n王子はんも一緒に\n来まへんか？", 1, 3350, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "王子はんは日焼けより\n色白美人の方が\n好きでっしゃろか？", 2, 3351, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うちと一緒に\n浮き輪で海、\nプカプカしまへん？", 2, 3352, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "日が落ちたら\n線香花火\nやりたいわぁ♪", 2, 3353, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "木陰でのんびり\nお昼寝…\n最高やね～", 2, 3354, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お祭ではぐれても\n王子はんなら見つけて\nくれはります？", 2, 3355, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "楽しい夏やわぁ\nずっとこんな日が\nつづくとええね", 2, 3356, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "うちにしては早起き？\n暑くて目が早う\n覚めてもうたんどす", 2, 3357, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼は冷たい\nおそうめんとか\nどうでっしゃろ", 2, 3358, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜は星がきれいやね\n二人で浜辺でも\n行きまへんか？", 2, 3359, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うーん、遊び疲れた\n身体にちょうどええ\nほっこり具合やわぁ", 3, 3361, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かいらしい子は\nみーんな\nマホマホ王国の\n住人どすえ♪", 3, 3362, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…\n南国にいる気分やねぇ\n癒されるわぁ～", 3, 3363, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これで\n冷えた身体も\nポカポカやねぇ", 3, 3364, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "外はまだ暑いやろうし\nバテんよう\nしっかり食べんとね", 3, 3366, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "海の中にもお城が\nあるんやねぇ\n行ってみたいわぁ", 3, 3367, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この子、ふかふかやね\nこのままマホマホ王国\n乗せてってくれはる？", 3, 3369, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "人魚姫になっても\n最後は王子はんと\nハッピーエンド\nどすえ～", 3, 3370, 110601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "真似したくなる\n人がここには\n大勢いますね", 1, 3371, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "偽物を一人\n紛れこませました\n…冗談です", 1, 3372, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "動物に変身して\nその辺りを\n散歩してきます", 1, 3373, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "失った記憶は\nどの程度回復するの\nでしょうね", 1, 3374, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "人や物だけでなく\nいずれは世界すら\n真似てみせます", 1, 3375, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "次は彼に\nどんなことを\n教えましょうか…", 1, 3376, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "知識はともかく\n私の力はまだ\n必要なようですね", 1, 3377, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうしました？\n…何でもない？\n…そうですか", 2, 3378, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "退屈しています\n芸でもして\n楽しませなさい", 2, 3379, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "研究のためです\n少し話し相手に\nなりなさい", 2, 3380, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "何か真似して欲しい？\n私の能力を何だと\n思っているのですか", 2, 3381, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "貴方にはまだ色々と\n教えるべきことが\nありますね", 2, 3382, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "随分多くの女性と\n知り合いなのですね\n驚きました", 2, 3383, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "…\nおはようございます\n…まだ朝ですよ", 2, 3384, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "食事にします\n…どうしました？\n早く持ってきなさい", 2, 3385, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "早く寝なさい\n夜更かしすると\n背が伸びませんよ？", 2, 3386, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "マサキより\n座り心地は\nいいですね", 3, 3388, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "意外に複雑な\n構造ですね", 3, 3389, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "真似るなら\n香りまで\n再現しなくては", 3, 3390, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "発火現象の\n模倣…なかなか\n難しいものです", 3, 3391, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "偽物や分身を作るには\nエネルギーが\n必要不可欠なのです", 3, 3393, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "暇つぶしには\nちょうどよさそうです\n…", 3, 3394, 107001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "学院かぁ…\n友達の作り方の\n授業はないかな？", 1, 3396, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "学院でぼっちに\nなったときのために、\n避難場所を\n探しておかないと…", 1, 3397, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぼっちの私が学院…\nな、なんだか\n目まいがしてきました", 1, 3398, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "クラスメイトに\n話しかける練習…\nむ、難しすぎます…！", 1, 3399, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "目指せ友達100人…\n無理かな…10人…\nや、やっぱり一人！", 1, 3400, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたと学院生活が\n送れるなんて、\nとっても\nうれしいです！", 1, 3401, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えへへ…\n学院でも、\nあなたと一緒に\n居られてうれしいな♪", 1, 3402, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "が、学院ってあんなに\n人が居るんですね…\n友達作りのイメトレを\nやり直さないと！", 2, 3403, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私にとって\n部活動とはＢＢ団！\n今日もたくさん\n活動しましょうね！", 2, 3404, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "休み時間は寝たふり…\nご飯はおトイレ…\nぼっち対策は完璧です", 2, 3405, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "学院で友達を作る\n勉強は完璧ですよ！\n購買部でパンを買って\n渡すんですよね！", 2, 3406, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "学院でも、\nBB団の活動を\nしていきましょうね♪", 2, 3407, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ぼっちに学院生活は\n厳しいですね…でも、\nあなたと一緒なら\n乗りこえられそうです", 2, 3408, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "もうこんな時間…\nあの…一緒に学院に\n行ってくれませんか？", 2, 3409, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ですね！\n言ってくれれば、\nパンでもお握りでも\n買ってきますよ！", 2, 3410, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日もぼっち…\nいつか友達と一緒に、\nパジャマパーティー\nしたいなぁ…", 2, 3411, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "森とは違う\n心地良さが…このまま\n眠っちゃいそうです…", 3, 3413, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい…この子を、\n話す練習の相手役に\nしてみようかな？", 3, 3414, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\nいつ友達ができても\nいいように、私の\n部屋にも置こうかな", 3, 3415, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こ、これは…\nぼっちで\n日陰者の私には\n暖かすぎます！", 3, 3416, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい…！\nお弁当にして、学院に\n持っていけないかな？", 3, 3418, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "学院の授業に\nついていくためにも、\n勉強しておこうかな…", 3, 3419, 110701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あんた、何してんの。\nいいけど、なんでも", 1, 3421, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "邪魔。どいて。\nいや怒ってないし。\nコレがフツーだから", 1, 3422, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いいけど、\n散らかしめの部屋だと\n片付けたくなるよね…", 1, 3423, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "暇なときは明日の\nコーデ考えてるよ。\n考えるのはタダだし", 1, 3424, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "昔よくシオリン\n構いすぎてハツネに\n文句言われたなァ…", 1, 3425, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なんかさ。あんたって\n謎に女子トモ多いよね\n…いいけど、べつに", 1, 3426, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねえ。あのさあ。\nあんた弁当で好きな\n具とかってあんの", 1, 3427, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ？　何。なんか用。\nや、ないならないで\nいいけど、べつに", 2, 3428, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ごめ、ちょっと\n黙っててくんない。\n明日の試験ヤバだから", 2, 3429, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "歩き方が静か？\n癖になってるんだよね\n足音を殺すの", 2, 3430, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うちの血液型？\n大雑把のОだけど。\nなんか文句あんの", 2, 3431, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひゃんっ！\nや、だからさ…急に\n話しかけんなっての", 2, 3432, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "な、何…あんまジッと\n見ないでくんない…\nなんか、その、ハズい", 2, 3433, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きは得意な方だと\n思うけど。昔から\nそれがデフォだったし", 2, 3434, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "こんな時間か…\n昼ごはん\nサクッと作っちゃお", 2, 3435, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あ？　夜遊び？\nはッ…そんなん\n５歳で卒業したっての", 2, 3436, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あーヤバじゃんコレ…\nふかついてる場合\nじゃないっつーのに…", 3, 3438, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんだこれ\nかわいいかよ", 3, 3439, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふーん。\nこの匂い…\nなんかいいじゃん", 3, 3440, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖炉はアドじゃん。\n煮物、焼き物、蒸し物\nいろいろ作れそう", 3, 3441, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "何コレ\n食べ物困んないじゃん\nうちにも一台くんない", 3, 3443, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本かァー…んー\n学校の勉強だけで\nいいかなァ…", 3, 3444, 110801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "イタズラってなにを\nしたらいいのかな？", 1, 3446, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "カップケーキ\n上手に作れました\n食べてくれるかな…", 1, 3447, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あの人、\nお菓子くれるかな？\nくれなかったら…ふふ", 1, 3448, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "オバケ…いないよね？\n怖くなんてないけど！", 1, 3449, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ハロウィンは\n楽しいけどオバケの\nお祭りなんだよね…", 1, 3450, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "にゃ～、にゃお～！\nちゃんと怖いかな？\n早く帰ってこないかな", 1, 3451, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人のことだから\nお菓子欲しがるよね…\n準備はバッチリです♪", 1, 3452, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えへへ。猫さんのお耳\nよく出来てるでしょ？", 2, 3453, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "触りましたね？\nイタズラしましたね？\nへんた～い！", 2, 3454, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "フー！　頭を撫でたら\n怒りますよ！　あれ？\n猫みたいでした？", 2, 3455, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "きゃっ！　も、もう、\n脅かさないでください\n怖くありませんけど！", 2, 3456, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お菓子ですか？\nありがとうございます\nハッピーハロウィン♪", 2, 3457, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ゴロゴロ…\nね、猫さんの真似です\n…似てましたか？", 2, 3458, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さぁ、お菓子作りを\n始めますよ。下準備は\n大事ですからね！", 2, 3459, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今、つまみ食い\nしましたね！？　あっ\nおやつの時間でしたか", 2, 3460, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "さぁ、ハロウィンの\n始まりです…ふぁ…\nね、眠くありません！", 2, 3461, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと疲れたかも…\nパーティの時間まで\nひと休みしなきゃ", 3, 3463, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私も今、こんな感じ\nなのかな？　こんなに\nかわいいといいなぁ", 3, 3464, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "甘い匂いがいっぱい…\nお菓子の香りかな？", 3, 3465, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "温かくなると、\n丸まりたくなって…\n…猫になっちゃう！？", 3, 3466, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ニンジンもこれくらい\nおいしければ\nいいのに…", 3, 3468, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ハロウィンの本、\nオバケがたくさん\n載ってて怖いかも…", 3, 3469, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "美味しそうなお菓子が\nいっぱい…これなら\nイタズラされませんね", 3, 3471, 111101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "たくさんいたずら\nできるから\nハロウィン大好き！", 1, 3473, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ハロウィンだから\nいつもよりすごい\nいたずらしたいな～！", 1, 3474, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カボチャを綺麗に\nくり抜いてすごく怖い\nランタン作っちゃお！", 1, 3475, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お菓子がたくさんで\nどれから食べるか\n迷っちゃうな～！", 1, 3476, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "どうすればみんなを\nびっくりさせられる\nかな～？", 1, 3477, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "カボチャ見てたら\nお腹空いて来たな～\nお菓子食べちゃお♪", 1, 3478, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "にいちゃんには\n特別ないたずらを\n用意してあげるね！", 1, 3479, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "カボチャにクラッカー\nを仕掛けて…わっ！？\nみ、見ちゃダメだよ！", 2, 3480, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ん？　なぁに？\nお菓子ほしいの？\nもう、しかたないな～", 2, 3481, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "にいちゃんの\n面白い仮装が\n見てみたいな～！", 2, 3482, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お菓子くれたお礼に\nとびっきりの\nいたずらしちゃうね！", 2, 3483, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "にいちゃんは\nハロウィンでも最高の\nいたずら相手だよ！", 2, 3484, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "にいちゃんと一緒に\nハロウィンパレード\n歩きたいな～！", 2, 3485, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようにいちゃん！\n仮装して出かける\n準備しなきゃ！", 2, 3486, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すいたな～\nもらったお菓子\n食べちゃだめかな？", 2, 3487, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "たくさんいたずらして\nもうクタクタ～\nミソギもう寝るね…", 2, 3488, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "やわらか～い…\nここでひと休みして\nまたいたずらしよう！", 3, 3490, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいもので\n油断させてわっ！\nってするのどうかな？", 3, 3491, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにお～い！\nいたずらのアイデアが\nわいてくるよ！", 3, 3492, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "もらったお菓子\nあったかくしたら\nおいしいかな～？", 3, 3493, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お菓子ばっかりじゃ\n飽きちゃうもんね！\nご飯も食べよう！", 3, 3495, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本のなかに\nいたずらのヒント\nないかな～？", 3, 3496, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "お菓子がたくさん！\n一人で食べていいの？\nやっぱりだめか～！", 3, 3498, 111201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お勉強は順調ですよ\nやっぱりお兄ちゃんの\nおかげなんでしょうか", 1, 3500, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お兄ちゃんとの\n思い出の場所\nまた行きましょうね", 2, 3501, 101101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えへへ～♪\nハロウィンの\nミイラさんうさぎさん\nぴょんぴょ～ん！", 1, 3502, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "るんたった～\nハロウィンハロウィン\n楽しいな～♪", 1, 3503, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハロウィンって\nどんなお菓子を\nもらえるのかな～？", 1, 3504, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お菓子をもらう\n練習をしなくちゃ！\nトリックオア\nトリート～♪", 1, 3505, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おにいちゃんと\nハロウィンするの\nミミ楽しみだな～♪", 1, 3506, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにいちゃんと\nいっしょにお菓子を\n食べたいな～", 1, 3507, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おにいちゃんと\n毎日ハロウィン\nできたらいいな～♪", 1, 3508, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えへへ～\nおにいちゃん！\nハッピーハロウィン♪", 2, 3509, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おにいちゃんも\nいっしょに\nハロウィンパレード\nしようね～！", 2, 3510, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミイラさんうさぎさん\nだぞ～…えへへ\nミミこわかったかな？", 2, 3511, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おにいちゃん！\nハロウィンのお菓子\nおいしいね～♪", 2, 3512, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにいちゃんと\nいっしょなら\nおばけさんも\nこわくないよ！", 2, 3513, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ミミね\nハロウィンも\nおにいちゃんも\nだ～いすき♪", 2, 3514, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おひさまさんも\nハロウィンの\nおようふく\n着たいかな～？", 2, 3515, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ねえねえおにいちゃん\nお昼ごはんはもらった\nお菓子でもい～い？", 2, 3516, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "まだハロウィン…？\nうぅん…眠くないよぅ\nでもちょっと…ふぁ～", 2, 3517, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか～♪\nおばけさんが\n中にいるのかな～？", 3, 3519, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わぁ、かわいい～♪\nミミといっしょに\nあそぼ～！", 3, 3520, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふわぁ～\nミミ、このにおい\nだ～いすき♪", 3, 3521, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいね～♪\nおばけさんも\nポカポカしてるかな？", 3, 3522, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい～♪\nおにいちゃんも\n食べようよー！", 3, 3524, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本\nおにいちゃんと\nいっしょに\n読みたいな～", 3, 3525, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "ハッピーハロウィン♪\nえへへ、お菓子が\nいっぱいだね～！", 3, 3527, 111301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここ、好きだよ。\nみんな優しいから…", 1, 3529, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なんかさみしいな", 1, 3530, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "知らない人怖いな", 1, 3531, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お部屋おっきいねー", 1, 3532, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ルナね…\nお昼寝したいかも", 1, 3533, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにいさん！\n今日は何して遊ぶの？", 1, 3534, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あのね、\nお料理教えてほしい！", 1, 3535, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あっ、おにいさんだ！", 2, 3536, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ルナは元気だよ！\nいいこだもん！", 2, 3537, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日は何しようかな", 2, 3538, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ルナと遊んでよ！", 2, 3539, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねーねー、\nルナとお出かけして！", 2, 3540, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おにいさんと、\n遊びたいなー！", 2, 3541, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふふっ！\nなんかまぶしいね！", 2, 3542, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ルナ、お腹空いたな", 2, 3543, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "どこに行こうかな？", 2, 3544, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ルナ、これ好きだな", 3, 3546, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい！　好き！", 3, 3547, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんかいい匂い！", 3, 3548, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいねー", 3, 3549, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ふふっ\nおいしいね", 3, 3551, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ルナ、\n眠くなっちゃう…", 3, 3552, 111401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "えへへ。あの人と\nランドソルでデート\nできたらうれしいな♪", 1, 3554, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あなたとなら\nどんなことだって\nできる気がするわ♪", 2, 3555, 105201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あーあ、退屈だな\nカレでも探しに\nいこうかな", 1, 3556, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この前のケンカは\n最高に燃えたなぁ\n…拳が疼いてきたぜ", 1, 3557, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "一体、この世界は\nどうなっちまったって\nいうんだ…？", 1, 3558, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "もう仕事の時間か\nボスも人使いが荒いぜ\n…ま、いいけどさ！", 1, 3559, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "オレたち以外に\nドラゴン族はあと何人\nいるんだろうな…", 1, 3560, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "カレの真剣な顔\n面白かったな\nまた遊びたいぜ", 1, 3561, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どうしてカレがそばに\nいると、腹の底から\n力が湧いてくるんだ？", 1, 3562, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "よっす！\nなんかオイシイ話でも\nあったりしない？", 2, 3563, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なあ、オレと遊ぼうぜ\n心配すんなよ。危ない\nことはよしとくからさ", 2, 3564, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうした。オレに\nケンカ売ろうってか？\n…ははは、冗談だよ！", 2, 3565, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ちょうど退屈してた\nところだ、特訓に\n付き合ってくれよ", 2, 3566, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ったくよぉ…\nオレがかわいいなんて\n冗談はもうよせよ？", 2, 3567, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次の仕事も一緒に\n来るだろ？　断っても\n連れて行くけどな！", 2, 3568, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！　今日の\n予定はまずケンカして\nで、その後もケンカだ", 2, 3569, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "よっす！\n腹ごしらえが済んだら\nオレと遊ぼうぜ！", 2, 3570, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜は危ないから\nあんま出歩くな？\n…だから面白えんだろ", 2, 3571, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "次のケンカに備えて\n今は休んでおくか…\n全力で暴れたいからな", 3, 3573, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ボスの飼ってる\nラーゴが、中に\n入ってるんじゃ？", 3, 3574, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ああ、たぎる匂いが\nする…ひと暴れ\nしたくなってきた！", 3, 3575, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おおぉ…\nオレの拳もなんだか\n熱くなってきたぜ…！", 3, 3576, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いつでも全力で\nケンカするために\n力を蓄えないとな", 3, 3578, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "やっぱりな…オレが\n知ってる地図とは\nまるで違ってやがる", 3, 3579, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さぁプレゼントで\n埋め尽くしてやろう！\n大いに喜ぶがいいよ！", 1, 3581, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "メリークリスマス☆\n聖夜の宴だ\n派手に楽しむとしよう", 1, 3582, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "煙突から入る？\nいいや、ワタシは\nいつでも正面からさ♪", 1, 3583, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "サンタクロースの\nお出ましだ！\n歓迎するがいいよ♪", 1, 3584, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "飾り付けが足りん！\nワタシが演出して\nやろうじゃないか！", 1, 3585, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "人の喜ぶ顔を見るのも\n悪くはないな…おっと\nワタシらしくないな☆", 1, 3586, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "プレゼントはまだか？\nワタシを喜ばせたら\nお返しは弾むぞ♪", 1, 3587, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ワタシを呼んだか？\n退屈な要件だったら\n覚悟しておくことだ", 2, 3588, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なんだ？\nワタシへの挑戦か？\nよし、受けた♪", 2, 3589, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おっと、当たらんよ\nワタシの乱数聖域は\n絶対だからな…♪", 2, 3590, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんだ、オマエも\n暇なのか？\n奇遇だな、ワタシもさ", 2, 3591, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なにか愉しいことでも\nしようじゃないか\nさぁ、何をする？", 2, 3592, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "こうもワタシに\n気安く触れるのは\nオマエくらいだよ…♪", 2, 3593, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝だろうと関係ない！\nさぁ愉しく苛烈に\n騒ごうじゃないか♪", 2, 3594, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "調子の出てくる時間だ\nしっかりワタシを\n愉しませてくれよ♪", 2, 3595, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "眠いなどと言わせんぞ\nまだまだ一日は\n終わらんからな！", 2, 3596, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いい具合じゃないか\nこのまま持って帰って\nしまおうか…♪", 3, 3598, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なかなか愛らしい\n造形をしているな？\nワタシには負けるがな", 3, 3599, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ほう、悪くない香りだ\n戦いの匂いをうまく\n隠してくれそうだ…♪", 3, 3600, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体が温まってくると\nひと暴れしたくなるな", 3, 3601, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ワタシの舌は厳しいぞ\n…ふーむ、なるほど\n認めざるをえんな", 3, 3603, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クリスティーナさんは\n知識の収集も\n欠かさないんだよ", 3, 3604, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "これは驚いたな\nだがもっと、もっとだ\nワタシを退屈させるな", 3, 3606, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "こんな戯れだって\n軽くこなしてしまう\nクリスティーナさんさ", 3, 3607, 111501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス！\nさあ、パーティーを\n盛り上げるよ！", 1, 3608, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "衣装一つで全然\n気分が違うね！\n最高のクリスマスに\nなりそうだよ！", 1, 3609, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ツリーのてっぺんの\n星って、なんだか\n欲しくなるんだよね", 1, 3610, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "めいっぱい\nクリスマスを楽しむよ\n遊びだって本気\nなんだからね！", 1, 3611, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "赤、白、緑、金\nクリスマスカラー\nってお洒落だよね", 1, 3612, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "雪、降らないかな？\nホワイトクリスマス\nってちょっと\n憧れるなぁ", 1, 3613, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミと過ごすこの\n楽しい時間がずーっと\n続けばいいのにな", 1, 3614, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "クリスマスライブ\nチケット用意するから\n絶対来てよね！", 2, 3615, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "カンパーイ！\nジュースだけど\nちょっと大人の\n気分だね", 2, 3616, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クリスマス衣装どう？\nかわいいでしょ\nあっ、どこ見てるの！", 2, 3617, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ねえ、後で街に\n行こうよ\n大きなツリーを\n一緒に見たいんだ♪", 2, 3618, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねえ、ダンスの練習に\n付き合ってくれない？\n大丈夫、手取り足取り\n教えてあげるから♪", 2, 3619, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年のクリスマスも\n隣にキミが\nいてくれたら\nうれしいのにな", 2, 3620, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "クリスマスって朝から\nドキドキしちゃうね\nなんだか子どもみたい", 2, 3621, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "パーティーの準備も\n大分進んだね\n一息ついて\nランチにしよっか", 2, 3622, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "静かな夜だね\n心臓の音まで\n聞こえちゃいそう…", 2, 3623, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ～、この絶妙な\n柔らかさ…\nいい仕事してるなぁ…", 3, 3625, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アイドル顔負けの\nかわいさ、ズルい！\nでもかわいい！", 3, 3626, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～、落ち着くなぁ\n今日はゆっくり\n眠れそうだよ", 3, 3627, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぬくぬく～\nどうしよう、ここから\n動きたくないなぁ", 3, 3628, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ダンスの練習もしたし\nちょっとくらいなら\nいいよね！", 3, 3630, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "アイドルといえど\nかわいいだけじゃダメ\n知識も必要だよね", 3, 3631, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "面白ーい！\nこの演出、ライブでも\nできないかな？", 3, 3633, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "もふもふ～♪\n寒い日には最高の\n抱き心地だね！", 3, 3634, 111601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "彼ともっとお話し\nしたいな…もう少し\n補習を増やそうかしら", 1, 3635, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "君のこともっともっと\n教えて欲しいな。私に\n補習授業してくれる？", 2, 3636, 101801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この姿ならあやつも\n子ども扱いできまい！\n…じゃがなぜか、少し\n物足りないような…", 1, 3637, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "時間もあるし、\n聖夜の宴の\n準備をするかのう♪", 1, 3638, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…わらわの知る聖夜と\n随分違うが、宴は宴\n楽しませて\nもらおうかのう♪", 1, 3639, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "大人の姿で\nできること…ふむ\n少しあやつを\nからかってやるか♪", 1, 3640, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…クリスマスは\n恋人たちの夜！？\nち、近頃の若いもんは\n破廉恥なのじゃ！", 1, 3641, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…あやつがおらんと、\n宴も物足りぬな\n…馬鹿者が\n早く帰ってこい…", 1, 3642, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "誰も見ておらぬな…？\n…よし、あやつへの\nプレゼントを\n準備するとしようか！", 1, 3643, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "クリスマスの\nチキンにケーキ…\nべ、別に楽しみになど\nしておらぬぞ！", 2, 3644, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この姿では、わらわの\n頭をなでるのは\n難しかろう…べ、\n別に残念ではないわ！", 2, 3645, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "メリー\nクリスマスじゃ！\nさあ、わらわのために\n宴の準備をするのじゃ", 2, 3646, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そんなにこの衣装が\n気になるのか？\n…だったら、直に\n触ってみるがよい♪", 2, 3647, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いつもと逆に、お主を\n子ども扱いしてやるか\nほれ、膝枕をしてやる\nからそばに来い♪", 2, 3648, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…せ、聖夜の予定は\n空けておくのじゃぞ？\nなんでって…\nな、なんでもじゃ！", 2, 3649, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "もう朝か…聖夜の宴が\n楽しみで…ではなく！\n準備のせいで、\nあまり眠れんかったぞ", 2, 3650, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "…ずっと雪が\n降っておれば、\n陽光が強いこの時間も\n怯えずにすむのにのう", 2, 3651, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "時は来た…\nさあ眷属よ！\nわらわと共に、\n聖夜の宴を楽しもうぞ", 2, 3652, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "良い椅子ではないか\nここから聖夜の宴を\n眺めるのもよいかもな", 3, 3654, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわい…こほん\nなかなか良い\nデザインをしておるな", 3, 3655, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふむ、良い香りじゃ\n聖夜の宴でも\nこれを使うとしよう", 3, 3656, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これが癒し…はっ！\nあやうく浄化される\nところであった…", 3, 3657, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ニ、ニンニクは\n入っておらぬよな？\n…うむ、美味じゃ♪", 3, 3659, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "聖夜は恋人たちの夜…\n…き、気になるわけ\nではないが、\n少し調べてみるか", 3, 3660, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "ほう…これは面白い\n魔法の使い方じゃな\nまるで本物の\n演劇のようじゃ", 3, 3662, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "こ、この程度の\nかわいさに誘惑される\nわらわでは…\nふわもこなのじゃ～♪", 3, 3663, 111701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おせち料理も\n魔物尽くしだったり\nしないわよね！", 1, 3664, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "初詣で何をお祈り\nしようかしら…\n定番でいいわよね？", 1, 3665, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "初日の出って\n特別な感じがして\nいいわよね…", 1, 3666, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "寒い中並んで飲む\n甘酒って不思議なほど\nおいしいわよね", 1, 3667, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "羽根つきで勝負…\nあいつにだったら\n勝てるかしら？", 1, 3668, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "年賀状になんて書こう\n…いろいろと\n恥ずかしくなるのよね", 1, 3669, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今年もあいつと\n居られること…\n結構うれしいわ", 1, 3670, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何じっと\n見てんのよ？\nお年玉はあげないわよ", 2, 3671, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おせち料理一緒に\n食べる？\n結構おいしいわよ", 2, 3672, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "羽根つきで負けたら\n顔に墨塗られるのよ\n覚悟しなさい！", 2, 3673, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "門松飾るから\nちょっと手伝って\nくれる？", 2, 3674, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたと一緒に\n初詣行くのも悪くない\n…かも", 2, 3675, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "初詣で何をお祈り\nしたか？　うっさい！\n内緒よ！内緒！", 2, 3676, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "もう朝なの…\n正月くらいゆっくり\n寝ていたいわよね…", 2, 3677, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おせちに飽きたら\n次は何を食べよう\nかしら…", 2, 3678, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ寝ましょ\nいい初夢が見られると\nいいわね", 2, 3679, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この格好でいるのも\nなかなか疲れるわね\n休憩～", 3, 3681, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい…う～ん\n鏡餅も顔を描けば\nかわいくなるかしら？", 3, 3682, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂いね\n落ち着いて\n眠れそう…", 3, 3683, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここでお餅焼いたら\n一段とおいしく\nなりそうね", 3, 3684, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "正月に食べるものは\nなんでもおいしく\n感じちゃうわね！", 3, 3686, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "魔物を使わない\nおせちを\n調べておかなきゃ…", 3, 3687, 112001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新年を気持ちよく\n過ごせるように\nお掃除がんばります！", 1, 3689, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "神殿に通っていたら\nいつの間にか足腰が\n鍛えられたような…", 1, 3690, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "神殿付近は屋台も\nあるので、良い香りが\n漂ってくるんですよ～", 1, 3691, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おせちを作れるように\nなれば、子どもたちも\n喜んでくれるかな…？", 1, 3692, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "コホォォォォォ…！\nふぅ、深呼吸すると\n落ち着きますね♪", 1, 3693, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お仕事以外の時も\nあなたと…い、いえ！\nなんでもないです！", 1, 3694, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと一緒だと\nなんだかポカポカ\nしてくるんです…", 1, 3695, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この格好をしていると\nなんだか神殿にいる\n気分になりますね", 2, 3696, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そういえば神殿で\n甘酒をもらったんです\nあなたも飲みますか？", 2, 3697, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あっ、髪飾りが\nズレちゃってました！\nいけないいけない…", 2, 3698, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひゃわっ！？\nく、くすぐったり\nしないでください～", 2, 3699, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "そ、そんなに\n見つめられると\nて、照れちゃいます…", 2, 3700, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今度、私が考えた\n運気上昇のおまじない\nかけてあげますね♪", 2, 3701, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n神殿のお手伝いに行く\n準備もしなきゃですね", 2, 3702, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼になりましたし\nご飯は私が作…\nえっ、ダメですか！？", 2, 3703, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日も早いですし\nそろそろ寝る支度を…\nふわぁ…", 2, 3704, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お掃除も終わったので\n少し休憩を…ふわぁ…\n急に眠気が…", 3, 3706, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新年を気持ちよく\n過ごせるようこの子も\nきれいにしましょう♪", 3, 3707, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "神殿のお香のような\n香りだと落ち着いて\n過ごせそうですよね", 3, 3708, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかですね～…\n甘酒も飲んで体の\n芯から温めましょう", 3, 3709, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "今年こそ\n料理も上手に…\nもぐもぐもぐもぐ…", 3, 3711, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "失敗続きだと\n逆に運が良くなる…\nほ、本当ですかぁ…？", 3, 3712, 112101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "キミにならもう\nどんな私を見られても\n大丈夫かな…♪", 1, 3714, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "なになにどしたのぉ？\nお姉さんが撫でたげる\nこっちにきなさぁい♪", 2, 3715, 103401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わたくしの舞を\n主さまは喜んで\nくださるでしょうか…", 1, 3716, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "年を越したあとに\n食べるおそばも\nおいしいです", 1, 3717, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "甘酒を飲むと\n心まで温まる\n気がいたします", 1, 3718, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "主さまのために\n真心を込めたおせちを\nご用意しなくては", 1, 3719, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おみくじを引くのは\nドキドキしつつも\n楽しいものです", 1, 3720, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "主さまの温もりは\n心まで温めてくれる\nようです", 1, 3721, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うまくできなくとも\n心を込めて精いっぱい\n舞いましょう", 1, 3722, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "主さま、この晴れ着は\n似合っている\nでしょうか？", 2, 3723, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お餅はゆっくりと\n召し上がって\nくださいまし", 2, 3724, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "主さまのお顔の\n福笑いなら、完璧に\nできる気がいたします", 2, 3725, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "主さまはどのような\n初夢をご覧になった\nのでしょう？", 2, 3726, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "甘酒の飲み過ぎは\nいけませんよ？\nめっ、でございます", 2, 3727, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "二人羽織とは\nあんなにも暖かい\nものなのですね…", 2, 3728, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n寒い季節の朝日は\nとても美しいですね", 2, 3729, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おいしくとも\n食べ過ぎは正月太りの\nもとでございます", 2, 3730, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "いい夢が見られるよう\n暖かくして\n眠るといたしましょう", 2, 3731, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか…\nこのまま\n寝てしまいそうです", 3, 3733, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたと一緒に\nお正月遊びを\n楽しんでみたいです", 3, 3734, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "神殿の独特な香りを\nおうちに持ち込むのは\nどうでしょうか", 3, 3735, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "風邪をひきませんよう\n暖かくいたしましょう", 3, 3736, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べ過ぎは\n正月太りの\nもとだというのに…", 3, 3738, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "主さまのために\n参拝の作法を\n予習しておきましょう", 3, 3739, 111901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…この杖、変身前には\n無いパーツがあるけど\nこれはどこから…うん\n考えないようにしよう", 1, 3741, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "フ、フリフリの\nかわいい衣装…はっ！\n素に戻ってはダメだ！", 1, 3742, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魔法探偵\nミスティ★カスミ！\n魔法の力で捜査開始！\n…練習終わりっと", 1, 3743, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "怪しい視線を感じる…\nまさか、近くに\n闇の力を持つ人が！？", 1, 3744, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "時間もあるし、\n魔法少女の修行を…\nじゃ、じゃなくて！\n探偵の仕事をしよう！", 1, 3745, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "助手くんとずっと\n一緒に居られるし、\n魔法少女も\n案外悪くないかも♪", 1, 3746, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "魔法少女の訓練のため\n助手くんの所に行こう\nかな…あ、あくまで\n訓練のためにね！", 1, 3747, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…髪型が急に\n変わって驚いた？\nき、気になるなら…\n少し触ってみるかい？", 2, 3748, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "助手くんは魔法少女に\nなりたいのかい？\nその場合は魔法騎士…\nいや、魔法助手とか？", 2, 3749, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "頭に浮かぶ呪文…\n強制変身…助手くん\n魔法少女とは\n呪いか何かなのかな？", 2, 3750, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ、あまり触らないで\nくれ…魔法少女になる\nと感覚が鋭くなって、\n耳も敏感に…ひゃう！", 2, 3751, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "や、やっぱりこの\n格好は変かな…え、\nかわいい？　じゃあ…\nいや、でも、う～ん", 2, 3752, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…この変身は助手くん\nのせいでもあるんだよ\nだから…せ、責任を\n取ってもらうからね！", 2, 3753, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう助手くん\nさあ、そろそろ\n街のパトロールに\n行こうじゃないか！", 2, 3754, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もうお昼…助手くん、\nそろそろ本業に戻ろう\n…その顔は何かな？\n私の本業は探偵だぞ！", 2, 3755, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜だけど、私は\nもう少し仕事をするよ\n魔法少女の強い体は\nこんなときに便利だね", 2, 3756, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気持ちいい…\nこの癒しを、魔法と\n論理の二つの観点から\n解明したいね…", 3, 3758, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ダ、ダメ！！\nここで感情のままに\n飛びついたら、私の\nイメージがぁ～！", 3, 3759, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "心が安らぐ香りだね…\n…今なら、魔法少女も\nすんなりと受け入れ…\nてはダメだっ！", 3, 3760, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\n魔法少女だろうと\n休息は必要だし、少し\n休んでいこうかな", 3, 3761, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "魔法少女も探偵も、\nやっぱり体が資本！\n食べられるときに\n食べておかないとね♪", 3, 3763, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…魔法少女\nセリイちゃんの本は\nどこにあるのかな？", 3, 3764, 112201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔法少女かぁ…\nせっかくだし思う存分\n体を動かしてみたいな", 1, 3766, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ニャットちゃん…\nこの格好を見て\n私って気づくかな？", 1, 3767, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ…\n今日はなんだか\n調子がいいかも", 1, 3768, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魔法は便利だけど\nあまり頼りすぎちゃ\nダメだよね", 1, 3769, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "さっき街で小さな子に\n声かけられちゃった\n照れるけどうれしいな", 1, 3770, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人がいると\nなんだかホッとする\n不思議…", 1, 3771, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "魔法少女になっても\nあの人への気持ちは\nずっと同じ…", 1, 3772, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日の私…ですか？\nはいとっても元気です\n…あなたのおかげかも", 2, 3773, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "よかったら魔法の\n練習に付き合って\nくれませんか？", 2, 3774, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あの…\nこの格好どうですか？\n似合ってると…いいな", 2, 3775, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…な、なんですか？\nあまり見られると\n恥ずかしいです…", 2, 3776, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私、あなたのそばに\nいられたら、それで…", 2, 3777, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "想い人と結ばれる\n魔法は…ひゃっ！？\n今の聞いてましたか？", 2, 3778, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n今日も街の平和の\nために頑張らなきゃ", 2, 3779, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹すきましたね。\nあの…一緒にランチは\nいかがですか？", 2, 3780, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あ、もうこんな時間…\nふふ、まだこんなに\n体力が余ってるのに", 2, 3781, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気持ちいい…\nこの気持ち良さは\nどんな魔法も勝てない", 3, 3783, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何これ、かわいい…\nお姉ちゃんにも\n見せてあげたいな", 3, 3784, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～、いい香り\n…これ、魔法で\n出せたりしないかな？", 3, 3785, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い\nえへへ…なんだか\nお姉ちゃんみたい", 3, 3786, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいなぁ、これ\n魔法少女になってから\n食欲旺盛かも…", 3, 3788, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふふ…\n魔法少女になっても\n読書はやめられないな", 3, 3789, 112301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "みらくるまほりん\nくるりんぱ～♪\n王子はんのために\n花嫁修業や～♪", 1, 3791, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あ、あのな王子はん\nできたらその…\nお姫さまだっこを\nお願いしてもええ…？", 2, 3792, 101001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やっぱりわたしたちの\nギルドハウスの\n居心地は最高ですね☆", 1, 3793, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "王宮じゃできないこと\nやっちゃいましょう♪\n例えば、えっと～…", 1, 3794, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そうだ、隠しておいた\nおやつがありました！\nまだ食べられますね☆", 1, 3795, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ごはんはみんなで\n楽しく食べましょう！\nそれが一番の\n調味料です♪", 1, 3796, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "やっぱりここが、\nわたしの帰る場所です\n…ただいま☆", 1, 3797, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なんだか物足りません\nきっと、あの人が隣に\nいないからですね…", 1, 3798, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どこを見ても、大切な\n思い出がたくさん\n詰まっていますね♪", 1, 3799, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "無礼者～、なんて\n冗談です♪　どんどん\n触っちゃってください", 2, 3800, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぷにぷにでしょう～？\nい～っぱい食べるのが\nぷにぷにの秘訣です！", 2, 3801, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "握手したいんですか？\nはい、にぎにぎ～！\nもう離しませんよ♪", 2, 3802, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "どうかしましたか？\n退屈してるんでしたら\nお散歩に行きましょう", 2, 3803, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ごはん王子♪\nわたしは王女ですから\nこれでピッタリですね", 2, 3804, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "大好きです～\n愛してます～\n…ほんと、ですよ♪", 2, 3805, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ごはんは大事です！\n山盛りごはんを食べて\n元気いっぱいですよ☆", 2, 3806, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹ぺこぺこになる\n時間ですね～！\nごはん特盛、一つ！", 2, 3807, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お腹いっぱい、今日は\nよく眠れそうですね♪\n明日もおいしい一日を", 2, 3808, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休憩休憩～♪\nお腹を休めて、次の\nごはんに挑みます…☆", 3, 3810, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいらしい\nぬいぐるみですね～\nキャルちゃんみたい☆", 3, 3811, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すんすん…この匂い\n食欲増進の効果が\nありそうですね…？", 3, 3812, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体温が上がってくると\n眠くなっちゃいます…\nほわぁ～", 3, 3813, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐもぐもぐもぐ\nむぐむぐむぐむぐむぐ\nはぐはぐはぐはぐはぐ", 3, 3815, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "教養を身に着けるには\n読書が一番です！\nえっと次のレシピは～", 3, 3816, 180401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アイドルらしくなる\nコツって、何か\nあるんでしょうか？", 1, 3818, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "色んな人と話すのが\n好きなんです。つい\n長くなっちゃって…", 1, 3819, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アイドルを目指すって\n決めてから、毎日が\nワクワクなんです♪", 1, 3820, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ちゃんとストレッチ\nしておかなくっちゃ\nよいしょ、よいしょ…", 1, 3821, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "リンちゃんミオちゃん\n二人に負けないように\n私、頑張ります！", 1, 3822, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私の笑顔は素敵だって\n誰かに褒められた…\nそんな気がするんです", 1, 3823, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私たちを支えてくれる\n誰かが、ずっと一緒に\nいてくれたような…", 1, 3824, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうかしましたか？\n何か困ってるのなら\nお手伝いしますよ！", 2, 3825, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "みなさん個性的で\n普通じゃない人ばかり\nいるような気が…", 2, 3826, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日はポカポカした\nいい天気ですね～\nお散歩日和です！", 2, 3827, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今、ミルクティーを\n淹れてたんです♪\nあなたも飲みますか？", 2, 3828, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私の得意なこと？\nうーんなんでしょう…\nあっ、肩たたきです！", 2, 3829, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "生・ハム・メローン！\nあ、ライブの掛け声を\n練習してたんですよ♪", 2, 3830, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます！\n今日も一日\n頑張りましょうね！", 2, 3831, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "しっかりお昼を食べて\n午後からも張り切って\nいきましょうね♪", 2, 3832, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ぐっすり眠れるよう\n早めに用事を済ませて\nお休みしましょうね", 2, 3833, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと休んだら\nレッスンの続きも\n頑張ります！", 3, 3835, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "えへへ～\nふわふわもこもこで\nかわいいです～♪", 3, 3836, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リラックスできる\nいい香りですね～♪", 3, 3837, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "わぁ、ポカポカです♪\n温かい飲み物も\nほしくなりますね", 3, 3838, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "レッスンしたら\nお腹が空いちゃって…\nぱくぱくもぐもぐ…", 3, 3840, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "レッスンに役立つ\n運動の情報とか\n載ってるでしょうか…", 3, 3841, 112401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "きらきらーん☆\nよし、次のステージは\nこれで行けるかも！", 1, 3843, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私の元気でみんなも\n元気になってくれたら\nうれしいな～", 1, 3844, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ちょっとレッスンで\n疲れちゃったかも…\nでも頑張るぞっ！", 1, 3845, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "晩ごはん何にしよう？\nそーだ、しぶりんにも\n聞いてみよっと！", 1, 3846, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "元気だから笑顔になる\nじゃなくて\n笑顔だから\n元気になるんだよね～", 1, 3847, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "声援を聞いてる時ね\nすごく懐かしいって\n思うことがあるんだ", 1, 3848, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私を応援してくれる\n一番大事な人が\n隣にいた気がする…", 1, 3849, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なになにー？\nミオちゃんに\n何か用かな～？", 2, 3850, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おっ、やっほー！\n元気そうだね～、キミ\n私？\nもちろん元気～！", 2, 3851, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねぇねぇ、ちょっと\n遊びに行かない？\nたまには息抜きで！", 2, 3852, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ね、この魔物料理さ\nプリンって言い張れば\n食べてもらえそうかな", 2, 3853, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "えへへ\nいつもありがとねっ！\nパワーもらってるよ～", 2, 3854, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どうしたどうした～\nミオちゃんの魅力に\nメロメロなのかい？", 2, 3855, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おっはよ～！\n一日の始まりだし\nテンション上げてこ！", 2, 3856, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空いた～…\nねぇねぇ、一緒に\nお昼食べようよ～", 2, 3857, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ～…\n眠くなってきちゃった\nそろそろ休もっかなぁ", 2, 3858, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わぁ、ふっかふか～！\nレッスンの疲れも\n吹っ飛んじゃうね☆", 3, 3860, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何これ…かわいーっ！\n早くしまむーに\n教えてあげなきゃ！", 3, 3861, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すぅ～…\nうんっ、これ私の\n好きな香りだな～♪", 3, 3862, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポッカポカだね～♪\n…あ～ん、ここから\n動きたくないーっ！", 3, 3863, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "わっ、おーいしー！\nこれはテンション\n上がっちゃうね♪", 3, 3865, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nふむふむふむ…！\n勉強になった、ブイ☆", 3, 3866, 112601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "なんでドキドキが\n止まらないの…？\n騎士くんのせいだー！", 1, 3868, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ドキドキしてるの\nあたしだけ、かな…\n騎士くんはどう…？", 2, 3869, 100101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "騎士クンの前で\n好きって言えるように\n練習しないと…", 1, 3870, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "騎士クン…大好き\n…き、騎士クン！？\nなんでここに！？", 2, 3871, 100201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "困ったな…\n彼が居ないだけで、\nここまで\n寂しいと思うなんて…", 1, 3872, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "えっと…\n今日は訓練じゃなくて\nその…二人でゆっくり\n過ごしたいな…", 2, 3873, 100301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アイドルの心構え…\nどういう風に考えると\nしっくりくるのかな", 1, 3874, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "何か始めるのって\nドキドキするよね\nだから最近楽しいんだ", 1, 3875, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "冒険者の時って毎日\nバタバタしてたけど…\n目標ができると違うね", 1, 3876, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "少しお腹が空いた…\nチョコレート一粒だけ\n食べようかな", 1, 3877, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ウヅキもミオも\n頑張ってるし\n私も負けられないね", 1, 3878, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "レッスンしてる時さ\n何か、誰かが足りない\nそう思うことがあるの", 1, 3879, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "大事なのは笑顔…\n誰か、大切な人から\n言われた気がするんだ", 1, 3880, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうしたの、何か用？\n手伝えることがあれば\nすぐに言ってね", 2, 3881, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "姿勢がいい？\n普段から鍛えてるし\n自然とそうなるのかも", 2, 3882, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "さっき散歩してたら\n犬を見かけたんだ\n人懐っこい子だったよ", 2, 3883, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今から冒険？\nなら私も一緒に行くよ\n前衛は任せておいて", 2, 3884, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今からレッスンに\n行くつもりだったんだ\n少し手伝ってくれる？", 2, 3885, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "蒼の剣を受けよ！\nえ、何してるのって？\nただの発声練習だけど", 2, 3886, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう、早いね\n今日は依頼もないし\nゆっくりしようかな", 2, 3887, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろお昼だね\nうーん、今日は\n何を食べよう…", 2, 3888, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\n明日も早いし\nそろそろ寝なくちゃ", 2, 3889, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "レッスンで疲れたし\nちょっとだけ\n休んでおこうかな", 3, 3891, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ、かわいい\nふわふわしたものって\n撫でたくなるんだよね", 3, 3892, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うん、いい香り…\nこういうものがあると\n落ち着くからいいよね", 3, 3893, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "温かい場所って\n居心地がいいから\nのんびりしちゃうよ", 3, 3894, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "レッスン頑張ったら\nすぐお腹が空くし\n食べておかないと…！", 3, 3896, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "アイドルのことを\nもっと勉強して\n成長しなくちゃ", 3, 3897, 112501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ああ、知りたい…\nなんでもかんでも\nとにかく知りたい…", 1, 3899, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ああ、眠い…\nいつでもどこでも\nとにかく眠い…", 1, 3900, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "君、気を付けたまえ\nぼーっと歩いていると\nほわっ！　転んだ…", 1, 3901, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ミツキ師にいただいた\n新作サプリ…丁度よい\n被験体はいないものか", 1, 3902, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "サレンディア救護院に\nユニちゃん８歳として\n潜入済みだが何か？", 1, 3903, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君がユニちゃんズの\n同志であること、\nぼくは誇りに思うぞ", 1, 3904, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ぼくは青春がしたい\nおい、君\nぼくと青春しないか", 1, 3905, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ああ、そうだな。\nぼくもそう思う。\n……えっ、何が？", 2, 3906, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "待て、話しかけるな。\n今の閃きをメモに…\n…ああっ、忘れた！", 2, 3907, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "歩き方が綺麗？\n何を今更なこと\n言っとるんだ君は", 2, 3908, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぼくの血液型？\n大らかのОだ。\n何か異論あるかね", 2, 3909, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君の声は精神に\n高揚をもたらすな…\n波形を分析したいぞ", 2, 3910, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "妙だな…最近\n君に話しかけられると\n心拍に乱れを覚える", 2, 3911, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おっと、朝だな。\nそろそろ寝るか、\n朝更かしは体に悪い", 2, 3912, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふむ、昼餉時か…\n今日のランチは\nサプリ定食にしよう", 2, 3913, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もう夜だな、\nそろそろ起きるか。\n最高の一日にするぞ！", 2, 3914, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ほわぁ～\n副交感神経が…\n優位に…ふふっひ", 3, 3916, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいすぎるな…\nセクシーユニには\nミスマッチか…", 3, 3917, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ほぁあアあァぁー…\nいい香りー…\nあアァあ…イイ…", 3, 3918, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "炎はいいぞ\nそこには人類発展の\nドラマがある", 3, 3919, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "フオオー！\n次から次へと固形食物\n原理気になるー！", 3, 3921, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "良書は時間を忘れる\n…ふむ、今度\n布団を持ってこよう", 3, 3922, 111001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "きらーん☆\nハツネちゃんに\n不可能はないのだ☆", 1, 3924, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "キミと一緒だと\n寝ちゃうのが\nもったいないよ～", 2, 3925, 101201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちぇるーん☆", 2, 3933, 192101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちぇる～ん☆\n今日もチエルは\nかわいいですよね～？", 1, 3951, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どこかに楽しいもの\n落ちてないかにゃー", 1, 3952, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "チエルのオキニは\n甘々カフェラテ！\nシクヨロでぇ～す☆", 1, 3953, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "先輩、ひまですよね？\nチエル遊んであげても\nいいですけど？", 1, 3954, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁー…しゅき…\nカルミナ尊い…\n一生すこれる…", 1, 3955, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "先輩、ひまー\nちょっとは構えよーう\nデュクシ！デュクシ！", 1, 3956, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "先輩なんか\nおごって～！\nてか…おごらなくても\nいいから遊んでよ…", 1, 3957, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "え、なんですか？\n告白だったら\n間に合ってますけど", 2, 3958, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと静かに！\n今ヤバかわポーズの\nイメトレ中なんです！", 2, 3959, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "足取りが軽やか？\nあー…ダンスとか\n習ってるからですかね", 2, 3960, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "チエルの血液型？\n大型新人のОです\n何か問題でも？", 2, 3961, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "先輩って何気に\nいい声してますよね\n言うことは変だけど", 2, 3962, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "え、なんですか？\nたまにだったら\n告白してもいいですよ", 2, 3963, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはちぇる～ん☆\nハイ、ご一緒に～？", 2, 3964, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日のランチは\nどこで\n映えよっかにゃー", 2, 3965, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "こんばんちぇるるん☆\nハイ、ご一緒に～？", 2, 3966, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかチエルン\n略して、ふかルン♪", 3, 3968, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいこの子と\nかわいいチエル！\n映ぁ～え～る～！", 3, 3969, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "かわいい香り～！\n持って帰ろっと！\nすぅーっ…", 3, 3970, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "マシュマロは\n焼かない方のが\nかわいくないです？", 3, 3971, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "チエル食べても\n太らない体質\nなんでぇ～！", 3, 3973, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "読書は好きですよ\nシンプルに楽しいし\nギャップ萌えでしょ？", 3, 3974, 110901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みんなのあたしを\n見る目が違うね\nま、気にしないけどね", 1, 3976, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日も疲れた～\nやる気ゼロだし\nもう寝ちゃおうかな", 1, 3977, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あたしの代わりに誰か\n働いてくれないかね", 1, 3978, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "労働の後に食べる\nあんパン最高～", 1, 3979, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "仕事の合間に\nちょっと一息いれよ\nあ～ドングリ美味し～", 1, 3980, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "報酬も入ったことだし\nあいつに何か\n買ってあげようかな", 1, 3981, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次の休みはあいつと\n一日中だらだら\nしたいな～", 1, 3982, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あたしは褒められて\n伸びるタイプなんだ\nだから褒めて褒めて", 2, 3983, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お、差し入れ？\n気が利くねぇ\nあんがと", 2, 3984, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しい依頼？\n今日はもう無理～\n閉店で～す", 2, 3985, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "サ、サボってないよ！\nちょっと休憩してた\nだけだから！", 2, 3986, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねえ、一緒に\nサボろうよ？\n働き過ぎはよくないよ", 2, 3987, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたが近くにいると\n仕事の疲れも\n和らぐんだよね～", 2, 3988, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "はぁ…もう起きなきゃ\nつらい労働の\nはじまりだ～", 2, 3989, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "うぅ、お昼に\nあんパン食べ過ぎた…\n苦しい…眠い…", 2, 3990, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日は仕事ないし\nガッツリ夜ふかし\nしちゃうよ～", 2, 3991, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "猫みたいに\n丸くなっちゃうよ～\nあたしリスだけどね", 3, 3993, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふかふか～\nあたしの尻尾と\n互角とはやるね～", 3, 3994, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あんパンの香りの\nアロマとか\nあればいいのにな～", 3, 3995, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これは危険な\nあたたかさだね～\n労働意欲が\nなくなるよ～", 3, 3996, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いっぱい働いたから\nいっぱい食べても\nカロリー０だよ", 3, 3998, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あたしだってたまには\n本くらい読むって\n全然似合わないけどね", 3, 3999, 112701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あたしの作った\nオリジナルたい焼き…\nあいつ、\n喜んでくれるかにゃ？", 1, 4001, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あ、お帰りにゃー♪\nえへへ…キミに\nお帰りって言えるのが\nなんかうれしいにゃ♪", 2, 4002, 104601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "フロンティア\nスピリッツを\nお見せするべ！", 1, 4003, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この鎧を着ると\n気が引き締まる\n感じがするべ", 1, 4004, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "搾りたての牛乳飲んで\n今日も一日\nがんばるべ！", 1, 4005, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みんなに牧場の\n乳製品を\n味わってもらいてぇべ", 1, 4006, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここはいいとこだべ\nうちの動物たちも\n連れてきてやりてぇな", 1, 4007, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "みんなオラより\n若ぇのに働いてて\n立派だべな", 1, 4008, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "牧場もギルドの\nみんなもオラが\nまとめて面倒見るべ！", 1, 4009, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さあ、今日も\n忙しくなるべよ\n気合入れてくべ！", 2, 4010, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お、あんちゃん\n丁度いいとこに！\n一緒に街に\n行商しに行くべ！", 2, 4011, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "牧場仕事で培った力が\n戦いでも役立つなら\n一石二鳥だべさ！", 2, 4012, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "疲れた時は牧場産の\nミルク菓子で\n糖分補給だべ", 2, 4013, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "これ、牧場の\n新製品だべ\n一番最初に味見\nしてほしいべさ", 2, 4014, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "働きづめはよくねぇベ\n膝枕してやっから\nこっち来るべさ", 2, 4015, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁあ…\n酪農家の朝は\n早ぇんだべ…", 2, 4016, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ごはんの時間だべ！\n腹が減っては酪農も\n戦いもできねえべ！", 2, 4017, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ寝るべ！\n健全なお笑いは\n健全な肉体に宿るべ！", 2, 4018, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "牧草みたいに\nふっかふかだべ～", 3, 4020, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子、目の感じが\nエリザベスに似てるべ", 3, 4021, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂いだべ～\n疲れた体に\nしみるべな～", 3, 4022, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったけぇな～\n牧場にも\n置いてみっかな～", 3, 4023, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うまいべ！\n生産者のこだわりを\n感じるべさ", 3, 4025, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "酪農も戦いも\nまずは知識だべ！", 3, 4026, 112801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぴょん、ぴょん♪\nこの服のおかげで、\n体が軽いなぁ…♪", 1, 4028, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今の内に部屋の\n掃除をしておこっと…\nみんな喜んで\nくれるといいなぁ", 1, 4029, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "耳と尻尾…この服、\n本当にウサギさん\nみたいだなぁ", 1, 4030, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんだか先輩の\n気配がするような…\n気のせいかな？", 1, 4031, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ウサギさんの真似を\nしたら、存在感が薄い\nとか言われないかな？\nア、アユミだぴょん♪", 1, 4032, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "えへへ…\nいつもとは違う先輩が\nたくさん見られて、\nうれしいな♪", 1, 4033, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "本の中の世界で先輩と\n旅をするなんて…\n幸せすぎて、罰が\n当たりそうだよぉ…", 1, 4034, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "じ～…はっ！？\nす、すみません！\n話しかけてもらえる\nなんて思ってなくて！", 2, 4035, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "先輩がすぐそばに…\nし、幸せすぎて\n倒れそうですぅ！", 2, 4036, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "え、えっと…あの…！\nうう…いざ先輩と\n向き合うと\n緊張しちゃうよぉ…", 2, 4037, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はうっ！？\nしょ、正面から見る\n先輩は、私にとって\n神々しすぎますぅ…！", 2, 4038, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "先輩…その…\nい、一緒にご飯でも\nどうでひゅか！\nうう…またかんだぁ…", 2, 4039, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "せ、先輩…\nハーブティーを\n入れたんですが、\n一緒にどうですか…？", 2, 4040, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "せ、先輩！\nおはようございます！\nえへへ、練習通りに\nバッチリ言えたぁ♪", 2, 4041, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あ、もうお昼ですね\n時計を持ってて\n良かったです", 2, 4042, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\nお休みする\n準備をしちゃいますね", 2, 4043, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ…ちょっとだけ\n先輩の匂いがする…\nえへへ、幸せだなぁ♪", 3, 4045, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…私もウサギさんの\nぬいぐるみとして、\n先輩のそばに…はっ！\n私ったら何を…！", 3, 4046, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ、いい香り…\n先輩もこういうのが\n好きなのかな？", 3, 4047, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "先輩が隣に\n居たら、もっと\n暖かいのになぁ…♪", 3, 4048, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい…でも、\n先輩と一緒に\n食べたら、もっと\nおいしいだろうな…", 3, 4050, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ウサギさんって、穴を\n掘ったりするんだ…\n私も、隠れたいときに\n掘ってみようかな？", 3, 4051, 113001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ネビアさまのように\n普段からパタパタと\n飛んでみるのも…", 1, 4053, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ご立派になられた\n主さまと並べるように\nもっと精進しなくては", 1, 4054, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "月々の食費が\n増えてしまいました\n申し訳ございません…", 1, 4055, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ワンワンのほうの\n主さまは、この姿に\n驚くでしょうか…？", 1, 4056, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "主さまと離れていても\n主さまとの絆は\n胸に感じております…", 1, 4057, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "このギルドハウスは\nみなさまの帰る場所…\nわたくしが守ります", 1, 4058, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どんな未来が\n待ち受けようとも\n主さまと添い遂げます", 1, 4059, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おでかけですか？\nではわたくしも\nお供いたします", 2, 4060, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もう二度と主さまと\n離れたくはありません\nいつ何時も…", 2, 4061, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なにかお困りごと\nでございますか？\nわたくしに何なりと…", 2, 4062, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "どうぞゆっくりと\n心ゆくまでくつろいで\nくださいまし、主さま", 2, 4063, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この羽で主さまを\nどこまでも遠く…\n高くへと導きます", 2, 4064, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さま、主さま…♪\nおそばにいられるのが\nうれしくて、つい…", 2, 4065, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n今日も一日、主さまの\nサポートをいたします", 2, 4066, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日も頑張っている\n主さまに、スタンプを\nもう一つ…ポン！", 2, 4067, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝付けないのでしたら\nわたくしが子守唄を\n歌ってさしあげます", 2, 4068, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか…\nまるで主さまのような\n柔らかさでございます", 3, 4070, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたも一緒に\n主さまと遊びますか？\n至福の時間ですよ♪", 3, 4071, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "主さまの優しくて\nくすぐったい匂いが\nたまらなく恋しいです", 3, 4072, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "主さまの心と\n繋がったときのような\n温もりを感じます", 3, 4073, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いけませんっ…！\n元の姿に戻ると、また\n食べてしまうのに…！", 3, 4075, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "主さまに読み聞かせる\n絵本は…妖精が主役の\n物語にいたしましょう", 3, 4076, 180501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "…彼のこと弟みたいに\n思ってきたのに…私、\nどうしたらいいの…？", 1, 4078, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "よ、予定がなかったら\nでいいんだけど…\nその、ふ、二人で\n訓練とか…どうかな？", 2, 4079, 104801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おめかしもしたし\nあとはお兄ちゃんを\n待つだけですね～♪", 1, 4080, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お兄ちゃんの身の回り\nをお片付け～、これぞ\nデキる妹アピール！", 1, 4081, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ、衣装がほつれてる\nこれくらいなら自分で\n繕えますね…！", 1, 4082, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この格好で歩いてると\n見慣れた景色も\n違うものに見えますね", 1, 4083, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "勉強もちゃんとします\n…でも、一人だと\n集中力がもちません～", 1, 4084, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんを大好きな\n妹が待ってますよ～\n…まだですかね～", 1, 4085, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんのために\n掃除洗濯をする私って\nお嫁さんみたい…\n…えへへ～", 1, 4086, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おに～いちゃん！\n縫い物、一緒に\nやりましょうよ！", 2, 4087, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "かわいい妹を\n愛でたくなりました？\n思う存分、どうぞ♪", 2, 4088, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わっ、ビックリした～\nもう、お兄ちゃんてば\nイタズラっ子ですね～", 2, 4089, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一緒にお買い物\n行きませんか？\n妹とデートですよっ♪", 2, 4090, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃん…頭を\n撫でてくれませんか？\nえへへ、これが一番♪", 2, 4091, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃん大好き♪\n何度でも言いますよ！\nお兄ちゃん大好きっ♪", 2, 4092, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよ～お兄ちゃん！\n妹モーニングコールの\n時間ですよっ♪", 2, 4093, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろ休憩ですね！\n甘いお菓子で\n元気回復しましょ～！", 2, 4094, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜更かし厳禁！\nでも、もう少しだけ\nお話ししたいなぁ～", 2, 4095, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふっかふかですよ！\nお兄ちゃんと一緒に\n座りたいなぁ…♪", 3, 4097, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このぬいぐるみの\nかわいさ…う～ん\n負けられません…！", 3, 4098, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "香りにも気をつかって\nパーフェクトな妹に\nなっちゃいますから！", 3, 4099, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ～ぬくぬくです～\nお兄ちゃんと一緒に\n温まりたいなぁ…♪", 3, 4100, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これは止まりませんね\nもぐもぐ…いくらでも\n食べられちゃいます", 3, 4102, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これ、デザインの\n参考になりそう！\n私にも作れるかなぁ", 3, 4103, 112901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "退屈です…\nなにか楽しいことは\nないですか？", 1, 4105, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ギャングの仕事は\n今日はお休みです\nのんびりするですよ", 1, 4106, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ひうっ！　あたしの\n尻尾なんて食べても\nおいしくないですよ？", 1, 4107, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふう…どうやら\n例の件はまだボスに\nバレてないですね…", 1, 4108, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "下克上…いい言葉です\nって、ボスに聞かれて\nないですよね…？", 1, 4109, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いつか絶対ビッグに\nなってやるです！\nあたしを信じるです！", 1, 4110, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あたしが覚醒したら\nきっと誰よりも\n強くなるはずです！", 1, 4111, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なんですか？\n貢ぎ物なら\nいつでも歓迎ですよ！", 2, 4112, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしだって\nやる時はやるですよ！\nその時がこないだけ！", 2, 4113, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "しりとり勝負ですか？\nいい度胸ですね、\nかかってくるです！", 2, 4114, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄さんは\nヒマそうですね…\nうらやましいです", 2, 4115, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "かまってほしいです？\nまったく…いいですよ\nしょうがないですね", 2, 4116, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄さんのことは\nこのあたしが\n守ってやるですよ！", 2, 4117, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "デキるギャングの\n朝は早いのです…\nふぁあ…", 2, 4118, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹がすいたですね\nなにか食べにいくです\nお兄さんのおごりで！", 2, 4119, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふぁあ…むにゅう…\nまだ起きてるですよぉ", 2, 4120, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ～…\nもうここから一歩も\n動きたくないです", 3, 4122, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なかなかいいモフりを\nしてやがるです…\n舎弟にしてやるですよ", 3, 4123, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんかおしゃれな\n匂いがするですね…", 3, 4124, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふふーん！\nあたしのブレスの方が\n火力は上ですね！", 3, 4125, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あたしに貢ぎ物とは\nよく分かってるですね\n食べてやるですよ", 3, 4127, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふーむ…\nもっと楽しい本は\nないですかね？", 3, 4128, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海に眠る秘宝…\n心躍る響きだ！\n早く見つけたい…！", 1, 4130, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うう～、暑いぃ…\nかき氷を食べて\nすっきりしたいぃ…", 1, 4131, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アターック！\nいや、もっとこう…\nアタァーック！", 1, 4132, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "スイカ割りで\n目を回さない\nコツはなんだろうか…", 1, 4133, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "せっかく海に来たのだ\n泳ぎも上手に\nなりたいものだな", 1, 4134, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふっふっふ…\n疼く…疼くぞ！\n日焼けの痕が…", 1, 4135, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "シグルドと私は\n来世でも共にある…\nつまり我らはずっと…\nはわわ…！", 1, 4136, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "シグルド、私と共に\n日光浴に行かないか？\n光の力を集めよう！", 2, 4137, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この格好だからできる\n必殺技を考えている\n何か案はないか？", 2, 4138, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "シグルド～！\nスイカを貰ったから\n一緒に食べよう！", 2, 4139, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こう日差しが強いと\n日焼けしそうだな\n跡になってないか…？", 2, 4140, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "我らの夏の黙示録\nしっかりと記録\nしておかねばな", 2, 4141, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ちゃんと日焼けどめを\n塗ってもらうべき\nだったかな…？\nシ、シグルドに…！", 2, 4142, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝だぞシグルド！\nさぁ、日光を浴びて\n光の加護を得るのだ！", 2, 4143, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もう昼食の時間か…\n私の魔力も減ったし\n早く補給しなければ", 2, 4144, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜でも我らの活動は\n終わることはない！\nさぁ準備を…ふわぁ…", 2, 4145, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海で遊んでいると\n疲れてしまうからな\n少し休まるとしよう", 3, 4147, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "えへへ～、君の名前は\n何にしまちょうかね♪\n…はっ、見たのか！？", 3, 4148, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "心地よい香りで\n我が精神も安らぐ…", 3, 4149, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "別に寒くなどないぞ！\n寒くないが、ちょっと\n暖まりたくなってな！", 3, 4150, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐ…食べ過ぎた分は\n魔力に変換されるのだ\n…たぶん", 3, 4152, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…なな、なんだ！？\nシグルドはこういう\n趣味なのか…！？", 3, 4153, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "むむ、この乗り心地…\nいざゆかん、\nシードラゴンよ！", 3, 4155, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "疾風の冥姫の名に\nふさわしき\n深海の玉座よ…\nふああ…柔らかい～", 3, 4156, 113201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この姿でいると\nわたしもお姫様に\nなれた気がする…♪", 1, 4157, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お腹空いてきちゃった\nまずは買い出しに…\n…変身解かなくちゃ！", 1, 4158, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "胸のところが空いてて\nスースーするの\nまだ慣れないな…", 1, 4159, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "治癒魔法に使ってた\n魔力を攻撃魔法に…\n頭の中でも練習練習", 1, 4160, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "何もできなかった\nわたしから、少しは\n変われたのかな…？", 1, 4161, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士クン…\n今どこにいるの…？\n…会いたいな", 1, 4162, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "離れてても分かるよ…\n温かい力で騎士クンに\n守られてるの", 1, 4163, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わたしが戦えてるのは\n騎士クンのおかげだよ\nいつもありがとう！", 2, 4164, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お腹空いてそう…？\n…内緒で作ったおやつ\n騎士クンも食べる？", 2, 4165, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ひゃうっ！　え！？\nせ、背中はダメ～！\n言ってから触って～！", 2, 4166, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この格好、どうかな？\nえ？　似合ってる…？\n本当？　…うれしい！", 2, 4167, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "かわいい？　そうだね\nひらひらが…わたし？\nええっ、そ、そんな！", 2, 4168, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士クン、これからも\nずっと…わたしの\nそばにいてください", 2, 4169, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝からこんなに\n食べる日が来るなんて\n思ってなかったよ…", 2, 4170, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼を作らなくちゃ\n騎士クン、一緒に\nお料理してみる？", 2, 4171, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "騎士クン、もう眠い？\n眠るまで、わたしが\nずっとそばにいるね", 2, 4172, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "攻撃参加するからこそ\n適度に体を休めるのは\n大切だよね！", 3, 4174, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい…騎士クンと\nシェフィちゃんにも\nプレゼントしたいな", 3, 4175, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～…\nあれ？　お腹が空いて\nきちゃった…！？", 3, 4176, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "温かい…\n騎士クンがくれる\n力みたい…", 3, 4177, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ぱくっ、\nあむ、はむっ…\nううぅ～…やっぱり\n手が止まらないよぉ～", 3, 4179, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "新しく覚えたいな…\nみんなで食べられる\n大皿向けの料理♪", 3, 4180, 180201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お姉ちゃんの愛\nこのままじゃ\nあふれちゃうよ…♪", 1, 4182, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "弟くん♪\n弟くんっ♪\nおっとうっとくんっ♪", 2, 4183, 104901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "泳ぐのもいいけど\n今日は砂浜で\nのんびりしようかね", 1, 4184, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さてと\nちょっくらひと泳ぎ\n行ってくるかね", 1, 4185, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あっついねぇ…\nうちわがないと\nしんどいったらないよ", 1, 4186, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "冷たすぎる飲み物で\n体を冷やさないよう\n気をつけないと…", 1, 4187, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "夏はあっという間だし\n悔いがないように\n楽しまないとね", 1, 4188, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "きっとこの夏は\nアタシにとって大事な\n想い出になるね…", 1, 4189, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…前に比べたら\nアタシたちの距離も\n近づいたみたいだね", 1, 4190, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もし暇なら\n今日も笹舟釣り\n一緒にどうだい？", 2, 4191, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お前さん、釣りに\n興味が湧いたなら今度\n道具を見に行こうよ", 2, 4192, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今から砂浜に行くんだ\nお前さんも一緒に\n散歩するかい？", 2, 4193, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "え、日焼け跡？\nおや…本当だ\nすぐ焼けちまうねえ", 2, 4194, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひゃっ！？\nちょっと！\n日焼け跡をいきなり\n触らないでおくれ！", 2, 4195, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お前さんは、その…\nアタシと一緒にいて\n楽しかったかい？", 2, 4196, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようさん\n今日も砂浜に行って\nゆっくりしようか", 2, 4197, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼か…\nそうだ、よかったら\n刺身定食、作ろうか？", 2, 4198, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の空を見てるとさ\nなつかしい気持ちに\nなるんだよね", 2, 4199, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "適度に休憩して\n夏バテしないよう\n気をつけないとね", 3, 4201, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あんたたちも\n海を楽しみたいって\n思っているのかね", 3, 4202, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～…香りでも\nバカンスらしさを\n楽しめるもんだね", 3, 4203, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こういう格好だと\n少し冷えちまうんだよ", 3, 4204, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐもぐ…\n遊んだ分、お腹が\n空いちまってねぇ", 3, 4206, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…ん、なんだいこの本\n催眠…うーん読めない\nナナカに聞いてみるか", 3, 4207, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "へえ…\nなかなかいい\n乗り心地じゃないか", 3, 4209, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "そうそうハマグリって\n竿でも釣れるんだよ\n知ってたかい？", 3, 4210, 113101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海を満喫しなきゃね\nちょっとひと泳ぎ\n行ってこようかな？", 1, 4211, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "う～ん…♪\nいつもと違った\n開放感～\nなんちゃって！", 1, 4212, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今のナナカちゃんは\nたぶん水属性！", 1, 4213, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "水着もバッチリ！\nサイカワサイツヨ\nナナカちゃ～ん☆", 1, 4214, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "んっふっふ\nドキ！　水着だらけの\nギルドハウス！\nとかどうかな？", 1, 4215, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "そんなに見られると\nちょ～っと\n恥ずかしいかも…\nなんてねなんてね！", 1, 4216, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ちょっとくらい\nドキッとしてくれても\nいいのにな～、もう…", 1, 4217, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着魔法少女の\n相方がほしいなぁ～…\nね、君やってみない？", 2, 4218, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いつもの格好と同じ？\nも～、わかってない！\nセクスィー度が違う！", 2, 4219, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうかなどうかな？\nこのひらひらのとこが\nかわいーかなー\nとか思うんだけど！", 2, 4220, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "せっかくだから\nギャルゲーイベント\nごっことか\nやってみる？", 2, 4221, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ナナカちゃんの\n好感度を上げたい？\nならおでかけだー！", 2, 4222, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おうちで水着って\nなんだかコスプレ\nみたいで楽しいかも♪", 2, 4223, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おっはよーう！\n今日はバカンス日和！\n海へゴーですぞ～♪", 2, 4224, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯どうしよ～…\nあ、ナナカちゃんと\nどっか食べに行く？", 2, 4225, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜は本を読むのが\n捗りまくりですな～！\n今日はなに読もっかな", 2, 4226, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "次のイベントもあるし\nちょっと休んで体力を\n回復しなきゃね～", 3, 4228, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうマスコット\n私にもいたらなぁ\nいっそ作っちゃう…？", 3, 4229, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "水着魔法少女に\n似合う香りってのも\n考えてみよっかな♪", 3, 4230, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "夜になると急に冷えて\n肌寒いんだよね～…", 3, 4231, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あんまり食べると\nお腹が出て…でも…\nうう、止まらない～！", 3, 4233, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この催眠魔法の本\n誰にもばれないように\n保管しとかなきゃね…", 3, 4234, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "ゴーゴーゴーゴーゴー\nナナカちゃーん♪", 3, 4236, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ナナカちゃんの\n誕生～\nなんちゃって", 3, 4237, 113301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ファイトファイト☆\n一生懸命\n応援するね！", 1, 4238, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "みんながんばってる！\n私も応援でみんなを\n盛り上げなきゃ！", 1, 4239, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もし元気のない人が\nいたら…応援で少し\nでも元気にしたいな！", 1, 4240, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "がんばれ～☆\nよし、発声練習OK！\n応援は、声も大事！", 1, 4241, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "せっかく水着なんだし\n泳いだり潜ったりして\n遊びたいな～！", 1, 4242, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "チアリーダーとして\nキミを精一杯\n応援したいな…！", 1, 4243, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミへの応援\nちゃんと\n届いてるかな…", 1, 4244, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えへへ…今ね、\nキミへの応援歌を\n考えてたのだ～♪", 2, 4245, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうしたの？\n元気がないなら\n私が応援するよ☆", 2, 4246, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "がんばったあとは休憩\nしなきゃね！　私と\n一緒にお昼寝する？", 2, 4247, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "シオリンとおそろいの\n水着で応援…\nしてみたいなぁ～", 2, 4248, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "次はなにして遊ぶ？\nキミがしたいことを\n教えてよ！", 2, 4249, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミを応援\nすることができて…\n私、すごく幸せ…", 2, 4250, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "キミって早起き\nなんだね！　私も\n見習わなきゃ！", 2, 4251, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ちょっとお疲れかな？\nそれじゃあ\n応援してあげるね♪", 2, 4252, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "遅い時間まで\nがんばってえらいね！\nでも無理はダメだよ♪", 2, 4253, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっとだけ休憩…\n…あう、座り心地が\n良すぎて…眠気が…", 3, 4255, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここにいるみんなを\n私の応援でもっと\n元気にするのだ～！", 3, 4256, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "元気の出る香り～♪\nこれもうまく応援に\n活かせないかな～？", 3, 4257, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかあったまって\n元気をチャージ\nするのだ～☆", 3, 4258, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いっぱい食べて、\nみんなを応援する\nパワーをつけなきゃ！", 3, 4260, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "みんなを元気にする\n方法は…どこかに\n書いてないかなぁ…？", 3, 4261, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "わぁ、この子\n怪獣さんみたいで\nかわいいね～♪", 3, 4263, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "水着でこれに\n乗ってると海にいる\n気分になれるね！", 3, 4264, 113401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "すごく忙しいけど\nとても充実した気分\nこれが青春なのかしら", 1, 4265, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "森の静かな雰囲気も\n海の開放的な空気も\nどちらも素敵ね～", 1, 4266, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "汚れたお洗濯物は\nみんなが頑張った証\nなんだか愛おしいわ", 1, 4267, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みんなを見てると\n何だか私も\n走りたくなっちゃうわ", 1, 4268, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "せっかくの水着だし\n泳ぐ練習でも\nしてみようかしら", 1, 4269, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "みんな～ファイト～！\n応援するのも大事よね\n練習しておかなきゃ♪", 1, 4270, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "先生に教えられること\nまだまだい～っぱいね\n次は何がいいかしら♪", 1, 4271, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日も暑くなりそうね\nこまめな水分補給を\n忘れないでね", 2, 4272, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "手伝ってくれるの？\nありがとう♪\n先生、頼りにしてるわ", 2, 4273, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "休憩はこまめに\nとりましょうね\n無理は厳禁よ", 2, 4274, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海の遊びって\nどんなのがあるの？\n先生に教えてね", 2, 4275, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "水着は初めてだけど\nどう？　変じゃない？\nふふ、ありがとう", 2, 4276, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと過ごした\nこの夏は、きっと…\n忘れられない思い出ね", 2, 4277, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう～\n朝練前にちゃんと\nごはん食べましょうね", 2, 4278, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お弁当作ってきたの\n栄養いっぱい摂って\n午後も頑張ろうね", 2, 4279, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうお休みしなきゃね\n先生が子守唄を歌って\nあげましょうか？", 2, 4280, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふふ、いい気持ちねぇ\n先生、少しだけ\n休憩しちゃおうかしら", 3, 4282, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あらかわいい♪\nチームにもこういう\nマスコットが欲しいわ", 3, 4283, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あら、海の香り？\n波の音まで聞こえて\nきちゃいそうだわ", 3, 4284, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うふふ\nこれなら濡れた水着を\n乾かすのも簡単ね♪", 3, 4285, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これ、美味しいわね♪\nでも、食べ過ぎは\n禁物よ", 3, 4287, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "先生だって日々勉強よ\n新しいことを知るのは\nとても楽しいわ♪", 3, 4288, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "あらあら、楽しいわね\nみんなもきっと\nおおはしゃぎね", 3, 4290, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふふ、これで\n夏らしい気分を\n満喫するわよ♪", 3, 4291, 113501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "サンドイッチも\n作ったし、\nお兄ちゃんのお出迎え\n準備は完璧だね♪", 1, 4292, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "えへへ、お兄ちゃんと\nぷうきちが居てくれる\nだけで、なんだか\nうれしくなっちゃう♪", 2, 4293, 102301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "少し赤くなっているな\n日焼けなんてしたのは\nいつ以来だろう", 1, 4294, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この格好で\n過ごすのは\n少し勇気がいるな…", 1, 4295, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "暑いのは平気だが\n肌が外気に触れるの\nにはまだ慣れないな…", 1, 4296, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この格好でも\n堂々としていれば\n恥ずかしくはない…\nのかな？", 1, 4297, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おっと…鎧姿の時と\n重心が違うせいか\nちょっと不安定だな", 1, 4298, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この水着…\n私に似合って\nいるのだろうか…？\n少年には聞きづらいな", 1, 4299, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "少年との\n海のバカンス…\nまた行きたい\nものだな", 1, 4300, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あまり見るのは\nよしてくれ…\n恥ずかしいじゃ\nないか…", 2, 4301, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうかしたのかい？\n私でよければ\n話し相手くらいには\nなろうじゃないか", 2, 4302, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ひゃっ！\nす、すまない\nちょっと過敏に\nなっているようだ", 2, 4303, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…っくしゅん！\nすまない\n薄着には慣れて\nないものでね", 2, 4304, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "まあ、少年になら\n見られても…\nい、いや！\nなんでもない！", 2, 4305, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私がこうして\nゆっくりできるのは\n少年がそばにいて\nくれるからだよ", 2, 4306, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "この時間なら\nビーチにも人は\n少ないだろうね…\n遊びに行くかい？", 2, 4307, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食のお誘いかい？\nいいよ、付き合おう", 2, 4308, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もう夜か…\n一日が経つのは\nはやいものだね", 2, 4309, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これは楽でいいな…\nいつもは鎧姿で\n家具を傷つけないか\n気を使っているからね", 3, 4311, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うん…ふわふわの\n感触が\nよくわかるな…", 3, 4312, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いつもは\n鎧に匂いが\n移ってしまうのが\n悩みなんだよ…", 3, 4313, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うーむ…\n涼しいのに暖かい\nなんだか奇妙な気分だ", 3, 4314, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "兜を気にせず\n食べられるのは\n楽でいいな…", 3, 4316, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむ…鎧がないと\nページがめくりやすい", 3, 4317, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "身軽でいいな…\n鎧を着ていると\n騎乗訓練の時\n馬に申し訳がなくてね", 3, 4319, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "貝をうまく使えば\n水中でも\n守りを固められそうだ", 3, 4320, 113601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どこをアジトと\nつなげようかな～…\nこのへんにしよっと♪", 1, 4321, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここってちょっと\n変わった建物だね\n妖精がいるでしょ？", 1, 4322, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "色んな人を観察できて\n眼福眼福…♪", 1, 4323, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "家具の配置変更なら\nアタシにおまかせあれ\n…家の形は変えない？", 1, 4324, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "新メニューどうしよう\n思いついた人がいたら\nアタシに教えてね！", 1, 4325, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "少年、早く帰って\nこないかな…\nよし、迎えに行こう！", 1, 4326, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "結局またあちこち\n移動する日々だし…\n少年に会いたいな～", 1, 4327, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どしたの少年？\nお姉さんに何でも\n相談してみな～？", 2, 4328, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あれをああして…\nおや少年！　ごめんね\nすぐに気づけなくて！", 2, 4329, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何？　クリスが\nアタシを探してる？\n…いないって言って！", 2, 4330, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "よければリノちゃんと\nシズルちゃんにも\n顔を見せてあげて", 2, 4331, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "少年～！\nもうヘトヘトだよ～！\nお願い癒して～！", 2, 4332, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…アタシが素直に\n助けてって言えるのは\n少年だけだよ", 2, 4333, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝だよ少年！\n爽やかな朝の\nクレープはいかが？", 2, 4334, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空いたな～\nお昼のクレープ\n少年は食べる？", 2, 4335, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜までクレープは\nやめとけ？　ごめん\nそれだけは無理…！", 2, 4336, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アタシこんなに\nゆっくりしちゃって\nいいんだっけ～？", 3, 4338, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…これ\nネネカが変身\nしてないよね？", 3, 4339, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだ…\n解析完了\n今度生成しようっと♪", 3, 4340, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "安心するな～…\nアジトに置けないから\n羨ましいよ", 3, 4341, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べ物を消化するって\n仕組み、どんなものか\n気になる…", 3, 4343, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "速読できるけど\n本を読む時くらい\n文字にじっくり\n浸かりたいんだよね…", 3, 4344, 106801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "エンジェルとして\nみんなを元気に…！\nアカリ、頑張ります♪", 1, 4346, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お姉ちゃんと一緒に\nお兄ちゃんを…えへへ\nまだかな、お兄ちゃん", 1, 4347, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "エンジェルの音色を\n目指して、今日も\nサックスの練習です♪", 1, 4348, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃんとの特訓も\n頑張らないと…\n厳しくしてくださいね", 1, 4349, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "かわいいエンジェルの\n格好、お兄ちゃんなら\n喜んでくれますよね♪", 1, 4350, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "エンジェルの力で\nお兄ちゃんのハートも\nイチコロですよ♪", 1, 4351, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アカリが一番\n元気にしたいのは\nお兄ちゃんですよ♪", 1, 4352, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お兄ちゃん？\n触りたいなら…\nこことかどうですか♪", 2, 4353, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "特訓の時間ですか？\nアカリ、楽しみに\nしてたんですよ♪", 2, 4354, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あ、お兄ちゃん！\nそろそろアカリと\n休憩…しませんか♪", 2, 4355, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この羽、触り心地\nいいですか？　あんっ\nくすぐったいですよぉ", 2, 4356, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんも元気に\nなりたいんですか？\nアカリにお任せです♪", 2, 4357, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "やんっ♪\nお兄ちゃんったら\nダイタンですね♪", 2, 4358, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お兄ちゃん、朝ですよ\nすっごく気持ちのいい\nお天気ですよ…♪", 2, 4359, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼寝しませんか\nお兄ちゃん？\nアカリの膝枕で…♪", 2, 4360, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜ですね、お兄ちゃん\nアカリ、なんだか胸が\nドキドキしちゃいます", 2, 4361, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "フカフカですね…\n隣にお兄ちゃんが\nいてくれたらなぁ…♪", 3, 4363, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "えへへ、アカリも\nこんな風にかわいく\nなりたいな～", 3, 4364, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃんが好きな\n匂いなのかな？\n参考にしますね！", 3, 4365, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体が火照ってきて\nなんだかアカリ…\nクラクラしちゃう…", 3, 4366, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむ、んぐ…あっ\nほっぺについちゃった\nベトベトですよぉ～", 3, 4368, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "エンジェルって色んな\n物語に出てきますよね\nもっと調べなくちゃ！", 3, 4369, 113701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あの方の前では\n常に気高く\nありたいですわね", 1, 4371, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "どんなに道に迷っても\nあなたさまの元には\n絶対に辿り着く\n自信がありますわ", 2, 4372, 103201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あんたと一緒に\nいるときが一番楽しい\n一時かもしれないわ", 1, 4373, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "いつかあんたと一緒に\nサレンディア救護院を\n切り盛り…なんてね♪", 2, 4374, 102801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日も\nエンジェルとして、\nみんなの幸せの\nために頑張らないと", 1, 4375, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "せっかく羽が\nついてるのに\n飛べないのが残念だわ", 1, 4376, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この格好、子供たちに\n妙にウケがいいわね\nま、悪くないけど", 1, 4377, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "や、やっぱりみんな\n注目してくるわね…\nエンジェルって珍しい\nからしかたないか", 1, 4378, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "エンジェルになると\n人見知りがなおる！\n…わけないか", 1, 4379, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "エンジェルの活動は\n大変だけど、自分が\n成長してるって\n実感がうれしいわね", 1, 4380, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もし誰かの願いを\nかなえられるなら\n私はアイツの…\nって何考えてるのよ！", 1, 4381, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何ボサっとしてるの！\nさあ、街に出て\n人助けするわよ！", 2, 4382, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "エンジェリック\nアロー！\nなんてね…え、アンタ\nいつから見てたのよ！", 2, 4383, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "コラ！\n羽は触らないで！\n壊れたらどうするのよ", 2, 4384, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "エンジェルじゃなく\nても、アンタはいつも\n人助けしてるわよね\n…ちょっと尊敬するわ", 2, 4385, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この服なら他の子より\n私を見てくれるかも…\nって、な、何\n見てるのよ！", 2, 4386, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ね、ねえ、もし私が\n困ってたら、一番に\n駆けつけて…やっぱり\n何でもないわ！", 2, 4387, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう…あ、あの、\nエンジェルとして\n町に行くんだけど…\n一緒に行かない？", 2, 4388, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふぅ、いいことした\n後のランチは\nおいしいわね", 2, 4389, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\n夜更かししてないで\n早く寝なさいよね", 2, 4390, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いい座り心地ね～\nまさに天にも昇る\n心地よさだわ～", 3, 4392, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、かわいい…\nあ、羽付けたら\nもっとかわいく\nなるんじゃないかな？", 3, 4393, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁ～落ち着くわ～\n回復アイテムみたいで\n癒やされちゃうわ～", 3, 4394, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "わっ、とと…\n危ない、羽が\nこげちゃうところ\nだったわ", 3, 4395, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "人の役に立つのって\nすごく大変だから、\nこれでライフ回復よ！", 3, 4397, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "エンジェルに関する\n本はあるかしら…あ！\nこれ探してた攻略本！", 3, 4398, 113801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふっふっふ\n吸血鬼らしく\n驚かせてあげましょう", 1, 4400, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "獲物はどこですか～！\nう～ん、もうちょっと\n迫力が欲しいですね", 1, 4401, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "トリックオアトリート\n…返事がないので\nイタズラしておきます", 1, 4402, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハロウィンですし\nたまには騎士さんでも\n誘ってあげますかね", 1, 4403, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "マントは動きに\nメリハリがついて\nいいですね", 1, 4404, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "色んな仮装が見られて\nやっぱりハロウィンは\n最高ですね", 1, 4405, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "吸血鬼らしい行動って\n噛みついたり…いや\nそれは大胆過ぎです！", 1, 4406, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "呼びましたか？\n手短にお願いしますよ\n忙しいんですから！", 2, 4407, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "え？　衣装に穴が？\nありがとうございます\n…よく見てるんですね", 2, 4408, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふわあ…吸血鬼の\n姿でも、眠い時は\n眠いんですよね…", 2, 4409, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハロウィンってライブ\nとは違った賑やかさが\nあってワクワクします", 2, 4410, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私を驚かそうとしても\n無駄ですよ！\nすぐ分かるんですから", 2, 4411, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士さん、一緒に\nハロウィンを…いいえ\nなんでもないですっ！", 2, 4412, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "仕事で寝不足だから\n太陽がまぶしいです…\n私、吸血鬼っぽいかも", 2, 4413, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯は真っ赤な…\nトマト尽くしのお弁当\nにしてみました", 2, 4414, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜はハロウィンが\n盛り上がる時間…\n行きますよ騎士さん！", 2, 4415, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このフィット感\nどうにか服作りにも\n活かせれば…！", 3, 4417, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "よく出来てますね…！\nぬいぐるみの服を作る\nのも楽しそうですね！", 3, 4418, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい感じですね…\n服に合わせた香りって\nいうのも、いいかも…", 3, 4419, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ、温まりますね…\nおっと、マントに火が\n点いちゃいそうです！", 3, 4420, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あぁ、美味しい～\n食べた分は、働いて\n燃焼しますからね！", 3, 4422, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "伝説の吸血鬼…\n夜を統べる者…\nほうほう…", 3, 4423, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "やっぱりハロウィンと\nいえばお菓子です！\nさぁ配りましょうか！", 3, 4425, 113901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この格好…\nカッコイイのに\n動きやすくて\n着心地も最高ッス！", 1, 4427, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キメポーズはこう…\nいやこっちのほうが…\nなやましいッス…！", 1, 4428, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "トリックオア\nジャスティス！\nって言ったら何か\nもらえるッスかね？", 1, 4429, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新しい必殺技の\n特訓もしなくちゃ\nいけないッスね…\n忙しいッス！", 1, 4430, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "自分のこの姿\nトモね～ちゃんにも\nみせてあげるッス！", 1, 4431, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ホワイトタイガー\n参上ッス！\n今のポーズは\nキマったッス！", 1, 4432, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人と一緒だと\nほんとにヒーローに\nなれる気がするッス！", 1, 4433, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうッスか？\nこの色、自分に\n似合ってるッスかね？", 2, 4434, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ヒマだったら\n必殺技の特訓に\n付き合ってもらって\nいいッスか？", 2, 4435, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ちょうどいいところに\n来たッスね！\nこのキメポーズ\nどうッスか？", 2, 4436, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お！　この格好、\n気になるッスか？\nじっくり見ても\nいいッスよ♪", 2, 4437, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたも一緒に\n新しい技の練習\nどうッスか？", 2, 4438, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今日もあんたと一緒に\nランドソルの平和を\n守るッスよ！", 2, 4439, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ッス！\n一緒に早朝特訓\nやるッスよ！", 2, 4440, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼休憩ッス！\nヒーローにも\n休息は必要ッス！", 2, 4441, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "闇夜に映える\n白い衣装で\n平和を守るッスよ！", 2, 4442, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "トラも狩りの時以外は\nごろごろしてるって\n本で読んだッスよー", 3, 4444, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もこもこッスね♪\nこのかわいらしさを\n守ってあげるのも\nヒーローの役目ッス！", 3, 4445, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂いッスね…\nリラックスして\n瞑想するッス！", 3, 4446, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "燃える炎は\nヒーローの心意気ッス\nいつまでも\n見てられるッスよ", 3, 4447, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nいっぱい食べて\n強いヒーローに\nなるッスよ！", 3, 4449, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ちゃんと勉強の本も\n読んでるッスよ…！\nヒーローには賢さも\n必要らしいッス！", 3, 4450, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "わわっ、お菓子が\nいっぱいッス！\nみんなで\n食べるッスよ！", 3, 4452, 114101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ワタシがチューシンと\nなった今、天下統一は\n目の前デス！", 1, 4454, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "もうショーグンってば\nそれはセイシツに\nすることデ～ス…", 2, 4455, 103001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "女幽霊…うらめしや…\nうーん、これは\nちょっと違う気が\nするな…", 1, 4456, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "何だか寒気がする…\nま、まさか\nこの部屋にも幽霊が？", 1, 4457, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハロウィンは楽しいね\n童心に帰ったような\n気分だよ", 1, 4458, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度のハロウィンは\nユイとヒヨリを\n誘ってみようかな", 1, 4459, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ハロウィンのお菓子は\nどれもかわいいね\n…一つくらいなら\nいいかな？", 1, 4460, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "次は彼と\nどんなハロウィンを\n過ごそうかな…", 1, 4461, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "こんな賑やかさも\nいいものだね\n彼といられるのなら\nなおさら…", 1, 4462, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…いたずらしようと\nしてない、キミ？\nふふ、お見通しだよ", 2, 4463, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "え、私にもお菓子を？\nありがとう…ふふ\nうれしいものだね\nハッピーハロウィン！", 2, 4464, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうしたの？\n出かけるなら\n私も同行しようか", 2, 4465, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この格好、舞踏会にも\n出られそうだね\n一曲、踊ってみる？", 2, 4466, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "やるからには本気で\nやらせてもらおう\nトリックオア\nトリート！", 2, 4467, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "他の子に目移りする\nのも分かるが、その…\nせっかくの特別な衣装\n見てほしいな", 2, 4468, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "寝起きの体を\n慣らしておこうか\nほら、剣を取って", 2, 4469, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お菓子もいいけど\nちゃんと昼食も\nとるんだよ", 2, 4470, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "さあ、行こうか！\nハロウィンは\nこれからが本番だよ", 2, 4471, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ハロウィンはまだ\nこれからだ\n一休みしようか", 3, 4473, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キミたちも\n仮装に興味は\nあるかな？　…ふふ", 3, 4474, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだけど\n幽霊が集まったり\nしないだろうか…？", 3, 4475, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かい…一息ついたら\nハロウィンの\nパレードを\n見に行こうかな", 3, 4476, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ハロウィンを本気で\n楽しむなら\n食事もしっかり\nとっておかないとね", 3, 4478, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ハロウィンの\nホラー小説か…\nけ、結構\n怖いものだね…？", 3, 4479, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "お菓子がいっぱいだ…\nこういうのって\n見ているだけで心が\n躍ってしまうね", 3, 4481, 114001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こんなにかわいい\n武器で戦えるとは…\nすごいものだな\n魔法少女は", 1, 4483, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "決めポーズの訓練も\nしっかりやっておくか\n…誰も見ていないな？", 1, 4484, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういう格好は\nユキあたりがすごく\n似合いそうだな", 1, 4485, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "子どもたちにサインを\n求められてしまった…\nこれもまた私の使命！", 1, 4486, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この格好は目立つな…\nいや、提督とは人々の\n視線を集めるものだ！", 1, 4487, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつと作戦会議を\nしておくか。あれで\nなかなか頼れるからな", 1, 4488, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつには私の勇姿を\nちゃんと見ていて\nほしいものだな", 1, 4489, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "一仕事終えたことだし\n一緒に甘いものでも\n食べに行くか？", 2, 4490, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "怪しげな気配がするな\n貴公も警戒を\n怠るなよ！", 2, 4491, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "シオリに魔法少女の\n本を借りたんだ\n一緒に読まないか？", 2, 4492, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "巡回の時間まで\nお茶にでもするか\n貴公も付き合うがいい", 2, 4493, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "貴公がサポートして\nくれるのなら心強いな\n頼りにしているぞ", 2, 4494, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "頭を撫でるな～！\n…まったく、貴公だけ\nだぞ、こんな風に私を\n撫でてくるのは…", 2, 4495, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "起きろ貴公！\n魔法少女の朝は\n早いぞ！", 2, 4496, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ほら、食後の\nデザートだ\nて、適度な糖分は\n体に必要なんだ！", 2, 4497, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ…魔法少女も…\n眠気、には…い、いや\n寝てないぞ！？", 2, 4498, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "任務や訓練で\n疲れた体に\nこれは効くなぁ…", 3, 4500, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うむ、かわいいな\nモーラのやつを隣に\n並べようか", 3, 4501, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ああ、身も心も\n安らぐ…\nまるで魔法だな…", 3, 4502, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この温かさ…\n愛と希望に\n通じるものがある…", 3, 4503, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事の大切さは\n魔法少女も軍人も\n変わりない\nしっかり食べるんだ！", 3, 4505, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "魔法少女の本を\n読んでるのだが\nわ、私もこんななのか", 3, 4506, 114201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "オラとあんちゃんは\nボケもツッコミも\nあうんの呼吸だべ♪", 1, 4508, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あんちゃんと二人で\nネタ合わせ…初めての\n共同作業だべ♪", 2, 4509, 103301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぴっぷる！", 1, 4510, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぴっぷるぴっぷる♪", 1, 4511, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぴっ！", 1, 4512, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぷっぷー", 1, 4513, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぴぃ？", 1, 4514, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぴっぷるんるん♪", 2, 4515, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぷぅ！", 2, 4516, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぴぴっ♪", 2, 4517, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぷぅー…", 2, 4518, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ちゅ！", 2, 4519, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ぷはー", 2, 4520, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ぴぇー", 2, 4521, 192501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔法少女になったら\n髪型も変わるんだね\n色々試してみようかな", 1, 4531, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…煌く剣技で、\n悪を断つ！\nうん、今日も\n完璧なポーズだね♪", 1, 4532, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミクマ流剣術で、\n魔法少女の技に使え\nそうなものは…よし、\n早速試してみよっと♪", 1, 4533, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魔法少女になったから\nには、サインの練習も\nしないと…\nよし、頑張るぞ！", 1, 4534, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "魔法少女の姿はすごく\nかわいいけど…この\n姿はジュンさんたちに\n見せられないなぁ…", 1, 4535, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人は魔法少女\nのこと好きなのかな？\n…好きだったら\nうれしいな♪", 1, 4536, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…やっぱり、\nあの人がいないと\n特訓に身が入らない…\n早く帰ってこないかな", 1, 4537, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "もし時間があるなら、\n私と街の見回りに\n行かない？", 2, 4538, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ、いいところに！\n新しい魔法剣術を\n編み出したから、\n見てくれないかな？", 2, 4539, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魔法少女の姿が気に\nなるのは分かるけど…\nず、ずっと見られる\nのは照れるからやめて", 2, 4540, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "変身ポーズ中の動き、\n少し変えた方が\nいいかな…\nあなたはどう思う？", 2, 4541, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "よければ、\n魔法少女の特訓に\n付き合ってくれない？\nその…二人きりでさ…", 2, 4542, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私…あなただけの\n魔法少女になっても…\nふふっ、な～んてね♪", 2, 4543, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日もいい朝だね\nさあ、一緒に\n街の見回りに行こうか", 2, 4544, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もう昼か…なにか\n食べたいものある？\n簡単なのでいいなら、\n私が作ってあげるよ", 2, 4545, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ休もうか\n…なんなら、添い寝\nしてあげようか？\nふふっ、冗談だよ♪", 2, 4546, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これは…\n心身ともに安らぐね\nなんだか\n眠くなっちゃいそう", 3, 4548, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい…これ、\n魔法で動かせたり\nしないかな？", 3, 4549, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだね\nなんだか頭が冴えて\nきたし、新しい技でも\n考えようかな", 3, 4550, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいな…\nこの温もりは、\n魔法少女の魔法でも\n再現不可能だね…", 3, 4551, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こ、これは…\nおいしすぎて手が\n止まらないかも", 3, 4553, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本の\nキャラの動き、\n変身ポーズの\n参考にできるかも！", 3, 4554, 114301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス！\nさあ、素敵な\nパーティーを始めると\nいたしましょう！", 1, 4556, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふふっ、\nいくつになっても、\nやはりクリスマスは、\nワクワクしますわね♪", 1, 4557, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "自分で料理をしてみて\nシェフたちのすごさが\n改めて分かりましたわ", 1, 4558, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "何事も自分で\n体験してみると\n新しい発見が\nあるものですわね♪", 1, 4559, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "やはり、クリスマスは\n街が活発になり\nますわね…これは、\n絶好の商機ですわ♪", 1, 4560, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "他のクリスマス料理も\n作れるようになったら\nあのお方は食べて\nくださるかしら…？", 1, 4561, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あのお方に贈る\nプレゼント…\nこれはかなりの\n難題ですわね…", 1, 4562, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス！\nよろしければ、一緒に\nクリスマスの準備を\nいたしませんか？", 2, 4563, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "まあ、クリスマスの\n飾りつけを手伝って\nいただけるのですか？\nありがとうございます", 2, 4564, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クリスマスに合わせて\nあつらえた自慢の衣装\nなのですが…その、\nいかがでしょうか？", 2, 4565, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "幼い頃はサンタさんが\nいらっしゃるのを\n待ちわびたものです\n今は…内緒ですわ♪", 2, 4566, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "も、もしお時間が\nあるようでしたら、\nクリスマスの街を\n一緒に歩きませんか？", 2, 4567, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年のクリスマスも\nあのお方と一緒に\n迎えられたら…", 2, 4568, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "時は金なり…\nせっかくの朝ですもの\n時間を有効活用\nいたしましょう！", 2, 4569, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼になりましたわね\nさあ、\nパーティーの準備を\n進めますわよ！", 2, 4570, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "静かな夜ですわね…\nもうちょっとだけ、\nあなたさまとお話を\nしていたい気分です", 2, 4571, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "適度な休息は\n成功の秘訣ですわ！", 3, 4573, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このかわいらしさ…\nいつまでも見て\nいられそうですわ♪", 3, 4574, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "人をもてなすには\nこうしたところにも\n気を配らないと\nいけませんわね", 3, 4575, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かい…\nこういう憩いの\nひと時こそ、大事に\nしたいものですわね", 3, 4576, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "この奥深い味わい…\n何か隠し味など\n使われていまして？", 3, 4578, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クリスマス料理の\nレシピも、\nこれだけあると\n迷ってしまいますわね", 3, 4579, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "この絵本、とっても\n面白いつくりですわね\nうちの商品に\nしたいぐらいですわ", 3, 4581, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "これだけ大きな\n着ぐるみ…\n職人の技術が\n光りますわね", 3, 4582, 114401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "クリスマスといえば\nパーティーよね！\nいっぱい飲むわよ～♪", 1, 4583, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私を麦しゅわだけの\n女と思ったら\n大間違いなんだから♪", 1, 4584, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クリスマスらしい\n飲み物も結構いいわね\n私も今度\n作ってみようかしら", 1, 4585, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "暖かい部屋で飲む\n麦しゅわも\nまた格別なのよね…", 1, 4586, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "今日はオフの日だし\n朝から飲んでも\n怒られないわよね？", 1, 4587, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クリスマスの\nデートスポットで\n彼と一緒に…ってなに\n考えてるのユカリ！？", 1, 4588, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "背伸びしなくても\nありのままの自分を\n受け入れてくれるって\nすごく…幸せ…", 1, 4589, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "大丈夫よ～\n飲んでない\n飲んでないひゃら～", 2, 4590, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クリスマスは\n特別だもの\n特別な一杯を\n飲まないとね♪", 2, 4591, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "メリークリスマース！\nほらほらぁ\n乾杯しましょ♪", 2, 4592, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お姉さんの\n頼れるところ\n見せてあげるわね", 2, 4593, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "何かあったら\n頼ってくれても\nいいんだからね？", 2, 4594, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ふふ…これからも\nキミのこと…\n頼りにしちゃうからね", 2, 4595, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さわやかな朝ね\n…二日酔いがないと\n朝ってこんなに\n気持ちいいのね", 2, 4596, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼間から飲むのって\nまた格別よね…って\nガマン、ガマンよ…", 2, 4597, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間かあ…\nあとは寝るだけだし\nちょっとくらいは…", 2, 4598, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ゴロゴロするのって\n最高ね～\nあとは麦しゅわが\nあればなぁ", 3, 4600, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私だって…\nかわいいものは\n好きでいいわよね？", 3, 4601, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "んっ～…いい香りね\n日頃の疲れが\n取れる気がするわ", 3, 4602, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポカポカする～\n…なんだかのどが\nかわいてきたわね", 3, 4603, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…労働の\n後のご飯はやっぱり\nおいしいわぁ…", 3, 4605, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クリスマスデート\n完全攻略マニュアル？\n…読んでおかなくちゃ", 3, 4606, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "あら、絵が飛び出して\n見えるけど…\n酔っ払ってるせいじゃ\nないわよね…？", 3, 4608, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "いい手触りね～\nウチにもほしいけど\n麦しゅわをこぼしたら\n大変そうだわ…", 3, 4609, 114601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ヒデサイの視線\nずっと独り占め\nしてたいな～", 1, 4610, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ヒデサイといるだけで\nうち、おに楽しいし！\nヒデサイもっしょ～？", 2, 4611, 101601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス！\nふふ、口にするだけで\n何だか楽しくなるわね", 1, 4612, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いつもは子どもたちを\n見守る方だけど\n今ははしゃいでも\nいいわよね？", 1, 4613, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ツリーや料理\nそしてプレゼント！\nいくつになっても\nやっぱり心躍るわね♪", 1, 4614, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "飾り付けも料理も\nいいセンスしてるわね\n救護院のパーティーの\n参考にさせてもらうわ", 1, 4615, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "焼きそばパンを\nクリスマスの定番に\nするにはどうすれば…", 1, 4616, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "これ、あいつの\n好きそうな料理だわ\n取っといて食べさせて\nあげようかしら♪", 1, 4617, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつのプレゼント\nちょっとだけ奮発\nしたのよね…\n喜んでくれるかしら", 1, 4618, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "このドレス\n似合ってるかしら？\n今だけは見とれても\n許してあげるわ♪", 2, 4619, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "見て、このケーキ！\nおいしそうでしょ\nたまにはこんな贅沢も\nいいわよね♪", 2, 4620, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "料理も飲み物も\nおいしいわね！\nいっぱい食べて\n元を取らないと♪", 2, 4621, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "子どもたちと一緒に\n雪遊び、楽しそうね\nあんたもどう？", 2, 4622, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "せっかくの\nクリスマスなんだもの\nエスコート\nよろしくね♪", 2, 4623, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "寒い？　そう…\nなら、もっとこっち\n来ていいわよ…？", 2, 4624, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ほら、早く起きて？\nパーティー用の\n買い出しに\n付き合ってちょうだい", 2, 4625, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "パーティーの料理の\n準備をしながらお昼も\n作っておいたわ\n我ながらいい手際ね", 2, 4626, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "にぎやかなパーティー\nもいいけど、聖夜の\n余韻を感じるのも\n結構素敵ね", 2, 4627, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いい座り心地だわ～\n腕のいい職人の仕事ね\nうちでも扱いたいわ", 3, 4629, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい！\n子どもたちに\nプレゼントしたら\n喜んでくれるかも", 3, 4630, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "華やかな香りね\nクリスマスに\nピッタリだわ", 3, 4631, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "寒い日にはやっぱり\nこれよね…\nはぁ、極楽極楽♪", 3, 4632, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "んー、おいしいわ！\n焼きそばパン味の\nものも、作れない\nかしら？", 3, 4634, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "たまにはのんびり\n読書でも…なんだか\nラブロマンスばかりね\nクリスマスだから？", 3, 4635, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "これ、面白いわね！\n子どもたちの\nプレゼントに\nピッタリだわ", 3, 4637, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "こんないい毛並み\n初めて見るわ…\n一体どこで手に\n入るのかしら？", 3, 4638, 114501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アタシもみんなと\n一緒に正月を\n楽しんでいいのか？", 1, 4639, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今年こそ、もう少し\n身長が伸びます\nように…", 1, 4640, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "げっ！　お年玉が\n全然残ってないぞ！？\nそんな、嘘だろ…？", 1, 4641, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "大勢で過ごす\n正月か…初めてだけど\n悪くないもんだな", 1, 4642, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "んー…ここじゃ\n天楼覇断剣の\n出番はなさそうだな", 1, 4643, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アイツらと作る\n戦い以外の思い出も\nもっと増やしたいな", 1, 4644, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "こんなに賑やかな\n正月は初めてだ\n…温かくて、いいな", 1, 4645, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "記憶がなくったって\n楽しい思い出は\n新しく作れるよな？", 2, 4646, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "早くでかけるぞ！\nアタシはもっと\n正月を楽しみたい！", 2, 4647, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なあ、オマエはもう\nノウェムって名前\n覚えてくれたよな？", 2, 4648, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この服、アタシに\n似合ってるのか？\n…そっか。\nありがとな！", 2, 4649, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "オマエらと見た朝日は\nきっと忘れないぞ！\n思い出ができたな！", 2, 4650, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつかオクトーも\n一緒に、みんなで\n正月を過ごせたらな…", 2, 4651, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝から元気だな！\nアタシもいっちょ\n見習ってみるか！", 2, 4652, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯は何にする？\n正月はうまいものが\n多くて迷うよな！", 2, 4653, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "いい夜だな！\nアタシと一緒に\n夜更かしを楽しむか？", 2, 4654, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "正月らしく、たまには\nゆっくりするのも\nいいかもな…", 3, 4656, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんだ？\nオマエも初詣に\n行きたいのか？", 3, 4657, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すーはー…\n神殿のニオイがするな\nいい事ありそうだ！", 3, 4658, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "コイツがあれば\nうまい魚が\n焼けそうだな…", 3, 4659, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ううー\n食べ過ぎて帯が\nきつくなってきたぞ…", 3, 4661, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おみくじって\n書いてあることが\nむずかしいんだよな…", 3, 4662, 114701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "困ってる人は\nいないみたいだし…\nちょっとここで、\n特訓しようかな♪", 1, 4664, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "空が飛べるんだから\nもっとたくさんの人を\n助けにいけちゃう！\n…ここじゃ飛べないや", 1, 4665, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "炎の翼\nかっこいいなー！\nこれ、もっと大きく\nできないのかな？", 1, 4666, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "やっぱり変身すると\nお腹すくんだね…\n…今ならペコさんの\n食欲の理由が分かるよ", 1, 4667, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "色なんかは違うけど…\nマントがあるから\n騎士くんとお揃いに\nなったみたい♪", 1, 4668, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…騎士くんがいないと\nなんか調子でない…\n早く会いたいよぉ…", 1, 4669, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この姿になると、\n騎士くんを近くに\n感じる…なんだろ\nドキドキしちゃう…", 1, 4670, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士くん騎士くん！\n今大丈夫？\nトレーニングメニュー\n考えるの手伝って！", 2, 4671, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…うにゃっ！？\nこ、この姿になっても\n尻尾は触っちゃ\nダメー！", 2, 4672, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もしかして、この服が\n気になってるの？\nだったら、もっと\n近くで見ていいよ♪", 2, 4673, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あ、騎士くん！\n困ってる人がいないか\n見回りに行くんだけど\nついてきて欲しいな！", 2, 4674, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "耳に触りたいの？\nだったら頭もなでて！\nそしたら、好きなだけ\n触っていいよ♪", 2, 4675, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…あたし、強くなって\n騎士くんを守るよ！\nだから…これからも\n一緒にいていい？", 2, 4676, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おっはよー！\nさあさあ騎士くん！\n今日も一緒に\nはりきっていこー♪", 2, 4677, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼、お昼～♪\n今日のご飯は何かな～\nあ、騎士くん！\n早くお昼食べ行こ！", 2, 4678, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日もお疲れ様ー！\n騎士くん、あたしが\nマッサージしよっか？\n結構評判なんだよ！", 2, 4679, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うにゃぁ…\nこの気持ちよさ…\n溶けちゃいそう…\nにゃぁ…", 3, 4681, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい～\nこれ、なでなで\nしていいんだよね…？\nよしよし…♪", 3, 4682, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "とってもいい香り！\n気分も落ち着くし、\n特訓の後なんかに\nいいかもー！", 3, 4683, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぬくぬくだぁ…\nなんだか、\nふにゃふにゃに\nなっちゃうよぉ…", 3, 4684, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お、おいひぃ…！\nこの姿になると\nお腹すくし、すっごく\n助かっちゃった！", 3, 4686, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本で勉強して、\nぶんぶりょーどーの\n超ウルトラヒヨリに\nなっちゃうぞー！", 3, 4687, 180101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今年もみんなで\nおいしいものを\nたくさん食べたいです", 1, 4689, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "挑戦は大切ですよね☆\nというわけで\nおせちに魔物を…", 1, 4690, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おせちは縁起物です！\n食べれば食べるほど\n幸せになるはずです！", 1, 4691, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "食べ物がたくさん\n入った福袋は\nないんでしょうか…？", 1, 4692, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "初詣で何を\nお願いしましょう…\n五穀豊穣？", 1, 4693, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ずっとこうして\n年の始まりを\n過ごしたいですね", 1, 4694, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつか二人きりで\n初日の出を\n見たいです", 1, 4695, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お餅おかわりです！\nいくらでも\n食べられますよ！", 2, 4696, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おせちの食材を\n取りに行きませんか？\nいい運動です☆", 2, 4697, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "凧揚げって\n難しいですね～\n糸が絡まっちゃいます", 2, 4698, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一年の計は元旦にあり\n今年一年分の\n献立を作りましょう！", 2, 4699, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ほらほら！\nもっと近くで着物を\n見ていいんですよ☆", 2, 4700, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたはどんな\n初夢を見ましたか？\nわたしは…内緒です☆", 2, 4701, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "年明けの朝は\n心なしか\n気持ちいいですね☆", 2, 4702, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お雑煮のあとは\nおしるこで\nおやつタイムです！", 2, 4703, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あたたかくして\n幸せな初夢を\n見ましょうね", 2, 4704, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ～屋台巡りを\n満喫しました☆\n一休み一休み", 3, 4706, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "縁起のいい\nぬいぐるみを並べて\n福を呼びましょう！", 3, 4707, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おしるこのアロマって\nないんでしょうか？\nそれなら作るしか…", 3, 4708, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここでお餅を\n焼いたらおいしく\nなりそうですね～♪", 3, 4709, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしすぎて\n食べる手が\n止まりません～", 3, 4711, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "新しいおせち料理の\nヒントは…なるほど…\nふむふむ…", 3, 4712, 111801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お兄ちゃんとあんな\n特訓やこんな特訓が\nしたいなぁ、えへへ♪", 1, 4714, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お兄ちゃんに褒めて\nもらうと、身体が\nじぃーんと\n熱くなっちゃいます♪", 2, 4715, 100601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "見目麗しい衣装に\n身を包むのも\n悪い気分では\nありませんね", 1, 4716, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "縁起物で\n験を担ぐというのも\nたまにはよいでしょう", 1, 4717, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "非効率なので\nあまり行いませんが\n私も手料理くらいは\n作れるのですよ", 1, 4718, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "研究のためなら\n時に遠路を超え\n実地へ赴くことも\n必要なのです", 1, 4719, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "トゥンヌスの\n突然変異…\n大いに興味を\nそそられますね", 1, 4720, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "漁師の技法も\n再現できたことで\nまた一つ、仮説が\n実証できました", 1, 4721, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "正月くらいは\n私ものんびりしたい\n気持ちなのですよ\n意外ですか？", 1, 4722, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "模倣に頼らずとも\n衣装に合わせた\n所作程度は\nできて当然です", 2, 4723, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お年玉の使い道は\n思いつきましたか\nゆっくり考えても\nいいのですよ", 2, 4724, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "トランプでも花札でも\n相手をしましょう\n手心が必要なら\nいつでも言いなさい", 2, 4725, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "初詣でお祈りする\n内容ですか\n…ヒミツ、として\nおきましょう", 2, 4726, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私たちでオーマ中の\nトゥンヌスを\n釣り上げましょうか\n…冗談ですよ", 2, 4727, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "見返りを求めない願い\nそれは祈りに通じるの\nかもしれませんね", 2, 4728, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "…貴方がその眠たげな\n顔を洗ってくる間に、\n温かいお茶でも\n淹れておきましょう", 2, 4729, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "さて、本格的に\n活動を再開します\n貴方も同行しなさい\n昼食は済みましたか？", 2, 4730, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "私はもう少し\n作業を片付けてから\n寝ることにします\n早く眠りなさい", 2, 4731, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "少し休みます…\n時間が来たら\n起こすように", 3, 4733, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "贈り物を模倣して\n潜入…試してみる\n価値はありそうですね", 3, 4734, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "嗅覚から得られる\n情報量は侮れません\n動物の模倣において\n注意すべき点ですよ", 3, 4735, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "穏やかな炎による\nリラックス効果は\n本能によるものかも\nしれませんね", 3, 4736, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いかなる強者でも\n兵站、補給は\n必要なものです", 3, 4738, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あらゆる学問は\n完璧な模倣のための\n大きな礎となります", 3, 4739, 115001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新たに得たこの力で\n仲間と目指す未来を\n切り拓いてみせます", 1, 4741, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここは、みなさまと…\nわたくしの\n帰る場所でございます", 1, 4742, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "主さまも精霊の召喚を\n試してみますか？", 1, 4743, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "主さま、おこづかいは\n足りていますか？\n遠慮は無用ですよ", 1, 4744, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この装束をまとうと\n自然と背筋が伸びる\n思いがいたします", 1, 4745, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "進化した精霊に\n負けぬよう\n修行に励みます", 1, 4746, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "仲間たちといられる\nこの幸せが、末永く\n続きますように…", 1, 4747, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "主さまのお手手は\n大きくて温かいですね\nぎゅっぎゅっ…ふふ♪", 2, 4748, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今度、主さまにも\n里に伝わる昔話を\nお話しいたしましょう", 2, 4749, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "里で採れた果物を\n持って参りました\n召し上がってください", 2, 4750, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "里のお土産を\nここのみなさまに\nお配りいたしましょう", 2, 4751, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "仲間と囲む食卓…この\n温もりは、みなさまの\n心の温かさなのですね", 2, 4752, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "主さまに名前を\n呼んでいただくと\n心が温かくなります♪", 2, 4753, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふふっ…主さま\n寝癖がついて\nおりますよ？", 2, 4754, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日の昼食は\n里の伝統料理です\nお口に合うでしょうか", 2, 4755, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "主さまが眠れるよう\n安らぎの風を…\nおやすみなさいませ", 2, 4756, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この癒し…\n主さまにも味わって\nいただきたい…", 3, 4758, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この愛らしさ…\n精霊たちと似たものを\n感じます…♪", 3, 4759, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "精霊よ…この安らぐ\n香りを、隅々まで\n届けてくださいまし", 3, 4760, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "瞑想するのに\nちょうどよい暖かさで\nございます", 3, 4761, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "進化した精霊を\n使役するためにも\nよく食べて体力を…！", 3, 4763, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "風の精霊について\nもっと詳しく知って\nおかなければ…", 3, 4764, 115501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "儀式の時を思い出して\n精霊に呼びかける…\n出ておいで～♪", 1, 4766, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ひゃうっ！　もう…\n急に背中を触るなんて\nいたずら好きな精霊に\n育てた覚えはないのに", 1, 4767, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "儀式用の衣装…\nあんまり激しい動きは\nできないよね…でも\n戦う時は気にしない！", 1, 4768, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そうだ…精霊に\n騎士クンのそばで\n見守っていてって\n頼んでみようかな…", 1, 4769, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふふっ、こうやって、\n楽しく精霊とお話し\nしていられる、平穏な\n日々が続くといいな", 1, 4770, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "き、きき、騎士クン！\nわたしと、あの…！\nうう…練習ですら\n上手く誘えないよぉ…", 1, 4771, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あっ、精霊が…\nふふ、応援ありがとう\nわたしの想い…いつか\n必ず伝えるね", 1, 4772, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新しく覚えた料理\n作ってみたんだけど\n騎士クンも食べない？", 2, 4773, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "騎士クン、\n疲れてない？\nわたしと精霊で\n治療するよ？", 2, 4774, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もう、いたずらしない\n…騎士クン！？\nご、ごめんなさい！\n精霊だと思って！", 2, 4775, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "騎士クン！\n時間が合ったら、\n精霊と一緒に\nお話しない？", 2, 4776, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…こういう服着るの\n初めてなんだけど…\nえっ、かわいい…？\nあ、ありがとう…！", 2, 4777, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "困ったことがあったら\n相談してね。わたし、\n騎士クンのためなら…\n色々できるよ、色々！", 2, 4778, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう騎士クン！\n今からお外で\n瞑想するんだけど…\n騎士クンもどうかな？", 2, 4779, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼の時間だ\nご飯ならわたしが\n用意するから\nゆっくりしてて", 2, 4780, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\n騎士クン、はいどうぞ\n寝る前の温かいミルク\nぐっすり眠れるよ♪", 2, 4781, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…うん、落ち着く\n精霊との魔法で\nこんな風に誰かを\n安心させたいな", 3, 4783, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい…\n精霊も気に入ってる…\nそうだ、同じ物\n作ってあげようかな？", 3, 4784, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…これ、\nうちに置いたら、\nお母さん喜ぶかも！", 3, 4785, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\nまるで誰かが\n抱きしめてくれた\nみたい…", 3, 4786, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "自然の恵みに\n感謝して…\nいただきます♪", 3, 4788, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "もっと精霊について\n勉強して、みんなを\n守れるように\nなりたいな…", 3, 4789, 115601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "アイツといると胸が\nぎゅーっとなる…\nこれってもしかして…", 1, 4791, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "アンタとならきっと\nどんなゲームでも…\nそ、その、たた、\n楽しいって思えるわ！", 2, 4792, 102201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "色んな人と話したら\n記憶探しの手がかりが\n見つかるかも…？", 1, 4793, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アイスクリームでも\n作ろうかしら？\nバニラにミントに…", 1, 4794, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ネビアに話しかけると\n逃げられるのよね…\nもう、襲わないのに…", 1, 4795, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "「コッコロさん」、\n「コッコロさん」…\n…間違えないように…", 1, 4796, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "最近少し太ったかも？\nきっとおいしいもの、\n食べ過ぎね…", 1, 4797, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ここにいると、\nとても落ち着くわ…\n自分の家、だものね", 1, 4798, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "みんなと一緒の時間、\nずっと記憶に残したい\n…そう思っているのよ", 1, 4799, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ドラゴン族って、\nそんなに珍しいの？\nあまり実感ないけど…", 2, 4800, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "料理、練習してるのよ\n…味見してもらえる？\n期待はしないでね", 2, 4801, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "頭を叩いたら、\n記憶が戻ったり\nしないかしら…？\nやらなくていいわよ？", 2, 4802, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "赤ちゃんみたいだった\n時のことは、忘れて…\nお願いだから…", 2, 4803, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひゃんっ！？\nし、しっぽを掴むのは\nダメよ？", 2, 4804, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "記憶が戻っても…\n私は、あなたたちと\n一緒にいたいわ", 2, 4805, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう。\n寝ぐせついてるわよ？\n…ふふっ、これでよし", 2, 4806, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろお昼かしら？\nおいしいごはんを、\nみんなで一緒に…ね", 2, 4807, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間ね。\nそろそろ休みましょ？\n…ふわぁ…", 2, 4808, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか、ぎゅう～…\n…あっ、これはその…\nストレッチしててっ…", 3, 4810, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あまり、興味ないわ。\nけど…けど…\n…か、かわいい…", 3, 4811, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りね。\nとっても落ち着くわ…\n…っくしゅっ", 3, 4812, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "冷やす方が得意だけど\nあったかいのも、\nキライじゃないのよ", 3, 4813, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "別に、食いしん坊\nじゃないのよ？\nでも、もう一口だけ…", 3, 4815, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ん…なるほどね。\n勉強になるわ…", 3, 4816, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着の探偵か…\nちょっと恥ずかしい\n気がしてきたよ…", 1, 4818, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "依頼があれば\n海でも山でも\n赴くさ！", 1, 4819, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今のうちに\n助手くんの秘密を…\nわ…私はなにをっ！？", 1, 4820, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "休暇も時には必要さ\n海でゆっくりと…\nむっ？　事件の気配！", 1, 4821, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "探偵の秘密道具…\n水着だと隠す\n場所がない…！", 1, 4822, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "そろそろ助手くんが\n現れる時間かな？\nふふっ、楽しみだね", 1, 4823, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "真実は私と助手くん\n二人だからこそ\n解き明かせるのさ", 1, 4824, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ひゃああっ！？\nわ、私の不意を突く\nとは…やるね助手くん", 2, 4825, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さて、なにか気づいた\nことはあるかな？\n言ってごらん♪", 2, 4826, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この感触…分かった！\n助手くんだね！\nふふっ、やっぱり♪", 2, 4827, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "水着…どうかな？\n探偵らしさは\n残してるつもりだけど", 2, 4828, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ん？　依頼かな？\n助手くんの頼みなら\nなんでもお安い御用さ", 2, 4829, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "助手くん、私と海に\n行かないかな\n…事件じゃないよ？", 2, 4830, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "珈琲でも淹れて\n目を覚ますとしよう\n一緒に飲むかい？", 2, 4831, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食は済ませた？\nなにを食べたか\n当ててあげよう！", 2, 4832, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜は謎が深まる時間…\n闇に覆い隠された真実\n必ず暴いてみせる！", 2, 4833, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さて、推理の時間だ\n…サボってないよ？\n考えてるんだからね？", 3, 4835, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これはもしや、中に\n秘密のメッセージが？\n…かわいいだけだね", 3, 4836, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふむ、なんだか\n頭がスッキリするね\n…閃いた！", 3, 4837, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポカポカするね…\n助手くん\n君もおいでよ", 3, 4838, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむ、はむ…んぐっ\nた、食べてるところを\n見つめられると～…", 3, 4840, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "秘密の依頼とか\nこういう場所に\n隠したりするよね…♪", 3, 4841, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "これはいい乗り心地だ\n事件現場にこれで登場\n…は、やめておこう", 3, 4843, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "不思議な感触だね…\nでも、いい発想が\n生まれてきそうだ…♪", 3, 4844, 115701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "これはあたしが\n前へ進むために\nあいつがくれた\n大切な力…！", 1, 4845, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "チェンジ・\nプリンセスフォーム！\n練習練習、っと", 1, 4846, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もうあいつに助けて\nもらいっぱなしの\nあたしは…\n卒業しなきゃね", 1, 4847, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "気ままに、お気楽に\nあいつと冒険する…\nそれって幸せよね", 1, 4848, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "プリンセスフォーム…\nお姫様みたいね\nあたしがお姫様か…\nそっかぁ…ふふ♪", 1, 4849, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつと繋がって\n生まれたこの絆は\nあたしの宝物だわ", 1, 4850, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あたしの命の使い方…\n全て受け止めてくれた\nあいつにだったら…", 1, 4851, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふふ～ん♪\nプリンセスフォームの\n天才魔法使い\nキャル様に用かしら？", 2, 4852, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これからは\nあたしの力で\nなんでもパパっと\n解決してあげるわね！", 2, 4853, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魔力がみなぎってる…\nねえ、もしかして\n今のあたしって本気で\nすごいんじゃない？", 2, 4854, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "変身の反動で\nお腹が空いても\n魔物料理だけは\nいやだからね！？", 2, 4855, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねぇ、あんたになら\nあたしの心…\n全部預けていいかも", 2, 4856, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつと一緒に\nいられたら、他には\n何も…って、あああ\nあんたいつの間に！？", 2, 4857, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きも悪くないわね\n読みかけの魔導書\n今のうちに\n読んじゃおうかしら", 2, 4858, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ねぇ～お腹すいたー\nあんたなんか\n作りなさいよ\n魔物料理以外でね！", 2, 4859, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふぁぁ…眠すぎて\n今なら変身しても\nお腹が減らない\n自信があるわ…", 2, 4860, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あー♪　最っ高！\n休んで魔力を高めて…\nあいつの役に\n立ってあげなきゃね", 3, 4862, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なにこれかわいい…！\nコレクションにしたく\nなっちゃうじゃない", 3, 4863, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…すごく\nリラックスできるわ…\nあ、いい感じの魔法\n思いついちゃったかも", 3, 4864, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\n落ち着くわ…\nあいつの手の\nぬくもりみたいね", 3, 4865, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "プリンセスフォーム…\nこ、こんなに\nお腹が減るのね\n甘く見てたわ…！", 3, 4867, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ま、魔物料理の本！？\n誰よこんな本\n買ったの！　って…\n一人しかいないか", 3, 4868, 180601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "憧れの舞踏会…\n私、きちんと\n踊れるかしら", 1, 4870, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アン・ドゥ・トロワ\nアン・ドゥ・トロワ\n練習はばっちりね♪", 1, 4871, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こんなにすてきな\nドレスを着られて\n本当に夢みたいだわ♪", 1, 4872, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魔法はいつか解ける…\nでも、その時間は心に\n残り続けるわ♪", 1, 4873, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ガラスの靴は夢へ\n踏み出す魔法の道具…\n私、がんばっちゃう！", 1, 4874, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "舞踏会であなたと\n一緒に踊れたら\nいいのにな", 1, 4875, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "舞踏会に行く前に\n運命の王子様には\n出会ってるのよね", 1, 4876, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうかしら？\n私、きちんとドレス\n着られてる？", 2, 4877, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなたも一緒に\n踊ってみる？\nしゃなりしゃなり♪", 2, 4878, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたにエスコート\nされてきれいなお城を\n歩いてみたいわ♪", 2, 4879, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "どう？　レッスンの\n成果はきちんと\n出てるかしら？", 2, 4880, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたが隣にいれば\n私も立派なお姫様に\n見えるかしら♪", 2, 4881, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私にとって\n一番の魔法はあなたが\nくれる勇気よ♪", 2, 4882, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さぁ！　今日も一日\n立派な淑女を目指して\nいきましょう♪", 2, 4883, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはん代わりに\nメタモルアップルを\n食べておきましょう", 2, 4884, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ魔法が解ける\n時間…でも淑女の\n心得は忘れないわ♪", 2, 4885, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "淑女にも休息は\n必要よね…少しだけ\n休ませてもらおっと", 3, 4887, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいものに\n囲まれた部屋も\n女の子の夢よね…", 3, 4888, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すてきな香り…\nお花かしら？\n森で探してみようかな", 3, 4889, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かい…暖炉のそばで\nおとぎ話を聞くのも\nいいわよね♪", 3, 4890, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "レッスンのために\n栄養補給して\nおかないと！", 3, 4892, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "教養を身に着ける\nことも大切よね！\nなになに…", 3, 4893, 115801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "や、やっぱスカートは\n落ち着かねえな…\nなんか、\nスースーするしよ…", 1, 4895, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "せっかくこんな格好\nしてるし、いつもとは\n違う剣術の訓練を\nしてみるかな", 1, 4896, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "さて、他の連中が\n帰ってくる前に、\nなんか料理でも\n作っといてやるか", 1, 4897, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こ、こんな服着てる\nわけだし、紅茶とか\n楽しんじゃっても\n変じゃないよな！", 1, 4898, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暇だし運動でも…\nあ、あぶねえ！\nスカートなの忘れてた\n…誰も見てねえよな？", 1, 4899, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "紅茶が切れてるな…\nよし、あいつと一緒に\n買い物にでも行くか♪", 1, 4900, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…あいつがいねえと、\nつまんねえな…ったく\n飯用意してやるから、\n早く帰ってこいよな…", 1, 4901, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ、あんまり\nジロジロ見んなよ\n…結構、\n恥ずかしいんだからな", 2, 4902, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ダンスの相手は\n無理だが、\n剣の訓練なら\nいつでも付き合うぜ！", 2, 4903, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この服に\n触りたいのか？\nすごい作りだし、\n気持ちは分かるぜ", 2, 4904, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お、いいところに！\nクッキーを焼く\nところだったんだが、\nおまえも食うか？", 2, 4905, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おまえにもこういう服\n似合うんじゃねえか？\n今度あたしが\n選んでやるよ♪", 2, 4906, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…おまえの前でなら、\nこういう格好を\nすんのも…\nな、なんでもねえよ！", 2, 4907, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝の訓練を始めるか\n時間あるなら、\nおまえも付き合えよな", 2, 4908, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もうこんな時間か…\n昼飯作るけど、\nなんか\n食いたいものあるか？", 2, 4909, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "眠れないなら、\nホットミルク飲むか？\n体あったまって、\n眠くなると思うぜ", 2, 4910, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと休憩して…\nおっと、服にしわが\nできないように\nしねえとな", 3, 4912, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "だ、誰も\n見てねえよな？\n…よ～しよしよし、\nかわいいなおまえー♪", 3, 4913, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すげぇいい香りだな\nうちの居酒屋にも…\nいや、合わねえか", 3, 4914, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったけぇ…\nちょっとだけなら、\n寝ちまっても\nいいよな…？", 3, 4915, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これうめえな！\nたぶん材料は…よし！\nあたしも作ってみるか", 3, 4917, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本は…\n誰でも分かる作法…か\n最低限このぐらいは\n勉強しとくか…", 3, 4918, 115901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ミミがおとなに\nなっても\nおにいちゃんとは\nずーっといっしょ♪", 1, 4920, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ミミとくべつなだっこ\nしてほしいな…うん！\nおひめさまだっこ～♪", 2, 4921, 102001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "次はにいちゃんに\nどんなイタズラしよう\n早く会いたいな～", 1, 4922, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ミソギの特別な\nイタズラ見てくれる？\nいいよねっ♪", 2, 4923, 100401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "大人になったら、\nあの人と何しようかな\n…楽しみだなぁ", 1, 4924, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "頭を撫でないで\nください！　もう、\n少しだけ、ですからね", 2, 4925, 103601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "くるくる〜♪\nうちのドレス\nかわええなぁ", 1, 4926, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "日差しは苦手やけど\nたまにはひなたの下で\nぽかぽかしたいわぁ", 1, 4927, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "外はお花が咲いてる\n久しぶりにお花を\n活けたいなぁ", 1, 4928, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お花をたくさん集めて\nギルドハウスに飾れば\n喜んでくれはるかな", 1, 4929, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あたたかい日は\n紅茶を飲みながら\nゆっくりしたいなぁ", 1, 4930, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お稽古事を始めるなら\nうちに言ってな\nどんなことも教えたる", 1, 4931, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うちにいろんな夢を\n見せてくれはって\nほんま、おおきにな♪", 1, 4932, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "王子はん\n一緒におとぎの国へ\nお散歩にいきまひょ♪", 2, 4933, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふんふんふ〜ん♪\n今な、王子はんに\n花冠を作ってるんよ", 2, 4934, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "王子はんは\nお菓子好きどす？\nうち、作りますわ", 2, 4935, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うーん。ドレスの柄は\nお花とお星さま\nどっちにしまひょか", 2, 4936, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "王子はんとの\n思い出が増えるたび\nうちの宝物も増えます", 2, 4937, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "王子はんと一緒なら\nどんな場所でも\n夢の国になりますわ", 2, 4938, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "夢の中におりたいけど\n王子はんに会いたくて\n起きてもうたわ♪", 2, 4939, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "王子はん一緒に\nアフタヌーンティー\nいかがやろか？", 2, 4940, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の舞踏会…\n夢が広がるわぁ\nもちろんお相手は…♪", 2, 4941, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわふわや〜\nなんや心地よぉて\n眠ってしまいそうや…", 3, 4943, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かいらしいなぁ\n新しいお洋服でも\n作ってあげまひょか♪", 3, 4944, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お花やろうか…\nリラックスできて\nええ香りやねぇ", 3, 4945, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こういう場所で\n絵本を読むと\n気分が出てええなぁ♪", 3, 4946, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "舞踏会を楽しむなら\nたくさん食べて\nたくさん踊りまひょ", 3, 4948, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "うち、この本好きや\n王子さまと結ばれる\nお姫さまのお話なんよ", 3, 4949, 116001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はぁ、宿題めんどい…\nこれは楽しくない…\nこんな青春いらない…", 1, 4951, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "奨学金の道は遠いなぁ\nメルクリちゃんたちが\nお金くれればいいのに", 1, 4952, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アオイちゃん元気かな\nチエルに会いたくて\n泣いてるんだろうな…", 1, 4953, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "暇だし鏡でも見るか…\nうわ、顔良っ！\nえ誰この超絶美少女！", 1, 4954, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ワンツーワンツー♪\nうーん…カルミナの\n振りコピ難しいにゃー", 1, 4955, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "先輩も運動してます？\nチエルが一緒に走って\nあげてもいいですよ？", 1, 4956, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年のテレフェスも\n今から楽しみだなあ…\nまた一緒にお化け屋敷\n入ってくださいね", 1, 4957, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちぇる～ん☆\nフェス仕様でも\nかわいいちえるん！", 2, 4958, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いま話しかけないで！\n来年の聖学祭ライブの\nイメトレ中なんです！", 2, 4959, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クロエ先輩のウェア姿\nめっちゃカッコよ！\n思わずおへそ触ったら\nぶたれましたけど", 2, 4960, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ユニ先輩の体操着姿…\nあれはあれで実に良き\n一生見てられますよね", 2, 4961, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "先輩って体操着持って\nないんですか？　ハ？\nチエルのを貸せと…？\nえっ…変態かな？", 2, 4962, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "テレフェスでは先輩も\n地味に頑張ってました\nね。まあ格好よかった\nんじゃないですか…", 2, 4963, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはちぇる～ん☆\nさあ今日も楽しいを\n探しに行きますよー！", 2, 4964, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "先輩ビッグニュース！\n今からお昼ごはん\nおごらせてあげます！", 2, 4965, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "こんばんちぇるるん☆\nさあ朝まで楽しいを\n探しに行きますよー！", 2, 4966, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ…ふかふか～…\n運動の後は…眠たく…\nなり…ま…", 3, 4968, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ユニ先輩に似合いそ！\nいやクロエ先輩かな？\nチエルは当然すぎて…", 3, 4969, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "やん、いい香り～！\nまるでチエルのために\n存在するみたい！", 3, 4970, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この火を使って\n聖火リレーしましょう\n先輩、一本抜いて！", 3, 4971, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あむあむ…ちゃんと\n食べないとユニ先輩\nみたいになっちゃう！", 3, 4973, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…ちゃんと\n読まないとクロエ先輩\nみたいになっちゃう！", 3, 4974, 116301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今なら書ける気がする\n私の本当の\n想いを込めた\nラブソングを！", 1, 4976, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "輝きを増した私を\nいっぱい見てね！\n…ちょ、ちょっと\n見つめすぎだよ！", 2, 4977, 102901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "テレフェスかぁー…\nあんまいい記憶ないな\nよし、忘れとこ", 1, 4978, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "暇だし鏡でも見るか…\nふふ～ん…いいじゃん\nあ？　何見てんだコラ", 1, 4979, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ワンツー、ワンツー♪\nああクソ、難しいな…\nあ？　何見てんだコラ", 1, 4980, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アオイ元気してるかな\nまた絶叫したり白目\n剥いたりしてんのかな", 1, 4981, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ミフユねえさんが\nバイトリーダーしてる\n工場…うちも行くか…", 1, 4982, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "うーん…今日の晩御飯\n何にすっかなァ…\nあんたも食べてく？", 1, 4983, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年のテレフェスは\nどーなンだかねえ？\nま、一緒にまた弟の\n相手してやってよ", 1, 4984, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "体操着なんてフツーに\n着てもつまんないし？\nその辺センス出るよね", 2, 4985, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "奨学金の道、遠くね？\nアキノ先輩と仲良く\nなった方が早いかも…", 2, 4986, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あんた体操着は持って\nないの。ハ？　うちの\n貸せって？　いいけど\n…いや、よくねえよ", 2, 4987, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "にゃんっ！\nや、だからさ…急に\n話しかけんなっての", 2, 4988, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "え、なに？　この服？\nハ？　似合ってる？\n…え、聞こえなかった\nちょ、もっかい言って", 2, 4989, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたもテレフェスで\n一応は頑張ってたよね\nま格好よかったんじゃ\nないの。知んないけど", 2, 4990, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁ～あ…おはーす\n昨日も寝たの遅くて\nまだ目がショボだよ…", 2, 4991, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "なに。あんた昼御飯\nまだなの。じゃ、うち\n適当になんか作ろうか", 2, 4992, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜っていいよね。色々\n見えすぎない感じとか\n…この話したっけ？", 2, 4993, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ、ヤバ…運動の後に\nこのフカついたのは…\n秒でスヤれる…すやぁ", 3, 4995, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "へーこんなんチエルに\n似合いそうじゃん。\n…いやユニ先輩かな？", 3, 4996, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お、なんか良さげな\n香りじゃん。これは\n何の…いや分かんね", 3, 4997, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "熱ッ！　この野郎なに\n爆ぜてンだコラァ！\n濡らすぞ木、てめえ！", 3, 4998, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "何コレよく分かんない\nけど、今日モヤシしか\n食ってないから助かる", 3, 5000, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "今日、体操着だしね。\n読書には逆アドかな。\nうん帰ろ。いやあ残念", 3, 5001, 116201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ビッグボス・イノリ様\nふっふっふ…\nしびれる響きです！", 1, 5003, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いつかお兄さんを\nあたしの側近に\nしてやるですよ！", 1, 5004, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ビッグボスになったら\nみんなからたくさん\nお菓子をもらうです！", 1, 5005, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふふん！\nこの服はあたしにしか\n着こなせませんよ！", 1, 5006, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ばーんと立って\nどーんと腕を組む！\nこれがボスのポーズ！", 1, 5007, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "イノリ様の側近に\n選ばれるなんて\n名誉なことですよ！", 1, 5008, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "未来の側近として\nあたしをしっかり\n甘やかすですよ！", 1, 5009, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あたしがお兄さんを\n立派なギャングに\nしてあげますからね！", 2, 5010, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "側近たるもの\nボスを甘やかなさいと\nだめですよ！", 2, 5011, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なに見てやがるです…\nくぅ、分かりました！\nお菓子は半分こです！", 2, 5012, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄さんも\nあたしがボスなら\nうれしいですよね！", 2, 5013, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄さんが側近なら\nあたしも安心して\n夜眠れるですよ！", 2, 5014, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ビッグボスになったら\nお兄さんにいい思い\nさせてあげますから！", 2, 5015, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ボスたるもの\n早起きは鉄則ですよ！\nふぁあ…", 2, 5016, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹が空きました…\nご飯食べにいきますよ", 2, 5017, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ボスたるものぉ〜…\n夜更かしぐらい当然…\nぐー…", 2, 5018, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "は〜これは人をだめに\nしやがるやつですね\nあたし専用です", 3, 5020, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これはけしからん\nかわいらしさですね\nあたしにぴったりです", 3, 5021, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "高級な香りがするです\nボスになったら\n部屋に置いてやるです", 3, 5022, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいですねぇ\nちょっとこのまま\n一休憩です…", 3, 5023, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむはむ♪\nボスたるもの食べねば\n戦はできませんよ！", 3, 5025, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ボスなら経済書ぐらい\n…う。難しくて\n読めねーです…", 3, 5026, 116501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あなたはドジな私を\n受け入れてくれる…\nだから、頑張れます！", 1, 5028, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "何でも仰ってください\nちょっぴり大胆な\nことでも…な～んて♪", 2, 5029, 102501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あーあー、よし\nのどの調子もいいし\nはりきってガイド\nしてくるか！", 1, 5030, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さあ、そろそろ行くか\nガイドが\n遅刻したんじゃ\n話になんないからな", 1, 5031, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "しれっとドラゴン族が\n旅行に来たり\nしてくれないかな", 1, 5032, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "たぎるガイド先…\n火山、魔物の巣…\nダメだ、そんなとこ\nオレしか行けないや", 1, 5033, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この前行った絶景\nスポットよかったな\nキレイな景色を見る\nのもいいもんだぜ", 1, 5034, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お、今日はカレと\n一緒か。なんだか\nやる気出てきたぜ！", 1, 5035, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "カレにガイドして\nもらったら\nどこに行っても\n楽しいだろうな", 1, 5036, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "よっしゃあ！\nどっちが上手く\nガイドできるか\n勝負しようぜ！", 2, 5037, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "飯でも食いがてら\nおススメの店の\n下調べでもしようぜ！", 2, 5038, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なかなかいいだろ？\nこの格好。キミも\n作ってもらったら\nどうだ？", 2, 5039, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "普通は行けない\n場所とか行きたいよな\nキミならどんな\nとこがいい？", 2, 5040, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ガイドの仕事は\nキミの方が得意そうだ\n参考にさせてもらうぜ\nよろしくな！", 2, 5041, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミの探してきた店\n結構よさそうじゃん\nそうだ、今度二人で\n下見に行こうぜ！", 2, 5042, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "いい朝だな。絶好の\n仕事日和だぜ！\n今日もよろしくな！", 2, 5043, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "よし、昼飯にしよう\nこの後も激務だし\n飯抜きじゃあ\nぶっ倒れちまうからな", 2, 5044, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お疲れさん！　さーて\n次はオレと遊んで\nくれよ。まだまだ\nいけるだろ？", 2, 5045, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ガイドは一日\n歩きっぱなしだからな\nゆっくり休ませて\nもらうぜ", 3, 5047, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ、どこで\n売ってるんだろ？\n土産の情報も\n仕入れとかなきゃな", 3, 5048, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アロマとかよく\n分かんねえけど\n土産にはいいかもな\n覚えておくぜ", 3, 5049, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体が温まると心も\n熱くなるんだよな\nいい仕事が\nできそうだぜ", 3, 5050, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べ放題か\nこれはお客さんも\n喜んでくれそうだな！", 3, 5052, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "へえ、こんなスポット\nあったんだ。やっぱ\nたまには勉強も\nしとくもんだな", 3, 5053, 116601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "バイト先になじめる\nように笑顔の練習を！\nに、にへぇ〜…", 1, 5055, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "働いて働いて働いて\n…いつかその先に\nぼっちの出口が\n見えるのかも…！", 1, 5056, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "バイトのイメトレを\n始めます。ポーズを\n決めて…よし！\n角度を変えて…よし！", 1, 5057, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "バイト仲間に入る\nためには厳しい修業が\n必須と聞きました…！", 1, 5058, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "どんどん技術を磨いて\nバイト仲間として\n認めてもらうんです！\n目指せ職人技…！", 1, 5059, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人が応援して\nくれる…だから必ず\nバイト仲間の輪に\n入ってみせます…！", 1, 5060, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人がいてくれると\n勇気が湧いてきます…\nぼっち卒業を夢見ても\nいいんだ、って…♪", 1, 5061, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "緊張するけど\n思い切って声をかけて\nみます…バイト仲間に\n入るために…！", 2, 5062, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぼっちの私が\nおもちゃ作りで\n人と共同作業…！\nか、感動です…！", 2, 5063, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "好きなおもちゃって\nありますか？　私は\nもちろんマイフレンド\nくんです！", 2, 5064, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "私が作ったおもちゃも\n誰かの友達に\nなってたら\nいいなぁ…♪", 2, 5065, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今日も明日もバイト\nですね！　バイト\n仲間ができる日が\n楽しみです…♪", 2, 5066, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "脱ぼっちを目指して\nこれからも一緒に\n頑張りましょう！\n目指せ、バイト仲間！", 2, 5067, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n今日も気合いを入れて\nおもちゃ作りします！", 2, 5068, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ランチの時間です…♪\nもちろん工場の隅で\nぼっち飯です…！", 2, 5069, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ…今日も\nお疲れさまでした\n明日も働きます～！", 2, 5070, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "バイトで頑張った日は\nふわふわの誘惑に\n勝てません…", 3, 5072, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうおもちゃの\nアイデアも\n素敵かも…♪", 3, 5073, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りがする\nおもちゃはどうかな…\n森の薬草を使って…", 3, 5074, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽか…\n幸せなひとときですね", 3, 5075, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…たくさん\n食べて厳しいバイトを\n乗り切ります…！", 3, 5077, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…おもちゃの\n設計図を見るのも\n勉強になりますね！", 3, 5078, 116701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "う～ん\n次はどんなたい焼きを\n作ろうかにゃぁ…", 1, 5080, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしが売る\nたい焼きには\n夢が詰まってるにゃ！", 1, 5081, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いつか絶対に\nたい焼き工場を\n建て直してみせるにゃ", 1, 5082, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "たまにたい焼き以外の\nおやつも食べるにゃ\nたとえば煮干しとか！", 1, 5083, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "悪い商売人がいたら\nファントムキャッツに\n知らせるにゃ！", 1, 5084, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミと一緒にいると\nたい焼きのアイデアが\n次々出てくるにゃ♪", 1, 5085, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "出来ないことも\nキミと一緒にいれば\n出来る気がするにゃ♪", 1, 5086, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なんにゃ～？\nお姉さんにかまって\nほしいのかにゃ♪", 2, 5087, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キミ、いいところに！\nあたしとライバル店へ\n視察にいくにゃ！", 2, 5088, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "くんくん…この匂い！\nたい焼き持ってるなら\nちょうだいにゃ♪", 2, 5089, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "次はどんなたい焼きを\n売ろうかにゃ～\nキミの案も欲しいにゃ", 2, 5090, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ファントムキャッツに\n相棒が必要にゃ\nたとえばキミとか…", 2, 5091, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "相棒！\n…ってキミのこと\n呼んでいいかにゃ？", 2, 5092, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きは三文の徳にゃ\n今日もたい焼き\n売れますよーににゃ！", 2, 5093, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空いたにゃ…\n賄いのたい焼きを\nいただくにゃ！", 2, 5094, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "猫は夜が本番にゃ\nでもあたしは…\nふわぁ～眠いにゃ…", 2, 5095, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかにゃ～\nここで体を丸めて\n一眠りしたいにゃ", 3, 5097, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これは…！\n猫にも負けない\nかわいさだにゃ…！", 3, 5098, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りにゃ～\nゴロゴロのどが\n鳴りそうだにゃ～", 3, 5099, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふにゃ～…\nこのまま働かずに\nまるまってたいにゃ…", 3, 5100, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "商売は戦いにゃ\nたくさん食べて\nたくさん働くにゃ！", 3, 5102, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ。たい焼きの\nアレンジレシピ集…\nためになるにゃ…", 3, 5103, 116801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お芝居の前に\nお兄ちゃんの顔を\n見ると、とっても\n落ち着きますぅ…♪", 1, 5105, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "お兄ちゃんにもっと\n見てもらいたい…\nだから私…\n強くなりたいです…！", 2, 5106, 102101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さらなる効率化で\nみんなといい仕事を\nしたいわね！", 1, 5107, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "他のバイトとの\nスケジュールを\n調整しないと…", 1, 5108, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "時給がアップしたわ！\n働きが認められると\nやる気が出るわね", 1, 5109, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "効率的に動ければ\n業務を追加できる…\n燃えてきたわ！", 1, 5110, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "帳簿付けのコツ…\nユカリさんに教わって\nみようかしら", 1, 5111, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "バイトリーダーとして\nみんなをビシバシ\n鍛えていくわ！", 1, 5112, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "戦いでもバイトでも\nキミなら安心して\n背中を預けられるわね", 1, 5113, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうしたの？\n仕事のことなら\nなんでも相談してね！", 2, 5114, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さすがは私の弟子ね\nこれなら安心して\n仕事を任せられるわ", 2, 5115, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "みんなのお手本になる\n働きぶりを見せないと\nいけないわね！", 2, 5116, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "キミのこと…もっと\n頼りにしちゃっても\nいいのかしら…？", 2, 5117, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふふ、キミも一人前の\nバイト戦士として\n立派に成長したわね！", 2, 5118, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "新しいおもちゃの\n企画書を作ってみたの\nちょっと見てくれる？", 2, 5119, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は一番効率がいい\n時間帯よ！\nバリバリ働くわよ！", 2, 5120, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "さ、お昼に行きましょ\n今日の日替わり定食は\n何かしら…楽しみね♪", 2, 5121, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\nちゃんと寝て明日に\n備えなくちゃね", 2, 5122, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "適度な労働と休息の\nサイクルが最大効率を\n生み出すのよ…ふぅ…", 3, 5124, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はぁ～なんて素敵な\n抱き心地なのかしら…\n最高効率の癒やしね♪", 3, 5125, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "落ち着く香りね…\nなんだか集中力が\nアップした気がするわ", 3, 5126, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふぅ…癒されるわね…\n仕事のオンオフの\n切り替えは重要よね", 3, 5127, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "働くためには\nエネルギーをちゃんと\n摂っておかないと", 3, 5129, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "効率を上げるため\n生産管理の勉強も\nしておきたいわね", 3, 5130, 116901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "変身している間に\n色々と試しておこう\nまずは…", 1, 5132, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "飛べるというのは\n便利だな。料理が\n暖かいうちに\n持ち帰れる", 1, 5133, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "プリンセスか…\n柄ではないけれど\n嫌な気はしないな", 1, 5134, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この力で\n何を成すべきなのか…\n剣に聞いてみよう", 1, 5135, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "変身したとて私は私\n一時的に強くなろうと\n元が弱くてはだめだ", 1, 5136, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "変身していない時でも\n彼がそばにいると\n力が湧いてくる…", 1, 5137, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私の思い…\nいつか伝えてみせるよ\n…きっといつか！", 1, 5138, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何者かと戦うの？\nそれとも修行？\nどちらだとしても\n付き合うよ", 2, 5139, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "変身し続けたら\nどれだけ空腹に…\n私は試さないからね？", 2, 5140, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "本物のプリンセスに\nなるのは御免だが\nナイトがいて\nくれるのは頼もしいよ", 2, 5141, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いつかこの力を\n誰かを救うために…\n戦い以外に使える時が\nくることを願うよ", 2, 5142, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "キミに感じてほしいな\n私に流れてくる\nキミからの力を…\nその…私の、思いも…", 2, 5143, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "思いを告げる…\nそれがこんなにも\n難しいなんて…\nでも、いつか必ず…！", 2, 5144, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\nいい変身日和だ！\n…ふふっ、冗談だよ", 2, 5145, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "いつもより多く\n昼食を用意しよう\n変身が解けたら大変だ", 2, 5146, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "一日お疲れ様\n私もそろそろ変身を\n解いて休むとするよ", 2, 5147, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "変身してしまうと\n動かずにいても\n空腹になるのかな…？", 3, 5149, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私もキミたちくらい\n可愛げがある姿に\nなっているかな？", 3, 5150, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "香りに対する感覚も\nいつもより鋭く\nなっているみたいだ…", 3, 5151, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ありがたいな\n少し足元が\n冷えていたところだ", 3, 5152, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これは…！\n持ち運べるように\n改良できないかな？", 3, 5154, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "祖父に貰った\n技法書を読んで\n初心に帰ろう", 3, 5155, 180301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "最強の惚れ薬を作って\nあのおかたの心を\n私の思いのままに…", 1, 5157, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏といえば海にスイカ\n花火に水着…\nそして惚れ薬ですわ…", 1, 5158, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あのおかたの心を\n手に入れるための\n準備を進めましょう\nこの夏こそ確実に…", 1, 5159, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あのおかたに近づく\n虫どもを、どうやって\n片付けようかしら…\nまったく忌々しいこと", 1, 5160, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…クスクス\n薬の調合を考えるのは\n至福の時間ですわ…", 1, 5161, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あのおかたの全てが\n早く私のものに\nなりますように…", 1, 5162, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "かき氷も花火も海も…\nあなた様がいてこそ…\nそう、あなた様は\n私の全てなのですわ", 1, 5163, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "二人だけの夏を\n楽しみましょう…？\n…クスクス", 2, 5164, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あら、あなた様\n私に秘密でどこに\n行こうとして\nいますの…？", 2, 5165, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海に行きませんか？\nあなた様と一緒に\n過ごすには\n最高の場所ですから…", 2, 5166, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ちょうどいいところに\nいらっしゃいました\nできたての薬を…\nさぁどうぞ…クスクス", 2, 5167, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "夏の海のきらめきも\nあなた様の存在が\nなければ色あせて\nしまいますわ…", 2, 5168, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私とあなた様は\n結ばれる運命に\nあるのです…\n逃がしませんわ…", 2, 5169, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "起きてすぐに会いに\n来てくださるなんて\nようやく私の伴侶たる\n自覚が…クスクス", 2, 5170, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お食事はまだですか？\n特製の薬草ランチを\n召し上がれ…クスクス", 2, 5171, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "私の夢を見られる薬を\n差し上げますわ…\nおやすみなさいませ\nあなた様…クスクス", 2, 5172, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いい肌触りですわ…\n考え事にもぴったり\n眠くなるのが\n玉に瑕ですが…", 3, 5174, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういったものに\n揮発性の薬を仕込む\nのも一つの手ですわね", 3, 5175, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…開発中の\n薬に使えそうな気が\nしますわ…クスクス", 3, 5176, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あのおかたの\nぬくもりを\n思い出しますわ…", 3, 5177, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味しい…この味なら\n薬を混ぜても違和感は\nなさそうですわ…", 3, 5179, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この薬の調合法…\n今度試してみましょう\nもちろんあのおかたに\n飲んでいただいて…", 3, 5180, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "二人乗りができると\nいいですわね…", 3, 5182, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふかふかですわ…\nあのおかたの分も\n欲しくなります…", 3, 5183, 117001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今日はキミと\nいつまでも歌って\n踊りたい気分さ～♪", 1, 5184, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あは～♪\nキミの隣は、故郷より\n落ち着くかも～…♪", 2, 5185, 101701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この水着…\n一番に弟くんに\n見せたいな♪", 1, 5186, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "弟くんをこっそり\n海に運んで…\nサプライズしちゃお♪", 1, 5187, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いつもと違う髪型に\nしてみたけど…\n気に入ってくれるかな", 1, 5188, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海は楽しみだけど\n日焼けしないように\n気を付けなきゃね", 1, 5189, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "まだかな、弟くん\n水着のお姉ちゃんが\nお出迎えだよっ♪", 1, 5190, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海が見えるおうちで\n弟くんと一緒に\n暮らしたいなぁ～", 1, 5191, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "弟くんの水着…\nどんな感じかなぁ\n…あ、想像してたら\nドキドキして…えへへ", 1, 5192, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こーら、水着の\nお姉ちゃんは\nおさわり禁止♪\n…なんてね？", 2, 5193, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なぁに？\nふふっ、何回でも\n呼んでいいんだよ♪", 2, 5194, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海で迷子に\nならないように\n手を繋ごうね♪", 2, 5195, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お姉ちゃんが\n海の楽しみ方を\n教えてあげるねっ！", 2, 5196, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "わっ、弟くん\nどこ触ってるの？\nも～驚いちゃったぞ♪", 2, 5197, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お姉ちゃん、海でも\nずっとキミを見てるよ\n…安心してね", 2, 5198, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "まだ眠そうだね？\nほら、海が待ってるよ\n早く起きて起きて♪", 2, 5199, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "大丈夫、疲れてない？\n海で遊び疲れた時は\n素直に休憩しようね", 2, 5200, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ほら、早く寝ないと\n明日もお姉ちゃんと\n遊べないぞ♪", 2, 5201, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "だらけたお姉ちゃんは\n弟くんには\n見せられないな～", 3, 5203, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ、かわいいね♪\n弟くんが持つと\nもっとかわいいよっ♪", 3, 5204, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだね…\n一味違うお姉ちゃんに\nなれそう…♪", 3, 5205, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い♪\nほら、弟くんも\nおいでよ♪", 3, 5206, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "よく食べて、いつでも\n弟くんの呼び声に\n応える準備を…！", 3, 5208, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "弟くんの水着の写真\nこの辺りに隠して\nおこうかな", 3, 5209, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この子の背に乗って\nお姉ちゃんと弟くんの\n楽園へ…な～んて♪", 3, 5211, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "海を感じる感触だね\n弟くんとの楽しい夏を\n思い出しちゃうな…♪", 3, 5212, 117101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この夏、誰よりも\nキラキラしてみせる！\nだって私は\nアイドルだから！", 1, 5213, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "日傘にアームカバー\n帽子にサングラス…\n紫外線対策は完璧！", 1, 5214, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "とっておきの\nサマーソングを\nみんなに届けるよ！", 1, 5215, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんにもしないのって\n苦手かも…\n彼、早く来ないかな？", 1, 5216, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ラムネって\n夏って感じするよね\n後で彼と飲もっと♪", 1, 5217, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "夏は恋の季節！\n燃えるような恋…\nいつかしたいな", 1, 5218, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今年の夏の目標は\n…彼との思い出を\nいっぱい作ること！", 1, 5219, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私の水着写真集\n見てくれたんだ！\nどう、かわいかった？", 2, 5220, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "スイカ割りしたいの？\nいいね、楽しそう！\nみんなも誘おうよ♪", 2, 5221, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ねぇ、見て見て！\n水着の映える\nポーズ考えたんだ！", 2, 5222, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ライブ中に\n花火を打ち上げたら\n絶対盛り上がるよね！", 2, 5223, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "最近、忙しいけど…\nキミの顔見たら\n疲れなんて\n消えちゃった！", 2, 5224, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この夏もいーっぱい\nドキドキさせるから！\n覚悟しててよね♪", 2, 5225, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "外は朝から暑いね\nけど、負けないから！\nお仕事、頑張るぞー！", 2, 5226, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "自分へのご褒美に、\nアイス食べちゃお♪\nキミも一緒に食べよ！", 2, 5227, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夏の夜って\nワクワクするね♪\nホタル見に行こうよ！", 2, 5228, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわぁ…眠い…\n仕事とかの疲れ、\nたまってるのかな…？", 3, 5230, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私のぬいぐるみが\nグッズになったら…\n彼にかわいがって\nもらえるかな？", 3, 5231, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…\n夏限定のやつでしょ？\nいいセンスしてるね♪", 3, 5232, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暑～い！\nけど…汗かいて\n気持ちいいかも！", 3, 5233, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "レッスンの後のご飯は\n特別おいしい♪\n…もうひとつだけ\n食べちゃおっかな", 3, 5235, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あ、この前撮影した\n水着グラビアだ\nうんうん、いい感じ！", 3, 5236, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この子、もふもふだね\n触るのクセになりそう\nもふもふもふもふ…", 3, 5238, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "わ、かわいい♪\n今度のグラビア撮影で\nこれ使ってもいい？", 3, 5239, 117201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着っていいですよね\n海に浮かぶ一輪の花\nって感じがして！", 1, 5240, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "自分の水着を作るのも\n誰かの水着を作るのも\n楽しいですね♪", 1, 5241, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "水着の最終チェック！\n伸縮性や動きやすさは\n…いい感じですね！", 1, 5242, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "振り付けや衣装作りに\n歌や踊りの練習…\n…やることがいっぱい", 1, 5243, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ…レイ様の水着…\n私に作らせて\nもらえないかなぁ～…", 1, 5244, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士さんのことは\n気に入らないですけど\n別に嫌いという\nわけじゃなくて…", 1, 5245, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士さん暇そうですね\nに、荷物持ちとして\n誘ってみようかな…", 1, 5246, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士さんいいところに\nこの衣装\nどう思います？", 2, 5247, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "何見てるんですか？\nもしかしてこの水着の\n良さが分かります！？", 2, 5248, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "真夏でも涼しい…\nそれも水着の良さの\n一つですね", 2, 5249, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "仕立て屋も\nアイドルも\n諦めません！", 2, 5250, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "夏と言えば\nバカンスですけど…\n予定、あるんですか？", 2, 5251, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "う～ん…騎士さんを\n海へ誘うには…って\nなんでもないですよ！", 2, 5252, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふー…夏はやっぱり\n朝が一番過ごしやすい\nですね～！", 2, 5253, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "暑い時こそ海です！\n体力づくりのためにも\n泳ぎにいきますよ！", 2, 5254, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "外で虫が鳴いてる…\n夏って感じがして\n風流ですねぇ…", 2, 5255, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "少し休憩です…\nこのまま寝ないよう\n気をつけないと…", 3, 5257, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい…！\nこの感動を次の\nステージ衣装にも…！", 3, 5258, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りですね～\n波の音が聞こえて\nきそうです…", 3, 5259, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "泳いだ後は\n少し寒いので\nちょうどいいですね", 3, 5260, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "夏バテしないように\n栄養はしっかり\n取らないと！", 3, 5262, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "次のトレンドは…\nふむふむ、やっぱり\nこう来ましたか…", 3, 5263, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "デザインはもちろん\n触り心地も\n最高ですね♪", 3, 5265, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "夏の撮影スポットに\n活用できそうですね\nさっそく衣装考えて…", 3, 5266, 117401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "えへへ…♪\n団長さんが初めての\n友達で本当に良かった", 1, 5267, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あっ、団長さん！\n今日のＢＢ団の活動\nなんですけど…二人で\n大縄跳びしませんか！", 2, 5268, 104001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この衣装で\nライブするのは\n恥ずかしいな…", 1, 5269, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "せっかくの夏だし\n肝試しに\n行ってみたいかも…", 1, 5270, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "歌もダンスも\nより上を目指すために\n夏合宿をしよう…！", 1, 5271, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏の暑さにも負けない\n熱いライブに\nしてみせる…！", 1, 5272, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "新曲のアイデア\nまとめたいな…\n少し海辺を散歩しよう", 1, 5273, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "かき氷、食べたいな\n…あの人は何味が\n好きなんだろう？", 1, 5274, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着、似合ってるって\n言ってもらえるかな…", 1, 5275, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "サインして、ですか？\nいいですけど…\n少し照れますね…", 2, 5276, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "少し待ってください\n今、新曲の楽譜を\n書いているので…", 2, 5277, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんでしょう？\nもしかして…\nボイトレに興味が？", 2, 5278, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度のライブでは\n夏らしい爽やかな歌を\nファンにお届けします", 2, 5279, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…水鉄砲で遊ぼう？\nふふ。楽しそうですね\nお手柔らかに…♪", 2, 5280, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたの声を\n聴いていると、\n何だか落ち着きます…", 2, 5281, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日も暑くなりそう…\nお互いしっかりと\n水分補給しましょうね", 2, 5282, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空きましたよね\n海の家で、\nなにか買ってきます", 2, 5283, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海で月明かりと\n波の音を楽しもうかと\n…一緒に行きますか？", 2, 5284, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "レッスンだけでなく\nリラックスすることも\n大事、ですよね", 3, 5286, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、かわいい\n精霊も負けないくらい\nかわいいですけどね", 3, 5287, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏らしい爽やかで\nいい匂い…あなたに\nピッタリな香りですね", 3, 5288, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "海に入った後は、\n体が冷えてしまいます\n一緒に温まりましょう", 3, 5289, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "アイドルとして、\n食べすぎには\n気をつけないと…", 3, 5291, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏は恋の季節…\nガンガン攻めるべし…\nなるほど…", 3, 5292, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この子に乗りながら\nライブをする…\nというのはどうですか", 3, 5294, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "まるで人魚になった\n気分…なんて、ふふ", 3, 5295, 117301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姉ちゃんとして\nシオリンにかっこいい\nとこ見せなくっちゃ☆", 1, 5296, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いつかシオリンと\n一緒に空を飛んで\n空中散歩してみたいな", 1, 5297, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "すこし眠くなってきた\nかも…シオリンと\nお昼寝しようかな", 1, 5298, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お散歩してこよっと！\nシオリンとお出かけ\nするのにいい場所\n探さなくっちゃ！", 1, 5299, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "シオリンに過保護って\n言われちゃった…♪\nそれでも心配しちゃう\nのが姉心…だよね？", 1, 5300, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "気持ちいい日差し！\nシオリンと彼と、\nお昼寝したら\n気持ちよさそ～♪", 1, 5301, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今度天気がいい日には\nシオリンと彼を誘って\n一緒にお出かけ\nしたいな～♪", 1, 5302, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日はご機嫌なんだ♪\nだって、シオリンの\n調子がいいんだもん☆", 2, 5303, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今からシオリンと\nピクニックに\n行くんだ♪　そうだ！\nキミも一緒にどう？", 2, 5304, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わっ、びっくりした！\nシオリンから借りた本\n読むのに集中\nしてたから…", 2, 5305, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うん？　どうしたの？\nあっ、もしかして\nこの服、気になる？", 2, 5306, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "シオリンもキミも元気\nいっぱいだと、私も\n元気になっちゃうよ☆", 2, 5307, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "シオリンの前だけ\nじゃなくて、キミにも\nかっこいい私の姿を\n見てほしいな☆", 2, 5308, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！　えへへっ\n今日は早起きなんだ♪\nシオリンにかっこ悪い\nとこ見せたくないから", 2, 5309, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おなかすいたなぁ～…\nシオリンと一緒に\nおいしいもの食べに\n行こうかな！", 2, 5310, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間！？\nシオリンと一緒だと\n時間が早く\n過ぎていっちゃうね！", 2, 5311, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この快適な寝心地…！\nシオリンにもおすすめ\nしなきゃ…！", 3, 5313, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わあ、かわいい！\nそれにさわり心地も\nいいし、抱き枕に\nちょうどいいかも！", 3, 5314, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにおい…♪\nなんだかリラックス\nできて…すやぁ…", 3, 5315, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽか～☆\nシオリンと一緒に\nぬくぬくしたら\n気持ちよさそう♪", 3, 5316, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "仲のいい人が一緒だと\nつい食が進んじゃうね\nえへへ…♪", 3, 5318, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…この本…\nシオリンが好きかも！\n今度おすすめしよっと", 3, 5319, 118301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姉ちゃん、\n私のために無理は\nしてないかな…？", 1, 5322, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "新しく買った絵本…\nこういうのなら\nお姉ちゃんと楽しく\n読めるよね", 1, 5323, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ニャットちゃんを\nここに連れてきて\nみんなで遊べないかな", 1, 5324, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "本屋さんに行こうかな\nみんなで読める\n面白い本が\nあるといいなぁ", 1, 5325, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "たまには…読むだけ\nじゃなくて、自分で\nお話を書いて\nみようかな…？", 1, 5326, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "時々…お姉ちゃんと\nあの人が似てるって\n思うことがあります…", 1, 5327, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お姉ちゃんとあの人…\n優しくて頼もしい\n二人に囲まれて…\n私、幸せ者だなぁ…", 1, 5328, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうかしましたか？\nもしかして…あなたも\n一緒にこの本を\n読みたい…とか？", 2, 5329, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "けほっ…けほっ…\nあっ、心配いりません\n飲み物を飲んで\nむせただけですから", 2, 5330, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この格好…\n似合ってますか…？\nえへへ、照れますね…", 2, 5331, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なぁに、お姉ちゃん？\n…あっ、すみません\n読書に集中していて…\n間違えちゃいました…", 2, 5332, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お姉ちゃん、時々無理\nしちゃうから…\nあなたも一緒だと\n安心できます", 2, 5333, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お姉ちゃんとあなたと\n頼れる人に囲まれて\n私は幸せものですね", 2, 5334, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "なんだか朝から\n調子がいい…今日は\nいい日になりそうです", 2, 5335, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "せっかくだから、\nお姉ちゃんを誘って\nお外でランチも\nいいかも", 2, 5336, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お姉ちゃんに心配\nかけないように…もう\nちょっと本を読んだら\n寝なくちゃね", 2, 5337, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふんわり柔らかくて\n気持ちいい手触り…\nお姉ちゃんが寝るのに\nちょうどよさそう", 3, 5339, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ、かわいい♪\n絵本の物語みたいに\nおしゃべりできない\nかな…？", 3, 5340, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "素敵な落ち着く香り♪\nなんだかお姉ちゃん\nみたい、ふふっ", 3, 5341, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかくてほっと\nするなぁ\nここでゆっくり\n読書しようかな", 3, 5342, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "この味…\nお姉ちゃんが好きそう\n少しもらって、\n持って行こうかな…？", 3, 5344, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この本みたいな、\n心躍る大冒険も\nお姉ちゃんと一緒なら\nできちゃいそう", 3, 5345, 118401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いい部屋ね\nここを私の分院に\nするのもいいかも\nしれないわね…♪", 1, 5348, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "珍しいカンポーが\n手に入ったから\n色々試してみたいわ\n色々と、ね♪", 1, 5349, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この服を着ると\n自分が医者だって\nより実感するわね\nまあ、闇医者だけどね", 1, 5350, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新薬開発のために\n薬草を採取して\nおこうかしら", 1, 5351, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "いつ急患が来ても\n対応できるように\nしておきましょうか", 1, 5352, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの子の研究資料も\nだいぶ増えてきたわね\nちゃんとまとめて\nおかないと♪", 1, 5353, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの子は大事な\n研究対象。だから\nいつまでも健康で\nいてもらわないとね♪", 1, 5354, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "薬に興味があるの？\nなら、今度ゆっくりと\n教えてあげるわね", 2, 5355, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "少し時間があいたから\n一緒に新薬の実験を\nしましょうか♪", 2, 5356, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうしたの？\nまさか急患…！？\nあら、違うのね\nならよかったわ", 2, 5357, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "具合が悪い時はすぐに\n言うのよ。君には\nいつでも健康でいて\nほしいから", 2, 5358, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "少し仮眠したいわね\n肩…いいえ、膝を\n貸してもらえる？", 2, 5359, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "たまには…君の隣なら\n闇医者も悪い研究者も\nお休みにするのも\n悪くないわね♪", 2, 5360, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "たまには朝の陽ざしを\n浴びるのも…\n悪くないわね", 2, 5361, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "天気がいい日は\nいい薬草が採れるの\n君も集めるの、\n手伝ってくれる？", 2, 5362, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "いけない、もうこんな\n時間なのね\n診察に没頭すると\n時間感覚がなくなるわ", 2, 5363, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もう少し固い方が\n私好みだけど…\n悪くない寝心地ね", 3, 5365, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このぬいぐるみ…\n闇医者として\n興味深いわね…", 3, 5366, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "落ち着く香りね\n私も診察室で\n使ってみようかしら", 3, 5367, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "冷えは病につながるわ\nしっかり温めて\n体をいたわりましょ", 3, 5368, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい♪\n研究のお供に\nもってこいの\n味だわ", 3, 5370, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "医学は日進月歩…\n闇医者とはいえ\n最新の論文には\n目を通しておかないと", 3, 5371, 117501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "白衣の天使かあ\nまさにボクのための\n呼び方だね", 1, 5400, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "美しさとは\n日々の努力が\n作るものなんだよ", 1, 5401, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "大変だ…\nボクは美しく\nなりすぎたかも", 1, 5402, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ボクのかわいさで\n癒やされて\nみんな健康に\nなっちゃうね", 1, 5403, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "どんな服装をしても\nボクの美しさは\n変わらないね", 1, 5404, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "これからはボクも\n美の伝道師として\nがんばらないとね♪", 1, 5405, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ボクのかわいい笑顔を\n近くで見る以上の\n癒やしはないよね♪", 1, 5406, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どう？　看護師姿の\nボクもかわいいでしょ\nもっと近くで見る？", 2, 5407, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ほら！　美しいボクの\n看護師姿を見たら\n元気でちゃうでしょ？", 2, 5408, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "白衣の天使のボクも\n最高に美しいね\n存分に癒されてよ♪", 2, 5409, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "具合が悪いの？\nならボクの美しい顔を\n処方してあげる♪", 2, 5410, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "さあ今日もボクと\n一緒に美の追求に\n付き合ってもらうよ♪", 2, 5411, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "かわいい天使のボクが\nいつもそばにいるんだ\nキミって幸せ者だね♪", 2, 5412, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さすがボク\n目が覚めるような\n美しさでしょ？", 2, 5413, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "美は食で作られる\n美容にいいものを\n食べようよ！", 2, 5414, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふああ…早く寝よ？\n夜更かしは美容の\n大敵だからね", 2, 5415, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふう～…\nリラックスする\nボクも美しい", 3, 5417, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ボクが抱きしめると\n普段よりかわいく\n見えちゃうね♪", 3, 5418, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "美しいボクは\n常にいい香りを\nしていなくちゃね", 3, 5419, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "光がボクを照らしてる\nんじゃなくて、ボクが\n光を輝かせてるのさ", 3, 5420, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "バランスのいい食事が\n美しいボクを\n作るのさ", 3, 5422, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…なるほど\nこうすればより美しく\nなれるかもしれない", 3, 5423, 117601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "仲間のためなら\nきっと…どこまでも\n強くなれるよね", 1, 5425, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "プリンセスフォーム？\n私と同じような力を\n持ってる人がいるの？\n会ってみたいな～！", 2, 5426, 105701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここの空気は、\nどうもゆるすぎて…\n落ち着きませんわね", 1, 5427, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "陛下のお越しになる\n別宅としては、\n少し警備が\n甘すぎでは？", 1, 5428, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あらあら？\nサッシにホコリが！\nちょっとネコ助！\n掃除は念入りに！", 1, 5429, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いつまで入り浸って\nいるのかと、\n秘書に叱られて\nしまいましたわ…", 1, 5430, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "もういっそ、\nここに間借りして\n仕事しようかしら…？", 1, 5431, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "邪魔している身ですし\n家事くらい\nお手伝いさせなさいな", 1, 5432, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "本当は、意外と\n居心地が良いのかも…\n陛下の気持ち、\n少し分かりましたわ", 1, 5433, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちょっ…わたくしを\n叩いても、ホコリなど\nあまり出ませんわよ！", 2, 5434, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "陛下っ？\nなんだ…貴方でしたの\n用件は手短にお願いね", 2, 5435, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "別に、好き嫌いは\nありませんけれど…\n魔物料理って、意外と\n美味なものですわね", 2, 5436, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "言っておきますけれど\nわたくしは商売人です\n荒事は専門外ですわよ", 2, 5437, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "プリンセスナイトの\n能力…なにか儲け話に\n使えませんかしらね", 2, 5438, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "貴方がたのことも、\n少しくらいは\n信用してないことも\nありませんでしてよ", 2, 5439, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\nさ、今日もバリバリ\n働きますわよ！", 2, 5440, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ですわね\n栄養補給をしつつ\n働きますわよ！", 2, 5441, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "定時ですって？\n関係ありません！\nわたくし、まだまだ\n働きますわよ～っ！", 2, 5442, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うっ…いけませんわ\n日頃の疲れが…\nふわぁ…", 3, 5444, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もふもふ…ふふっ♪\n…なんですのっ、\nなにかおかしくて！？", 3, 5445, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りですわね\nわたくしの執務室にも\n置きたいくらいですわ", 3, 5446, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "いけませんわ…\nこんなに暖かいと\n日頃の疲れが…ふわぁ", 3, 5447, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もう一つ食べたら\n仕事に戻りますわよ？\nあと一つだけ…", 3, 5449, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "商人にとって\n知識は武器ですわ\n陛下のため、貴方も\nもっと勉強なさい？", 3, 5450, 118001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "故郷のお菓子を\nいろいろ作ったんだ～\nみんなに\n配ってくるさ～♪", 1, 5452, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "彼ってどんな仮装が\n似合うかな～？\nシーサーとか？", 1, 5453, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カボチャチャンプルー\n作ってみよっと！\nきっとおいしいさ～♪", 1, 5454, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "視線を感じるさ～\nもしかして幽霊？\nおしゃべりするさ～♪", 1, 5455, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "さっき作った\nサーターアンダギー、\n早く彼に\n食べてほしいさ～♪", 1, 5456, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "彼のために、\n特別なイタズラを\n考えとくさ～♪", 1, 5457, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつか彼と、\n故郷のハロウィンを\n楽しみたいさ～♪", 1, 5458, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ハロウィンは\n私たちが守るさ～♪\nさ、見回りに行こ！", 2, 5459, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この制服、\nハロウィンらしくて\n大好きさ～♪", 2, 5460, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "イタズラする気ね～？\nどんなことされるのか\n楽しみさ～♪", 2, 5461, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "カボチャのランタン、\n一緒に作ろ！\n絶対楽しいよ～♪", 2, 5462, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お菓子くれるの？\nあは～、ありがとー♪\nもぐもぐ…\n優しい味がするさ～♪", 2, 5463, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミと一緒に過ごす\nハロウィンは、\nドキドキとワクワクが\n止まらないさ～♪", 2, 5464, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ハロウィンは\n朝から大忙しさ～！\nお菓子作り、\n手伝ってほしいさ～", 2, 5465, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お化け屋敷に行こ！\n一緒にいっぱい\nドキドキしようね～♪", 2, 5466, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ここからが\nハロウィン本番さ～！\n幽霊たちと\nいっぱい遊ぶさ～♪", 2, 5467, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと休んだら、\nお菓子作りを\n再開するさ～♪", 3, 5469, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "でーじかわいいね～♪\nこの子に仮装させたら\nきっと似合うさ～♪", 3, 5470, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お菓子みたいに\n甘い匂い…\nハロウィンらしい\nいい香りさ～♪", 3, 5471, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ランドソルの秋って\n冷えるけど…\nこれがあれば\n体も心もぽかぽかさ～", 3, 5472, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "故郷のご飯も\nおいしいけど、\nこっちのご飯も\nでーじおいしいさ～♪", 3, 5474, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "パンプキンパイの\nレシピは…なるほど～\n勉強になるさ～♪", 3, 5475, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "全部おいしそうで\nどれから食べるか\n迷っちゃうさ～♪", 3, 5477, 117701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ムっ！　幽霊の気配を\n感じるデス！\nさあ姿を現すデス！", 1, 5479, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ムムム…\n妖魔の力を忍法に\n使えないでショウか…", 1, 5480, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "怪しい妖魔を\n成敗するデス！\nハロウィンの平和は\nワタシが守りマスよ！", 1, 5481, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ワタシの祭囃子が\n聞こえマスかー？\nさあ集まるデース！\n陽気に踊りまショウ！", 1, 5482, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お祭りは\n楽しんだ者勝ちデス！\n踊らにゃ\nソンソンデス！", 1, 5483, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "幽霊になる前に\n天下統一を\n果たしたいデスね", 1, 5484, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの世に行っても\nショーグンは\nワタシの大事な\nショーグンデス！", 1, 5485, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ショーグン！\n悪霊退治に\n出かけるデース！", 2, 5486, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "妖魔を家来に\nしてみるのは\nどうデス？", 2, 5487, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "マントを使って\nウツセミの術の精度を\n高めるデス！", 2, 5488, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハロウィンにちなんだ\n新しい忍法…\nすなわち妖忍法の\n開発を急ぐデス！", 2, 5489, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの世でも\nショーグンに\nお仕えしマスよー！", 2, 5490, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ショーグンもワタシと\nハロウィンパレードを\n踊り明かしまセンか？", 2, 5491, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございマス！\n天下統一に向けて\n急いで準備するデス！", 2, 5492, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹減ってまセンか？\nハロウィンスイーツで\n休憩するデ〜ス", 2, 5493, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜更かしすると幽霊が\nでるかもしれまセン…\nヒュ〜ドロロロ〜…", 2, 5494, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "もふもふなところが\nわたあめちゃんに\n似ていマス。わんっ！", 3, 5496, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぬいぐるみや人形には\n魂が宿るという\n言い伝えがありマス…\nマカフシギデ〜ス", 3, 5497, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ウ〜ム…\nなんとも怪しい\n香りがしマスね！", 3, 5498, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "パレードの熱気に\n負けないくらい\n熱いデス！", 3, 5499, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ついつい食べすぎて\nしまうのは\n妖魔のせいデスか！？", 3, 5501, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "トーゴク妖怪の\n図鑑デス！　個性的な\n妖怪ばかりデスね！", 3, 5502, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "ハロウィンの甘味を\n集めまシタよ！\nショーグンへの\n貢ぎ物デス！", 3, 5504, 117801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "彼と二人で\n買い物に…って…\nこれってデートに\nなっちゃうのかな！？", 1, 5531, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "とうっ！　どうどう？\n今の決めポーズ！\nかっこいいよね♪", 2, 5532, 101301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ヒデサイとおそろの\nハロウィンコスとか\nしてみたいな～", 1, 5533, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "カボチャ料理かぁ…\n作ったらヒデサイ\n食べてくれるかな～", 1, 5534, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハロウィンスイーツ…\nどれもおいしすぎて\n激ヤバなんですけど！", 1, 5535, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "霊界ってどんなとこ\nなんだろ～\nわりと近所だったり？", 1, 5536, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "服をハロウィンっぽく\nアレンジするのも\nたのしーよね♪", 1, 5537, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒデサイと一緒に\nハロウィンパーティー\n…えへへ、楽しみ～", 1, 5538, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒデサイといると\nドキドキする…\nなんでだろ～？", 1, 5539, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねねね、うちらも\nハロウィンパレード\n見に行こー？", 2, 5540, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ハロウィンセイバーズ\nしゅつどーう！\nヒデサイも行こ～♪", 2, 5541, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "マントのロゴ\nかっこいいっしょ～？\nカボきちってゆーんだ", 2, 5542, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "トリックオア\nトリート！\nねえねえヒデサイ\nお菓子ちょうだい♪", 2, 5543, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒデサイも\nメイクしてみる？\nハロウィンぽいやつ♪", 2, 5544, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒデサイのこと\nうちがいつでも\nあっためたげるね！\n…あ！　手、手の話！", 2, 5545, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ハロウィンのイベント\n朝からでも\nやってるかな～？", 2, 5546, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "カボチャでおやつ\n作ってみたんだ～\nヒデサイ食べてみて！", 2, 5547, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ハロウィンの夜って\nやっぱテンション\n上がるよね～♪", 2, 5548, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "超ふかふかしてる～\nちょっと休憩させて\nもらっちゃお", 3, 5550, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はぁ…\nもにカワすぎて\nつらいんですけど～！", 3, 5551, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ハロウィン限定の\nフレグランスじゃん！\nいい匂いする～♪", 3, 5552, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "やばばば…\nあったかくて\n眠くなっちゃう～", 3, 5553, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これ食べて\nもうひとがんばり\nしよーっと！", 3, 5555, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ハロウィンっぽい\nファッションとか\n載ってないかなぁ？", 3, 5556, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "お菓子いっぱいだ～！\nあとでヒデサイにも\n持ってってあげよ～", 3, 5558, 117901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お掃除が終わったら\n次は書類を片付けて…\nその次は…", 1, 5560, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "皆さんが冒険している\n間の留守は私に\nお任せください♪", 1, 5561, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "美食殿の皆さんが\n持ってきてくれる\nお土産が楽しみです♪", 1, 5562, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ネビアさんとは\nときどき一緒にお茶\nする仲なんです", 1, 5563, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ギルドハウスの乱れは\nギルドの乱れ\n整理整頓が大切です", 1, 5564, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "素敵なギルドハウスの\n管理人ができて\nとっても幸せです♪", 1, 5565, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "皆さんをほんの少し\n特別扱いしちゃう\n私がいます", 1, 5566, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何かわからないことが\nあるときは私に\n聞いてくださいね", 2, 5567, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "書類を書いていると\n落ち着きます…\n一緒にどうですか？", 2, 5568, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたのまわりは\nいつも賑やかで\n楽しいですね♪", 2, 5569, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あっ！　お頼みしたい\nことがあって\n探してたんです♪", 2, 5570, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ギブアンドテイクは\n大切です。たまには\nお礼させてください♪", 2, 5571, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "陰に日向にあなたを\n支えていきます♪\n期待していてください", 2, 5572, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日も一日\n管理人として\nがんばります♪", 2, 5573, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹がすきました…\nそろそろお昼に\nしませんか？", 2, 5574, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間…\n皆さんといると一日が\nあっという間です", 2, 5575, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "良質なお仕事は\n良質な休憩から\nです♪", 3, 5577, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいものに\n囲まれてお仕事できる\nのは幸せですね♪", 3, 5578, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お仕事に集中できる\nアロマを設置するのも\nよさそうですね♪", 3, 5579, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポカポカ温まりながら\n書類仕事をするのも\nいいものですね…", 3, 5580, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "栄養補給しないと\n頭が回りませんからね\nきちんと食べましょう", 3, 5582, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "新条例はこのように\n活用されている、と…\nふむふむ…", 3, 5583, 118501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "会合用の資料と\n連載のネーム…\nどっちを片付けよう？", 1, 5585, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "イノリちゃん、また\nお金くすねてる…\n帰ってきたら\nお尻ペンペンだ♪", 1, 5586, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カヤちゃんの装備\n傷むの早いなぁ〜\nメンテしてあげないと", 1, 5587, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そうだ、ラーゴのご飯\n買いに行かないと\n今日は何がいいかな？", 1, 5588, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここの人たちは見てて\n飽きない人ばっかり♪\n漫画の参考にしよ〜", 1, 5589, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "また一緒に買い物にも\n行きたいし、冒険も\nしたいな〜…♪", 1, 5590, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…君は見てるだけで\n満足なの？ ちゃんと\n触って欲しいな…♪", 1, 5591, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私の目が見たいの？\nいいけど…魅了されて\n魂が壊れちゃうよ…？\n…冗談で〜す☆", 2, 5592, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ラーゴがね、君に\n遊んで欲しいって☆\n仲良くしてあげてね", 2, 5593, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アシスタントの仕事\n気に入ってくれたなら\nまたお願いしていい？", 2, 5594, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "私が覚醒できるか？\n見せてあげたいけど…\nすごいことになるから\nまた今度で♪", 2, 5595, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "楽しいトラブルが\nあったら、とりあえず\n声はかけて欲しいな♪", 2, 5596, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "マッサージお願い♪\n変なところは…\n少しだけなら☆", 2, 5597, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう〜♪\n今日も一日、一緒に\nがんばっていこうね", 2, 5598, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空いちゃった…\n一緒にお昼行かない？\nいいお店があるんだ〜", 2, 5599, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "君、眠れないの？\n誰かに見られてる？\n…きっと気のせいだよ", 2, 5600, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっと休憩〜…\nこのまま原稿すれば\n疲れなくなるのかな？", 3, 5602, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい〜♪\nラーゴのお友達に\nなってくれる？", 3, 5603, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り〜♪\nこの目でどう見えるか\n伝えられたらいいのに", 3, 5604, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ほどほどなのが\nちょうどいい時も\nあるよね…♪", 3, 5605, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "この味付け…\nあっちでも再現\nできるかな？", 3, 5607, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふふっ、面白い♪\nイノリちゃんの買う\n漫画にハズレなし☆", 3, 5608, 106701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私…23歳だもん\n魔法少女だなんて\n名乗れないわ…", 1, 5610, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あん、どぅ、とろわ〜\nみんなイイ子に\nな〜る♪", 1, 5611, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あっ！　イケナイ子の\n気配がするわ！\n風紀の乱れは\n先生が許しませんっ！", 1, 5612, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここで闇の力が\n発動したら大変だわ！\nやだっ…そう思ったら\n緊張して…ダメぇ〜！", 1, 5613, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "オイタした子はみんな\nどうしてうれしそうに\n私の愛のムチを\n欲しがるのかしら…？", 1, 5614, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの子に次は何を\n教えてあげようかしら\n愛？　希望？\nそれとも…♪", 1, 5615, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの子のことを\n考えると、愛と希望で\n胸がいっぱいになるの", 1, 5616, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "先生なのに闇の力を\n持ってるのは秘密よ？\n他の子には\n知られたくないから…", 2, 5617, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "秘密の授業の内容？\nそれは…あんなことや\nこんなことよ♪\nそれから、それから…", 2, 5618, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "しーっ！　私の正体が\nルーセント学院の\n先生だって、ここでは\n秘密にしててね？", 2, 5619, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あら？　補習して\nほしいの？　いいわよ\n君のお願いなら\nなんでも聞いちゃう♪", 2, 5620, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "イイ子にはごほうびを\nあげなくちゃ！\n君はなにが欲しい？\n遠慮しちゃダメよ？", 2, 5621, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "君との秘密が\nまた一つ\n増えちゃったね♪", 2, 5622, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日も一日\n元気に過ごしましょう\n先生が指導してあげる", 2, 5623, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "夜まで頑張れるように\nお昼ご飯はしっかり\n食べましょう〜！", 2, 5624, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜更かしはダメよ？\nイケナイ子が\nすることです！", 2, 5625, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "闇の力に振り回されて\nもうヘトヘトよ〜\n心も体も\n癒されたいわ〜", 3, 5627, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "『秘密の学び舎』に\nこっそり連れて\n行っちゃおうかしら♪", 3, 5628, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "イケナイ甘い香り…\nなんだか胸の奥が\n熱くなってきたわ…♪", 3, 5629, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "やんっ♪\n燃え上がる愛みたい♪\n火照ってきちゃった♪", 3, 5630, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "生徒の見本に\nなれるように\n好き嫌いはしないの", 3, 5632, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "『学び舎に咲く禁断の\n愛』？　気になるわ…\nううん、ダメよっ！\nでも…ちょっとだけ…", 3, 5633, 119001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "次に会う時は、\nまたあそこに一緒に…\nえへへ…！", 1, 5635, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "横顔見てるの、\nバレてないよね…？\n…ちらっ", 2, 5636, 106301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "背が少し伸びたか！？\nあ、あいつのところへ\n報告に行かねばっ！", 1, 5637, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "私も貴公の隣に\n立っていられるよう\n日々精進していくぞ！", 2, 5638, 105301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ああ～\nドＭミストが\nあふれてしまいます～", 1, 5639, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "魔法少女として\nクウカ頑張ります～！\n愛と希望の妄想を…！", 1, 5640, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "決めポーズの練習より\nやられポーズの練習を\nしておきます…♪", 1, 5641, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "快感を溜めに溜めて\n放つドＭビームは\n最高ですよ～", 1, 5642, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はっ！\nこれは闇の気配！\n…クウカ自身でした", 1, 5643, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ドＳさん…ぐふふ…\nクウカを縛りあげ…\nじゅるりぃ～♪", 1, 5644, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ドＳさんに攻められる\nことで、クウカは進化\nしてゆくのです～！", 1, 5645, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はぅっ！\nもっと激しく…！\n情熱的に～～～！", 2, 5646, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クウカの変身シーンを\nじっくり眺めたい！？\nは、恥ずかしいです～", 2, 5647, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "「本当に魔法少女か\n確かめてやるよ…！」\nドＳさんはそう言って\nクウカを…ぐふふ…♪", 2, 5648, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "愛と希望の力が\nクウカの中に…\nこの胸の高鳴りが…？", 2, 5649, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひゃあんっ！\nそこです～っ！\nもっと、もっと～♪", 2, 5650, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "クウカをこんなに\n悦ばせるのは\nドＳさんだけです…♪", 2, 5651, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "明るい時間に出歩くと\n目立ちますね\n魔法少女の衣装…", 2, 5652, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼の見回りです～♪\nああ～うっかりドＭを\n増やしてしまいました", 2, 5653, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜！　それはクウカが\n活性化する時間です！\n闇の活動開始です～♪", 2, 5654, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気の緩んだクウカを\nドＳさんの鋭い牙が\n狙っています～♪", 3, 5656, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魔法少女のマスコット\nにいいかもしれません\nもっと鎖とか飾りを…", 3, 5657, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魅惑的な香りです～\nドＭミストの香りに\n似て…いや違いますね", 3, 5658, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "火照る体…紅潮した\nクウカの肢体を熱く\n見つめるドＳさん…", 3, 5659, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食欲を満たした次は\n何を満たせば\nいいですかねぇ～♪", 3, 5661, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "魔法少女がひどい目に\n遭う物語は…\nなさそうですね…", 3, 5662, 119101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ケーキも悪くないけど\nプリンが一番なの\nでもせっかくだから\n両方もらってやるの！", 1, 5664, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クリスマスって聞くと\nなんだかあったかい\n気分になるの～", 1, 5665, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "煙突がなくても\nミヤコはどこからでも\nおうちに入れるの♪", 1, 5666, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "イブもプリン！\nクリスマスもプリン！\nプレゼントもプリン！", 1, 5667, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クリスマスツリーの\n高いところの\n飾りつけは、ミヤコに\nまかせろなの～！", 1, 5668, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アイツのプレゼント\n楽しみなの～\nきっと最っ高に特別な\nプリンなの～♪", 1, 5669, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ミヤコがサンタなら\nアイツはトナカイなの\nつまりお似合いって\nことなの～♪", 1, 5670, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ミヤコ、プレゼントを\n配りにいくの～♪\nオマエも手伝えなの！", 2, 5671, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "オマエにも飾りつけ\nしてやるの！\n頭にプリンを乗せると\nかわいいの♪", 2, 5672, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "幽霊のミヤコが\nいるなら、サンタも\nいて当たり前なの～！", 2, 5673, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "靴下にプリンを\n入れたらつぶれるの\nだからプリンは直接\nミヤコによこすの～！", 2, 5674, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今日はプリンだけじゃ\n満足してやらないの！\nミヤコをたくさん\n甘やかせなの！", 2, 5675, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ミヤコのプリン\nオマエになら一個…\nうう～、一口だけ\nあげてもいいの！", 2, 5676, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "サンタの朝は早いの～\nミヤコも早起きして\nプレゼント準備したの\nとってもえらいの♪", 2, 5677, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日は一日中\nみんなと遊ぶの～！\nオマエも来いなの！", 2, 5678, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "みんなが寝たら\nチャンスなの～\nこっそりプレゼント\n配りにいくの♪", 2, 5679, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "むふー、気持ちいいの\nこういうプレゼントも\nいいかもしれないの", 3, 5681, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ気に入ったの～\nプリンとアイツの\n次くらいなの♪", 3, 5682, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いいにおいなの～\nうっかり成仏\nしちゃいそうなの…", 3, 5683, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここに飾っといた\n雪だるま\nなくなっちゃったの\nきっと成仏したの～", 3, 5684, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これはオマエがくれる\nプリンとは\n別腹なの～", 3, 5686, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "プリンケーキ…\nこれならミヤコにも\n作れそうなの！\nさっそく作るの！", 3, 5687, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "びっくりしたの～！\n幽霊のミヤコを\n驚かすなんて…\nなかなかやるの！", 3, 5689, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "コイツの中…\nあったかいの～♪\n昼寝にぴったりなの～", 3, 5690, 119901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メリークリスマス！\n聖夜に笑顔を\nお届けするべ♪", 1, 5691, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クリスマス前は\n乳製品がよく売れて\nありがてぇけんど…\n目が回る忙しさだ～", 1, 5692, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "牧場で売る\nクリスマスリースを\n作っておかねぇと…", 1, 5693, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うちの動物たちにも\nクリスマスプレゼント\n用意しなきゃなぁ", 1, 5694, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クリスマスに向けた\n限定商品とか\n作ってみるべか？", 1, 5695, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんちゃんへの\nプレゼント選び…\nここでボケるか…？\nやめておくべか…？", 1, 5696, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "オラ、あんちゃんから\n本当にたくさんの物を\nもらってんなぁ…", 1, 5697, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "雪遊びがしたいべか？\nへへっ、あんちゃん\nには負けねぇど！", 2, 5698, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ディナーと一緒に\n聖夜のお笑いライブを\nすんのはどうだべか？\nツッコミは任せたべ！", 2, 5699, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "寒くなってくると\n鍋が食べたくなるべや\nあんちゃんはどうだ？", 2, 5700, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あんちゃんは\nサンタさんのこと\n信じてるだか？", 2, 5701, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "どでかいクリスマス\nケーキをこさえるべ\nあんちゃんも作るの\n手伝ってくんろ♪", 2, 5702, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんちゃんが\nオラの旦那だったら…\nって、あんちゃん！\n今の聞いてただか！？", 2, 5703, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "牧場の朝は早いど！\nさぁてと、まずは\n雪かきしに行くべや", 2, 5704, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あんちゃんも一緒に\nお昼食べてくか？\n採れたての冬野菜は\nうんまいど～♪", 2, 5705, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "よい子は早く寝ねぇと\nサンタさんが\n来てくれねぇべよ？", 2, 5706, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こういうのリンリンが\n好きそうだな…\nプレゼント候補に\n入れておくべ！", 3, 5708, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もふもふしてて\nなまらめんこくて…\nあぁ…癒されるべや…", 3, 5709, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この匂い…\n気持ちが和むべや\n夢心地になっちまうな", 3, 5710, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったけぇところは\n落ち着くなぁ…\nつい眠くなっちまう", 3, 5711, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こ、この味は…！\n…うーん、もっと\nリアクション芸も\n練習しねぇとな", 3, 5713, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "シオシオって\nどんな本読んでんだ？\n…難しい字が\nぎっしりだべや…", 3, 5714, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "この仕掛け…\nオラのコントに\n活かせるかも\nしんねぇな", 3, 5716, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "この着ぐるみで\nリマリマのモノマネを\n練習してみるべか…？", 3, 5717, 119201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "もっとキレイになって\nアイツにぎゃふんと\n言わせてやるんだから", 1, 5718, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "アタシのこと\nどう思う？\nかわいいって…そこは\nキレイって言ってよね", 2, 5719, 105001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ハートマークの刺繍…\nは、やりすぎですかね\nいやちょっとくらい\nアピールしてみても…", 1, 5720, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "雪降らないかな～\nそしたらお兄ちゃんと\n雪だるま作ったり\nできるのに～", 1, 5721, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "プレゼントを入れる\n靴下…いくつ編んでも\n足りません～！", 1, 5722, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃんとの\nクリスマスデートは\n早い者勝ちですからね\n負けませんよ～！", 1, 5723, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "クリスマスだし…\n受験勉強は今日だけ\nお休みです♪", 1, 5724, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんと\nおそろいのコーデで\nクリスマスデート…\nしたいなぁ～！", 1, 5725, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんに\nプレゼントする編み物\nこれで３着目～と♪\nあれ、作りすぎ？", 1, 5726, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えへへ、もっと近くで\n見たくありませんか？\n私のとっておきの\nクリスマスコーデ♪", 2, 5727, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お兄ちゃんが風邪を\n引いたら一大事です！\n私の編み物で暖かく\nしてあげます♪", 2, 5728, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お兄ちゃん、ほっぺに\nケーキのクリームが\nついちゃってますよ♪\n私がとってあげます！", 2, 5729, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃん！\nケーキ、あーんって\nしてあげます！\nほら、あーん♪", 2, 5730, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クリスマスは大切な\n人と過ごすものっ！\nお兄ちゃん…妹の予定\n空いてますよっ！", 2, 5731, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "クリスマスはずっと、\nお兄ちゃんと一緒に\nいたい…って言ったら\n欲張り…すぎですか？", 2, 5732, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きは３本お得！\n…クリスマスなら\n追加で10本ぐらい\nもらえちゃうかも！？", 2, 5733, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はケーキ？\nそれとも七面鳥？\nごちそういっぱいで\n迷っちゃいますね～♪", 2, 5734, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "お兄ちゃんと\nクリスマスに夜更かし\n…えへへ、ちょっぴり\nドキドキしちゃう♪", 2, 5735, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "編み物をするには\n絶好のくつろぎ空間\nですね～♪", 3, 5737, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんというかわいさ…\nクリスマス\nプレゼントに\nもってこいですね！", 3, 5738, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これがお兄ちゃんの\nお部屋の香り…？\nんん～！　ずっと\nかいでいたいです～♪", 3, 5739, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふぁ、あったか～い…\n冬場はこういうのが\nありがたいですね～♪", 3, 5740, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ごちそうだぁ～♪\nほら、お兄ちゃんも\n食べて食べてっ！", 3, 5742, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クリスマスデートの\n必勝法…こ、これは\n読むしかないです！", 3, 5743, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "わっ、すごいです～！\nこれを飾っておけば\nクリスマスが一層\n賑やかになりますね♪", 3, 5745, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "さぷらーいずっ！\nリマちゃんじゃなくて\nリノちゃんでした～！", 3, 5746, 119301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ミミにもミソギにも\nあの人にも頼りに\nしてもらえるように\nしっかりしなきゃ！", 1, 5747, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ミミはにんじんを\n食べられてすごいな…\n私も見習わなきゃ\nがんばろう…！", 1, 5748, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミソギから怖い話\n聞いちゃった…\nうぅ…誰か一緒に\nいてくれないかな", 1, 5749, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "立派な大人に\nなれるように\nいっぱい勉強\nしておかなくっちゃ！", 1, 5750, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なんだか…あの人の\nあやしい視線を\n感じるような…？", 1, 5751, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人に勉強を\n教えられるように\nしっかり予習を\nしておこうっと…！", 1, 5752, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今日はあの人と\n一緒に冒険できる…\nなんだかワクワク\nしてきちゃった…！", 1, 5753, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あ、いいとこに来て\nくれましたね！\nあなたに頼みたい\nことがあるんです！", 2, 5754, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "きゃあっ！？\nへ、変なところを\n触らないでください！", 2, 5755, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうですかこの格好？\nかわいい、ですか…？\nそ、そうですか…\nありがとうございます", 2, 5756, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひゃあっ…！\nすみません、勉強に\n集中してたので\n驚いちゃいました", 2, 5757, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "一緒に勉強して立派な\n大人になりましょうね\n私がそばで見張ってて\nあげます", 2, 5758, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "まだ立派ではないかも\nですけど、私よりも\n大人なあなたのことは\n頼りにしてますからね", 2, 5759, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "立派な大人は\n朝の時間の使い方が\n上手だと聞きました\nあなたはどうですか？", 2, 5760, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ミミとミソギと\nあなたと…大事な人と\n一緒のお昼ごはんは\nやさしい味がしますね", 2, 5761, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "うぅ…怖い話を\n思い出しちゃいました\n寝るまで一緒に\nいてくれますか…？", 2, 5762, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "すごい座り心地…！\nとっても勉強が\nはかどりそう…！", 3, 5764, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子…なんだか\nミミに似てるような\n気がする…ふふっ♪", 3, 5765, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…♪\n勉強で疲れた\n頭がリフレッシュ\nできそうです", 3, 5766, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかだ…♪\nミミとミソギと\nあの人と一緒に\nいるときみたい", 3, 5767, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いっぱい食べたら\n早く大人になれたり\nしないかな…？", 3, 5769, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あう…\n知らない単語が…\nちゃんと調べて\n覚えなくっちゃ…！", 3, 5770, 120601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うさぎさんが\nぴょ～んぴょん♪\nみんなえがおで\nるんたった～♪", 1, 5773, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キョウカちゃんも\nいつかにんじんさんを\n好きになってくれたら\nうれしいな～♪", 1, 5774, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日のミソギちゃんの\nイタズラ、びっくり\nしちゃったけど\nおもしろかったな～♪", 1, 5775, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このおうち、いつも\nいろんな人がいて\nドキドキぴょんぴょん\nって楽しいな～♪", 1, 5776, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "いいお天気～♪\nお外でみんなと\nいっぱい遊びたいな♪", 1, 5777, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ミソギちゃんも\nキョウカちゃんも\nおにいちゃんがいると\nずっと笑顔だね～♪", 1, 5778, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おにいちゃんにはやく\nあいたいな～♪\nまだかな、まだかな♪", 1, 5779, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "えへへ♪\nおにいちゃんに\nなでなでされると\nぽかぽかするね♪", 2, 5780, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "聞いて、おにいちゃん\nさっきね、かわいい\nちょうちょさんに\n会ったんだよ～♪", 2, 5781, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふわっ…！\nおにいちゃんの顔を\nお絵かきしてたから\nびっくりしちゃった♪", 2, 5782, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おにいちゃんも\n遊びたいの？\nそれじゃあ二人も\n呼んで遊ぼう♪", 2, 5783, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにいちゃんも\nみんなも、優しい人\nばっかりで\nミミ幸せ～♪", 2, 5784, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おにいちゃん♪\n高い高いしてほしいな\nすっごくぴょんぴょん\nできて、好きなんだ♪", 2, 5785, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう～♪\nおにいちゃん、今日は\nおひさまみたいに\nきらきら元気だね～♪", 2, 5786, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おひるごはんだね～♪\nにんじんさんを\nいっぱい食べて\n元気いっぱい♪", 2, 5787, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわあ…\n眠くなってきちゃった\nおにいちゃん、\n一緒に寝よう～？", 2, 5788, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわぁ、気持ちいい♪\nずっとこうやって\n座ってたくなるね～♪", 3, 5790, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わあ、かわいい～\nぎゅ～っ、ぎゅ～っ♪\nこれで仲よしだね\nえへへ♪", 3, 5791, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "気持ちいいにおい～♪\nぴょんぴょんしたく\nなってきちゃった♪", 3, 5792, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかぽかぽか♪\nおにいちゃんも\nきてくれたら、もっと\nあったかくなりそう♪", 3, 5793, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…ごっくん♪\nおっきくなりたいから\nいっぱい食べるよ～♪", 3, 5795, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "えへへ、おもしろ～い\nこの絵本ね、\nキョウカちゃんから\n教えてもらったんだ♪", 3, 5796, 120401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この部屋…探索の\nしがいがありそう！\nついでにイタズラも\nしかけちゃお♪", 1, 5799, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ミミってああ見えて\n実は大胆で度胸も\nあるよね…ちょっと\nかっこいいな…！", 1, 5800, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "怖い話を聞いた時の\nキョウカって\n面白いんだよね～♪", 1, 5801, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "にいちゃんが\n慣れちゃわないように\nまた新しいイタズラを\n考えなきゃ！", 1, 5802, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "イタズラもいいけど\nミミとキョウカと\nにいちゃんと、普通に\n遊ぶのも楽しいなぁ♪", 1, 5803, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ミミにキョウカ、\nそれににいちゃん！\nみんなそろえば愉快な\n冒険が始まりそう！", 1, 5804, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次はどんなイタズラを\nしたら、にいちゃんは\n喜んでくれるかな？", 1, 5805, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今ミソギに触ったね？\nヤバいよにいちゃん…\n逃げないとトラップが\n発動しちゃうよ…！", 2, 5806, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わわっ！？　びっくり\nしたあ…！　新しい\nトラップを作ってて\n気づかなかったよ～", 2, 5807, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お？　にいちゃん、\nイタズラする側にも\n興味があるの？", 2, 5808, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "にいちゃんなにか用？\nあ、もしかして…\nミソギと遊びたく\nなっちゃった？", 2, 5809, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ベストタイミングだよ\nにいちゃん！\n今からみんなで探検に\n行くところなんだ！", 2, 5810, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "にいちゃんってさ\nホントに優しいよね\nなにしても怒らないし\n…ありがとね♪", 2, 5811, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "にいちゃんおはよー！\n景気づけに本日\n一発目のイタズラ、\nやっちゃうよ～♪", 2, 5812, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはんはロシアン\nサンドイッチだよ！\nさあ、にいちゃん！\n好きなの選んでよ！", 2, 5813, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜ってなんだか\nワクワクしてなかなか\n眠れないんだよね\nにいちゃんはどう？", 2, 5814, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この座り心地のよさ…\nなにかのトラップに\nうまく使えないかな？", 3, 5816, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうのに細工して\nミミやキョウカを\n驚かせると、いい反応\nするんだよね♪", 3, 5817, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "においをうまく使った\nイタズラって…\nなにかないかな？", 3, 5818, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったまりながら\n新しいイタズラを\n考えると、いい案が\n出て来たりするんだ♪", 3, 5819, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしくてついつい\n食べ過ぎちゃうなぁ…\nはっ…！？　これって\nまさかトラップ…！？", 3, 5821, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "このキョウカから\n借りた冒険物語\nすっごく\nおもしろいんだよね！", 3, 5822, 120501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "晴れ着を着ると\nなんだか心が躍るね\n足取りも軽く\nなるってもんさ", 1, 5825, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "正月の食べ物ってのは\n美味いもんだね\nいくらでも\n食べれちまうよ", 1, 5826, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "普段は好き勝手してる\nアタシらも\n正月くらいは\n大人しくするさ", 1, 5827, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "年越しそばに雑煮\nこの季節は\n温かいものが\n体に沁みるね", 1, 5828, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "正月だからって\nのんびりしすぎたね\nちょっと釣りにでも\n行こうかね", 1, 5829, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いい正月だね\nいつかあの子と\n一杯やりたいもんだよ", 1, 5830, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "大事な人と過ごす\n正月ってのがこんなに\n楽しいもんだとはね", 1, 5831, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "部屋があったかくて\n顔が火照っちまったよ\nちょいと外に涼みに\n行かないか？", 2, 5832, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "餅ってのは\n何をつけてもうまいね\nお前さんは\nどの味が好きだい？", 2, 5833, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お祝いの鯛が\n足りないって？\nそれじゃあアタシが\n釣ってきてやるよ", 2, 5834, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おせちが美味いのは\n分かるけど\n食べ過ぎには\n気を付けるんだよ", 2, 5835, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お前さんのおかげで\nいい正月を\n迎えられたよ\nありがとさん！", 2, 5836, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "慣れない晴れ着も\nお前さんに見て\nもらえたなら\n着たかいがあったね", 2, 5837, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようさん\n寒いのは分かるけど\nいい加減布団から\n出て顔洗ってきな", 2, 5838, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日の昼飯は雑煮だ\nアタシの郷土の味\nしっかり味わって\nおくれよ", 2, 5839, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おや、お前さんも\n夜ふかしかい？\n退屈してたところさ\n付き合っておくれよ", 2, 5840, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "晴れ着だと座り方にも\n気を遣うね\nしわになったら大変さ", 3, 5842, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "せっかくだし\nこの子にも晴れ着を\n着せてあげたいね", 3, 5843, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これは冬の花の香り…\n風情があって\nいいじゃないか", 3, 5844, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいねぇ…\nこんな寒い日には\nまさに天国だよ", 3, 5845, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いつも食べてる\nものでも正月に\n食べると\n新鮮な気がするね", 3, 5847, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "せっかくの正月休みだ\nたまにはゆっくりと\n本でも読もうかね", 3, 5848, 120801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新年のあいさつ…\n私も街のみんなに\nしてみようかしら…", 1, 5850, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "正月はゆっくり過ごす\nのよね…ゆっくりって\n何したらいいのかしら", 1, 5851, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この格好も\n慣れてくれば\n動きやすいわ", 1, 5852, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "う～ん、今年の抱負…\nやりたいことが\nたくさんあるのよね", 1, 5853, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "おせち料理\nネビアの分も\n用意しなくちゃね", 1, 5854, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふふっ\n正月っていいわね\nみんな楽しそうだもの", 1, 5855, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "新年の思い出…\nこれからもっと作るわ\nそれが私の抱負よ", 1, 5856, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日は家で過ごすの？\nあなたと一緒なら\nきっと楽しいわね", 2, 5857, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どう？　この格好？\nコッコロさんは\n褒めてくれたけど…", 2, 5858, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ちょうど良かったわ\nあなたも大掃除\n手伝ってくれる？", 2, 5859, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これから料理するけど\nお雑煮と焼き餅\nどっちが好きかしら？", 2, 5860, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "『今の私』にとって\n初めての正月だもの\nあなたと楽しまないと", 2, 5861, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "去年よりも今年…\nもっと成長するからね\n…お兄ちゃん♪", 2, 5862, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう\nせっかくの正月だもの\n朝から楽しまないとね", 2, 5863, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ねぇ…\n良かったら正月の遊び\n教えてくれるかしら？", 2, 5864, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ～…今日が\n終わっちゃうのが…\nもったいないわね…", 2, 5865, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…お参り後だから\n心地よすぎて眠って\nしまいそうだわ…", 3, 5867, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ\nかわいいものって\n癒されるわね…", 3, 5868, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…ん\nこれが梅の香り？\n…いい匂いね", 3, 5869, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "キャルじゃないけど…\nこのまま丸く\nなりたいところね…", 3, 5870, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむはむっ…♪\nせっかくの正月だもの\n堪能しなくちゃね♪", 3, 5872, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…ふんふん\n帯の結び方って\nこんなにあるのね…", 3, 5873, 120701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今の私が作れる\n最高の一曲…\nあの人に届くといいな", 1, 5875, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あの、歌を…\n聞いてくれませんか？\nあなたに贈る\n特別な歌を", 2, 5876, 104201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ひい、ふう…\nむむ、みなに配る\nお年玉のポチ袋が\n残りわずかなのじゃ…", 1, 5877, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "宴の準備はわらわに\n任せておくのじゃ！\n支配者の手腕、\n見せつけてくれる！", 1, 5878, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新年の願掛けなら\nわらわにすればよい\n支配者に頼むほうが\n確実じゃろう？", 1, 5879, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "みなからもらった\nこの年賀状とやら…\nわらわも\n書いてみようかの♪", 1, 5880, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "正月飾りにもいろいろ\n種類があるんじゃの～\nどれも華々しくて\nわらわ好みじゃ♪", 1, 5881, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あやつへのお年玉は\nちと多めにしておくか\n…日ごろの感謝も\n込めてのう", 1, 5882, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あやつのことを想うと\nそれだけで行く年\n来る年が楽しみになる\nふふ、愉快なやつじゃ", 1, 5883, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みなに晴れ着を\n褒められて、とても\nよい気分なのじゃ♪\n次はお主の番じゃぞ？", 2, 5884, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お主へのお年玉は\nいちばん最後じゃ！\n残り物には福が宿る\nそうじゃからのう", 2, 5885, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この季節は手が\nかじかむのう…ほれ、\nお主！　わらわの手を\nあたためるのじゃ！", 2, 5886, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お主のために雑煮を\n手作りしてみたのじゃ\n食べていくがよい♪", 2, 5887, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "眷属のお主に\n正月休みはまだ早い！\nずっとわらわのそばに\n控えておくのじゃ♪", 2, 5888, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ふふ、これほど楽しい\n正月は初めてじゃ…\nお主と過ごす時間は\nいつだって特別じゃな", 2, 5889, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きしてわらわを\n待っておったのか？\nさすがはわらわの眷属\n殊勝な心がけじゃな♪", 2, 5890, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "食事どきじゃな\n正月の宴会料理が\nわらわたちを\n待っておるぞ♪", 2, 5891, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜も更けてきたのう\n冬の夜は長い…\n心ゆくまでお主と\n過ごせるわけじゃな♪", 2, 5892, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "実に心地がよい♪\nこのまま寝正月も\n悪くないかも\nしれぬのう", 3, 5894, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "愛いやつじゃのう\nわらわのそばに置いて\nやってもよいぞ♪", 3, 5895, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "品のある香りじゃのう\n寝室に置いておけば\nなにかご利益に\nあずかれそうじゃな", 3, 5896, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "心地よい…\nわらわはしばらく\nここから動かぬぞ\nお主も付き合うがよい", 3, 5897, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "舌鼓が鳴るのう♪\n正月の宴には\n持ってこいの品じゃ！", 3, 5899, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ほう、新春にはそんな\n習わしが…正月を\n制するには、まだまだ\n勉強が必要じゃのう", 3, 5900, 120901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "久しぶりの我が家って\n感じです！　やっぱり\nここが一番ですね〜！", 1, 5902, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さあ食べましょう！\nみんなで囲める食卓を\n心から味わいますよ☆", 1, 5903, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ランドソルに\n帰ってきた途端に\nお腹が空きました〜！", 1, 5904, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ただいま☆\n幸せ特盛りの\nわたしの日常！", 1, 5905, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ようやくランドソルに\n帰ってきたことですし\nやっぱり魔物料理を\nいただきましょう☆", 1, 5906, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人との絆を\n守るために\nもっともっと食べて\n強くならなくちゃ☆", 1, 5907, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつもありがとうって\nあの人を思いっきり\n抱きしめたいです☆", 1, 5908, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あなたの想いは\nこの身をかけて\n全力で受け止めます！", 2, 5909, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おかえりなさい☆\nここにいるみんなも\nあなたの帰りをずっと\n待っていましたよ！", 2, 5910, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このギルドハウスで\n冒険の疲れを\n癒しましょう〜！", 2, 5911, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたの想いが\n全力全開を超える\n力をくれました！", 2, 5912, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "日常が続く幸せを\nあなたと一緒に\nかみしめたいです☆", 2, 5913, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ぎゅ〜っ！\nわたしたちは\nどんなことがあっても\nずっと一緒ですよ？", 2, 5914, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます！\nあなたと過ごせる\n幸せを、今日も\n味わいますよ〜！", 2, 5915, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ご飯の時間ですよー！\nあなたも一緒に\n食べましょうね！", 2, 5916, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日もあなたが隣に\nいてくれることを\n心から願ってますよ\nおやすみなさい☆", 2, 5917, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふい〜…\n安心できる場所で\nくつろげるって\n幸せですね〜…", 3, 5919, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "じゅるり…\n食べたくなっちゃう\nくらい、かわいい☆", 3, 5920, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん…おおー！\nステーキの香り！\nやばいですね☆", 3, 5921, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体がぽかぽかしてきて\nわたしの食欲も\n燃えてきましたよー！", 3, 5922, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "わたしの食欲に\nついてこられますか？\nまだまだ食べますよ！", 3, 5924, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これがキャルちゃんの\n言っていた、キスで\n目覚める王子様の\nおとぎ話ですか〜☆", 3, 5925, 121001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "自分で自分を\n分析するのも、これは\nこれで面白い…♪", 1, 5927, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "強過ぎる力の扱いには\n注意しないと…\n七冠がいい例だね", 1, 5928, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "少年の交友関係は\n計り知れないな…\nアタシも含むのか！", 1, 5929, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "原理を徹底解明して\n再発を防ぐぞー！\n…誰か手伝って～！", 1, 5930, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これは祝福にも\n呪いにもなる…\n忘れずにいよう", 1, 5931, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "少年が\n目を覚ましてくれて\n本当によかった…", 1, 5932, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼以外を選んでいたら\n今回の事態は\n乗り切れなかったな…\nさすがだよ、少年", 1, 5933, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "少年！　調子はどう？\nクレープ食べられる？\nっていうか食べて？", 2, 5934, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "元気そうで何よりだ\nまた店を手伝いに\nきてよ。二人もキミに\n会いたがってたしさ", 2, 5935, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キミの診察もあるし\n今はなるべくそばに\nいるよ。迷惑じゃ\nなければだけど", 2, 5936, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "やっぱり少年は\nあちこちで人を\n助けてる時が\n一番輝いてるよ", 2, 5937, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アタシは大したこと\nしてないけど\nみんなのことは\n褒めてあげてね", 2, 5938, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "みんなを笑顔に\nできるのは\nやっぱり少年だね", 2, 5939, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "やあ少年\n朝寝坊はしてない？\nそれじゃ、よい１日を", 2, 5940, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おや、少年！\nまかないのクレープ\n作ったけど、食べる？", 2, 5941, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ…もう夜か…\n研究してたら\nあっという間だね…\nおやすみ、少年", 2, 5942, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "体がなまってたのか\n前線に出ると疲れる…\nまさか…年のせい！？", 3, 5944, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キミたちも今の\nアタシと同じ感じに\nアレンジしてあげよう", 3, 5945, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "誰が置いたんだろう？\nいい香りだねぇ…\nうん、気に入った♪", 3, 5946, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "何も考えてない時間も\n実は思考にとって\n大事なんだよね～…", 3, 5947, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食の大切さは\nいつの食事からも\n感じられるね♪", 3, 5949, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむ…面白い！\n今度全巻\n借りにこようっと", 3, 5950, 121201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "聖学祭か…\n良い記憶はないな\nよし忘れよう", 1, 5952, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "健全なる精神は\n健全なる肉体に宿る…\nはっ、知ったことかよ", 1, 5953, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "暇だし鏡でも見るか…\nえへへ、ユニだよ♪\nよし子供料金いけるな", 1, 5954, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アオイ君は元気に\nしているだろうか…\n彼女は人一倍ぼくに\n懐いていたからな…", 1, 5955, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "そろそろシズル君は\n姉という幻想から\n目覚めただろうか…", 1, 5956, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ぼくは来年も聖学祭に\n行くさ…卒業しても\n君らとは永遠だ", 1, 5957, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "最近同志の登校率が\n減少傾向だな…\nまあ仕方ないのだが…\nないのだが…", 1, 5958, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ほわあああ！\nおい急に話しかけるな\n学びがこぼれる", 2, 5959, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この体操着、周囲から\n大層評判が良いのだよ\nたいそうだけにな\nどやっ！", 2, 5960, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "何を着ていようと\nぼくはぼくさ\n外見など所詮は\n魂の識別符に過ぎん", 2, 5961, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "救護院のアヤネ君が\n最近ぼくの自称年齢に\n疑念を持ち始めてな…\nあの熊…殺るか…", 2, 5962, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "うん？　なんだね？\nなに、用は無い？\n用も無いのに呼ぶとは\nもしや…これが友達！", 2, 5963, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この服が似合ってる？\nな、なんだね突然…\nやめたまえよでゅふふ", 2, 5964, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁ～あ…\n朝も更けてきたな…\nそろそろ寝るか…", 2, 5965, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふぁ～あ…もう昼だ…\n人間の起きている\n時間ではないな…\n早く寝なくては…", 2, 5966, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "うーん、よく寝た！\n気持ちのいい夜だな\n今日も一日がんばるぞ", 2, 5967, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ほわぁ～…\nもしやこれは都で噂の\n人を駄目にするやつ…", 3, 5969, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふむ、愛くるしいな\nだが似合い過ぎる…\nぼくが持つと我ながら\n子供にしか見えん", 3, 5970, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アロマか、興味深いな\nミツキ印ポーションも\n気化させて鼻腔から\n吸入してみるか…", 3, 5971, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "んふ、んふふ…\n火ってイイよね…\nずっと見てられるね…", 3, 5972, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "や、やめろ…\nとめどなく固形食物を\n生産するのはやめろ…", 3, 5974, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この可愛げのない筆致\nやはり作者は理系か！\nぐああ目が理系になる", 3, 5975, 116401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…あいつのためなら\n無理くらいいくらでも\nしてやるわよ", 1, 5977, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この姿、\n魔力の制御ムズ過ぎ…\nま、あたしは優秀だし\nどうとでもなるけど！", 1, 5978, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あいつのこと、\n全部受け入れるって\n決めたから！", 1, 5979, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今なら誰だろうと\n負ける気がしないわ\nドラゴンでもなんでも\nかかってこいっての！", 1, 5980, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "散々助けられた分、\n今度はあたしが\nあいつのこと助けるわ", 1, 5981, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつとの\nこれまでの冒険は\nどれも、あたしの\n大切な思い出…", 1, 5982, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もしまたあいつが\n寝たままになったら\nなんだってするわ\nキ…キスでも…", 1, 5983, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なに、お腹空いたの？\nなら、おいしいご飯を\n食べに行きましょ♪", 2, 5984, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "やっぱ、\nあんたのアホ面見ると\n安心するわ♪", 2, 5985, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "【美食殿】はあんたと\nぺコリーヌがいなきゃ\n始まんないっての", 2, 5986, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひゃあっ！？\n急に声かけないで！？\n魔力が暴発しても\n知らないわよ！", 2, 5987, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…あんたとこうして\nぼーっと過ごす時間、\nまあ…嫌いじゃないわ", 2, 5988, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたが信じて\n見守っててくれれば…\nあたし、\nなんだってできるわ", 2, 5989, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよ\n早く顔洗いなさいよ、\nこのねぼすけ♪", 2, 5990, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日のお昼は\nどこで食べる？\nあんたが\n決めていいわよ", 2, 5991, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もしあんたがまた\n夢に囚われても\nあたしが助けるわ\n安心して寝なさいよ", 2, 5992, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気持ちいい～…♪\nあいつもたまには\nこうして休ませなきゃ", 3, 5994, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "一目惚れしたかも…！\nこの子、\n部屋に飾りたいわー♪", 3, 5995, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "へぇ、あいつって\nこういう匂いが\n好きなのかしら…？", 3, 5996, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かくて最高…♪\n丸くなっちゃいそう…\nうにゃあ…♪", 3, 5997, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "イケるわね、これ！\nやっぱり食べるって\n大事よねー♪", 3, 5999, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ファーストキスは\nどんな味、ね…\nふ、ふ～ん…？\nなるほど…", 3, 6000, 121101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お友だち…\nできるかしら…？\nこんなわたしでも…", 1, 6002, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あまり、きょろきょろ\nしちゃダメよね…\n変な子だと、\n思われてしまうわ…", 1, 6003, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "広い場所、\n落ち着かない…\nはぅ…どこにいれば…", 1, 6004, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "～♪", 1, 6005, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "【レイジ・レギオン】\n…またいつか、\nみんなと…", 1, 6006, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…一度でいいから、\nわたしもママって…\nあっ、その…\n…な、なんでもないわ", 1, 6007, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ここが、今のわたしに\nとっての帰る場所…\n…そう思っても、\nいいのかしら…？", 1, 6008, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ええと…\nお腹、空いてる？\nおねむじゃない？", 2, 6009, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここにいると\n邪魔かしら…？\nならもっと隅っこに…", 2, 6010, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お喋り…？\nわたしでいいの…？\nうれしい…", 2, 6011, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたの好きな歌…\n教えて…？\n練習、するから…", 2, 6012, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ここは賑やかだけど…\nうるさいとは感じない\nむしろ、心地いい…", 2, 6013, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "安心、して…\nわたしの歌で、\nあなたを守るから…", 2, 6014, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ちょっとだけ…\n朝は、苦手…\n…ふぁ…", 2, 6015, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼は、食べた？\n良かったら、一緒に…\n少し…焦げてるけど…", 2, 6016, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "眠れないのかしら…\nじゃ、じゃあ…\n子守歌…聴く？", 2, 6017, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こんな特等席…\n恐縮、です…", 3, 6019, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "い、今のうちに、\nこの子でお世話の\n練習を…", 3, 6020, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\n…つらい気持ちも\n癒してくれる", 3, 6021, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\nいつまでも、\nこうしていられそう…", 3, 6022, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしく出来てる…\nすごいわ…\n見習わなくっちゃ…", 3, 6024, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "『赤ちゃんとママの\nスキンシップ入門』…\n…べ、勉強になるわ…", 3, 6025, 118101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "きれいなお部屋…！\n立派な舞台の\nセットみたい…♪", 1, 6027, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お芝居では私が先輩\nなんだから、しっかり\n私がミサキちゃんを\nエスコートしなきゃ", 1, 6028, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "～～♪\n歌うお芝居も多いから\nもっと上手く\nなりたいな…！", 1, 6029, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここにいる人たちと\n仲良くなりたいな…\nそしたらきっと演技の\n幅も広げられるよね", 1, 6030, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "機会があったら\nアヤネちゃんとも\nお芝居してみたいな♪", 1, 6031, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんに褒めて\nもらえるように\nお芝居の練習\nいっぱいしなきゃ…♪", 1, 6032, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あう…お兄ちゃんを\n意識したら、台詞が\n飛んじゃったよぅ…！", 1, 6033, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あっ、お兄ちゃん…♪\nお芝居の練習を\n見てくれませんか…？", 2, 6034, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いまの発声練習\nどうでしたか？\nひゃん…！？\n頭は撫でないでぇ～", 2, 6035, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミサキちゃんも\nお芝居、とっても\n上達してるんですよ\n私も負けられません♪", 2, 6036, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "また物語を聞かせて\nほしい、ですか…？\n私なんかでよければ\nもちろんよろこんで♪", 2, 6037, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "新しいお話を\n考えてみました\n聞いてくれますか…？\nよかった…♪", 2, 6038, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつか…舞台上じゃ\nなくても、照れずに\nお兄ちゃんに気持ちを\n伝えてみせますね…♪", 2, 6039, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\nマヒルさんにもらった\nミルク、一緒に\n飲みませんか？", 2, 6040, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "牧場のみなさんに\nドングリパンを\nいただきました～\nおひとつどうぞ♪", 2, 6041, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝る前にまたココアを\n飲みながら、お話を\n聞いてもらえますか？\nえへへ、うれしいな♪", 2, 6042, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お芝居の練習の\nあとは、ここで\nお兄ちゃんと\nゆっくりしたいな♪", 3, 6044, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日も演技の\n練習に付き合ってね♪", 3, 6045, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "素敵な香り…\nこのイメージも\nお芝居に\n活かせないかな…？", 3, 6046, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "私もお芝居で\nみんなの心を\nぽかぽか温められる\nようになりたいな…♪", 3, 6047, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "舞台に立つんだから\n食べ過ぎないように\n気をつけないと。\nでも…おいしいなぁ♪", 3, 6049, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "このお話、面白い…\n脚本を書く\n参考にもなりそう…♪", 3, 6050, 121301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "えへへ…♪\n二人で見た夕日…\nキレイでしたね…", 1, 6052, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "これから泳ぎの\n練習ですか？\n付き合いますよ♪", 2, 6053, 107501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "主さまを導くことで\nわたくしも未知なる\n領域へと辿り着けます", 1, 6054, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "主さまとなら\n海よりも深く\n空よりも高い場所へも\n目指せそうです", 2, 6055, 107601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あいつと二人で\n夏の遠い海に…って\nあたしってば\nなに考えてるのよ！", 1, 6056, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あたしが楽しく\n過ごせるのはあんたが\nいてくれたからよ\nか、感謝してるわ", 2, 6057, 107801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はぁ…アタシってば\nこんなにかわいくって\nキレイなんて罪よね～", 1, 6058, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "舞台の衣装を\nクリーニング\nしとかなくちゃ…", 1, 6059, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "舞台映えするメイク…\nスズナなら\n知ってるかしら？", 1, 6060, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "物産展の会計係と\n山盛りの算数の宿題…\nどっちが簡単かしら…", 1, 6061, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "牧場と温泉の仕事に\nお芝居の練習に…\nちょ、ちょっと休憩～", 1, 6062, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お客さんの視線も\nうれしいけど…\nあいつも見てて\nくれてるかしら？", 1, 6063, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もっともっと\nセクシーになって\nあいつをビックリ\nさせてやるわ♪", 1, 6064, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アンタも休憩？\nしっかり働くために\n休むのも大事よね", 2, 6065, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふふん♪　アタシも\n料理ができるように\nなったんだから！\n簡単なのだけだけど…", 2, 6066, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "温泉ってお肌に\nいいのよね？\nもっとキレイに\nなったらどうしよう〜", 2, 6067, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "物産展の荷物は\nこれでよし…っと\nそれじゃアンタも\n運ぶの手伝ってよね♪", 2, 6068, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いつもと違うアタシに\n見とれちゃった？\n仕方ないわね～♪", 2, 6069, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お花見って風流で\n大人って感じ♪\n…でもお団子も\n忘れないでよね！", 2, 6070, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "みんなに朝ごはんを\n作ってみたら\n喜んでくれるかしら？", 2, 6071, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お客さんがいっぱい\n来る時間帯ね！\n元気出していくわ！", 2, 6072, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ寝ないと…\n睡眠不足はお肌の\n大敵なんだから", 2, 6073, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかしてて\n気持ちいい～♪\n疲れが癒されるぅ…", 3, 6075, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子もアタシと\nおそろいの衣装に\nしてあげようかしら♪", 3, 6076, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "素敵な衣装で\nいい香りを\n身にまとう…ふふ、\n大人のたしなみよね♪", 3, 6077, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～い♪\nここでお昼寝したら\n気持ちよさそう…", 3, 6078, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お仕事がんばると\nいつもよりお腹\n空いちゃう～！", 3, 6080, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "最新のトレンド\n載ってないかしら？\n物産展の売り物に\n取り入れなくちゃ！", 3, 6081, 121401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "怪盗のこと…\nお父さんお母さんに\nもし知られたら\nなんて説明しよう…", 1, 6083, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たとえ怪盗でも、人の\n家にお邪魔するときは\n身だしなみをしっかり\nしないと…", 1, 6084, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "鍵開けって難しい…\nうーん、もっと\n練習しておかなくちゃ", 1, 6085, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "姿が見えない\n怪盗の噂…？\nわ、私のことじゃ\nありませんように…！", 1, 6086, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "予告状って…\n切手はどこに貼れば\nいいんだろう…？", 1, 6087, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "怪盗活動にも\n慣れてきたけど…\nやっぱり先輩が\nいないと心細いなぁ…", 1, 6088, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "せ、先輩の心も\nいつか盗めるかな…？\n…わわわ、私ってば\nなに言ってるんだろ…", 1, 6089, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "怪盗が大活躍って\n新聞で読んだ…？\nだっ、誰のこと\nでしょうね…あはは", 2, 6090, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "尾行に潜入…\n存在感がないのって\n意外と役立つことも\nあるんですね", 2, 6091, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "せせせ、先輩っ！\n帽子をぎゅーって\nかぶったら、抜けなく\nなっちゃいました…！", 2, 6092, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぬ、盗み聞きなんて\nしてませんよ？\nみんなが私に気づかず\n話し始めるだけで…", 2, 6093, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "秘密道具が見たい？\nそ、それは内緒です！\n秘密道具ですから…\nで、でも先輩になら…", 2, 6094, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えへへ\n見つかっちゃいました\n先輩はいつも私を\n見つけてくれますね…", 2, 6095, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございまふ…\n秘密道具のお手入れで\n夜更かししちゃって…\nちょっと眠たいです～", 2, 6096, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "怪盗が昼に活動する…\n案外そのほうが\n意外性が\nあるのかも…？", 2, 6097, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "外が暗くなりましたね\n…そろそろ怪盗の活動\n始めましょうか？", 2, 6098, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここでくつろぐと\n疲れが取れます～\n…今日も怪盗\nがんばろっと", 3, 6100, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わぁ、かわいい…！\n心を盗まれるって\nこういうことかな…？", 3, 6101, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "素敵な香り…でも\n服に香りがついたら\n隠れてるときに\n見つかっちゃうかな…", 3, 6102, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかで\nいい気持ち…\n夜道を歩く前に\n温まっておこうっと…", 3, 6103, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "怪盗活動に備えて\n今のうちにしっかり\n食べておかなきゃ…！", 3, 6105, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "女の子は秘密が\n多いほうが魅力的…？\nそ、そうなんだ…", 3, 6106, 121501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ドＳさんはいつも\nクウカの妄想の中に…\nぐふふ、じゅるり～♪", 1, 6108, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "やさしい触り方も\n嫌いじゃありません…\nは…恥ずかしいですが", 2, 6109, 104501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この大怪盗さまに\n盗めないものなんて\nないです！　たぶん！", 1, 6110, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしにふさわしい\nビッグなお宝は\nどこにあるですかね～", 1, 6111, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そろーりそろーり…\n気配を消せばお菓子も\n食べ放題…にやり", 1, 6112, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "またサボってたのが\nバレたです…\nボスの地獄耳～！", 1, 6113, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ギャングで大怪盗…！\nこの肩書の多さ！\nまさに有能の証です！", 1, 6114, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄さんだったら…\nお宝を山分けして\nあげてもいいですよ", 1, 6115, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄さんはアレですよ\n大怪盗イノリさまの\n相棒みたいなものです", 1, 6116, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何事も用心深さが\n大切ですよ。ビ…\nビビりじゃないです！", 2, 6117, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぬ、盗み聞き？\nしてないですよっ？\nぴゅーぴゅーぴゅー", 2, 6118, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "情報が欲しければ\nお菓子と交換ですよ\nさぁ、交換交換っ♪", 2, 6119, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "しーっ！\n今、尾行中なんです\n話はあとで…", 2, 6120, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄さんと話してると\n時間が速いような…？\nこの時間泥棒！", 2, 6121, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ちょうどよかった！\nいい話があるんです\n一口乗りませんか？", 2, 6122, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おてんとうさまが\n出てやがるですね…\n悪事がやりにくいです", 2, 6123, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "もうこんな時間ですか\nご飯にお昼寝…\nいやー忙しいです♪", 2, 6124, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふっふっふ！　夜こそ\n大怪盗の時間です！\n……ふぁあ", 2, 6125, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うーん…\n警備の目がないと\n気楽でいいですねぇ", 3, 6127, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "くう…！\nこのかわいさは\n盗めないです…♪", 3, 6128, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "犯行現場に残ったのは\n香水の匂いだけ…\nふふ、おしゃれ大怪盗", 3, 6129, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "意外とこういう場所に\n隠し扉があったり…\nしないです？", 3, 6130, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nこの美味しさ…\nとんでもない罠ですね", 3, 6132, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "むむむ…ちっとも\n分からないです…\nほとんど暗号ですよ", 3, 6133, 121601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あら、サレンさんは\nどこに行かれた\nのかしら？", 1, 6135, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふんふんふーん♪\nなんだか華やいだ\n気分ですわ♪", 1, 6136, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "さて…次の事業は\nどうしましょう\n何か面白いことは…", 1, 6137, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おーっほっほっほ！\nあら…楽しくて、つい\n笑ってしまいましたわ", 1, 6138, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "センスがあって\nいいお部屋ですわね\n私も見習いたいですわ", 1, 6139, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "サレンさんとあのお方\n仲がいいですわね\nも、もちろん仲がいい\nのはよいことですわ！", 1, 6140, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どんなときでも\n正々堂々！\nそれが私の\n誇りですわ！", 1, 6141, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふふ、ごきげんよう\n私、絶好調でしてよ", 2, 6142, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どうかされましたか？\n何かお困りごと\nでしたら\n是非力になりますわよ", 2, 6143, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "たまにはこうして\nゆっくりと\nお話しするのも\nいいものですわね", 2, 6144, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "次の事業に関して\n考え事をしてましたの\nよければ相談に乗って\nくださるかしら？", 2, 6145, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "よろしければ\nお話しませんこと？\nサレンさんのお話を\n聞かせてほしいですわ", 2, 6146, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ふふっ…\n先ほどサレンさんと\nあなたさまのお話を\nしていたところですわ", 2, 6147, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さあ！\n今日も一日\n全力で参りますわ！", 2, 6148, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はどうしましょう\nサレンさんをお誘い\nしてみようかしら", 2, 6149, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もう少しだけ…\n明日の準備をして\nおかないと…", 2, 6150, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ～…いいですわね\nはっ、私としたことが\nはしたないですわね", 3, 6152, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいらしいですわ\nいくつになっても\nぎゅっと\nしたくなりますわね", 3, 6153, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "落ち着きますわね\nサレンさんはどんな\n香りが好きなのかしら", 3, 6154, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふふっ、燃え盛る\n情熱の炎…\nいいですわね", 3, 6155, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "このおいしさで\n元手がゼロ…\nすばらしい\n商品ですわ！", 3, 6157, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これは…ふむふむ\n新しい事業のヒントに\nなりそうですわ", 3, 6158, 121701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さて、と…\n今日は何をしなくちゃ\nいけないんだっけ？", 1, 6161, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "やることは山積み\nだけど、手を動かす\nのは嫌いじゃないわ♪", 1, 6162, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あら？　アキノさんの\n声が聞こえたような\n気がしたんだけど…", 1, 6163, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アキノさんといると\nついこっちまで笑顔に\nなっちゃうのよね", 1, 6164, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "弱音なんか\nはいてられないわ\nアキノさんに\n笑われちゃうもの", 1, 6165, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "気が付けばアキノさん\nのペースだけど…\n不思議と嫌では\nないのよね", 1, 6166, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あたしを好敵手って\n言ってくれる\nアキノさんのためにも\nしっかりしなくちゃ", 1, 6167, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうしたの？\nアキノさんなら\nさっきそこに\nいなかった？", 2, 6168, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あたしなら大丈夫\n救護院だって\nみんなが助けて\nくれるからね", 2, 6169, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "さっきアキノさんが\nあんたを探してたわよ\nなにかしたの？", 2, 6170, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こう見えてヒマじゃ\nないんだけど…\n少しくらいなら\n付き合ってあげるわ", 2, 6171, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ねえ、あんたと\nアキノさんって…\nううん、やっぱり\nなんでもないわ…", 2, 6172, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アキノさんも誘って\nお茶でもしない？\n話したいことが\nたくさんあるの♪", 2, 6173, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きは三文の得よ\nいい一日を迎えるため\n目を覚まさなきゃ", 2, 6174, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日のお昼は…\nアキノさんと同席する\n予定だったわね\nあんたもどう？", 2, 6175, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふぁ…っと、だめね\nたるんだところを\nアキノさんに\n見せるわけには", 2, 6176, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ん～…\n落ち着くわね\nこのまま\n寝ちゃいそう…", 3, 6178, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "救護院の皆も\nぬいぐるみが\n大好きなのよ", 3, 6179, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りね…\nこれはアキノさんの\n趣味かしら？", 3, 6180, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こんなに激しく\n燃えているのに\nあったかくて落ち着く\nまるでアキノさんね", 3, 6181, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "どんどん出てくる…\nこれ、救護院にも\nほしいわね…", 3, 6183, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\n前にアキノさんが\n言ってたのは\nこのことかしら？", 3, 6184, 121801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この衣装、私には\nちょっとかわい過ぎて\n恥ずかしいな…", 1, 6187, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一部の人からは\n海賊より海賊らしいと\n評判の父です", 1, 6188, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "潮風で錆びないよう\n武器の手入れを\nしておきましょうか", 1, 6189, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "宝探しのお手伝いなら\n力になれると思います\n父のやる気次第ですが", 1, 6190, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "除霊は気を遣います\n一歩間違えると父まで\n成仏させてしまうので", 1, 6191, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人と見た\n海の景色を…ずっと\n忘れずにいたいな", 1, 6192, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "幽霊になっても\n一目会えるなら…\n私はきっとあの人に…", 1, 6193, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ボートを漕ぐの、少し\n上手になったんですよ\n今度お見せしますね", 2, 6194, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "航海に向けた\n買い出しが必要ですね\n予定は空いていますか", 2, 6195, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "呪われた財宝の\n解呪依頼が多くて…\nふぅ…えっと次は…", 2, 6196, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夜の航海では\n父が明かり代わりに\nなってくれるんです", 2, 6197, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "船の上では食材が\n限られるので料理の\nいい練習になります", 2, 6198, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この先もずっと\nあなたと一緒に\nたくさんの思い出を\n作っていきたいです", 2, 6199, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "あの人の寝顔…\nもう少しだけ\n眺めていたいな…", 2, 6200, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "船の上では\n規則正しい生活が\n重要ですから", 2, 6201, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海は幽霊が\n見分けやすいんです\n青白く光るので", 2, 6202, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海に揺られるような\n心地よさですね\n気が休まります…", 3, 6204, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたも一緒に\n海を見に行きますか？\n…なんて。ふふっ", 3, 6205, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "爽やかな香りですね…\n一面の青い海が\n目に浮かぶようです", 3, 6206, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "温かい…\n潮風で冷えた体に\n沁みますね", 3, 6207, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あ、おいしい…\n日持ちするなら船旅に\n持っていこうかな…", 3, 6209, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "アンナさんに教えて\nもらった小説は…\nあ、これですね", 3, 6210, 122001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "なにもしないを\nしてるんだよ\nあ～いそがしいそがし", 1, 6212, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "はぁ～あんたといると\nどこまでも気持ちよく\nダラダラできるね～", 2, 6213, 102601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "暗黒騎士にして、\n伝説の海賊でもある\n私に不可能はないっ！", 1, 6214, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海賊団の船員、\n随時募集中です…と\nこれで新たな盟友が\n増えるはずだ…！", 1, 6215, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "肩に乗せるペットが\nほしいな。今のうちに\nペット用品を買いに\n行かなくては…！", 1, 6216, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "財宝の地図はどこで\n売っているのだろう…\n古本屋？　古物商？", 1, 6217, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この海賊衣装に\n身を包んでいると\n前世の新たな記憶が\nよみがえってくるな！", 1, 6218, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いずれはシグルドと\n海原への冒険に\n繰り出したいな…\nきっと楽しいぞ！", 1, 6219, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "待ちわびたぞ盟友よ！\n私と貴様あっての\n海賊団…だからその…\n今日はそばにいてくれ", 1, 6220, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "シグルド！　港町で\nお魚のおすそ分けを\nもらったんだ！\n一緒に食べよう！", 2, 6221, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "シグルドもこのコート\n羽織ってみないか？\nふふっ、きっとすごく\n似合うと思うぞ！", 2, 6222, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海賊船の新たな\n秘密兵器を作ったぞ！\nシグルド、これから\n見に来ないか！？", 2, 6223, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "私は伝説の海賊だから\n泳ぐのだって得意だ！\nふ、深いところは\n少し怖いが…", 2, 6224, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふふ、いつ無人島に\n漂着してもいいように\n非常食は準備済みだ\nシグルドの分もある！", 2, 6225, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "冥風戦記の新章が\n完成したぞ…！\nシグルド、まずは\n貴様に読んでほしい！", 2, 6226, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふっ、天気明朗\n絶好の航海日和だ！\n早速海に繰り出そう！", 2, 6227, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食用に魚を\n釣っておいたぞ！\nふふ、いかにも\n海賊っぽいだろう？", 2, 6228, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海は真っ黒で\n少しだけ怖いな…\nシグルド、私の\nそばを離れるなよ…！", 2, 6229, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "大海賊がくつろぐのに\n相応しい逸品だ…！\nえっと…これ、どこの\nお店で買えますか？", 3, 6231, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わわ、かわいい…！\n船室のベッドに\n置いておきたいな…\n連れてってはダメか？", 3, 6232, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おぉ、この香りは…！\n集中力が上がりそうだ\n海賊船の船長室に\nぜひ置きたいな！", 3, 6233, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これが船乗りの\n伝承に聞く、海原を\nさまよう神秘の火か！\n…暖まるな！", 3, 6234, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "腹が減っては\n海賊はできぬ！\n…小説も書けぬ！", 3, 6236, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "女海賊と騎士はその後\n恋に落ち…？　恋愛\nモノではないかっ！？\nき、興味深くはあるが", 3, 6237, 121901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いつもの山籠もりが\nブームになるなんて…\n人生、なにが起きるか\n分からないなぁ", 1, 6239, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キャンプ道具…\nいえ、キャンプギア！\nカッコいい響き…♪", 1, 6240, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "レッツ、ＢＢキャン！\nこのフレーズ\n流行るかも…？", 1, 6241, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "キャンプ仲間…\n募集してみようかな？\n友達も兼任で…", 1, 6242, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ユカリさんと\nジュンさん…元気かな\nまた一緒に\nキャンプしたいなぁ…", 1, 6243, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私の取材が載った本…\n【フォレスティエ】に\n送らなくちゃ…♪", 1, 6244, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もし、あの人が\n落ち込むことが\nあったら…その時は\n私が力になりたいな", 1, 6245, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ブッシュクラフトは\nマイフレンドくんの\nカスタムにも\n活かせる技術です！", 2, 6246, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "会話に花が咲く…\nって言いますよね\n私の場合、会話相手が\nお花そのものですけど", 2, 6247, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この服、実は…\n昔ミサト先生に\nこしらえてもらった\n物なんです！", 2, 6248, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "昔はやまびこで会話の\n練習をしてたんです\nほとんどオウム返しで\n気まずかったなぁ～", 2, 6249, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "どうもマイスターです\n…あ、すみません\nみなさんの期待に\n応えようと練習中で…", 2, 6250, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "たとえぼっちを\n卒業しても…\n私は一生ＢＢ団です！", 2, 6251, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "小鳥さんのさえずりで\n目が覚める…\n心地いいものですね", 2, 6252, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "キャンプといえば\nおいしいご飯です！\n腕を振るいますよ！", 2, 6253, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "すっかり夜ですね…\nおやすみの前に\n星でも見ませんか？", 2, 6254, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "都会でくつろぎ…\n自然の中でくつろぐ…\nくつろぎ無限ループ…", 3, 6256, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "しっかり観察すれば\nブッシュクラフトで\n再現できるかも…？", 3, 6257, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁ～…やっぱり\n木の香りを嗅ぐと\n肩の力が抜けますねぇ", 3, 6258, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ああ…あったまります\nなんだか心に\nゆとりがでますね…", 3, 6259, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "このおいしさ…！\n今度はキャンプに\n持っていこうかな…", 3, 6261, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nいろんな知識があると\nキャンプはもっと\n楽しくなりますよね", 3, 6262, 122101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "部屋がキャンプ用品で\n埋まっていく…\nキャンプ…なんて\n恐ろしい趣味なの…？", 1, 6264, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "仕事でも\nアウトドアでも\n頼れるお姉さんに\nなれたらいいなぁ…", 1, 6265, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この服、かわいい上に\n本当に快適ね～♪\nおしゃれにキャンプを\n楽しめて最高だわ！", 1, 6266, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん〜次はどんな\nキャンプ飯を\n作ろうかしら？\n彼の好物は、っと…", 1, 6267, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "早く週末が\n来ないかしら…\n仕事を忘れてパーっと\nキャンプ飲みを…！", 1, 6268, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "新しいキャンプ飯の\nレシピを覚えたわ！\n彼も喜んで\nくれるはず…よね♪", 1, 6269, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼の分の食器も\nこっそり買い揃えちゃ\nおうかな…そ、それは\nさすがにまだ早いか…", 1, 6270, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今度、財団主催で\n大規模なキャンプを\nやってみるのも\nいいかもしれないわね", 2, 6271, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ソロキャンプも\n悪くはないけど\n私はやっぱりキミと…\nな、なんでもない！", 2, 6272, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キャンプのことなら\n私に聞いて。なんでも\n教えてあげるから！\n…調べた上でね！", 2, 6273, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "キャンプ場で飲む\n最高の一杯は\n他じゃ味わえないわ！\nさあ、乾杯っ！", 2, 6274, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "うん、決めた！　次は\n禁しゅわキャンプ！\nだってキミとゆっくり\n話したいんだもん♪", 2, 6275, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミのおかげで\n本当の最高の一杯が\n味わえたわ…\nありがとう♪", 2, 6276, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "んー、気持ちいい！\nキャンプが趣味に\nなってから、寝覚めが\nよくなったわ♪", 2, 6277, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼は私がごちそう\nするわ。キャンプ飯で\n鍛えた料理の腕前を\n披露しちゃうわよ～！", 2, 6278, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ寝ましょ？\n明日も朝日を眺める\nためにね。もちろん\nコーヒー付きで♪", 2, 6279, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "くつろぐのに\n持ってこいね～\nテントの中に置いても\nよさそうだわ！", 3, 6281, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、かわいいわね～\n…今度キャンプ場に\n連れていこうかしら？", 3, 6282, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うん、いい匂い…♪\nキャンプ場を思い出す\n自然の香りだわ〜", 3, 6283, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ、温まるぅ～\n冬のキャンプで\n使ってみたいわね", 3, 6284, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしい～♪\nキャンプ飲みの\nおつまみに\nぴったりね！", 3, 6286, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "へえ…こんなキャンプ\n飯もあるんだ？\n彼、好きだったり\nするかな…", 3, 6287, 122201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "一生ついててやるの\n幽霊の一生は\nなっが～～～いの！", 1, 6289, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "む～…あんまり触ると\nすり抜けてやるの！\nウソなの。むふふ♪", 2, 6290, 100701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "んー…\n今日はベスちゃんと\nなにして遊ぼーかなー", 1, 6291, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ヴァンピィちゃんも\nけんぞくの友だちと\n仲良くなりたいな♪", 1, 6292, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "けんぞくのお部屋は\nヴァンピィちゃんが\n守ってあげなくちゃ！", 1, 6293, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お掃除するなら\nヴァンピィちゃんも\n手伝ってあげよー♪", 1, 6294, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふーん、ふーん♪\nけんぞくってこーゆー\nお部屋が好きなんだー", 1, 6295, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひまだなー\nけんぞくをさそって\nお散歩いこっかな♪", 1, 6296, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今日のスープに\nけんぞくの大好物を\n入れてあげよっと♪", 1, 6297, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "けんぞくー！\nヴァンピィちゃんと\nお出かけしよ♪", 2, 6298, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "よしよし！\n今日のけんぞくも\nいい子だね♪", 2, 6299, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "んんー…\nやっぱりけんぞくと\nベスちゃんは似てる？", 2, 6300, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いーい？\nヴァンピィちゃんの\nいうこと聞くのよ？", 2, 6301, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヴァンピィちゃんの\nけんぞくだもん！\n大切にするからね！", 2, 6302, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えへへっ！\nやっぱりけんぞくって\nやさしー匂いがする♪", 2, 6303, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよー…\nヴァンピィちゃんは\nもうちょっと眠るねー", 2, 6304, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ヴァンピィちゃん\nひなたぼっこ\nだーいすき！", 2, 6305, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "んー！　夜だ♪\nヴァンピィちゃん\n絶好調だよ！", 2, 6306, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わー！\nふかふかだ！\nきもちぃー♪", 3, 6308, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいー♪\nベスちゃんに負けない\n抱き心地！", 3, 6309, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…なんだろ？\nヴァンピィちゃん\n気に入っちゃった♪", 3, 6310, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいねー…\nヴァンピィちゃん\nずっとここにいるー…", 3, 6311, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "はむはむ…\nんー！\nおいしー♪", 3, 6313, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ヴァンピィちゃん\nこの本\n好きなんだよねー♪", 3, 6314, 122301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夏といえば\nかき氷だよね\n近くにお店は…", 1, 6316, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この格好でいるのも\nなじんできたし\nちょっと鍛錬でも…", 1, 6317, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "動きやすいけれど…\nいつもと違う服装は\n少し落ち着かないな", 1, 6318, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏の空気に\n当てられると思わず\n気が緩んでしまうね", 1, 6319, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "砂浜で走ると\nいい具合に体幹を\n鍛えられそうだ", 1, 6320, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "終わらない夏は\nないけれど…\nつい願ってしまうな", 1, 6321, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "胸を張って彼と\n並び立てるよう\n私も、もっと強く…！", 1, 6322, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうしたの？\n行きたい場所が\nあるなら付き合おうか", 2, 6323, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "快晴で風は穏やか…\n絶好の釣り日和だね\nさあ、出かけようか", 2, 6324, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日の予定を\n立ててるんだけど…\nキミの希望も\n聞きたいな", 2, 6325, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ビーチスポーツか…\nキミとなら\nいい勝負ができそうだ", 2, 6326, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私たちの夏に\n遠慮は無用だよ\n思いきり楽しもう！", 2, 6327, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつかまた一緒に\n花火を見に行こう\n…約束だよ？", 2, 6328, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "潮騒の音で\n目覚めるのも\nいいものだね", 2, 6329, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今朝釣ってきた魚が\nあるんだ。これで\nお昼ご飯にしようか", 2, 6330, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜にもイベントが\nあるみたいなんだ\n一緒に見に行かない？", 2, 6331, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気持ちが安らぐね…\nうっかり眠って…\nしまい…そうだ…", 3, 6333, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "肌触りのよさが\nこの格好だと\nよく分かるよ", 3, 6334, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海をイメージさせる\n香りだね…\n爽やかで落ち着くよ", 3, 6335, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "濡れたままだと\n風邪を引いてしまうよ\nほら、キミもおいで", 3, 6336, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "夏を楽しみきるには\nエネルギーが\n必要だからね", 3, 6338, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "大切な人と過ごせる\n観光スポット紹介…\n…こ、このページは\nもういいかな！", 3, 6339, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "濡らしてもいいなら\n海に持っていって\n乗るのもよさそうだ", 3, 6341, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "こういう名画を\n見た気がするな…\nこんな視点なんだね", 3, 6342, 122501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着って\n動きやすくて\nいいよねー♪\nいっちにーさんしー♪", 1, 6343, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ユイちゃんにもらった\n日焼け止め\n塗っておいて\nよかった～", 1, 6344, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんだか暑いなあ…\nせっかくだし\nプールで泳いで\nこようかな？", 1, 6345, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この格好で\n出かけようとしたら\nレイさんに\n怒られちゃった…", 1, 6346, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "たとえ水着姿でも\n困ってる人を見たら\n助けに行くからね！", 1, 6347, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "バカンス楽しかった～\nまた騎士くんと\n一緒に行きたいな♪", 1, 6348, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この水着、あたしに\n似合ってるかなあ？\n騎士くんはどう\n思ってるんだろ…", 1, 6349, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士くん！\n海に行くなら\n準備運動\n忘れずにね！", 2, 6350, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "泳ぐ練習がしたいの？\nいいよ！　水着だから\nなにかあったらすぐに\n助けてあげるね！", 2, 6351, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "騎士くんの水着姿も\nかっこよかったよ！\nまた遊びに行こ！\n約束ね！", 2, 6352, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このグローブの向日葵\nかわいいでしょ？\nユイちゃんが\n選んでくれたんだ♪", 2, 6353, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "実はこの水着\nいつも着てる\n服とおなじなんだ…\nって、冗談だよ？", 2, 6354, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "変な日焼けしてないか\n見てもらってもいい？\n…なし！　今のなし！\nやっぱりなしー！", 2, 6355, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "夏のお日様に\n負けないよう\n今日も元気いっぱい\nがんばるぞー！", 2, 6356, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹減ってきちゃった\n騎士くんはお腹\n空いてない？\n…聞こえちゃった♪", 2, 6357, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日も一日\n楽しかったー！\n明日もまた\n楽しもうね！", 2, 6358, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわあ…\nふわふわなのが\nいつもより\nよくわかるよー…", 3, 6360, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そうだ！　水着なら\n濡れてもいいし\n今度洗ってあげるね♪", 3, 6361, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "んー…いい匂い♪\nなんだか\n身体がぽかぽか\nしてきちゃった！", 3, 6362, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水着だから、えっと…\n暖か涼しい…！\n不思議な感じー", 3, 6363, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "思いっきり身体を\n動かした後だから\nいくらでも\n食べちゃえるよー！", 3, 6365, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nなるほどー\n水着の種類って\nそんなにあるんだぁ…", 3, 6366, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "乗り心地バッチリだね\nしゅっぱつしんこー！\nなんちゃって♪", 3, 6368, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "わっ、ぽよんぽよん！\nトランポリンみたいで\nた～のし～！", 3, 6369, 122401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "彼のことを考えてると\n幸せで胸が温かくなる\n…私ったら、もう", 1, 6370, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "うふふふふ\nくすぐったいわ～♪\nもう、イタズラっ子ね\n次は先生の番よ～♪", 2, 6371, 101501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士クンの汗\n拭いてあげたいな…\n余計なお世話かな…？", 1, 6372, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏バテ気味かも…\nそうだ、今夜は\nかば焼きにしよう♪", 1, 6373, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "青い空、白い雲\n眩しい日差し…！\n夏って好きだな…", 1, 6374, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ヒリヒリする…？\n日に焼けちゃったかな\nふー…ふー…", 1, 6375, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "花火大会があるんだ…\n夜、浜辺…2人きり…\nむ、無理だよ〜！", 1, 6376, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "水着って不思議…\n引っ込み思案が少し\nおさまる…気がする", 1, 6377, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士クンとまた\n海に行きたいな…\nまた、一緒に…", 1, 6378, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ダ、ダイエット！？\nしてないよ！？\n元々これ位だよ…？", 2, 6379, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "スイカ割りのコツ？\nわたしは、騎士クンに\n教わりたいな…", 2, 6380, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "騎士クン。うちわで\n扇いであげるね\nどこに置いたかな…", 2, 6381, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うぅ…暑いね…\n騎士クン、温度計は\n見ない方がいいよ～", 2, 6382, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "じ、じっと見ないで…\nええっと…ちょっと！\nちょっとならいいよ…", 2, 6383, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "え、肝試し？\nう〜ん、うう〜ん…\n…騎士クンとなら！", 2, 6384, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう騎士クン\n見て、あっちの空\nもう入道雲が出てる", 2, 6385, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "夕立、来るかなぁ…\nもし雷が鳴ったら\nそばにいてくれる…？", 2, 6386, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "しー。…ほら、虫の声\n…わ、わたしの心臓の\n音は気にしないで…！", 2, 6387, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふふ、水着でゴロゴロ\nするのってなんだか…\nいけないことみたい", 3, 6389, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいい～♪\n日光浴させて\nあげたいな♪", 3, 6390, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ほんのり潮の香りが…\n香ばしくて塩辛くて…\nあ…おなか鳴っちゃう", 3, 6391, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水着、乾かせるかも…\nそうだ、みんなの分も\n持ってこよう！", 3, 6392, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "夏バテなんてしてたら\nみんなの足を\n引っ張っちゃうよね\nいただきます！", 3, 6394, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "騎士クンの、どうして\n海はしょっぱいの？\nって質問の答えは…\n分かんないよぉ～", 3, 6395, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "顔は怒ってるのに\nなんだかかわいい…\n誰かに似てる…？", 3, 6397, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "これを枕に、ビーチで\n騎士クンと…なんて…\nなんて…なんて…！", 3, 6398, 122601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夏休み、\n毎日たのしいな～♪\nつぎはなにしよう？", 1, 6399, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "自由研究、\nなににしよっかな～？\nプチグリフォンさんの\nかんさつにっきとか？", 1, 6400, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "夏休みって、\n給食ないから…\nそれはちょっぴり\nさみしいかも…？", 1, 6401, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "砂浜をはだしで歩くの\nきもちいいよね♪\nくすぐったいけど\nミミ、好きなんだ～♪", 1, 6402, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "きれいな貝がら\n見つけちゃった♪\nミミのたからもの！", 1, 6403, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ミミ、浴衣を\n買ってもらったんだ♪\n今度、おにいちゃんに\n見せてあげたいな！", 1, 6404, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ミミ、おにいちゃんと\nいっぱい夏休みの\n思い出つくりたいな♪", 1, 6405, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねえ、おにいちゃん…\n夏休みの宿題、\nわかんないとこ\nおしえてくれる…？", 2, 6406, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おかあさんにね、\n麦茶つくるの上手って\nほめられたんだ～♪\n飲んでみて♪", 2, 6407, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "夏休みの宿題で\nポスターかくんだ～♪\nおにいちゃんを\nかいてもいい？", 2, 6408, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "線香花火やりたいな♪\nミミ、長持ちさせるの\n上手なんだよ♪", 2, 6409, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにいちゃんの\n好きな本ってなあに？\nその本で読書感想文\n書こうかな♪", 2, 6410, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "海であそんだ後ね、\nおにいちゃんに\n髪を拭いてもらうの\nすきなんだ～♪", 2, 6411, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "夏休みって、\nワクワクして\n早起きしちゃうよね♪", 2, 6412, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "わぁ♪　お昼は、\n流しそうめんなんだ？\nミミ、流してみたい♪", 2, 6413, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "こわい話聞いて、\nねむれないの…\nねえ、おにいちゃん、\nいっしょに寝ていい？", 2, 6414, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ちょっぴりやすんだら\nまた、いっしょに\n海であそぼうね♪", 3, 6416, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "すっごくかわいいね♪\nこの子のこと、\n絵日記にかこうっと♪", 3, 6417, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん…\nスイカのにおいだね♪\nこのにおいだいすき！", 3, 6418, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "およいだあとは、\nちゃんと体を\nあっためなくちゃね！", 3, 6419, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "夏休みのご飯って\nなんだかとくべつ\nおいしい気がするね♪", 3, 6421, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏の星座って\nすっごくきれいだね♪\nいつかみんなと\nいっしょに見たいな♪", 3, 6422, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "わぁ♪　この子、\nとってもかわいいね！\nおともだちに\nなりたいな♪", 3, 6424, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ミミ、人魚姫に\nなったみたい！\nおにいちゃん、\nとなりにすわって♪", 3, 6425, 122901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着姿になると\nバカンス気分を\n味わえちゃうね！", 1, 6426, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海に行くの待ちきれ\nなくて、もう水着に\n着替えちゃった！", 1, 6427, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海に行ったら\nずぶぬれ系のイタズラ\nたくさんしかけよう！", 1, 6428, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "部屋の中で泳ぎの練習\nしよう！　にいちゃん\nも水着に着替えて！", 1, 6429, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お日さまとお揃いの\n水着なんだ～♪\n似合ってるかなぁ？", 1, 6430, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海といえば冒険！\n海底に眠る財宝を\n見つけちゃおう！", 1, 6431, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "にいちゃんと一緒だと\n部屋にいても海気分♪\nスイカわりしよっか！", 1, 6432, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "にいちゃん！\n早く海に行く準備\nしなよ～！", 2, 6433, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ねーにいちゃん\n何秒息止められるか\n勝負しよーよ！", 2, 6434, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "にいちゃんはアイスと\nかき氷どっちが好き？\nミソギは…どっちも！", 2, 6435, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "日焼け止めクリーム\nキョウカに\nもらったんだ～", 2, 6436, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "水中メガネがあれば\n水鉄砲くらっても\n平気だね！", 2, 6437, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着なら、毎日夏休み\n気分！　にいちゃんも\n着てみなよ～！", 2, 6438, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "にいちゃんおはよー！\n早く顔洗って、\nいっぱい遊んじゃお！", 2, 6439, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "にいちゃんデザートは\nイチゴのかき氷だよ！\n…激辛ってバレた？", 2, 6440, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日は楽しかった～！\n明日もイタズラ日和に\nなるといいな！", 2, 6441, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "落とし穴の下に\nやわらかいの置けば\nケガしないよね！", 3, 6443, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいね～！\nこの子も海に\n連れてっちゃおうよ！", 3, 6444, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このにおいを利用して\nイタズラするには…\nにいちゃんどう思う？", 3, 6445, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水着を着て暖炉で\nあったまるのって、\n変でおもしろいね～！", 3, 6446, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "海辺で食べる\nお昼ごはんって最高♪\nってことで海行こう！", 3, 6448, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "いつか海を越えて、\n地図にも載ってない\n場所を見つけたいな！", 3, 6449, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この口から水が出たら\nみんな驚くよね！\nぷぷ…細工しちゃお！", 3, 6451, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "変な音がするイタズラ\nを仕込んどいて…\n誰か座らないかな～♪", 3, 6452, 122801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あなた様と私の愛を\n周りに見せつけて\n差し上げましょう♪", 1, 6453, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "呼びましたか？\n呼びましたね？\nでは愛を語りましょう\nそうしましょう", 2, 6454, 102701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着で歩き回るのは\n恥ずかしいな…\n誰も見てないよね？", 1, 6455, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏はやっぱり\nかき氷ですよね\n何色がいいかなぁ…♪", 1, 6456, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あの人、泳げないって\n聞きました！\n私が教えてあげないと", 1, 6457, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏休みの宿題は\n計画的に進めましょう\n当たり前のことです！", 1, 6458, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "防犯魔石、どこに\n着けておこうかなぁ\n…ここにしようかな", 1, 6459, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海の楽しみ方は\n予習済みです！\nあとは実践ですね♪", 1, 6460, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "水着…きっとあの人に\n見られちゃいますよね\n…褒めてくれるかな…", 1, 6461, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "触りたいんですか？\n…いいですよ\n帽子くらいなら", 2, 6462, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏は体調管理に\n気をつけましょう\n私が管理してあげます", 2, 6463, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海に行くのが楽しみで\nたまらないんですか？\n私はそこまで…嘘です", 2, 6464, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いつもより薄着だから\nなんだか恥ずかしい…\nみ、見ないでください", 2, 6465, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "へんたいふしんしゃ～\nえっ？　ああ、これは\n海に叫ぶ練習です", 2, 6466, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと一緒に\n海に行くなんて…\nなんだか大人…えへへ", 2, 6467, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\nさぁ、海に行って\n私と運動しましょう", 2, 6468, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あっつ～い…\nはっ！？　ダメですよ\nシャキッとしないと！", 2, 6469, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日も海で\n遊ぶために、しっかり\nお休みしましょうね", 2, 6470, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏を楽しむときは\n休憩も大事ですよね\n計画的に、計画的に！", 3, 6472, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいなぁ～\n海のお土産屋さんに\n売ってるかなぁ？", 3, 6473, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "大人な香りがします\n私も違いが分かる\n素敵な女性になります", 3, 6474, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "濡れた体を\n乾かしましょう\nタオル、タオル…", 3, 6475, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "泳いだ後は\n栄養補給…だけど\n…おなか膨らんじゃう", 3, 6477, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "遊ぶだけじゃなくて\nお勉強もしてますよ\nあなたもどうですか？", 3, 6478, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "ミミが喜びそう…♪\nわ、私ははしゃいだり\nしませんけど…っ！", 3, 6480, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ミソギがいたずらに\n使いそう…しっかりと\n試しておかないと！", 3, 6481, 122701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あたしがまさか\nここにいるなんて…\n自分でも不思議だわ", 1, 6482, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "昔みたいにあちこち\n飛び回れないのって\nちょっと不便かも", 1, 6483, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こうして誰かと一緒に\n暮らせるのもあいつや\nみんなのおかげね", 1, 6484, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここで厄介になるなら\nあたしも家事とか\n手伝わないと…", 1, 6485, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…だめ！　誰かの\n世話をせずには\nいられないわ！", 1, 6486, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつたちが\n帰ってくるところだし\n綺麗にしないと…", 1, 6487, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "せっかくあたしが\nいるっていうのに\n少しは構いなさいよ…", 1, 6488, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "おいしい店とか\n知らないの？\n食べに行きましょ", 2, 6489, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あんた暇でしょ？\nあたしのやること\n手伝いなさい", 2, 6490, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "コッコロたんと\n遊んでくるから\n留守番よろしく♪", 2, 6491, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あらおかえり…って\nボロボロじゃない！\nまた人助けしてたの？", 2, 6492, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "やっぱりあたしは\nあんたのそばが\n一番落ち着くみたい", 2, 6493, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どこまでだって\nあんたと一緒に\nいてやるんだから", 2, 6494, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふわぁ…おはよう\n…大きくなったせいか\n朝は特に体が重いわ", 2, 6495, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯が食べたい？\nしょうがないわね…\nなんか作って\nあげるから", 2, 6496, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あんたまだ成長期だし\nさっさと寝なさい\n大きくなれないわよ？", 2, 6497, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たまにはあたしも\nゆっくりしないと\nもたないのよ…", 3, 6499, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいじゃな～い♪\nコッコロたんに\nプレゼントしたいわ", 3, 6500, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りね\n塔にもこういうの\n置いておこうかしら", 3, 6501, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "炎か…前は\n羽が焼けそうで\n怖かったっけ", 3, 6502, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あむ…妖精に\n体重増減の設定って\nあったっけ…？", 3, 6504, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "記憶のデータと違って\n物語はいいわね\n結末が読めなくて", 3, 6505, 123001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "冒険のお土産\nみんなにおすそわけ\nせなあきまへんな", 1, 6507, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おとぎ話よりも\n不思議なことが\nあるもんやねぇ", 1, 6508, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "冒険しに出かけるなら\n動きやすい服装に\nせななぁ", 1, 6509, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "地図に水筒に…\n他に忘れもんは\nあらへんやろか？", 1, 6510, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これまでの冒険のこと\nノートに書いて\nまとめてますんよ", 1, 6511, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "王子はんとの冒険は\nどれもマホマホ王国の\n大事な歴史や♪", 1, 6512, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どこへ冒険するときも\nうちと王子はんは\n一緒どす♪", 1, 6513, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔法で火ぃつける\n練習してますんよ～\nよう爆発しますけど…", 2, 6514, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うちと王子はんで\n冒険道具をお揃いに\nするんもええなぁ♪", 2, 6515, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "テント張りも随分\n上達したんよ\n王子はんのおかげやね", 2, 6516, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ランスロットたちの\n新しい冒険衣装\n思いついたんよ♪", 2, 6517, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "迷子になっても\n王子はんと一緒なら\nきっと大丈夫やね♪", 2, 6518, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "王子はんのこと、\nきっちり守れるように\nなってみせますえ", 2, 6519, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お寝坊さんは\n布団めくって\n起こしにいきますえ～", 2, 6520, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "支度が終わったら\n今日の冒険に\n出かけまひょか", 2, 6521, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうちょっと\nおしゃべりしたいん？\nあと少しだけやで♪", 2, 6522, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "冒険で疲れた体に\nこの癒しぱわーは\nあきまへん…すや…", 3, 6524, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、あんさんも\nうちと一緒に\n冒険します？", 3, 6525, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "虫除けのアロマは\n冒険の必需品どす\n忘れんようにせんと", 3, 6526, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うちも魔法使わんでも\n火ぃ起こせるよう\n練習せんとあかんなぁ", 3, 6527, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "この料理…\n冒険するときに\n作ってみまひょか", 3, 6529, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "王子はんとの\n愛と冒険のおとぎ話…\nはぁ…素敵やわぁ♪", 3, 6530, 123101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あの人との\n最良の未来のために\n占いも霊能力ももっと\n精進しなきゃ", 1, 6532, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あなたともっと深く\nつながりたいです\n絆も、そして魂までも", 2, 6533, 103101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "絆の契約…\nあやつが望むのなら\n考えぬでもないがのう", 1, 6534, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "なんじゃ？\nわらわの姿に\n見惚れたかの？", 2, 6535, 104401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "旅の荷物って多いな…\nねぇぷうきち～\nすこしは持ってよぉ～", 1, 6536, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "傘はなくてもいっか\nぷうきちがいるし♪\n『おいなんだと…？』", 1, 6537, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "旅先で人見知りなんか\nしてちゃだめだよね…\nまずはあいさつだ…！", 1, 6538, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おみやげはやっぱり\nご当地ぬいぐるみ\nだよね♪　ワクワク…", 1, 6539, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "知らない場所かぁ…\nうぅ…考えただけで\nすでにホームシック…", 1, 6540, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "野宿するってことは…\nお兄ちゃんのマントで\n寝るチャンスかも…！", 1, 6541, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どんなに危険な冒険も\nお兄ちゃんと一緒なら\n大丈夫！　…だよね？", 1, 6542, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぷうきちのアイマスク\nも腹巻も持ってくの！\n旅の必需品なの～！", 2, 6543, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これ全部背負うのって\nけっこうむずかしいの\n順番まちがえると大変", 2, 6544, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "えへへ～\nなでなでして？　帽子\nの上からでもいいよ♪", 2, 6545, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "『悪いが絆創膏の部分\nはアンタッチャブルだ\n綿が飛び出ちまう』", 2, 6546, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんと一緒に\nもっともっといろんな\n景色が見たいな！", 2, 6547, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "旅って、終わる時は\nきっとさびしいよね…\nお兄ちゃん、帰り道は\n手をつないでもいい？", 2, 6548, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "出発が楽しみすぎて\n寝られなかった…\n『旅行のお約束だな』", 2, 6549, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "わぁ　いいお天気！\n旅の間もずーっと\nぴーかんだといいな♪", 2, 6550, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "知らない場所で寝るの\n怖いな…寝る時だけ\n帰ってこようかな…", 2, 6551, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "旅先にはクッションも\nソファもないよね…\n『俺でいいだろ』", 3, 6553, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぬいぐるみのみんな\n旅の無事を\n祈ってて…！", 3, 6554, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "旅先の香りも\n思い出に持って\n帰れたらいいのにな～", 3, 6555, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "旅行用に携帯用暖炉\nがあるといいかも…！\n『まだ荷物増やす？』", 3, 6556, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "『もう出発だぜ？』\nえーまってまって！\n腹ごしらえがまだ…", 3, 6558, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "世界ってこんなに広い\nんだ…！　はやく自分\nの目で見てみたいな～", 3, 6559, 123201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はちゃめちゃヒマ～\nなーんか楽し～コト\nないかなー", 1, 6561, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここ、いートコだねー\nこんどカリザきゅんも\nつれてこよー", 1, 6562, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわゆいショタが\n見た～い♪\n触りた～～～い♪", 1, 6563, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんか服きっついなー\nちょい太ったかー？\nん～\nま・気のせーっしょ♪", 1, 6564, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あ～やべ\nおねえちゃんに\nメッセすんの忘れたー\nまいっかー", 1, 6565, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "パンケーキ食いてー\n騎士きゅん\n誘ってみよーっと♪", 1, 6566, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "きょーも～\n好きぴに囲まれて～\nシ・ア・ワ・セ♪", 1, 6567, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アタシと遊ばな～い？\nってなんか\nナンパみスゴー\nウケる～", 2, 6568, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "んー？\n今はだるいからパース\nあとでねー", 2, 6569, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カリザきゅん\n見なかった～？\nおねえちゃんから\n逃げるとかオシオキー", 2, 6570, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ネイルしたいけど\n無理なんよねー\n爪の間にめっちゃ\nスライム入っからさー", 2, 6571, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おねえちゃんに\nかまってほし～の？\nかわゆ～い♪", 2, 6572, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "な～に騎士きゅん♪\nここでイチャイチャ～\nし・ちゃ・う～？", 2, 6573, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ねんむ～\nけど外から\nショタの声したんで～\nつい起きちった～", 2, 6574, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ランチの後はやっぱ\nデザートっしょー\nベツバラってヤツ～♪", 2, 6575, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "こんな時間まで\n起きてるコは～\n食べちゃうぞ～♪", 2, 6576, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あーラクー\nいっしょーここで\nキューケーできるわー", 3, 6578, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なにこれ～\nかわいいじゃ～ん\nショタの次くらいに～", 3, 6579, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いーニオイする～\nなんのニオイとかー\nよくわかんないけどー", 3, 6580, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったか～♪\n溶けてスライム\n戻りそ～", 3, 6581, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ン・ン・ン～♪\nお・い・し～♪\nも～っと食べるぅ～♪", 3, 6583, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "わ～なんかムズー\n読めなー\nウケるー", 3, 6584, 123301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あんパンって\nお菓子に入るのかな？\nハロウィンで\nもらえたりしない？", 1, 6586, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お菓子をくれなきゃ\nぐうたらするぞ～！\nハロウィン以外でも！", 1, 6587, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お化けになったら\n仕事しないで\nゴロゴロし放題\nなのかな？", 1, 6588, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おっと…この仮装\n袖がすごく長いからさ\n引っ掛けないように\n気を付けないとね～", 1, 6589, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "イタズラするのも\n体力がいるよね～\n楽にできそうなの\n何かないかな？", 1, 6590, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつって\n仮装とかするのかな？\n似合いそうなのは\nどんなお化けだろ？", 1, 6591, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ずっとハロウィンなら\nあいつと遊び放題\nなんだけどな～", 1, 6592, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今の街はハロウィン\n一色だからね～\n人混みが大変だよ", 2, 6593, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この仮装、どうかな？\n気に入ったなら\n来年もしてあげるよ～", 2, 6594, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "実はこの長い袖\nドングリとかを\nため込めるんだよね…", 2, 6595, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "カボチャランタンが\nあるんなら\nドングリランタンも\nあっていいよね～♪", 2, 6596, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ハロウィンでも\nやる気があれば\nぐうたらできる…\nうん、いいこと言った", 2, 6597, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "一緒にお菓子食べよ？\n寝転びながら堪能する\nハロウィンスイーツは\n最高だからね～", 2, 6598, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お化けは寝る時間…\n今のあたしはお化け…\nだから、おやすみ～…", 2, 6599, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼か～…\n食後のデザートは\nハロウィンのお菓子で\n決まりだね～♪", 2, 6600, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふぁ～、寝よ…\nお化けは夜に\n出るものだけど\nあたしはリスだからね", 2, 6601, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ハロウィンを楽しむ\nためにも、ぐっすり\n寝とかないとね～", 3, 6603, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…袖から手が\n出せないから\nこのまま撫でよう\nよしよし", 3, 6604, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リラックスできる\n素敵な香りだね～\n成仏しそうだよ～", 3, 6605, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいね～\nここで寝てもいい？\n…着替えないとダメか", 3, 6606, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nお化けもリスも\nお腹は空くんだよ", 3, 6608, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "キョンシーって\nどんなお化けなのか\n本で調べようかな？", 3, 6609, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "より取り見取りだね～\nとりあえず、これと\nこのお菓子はキープで", 3, 6611, 123501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "よし、衣装もばっちり\nハロウィンパレードへ\n出かけよう♪", 1, 6613, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "仮装してても\n剣は手放せないね\nほとんど体の一部だよ", 1, 6614, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "見回りに誘うふりして\n二人でパレードに\n参加しちゃおうかな♪", 1, 6615, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…あれ？　手錠の鍵\n落としちゃった…？\nやば、出かける前に\n見つけないと…！", 1, 6616, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お家でコスプレも\nこれはこれで楽しいな\n決めポーズの練習\nたくさんしておこう！", 1, 6617, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "他にも、お姫様に\nメイドさんに学生服…\nやりたいコスプレが\n多すぎるよ～", 1, 6618, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "漫画もゲームも好き！\n仮装するのも大好き！\n…好きを言葉にすると\nもっと好きになる♪", 1, 6619, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ずっと目が合ってるね\n見つめてくれるのは\nいいんだけど、今日は\n衣装を見てほしいな♪", 2, 6620, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "トリックオアトリート\nお菓子をくれなきゃ\n逮捕しちゃうぞ♪", 2, 6621, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あなたにだけはこの姿\nいつでも見せてあげる\nふふ、なんちゃって♪", 2, 6622, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "どうしたの？\nイタズラするなら\n隙を突かなきゃ\nこんなふうに、ね♪", 2, 6623, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "コスプレしてても\n剣の稽古は休まないよ\nちょっと相手になって\nくれるかな？", 2, 6624, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ひゃっ、びっくりした\n急に触らないでよ～\nハロウィンだからって\nイタズラしないでね？", 2, 6625, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\n今日も朝から\nパトロールに行こう！", 2, 6626, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "カボチャのケーキを\n用意してるよ！\nデザートを食べて\n午後も頑張ろう！", 2, 6627, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "暗くなってきたね\nカボチャのランタンに\n火を灯そうよ♪", 2, 6628, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか気持ちいい～\nあっでも衣装がシワに\nなっちゃうかも…？\n…でも気持ちいい～", 3, 6630, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…かわいい\nこの子もパレードに\n連れて行きたいな", 3, 6631, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はぁ～癒される♪\nハロウィンの見回りが\n終わった後は、\nまったりくつろごう", 3, 6632, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここで二人寄り添って\nカボチャスープ飲もう\n…なんて想像したら\nポカポカしてきた…", 3, 6633, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "パレードに参加すると\n体力を使うから、\nいっぱい食べておこう", 3, 6635, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "この絵本のお姫様\nかわいいね\nこの仮装もいいな♪", 3, 6636, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "わあ、おいしそう！\n見回りに行く前に\n少しつまんじゃおう♪", 3, 6638, 123601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今日こそは、あの人に\n気持ちを打ち明けて…\nそのあとは…うう\nど、どうしよう？", 1, 6640, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "私が剣なら、あなたは\nさしずめ私の鞘…\nふふ、私の帰る\n場所ってことだよ♪", 2, 6641, 103701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やっぱり\nコスプレしてると\nテンションあがる～♪", 1, 6642, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "キャラコスにも\n興味あるけど…\nマジカル、ラブリー\nどっちにしよっかな～", 1, 6643, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キャラコスといえば\nミスティーシャイニー\nもいいんだよねえ…\nうはー！　悩むー！", 1, 6644, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ギルドハウスで\n宅コスしてる人\n実は結構\nいるんじゃないかな～", 1, 6645, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "コスプレだけど普段着\nって言いはれそう…\nって、ダメダメ！\nオタクは節度が大事！", 1, 6646, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "フェスで買ってきた\n薄い本～♪\nギルドハウスに持って\nきちゃおっかな～", 1, 6647, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ようこそ\nコスプレ沼へ～\nなんちゃって♪", 1, 6648, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "どうどう？\nナナカちゃんの\nハロウィンコスプレ\n似合ってる？", 2, 6649, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ハロウィン魔法少女\n参上カボ～！\n…やっぱ今の語尾\nナシで！", 2, 6650, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハロウィンといえば\nトリックオア～…\nコスプレ！\nなんちゃって", 2, 6651, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ランフェスの\n戦利品～♪\nねえねえ\n見たい？　見たい？", 2, 6652, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私にしてほしい\nコスプレがあったら\n教えて♪　君のために\nや～ってやるぜぇ！", 2, 6653, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "一緒にコスプレしたい\nならナナカちゃんは\nいつでも大歓迎だよ♪", 2, 6654, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁあ…ねむ\nって、ありゃりゃ　\n昨日コスプレしたまま\n寝ちゃってたかあ…", 2, 6655, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日のお昼は\nなんにしよ？\nカボチャ料理に\nしよっかな～", 2, 6656, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間かあ\nそういえばオタクって\n夜行性の人が多い\n気がするぜぇ…", 2, 6657, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふっふっふ\nこのパニエは\n座るときはちゃんと\nふにゃってなるのさ！", 3, 6659, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いや～\nかわいいものをみると\n癒されますな～", 3, 6660, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新しい薄い本の匂いの\nアロマとか…ダメ？\n私はあの匂い、なんか\n好きなんだよね～", 3, 6661, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖か～い…\nけど近づきすぎて\n衣装が燃えないように\n気を付けなきゃ", 3, 6662, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "コス衣装のために\n体型維持は必須だけど\nついつい\n食べちゃうんだよね～", 3, 6664, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "おっ、次はこの本に\nのってるキャラのコス\nしてみよっかな？", 3, 6665, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 12, 0, 1, 0, "おおっ！\nお菓子がいっぱい！\nベルルちゃんチョコ\n入ってないかな～？", 3, 6667, 123701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "むっ…\nこの耳の手触り…\n驚嘆に値する…！", 1, 6669, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "獲物を狩りまくる…\nそんなウサギがいても\nいいだろう？", 1, 6670, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ワナなど怖くないぞ？\nむしろ積極的に\n踏んでいく性分だ", 1, 6671, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "一匹狼ならぬ\n一匹ウサギか\nどっちでもかまわん♪", 1, 6672, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "人間とて本を正せば獣\n本能に従えばよいのだ\n遠慮は無用さ☆", 1, 6673, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "脱兎のごとく…\n逃げるものか\n坊やを追い回すのさ♪", 1, 6674, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "獣の道は険しいが…\n坊やめ、音を上げずに\nちゃんとついてきたな\n褒めてやるとしよう♪", 1, 6675, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ニンジンはいらん\n好物は好敵手だ\nさぁどんどんおくれ♪", 2, 6676, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "尻尾に触りたいだと？\nワタシの乱数聖域を\n崩せたらな…☆", 2, 6677, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "頭で考えるな\n体に率直になれ\n己を野放しにするのさ", 2, 6678, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そうさモコフワさ♪\nなで心地は最高だが\n意外にどう猛だぞ…？", 2, 6679, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ワタシにピョンピョン\n跳ねてほしいのか？\nあとでじっくり、な♪", 2, 6680, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ワタシと番になるか？\nオマエさえよければ\nいつでもかまわんぞ☆", 2, 6681, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "太陽と共に目覚め\n活動する\nそれが獣の生き方さ☆", 2, 6682, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼寝をすればいい\nワタシが周囲を\n警戒していてやる", 2, 6683, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "暗くなれば眠るだけさ\nそうすれば余計な\nストレスなどたまらん", 2, 6684, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "むむっ！？\n尻尾がつっかえて\nうまく座れんな…", 3, 6686, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "愛らしさでワタシに\n張り合おうというのか\n５億年後に出直せ☆", 3, 6687, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "野生の芳香か…\n本能が呼び覚まされる\nいいセンスだ♪", 3, 6688, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "寒さも野生のうちだ\n…とはいえ\n温まっていくか♪", 3, 6689, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "悪くはないが物足りん\nこう見えて肉食なのだ\n肉はないのか肉は☆", 3, 6691, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ウサギ族は地獄耳？\nワタシとの共通点だな", 3, 6692, 123801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ここが私の家…\nそれはこれからも\nずっと変わらないわ…", 1, 6694, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ええと、その…今から\nデート…じゃなくって\n散歩でもどうかしら？\n…ふ、二人きりで…", 2, 6695, 106401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ギルドハウスに\nヒーロー参上！\nみんな仲良くッスよ！", 1, 6696, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "料理もできて\n鎧も作れる！\nお母さんはすごいッス", 1, 6697, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ううう…\nまたマントをドアに\n挟んじゃったッス…", 1, 6698, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ずっと鎧を着ていれば\nジュンさんに近づける\nかも？　燃えるッス！", 1, 6699, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "サインの練習…\nもっとしておいた\nほうがいいッスかね～", 1, 6700, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "半人前でも\n胸を張るッス！\nそのうち似合う日が\nくるッスから！", 1, 6701, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "種族の違いも\n強い魂があれば\n超えられるッス！\n信じてるッスよ！", 1, 6702, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "困ったときは\n自分を呼ぶッス！\nあと楽しいときにも\n呼んでほしいッス！", 2, 6703, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "特訓でも行くッスか？\n望むところッス！\n目指せ、一人前！", 2, 6704, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しいショーの台本を\n読みこんでるッス！\nところで…この言葉の\n意味、分かるッスか？", 2, 6705, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ヒミツがなくなると\nなんか恥ずかしいッス\nあんたはどうッスか？", 2, 6706, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒーローは遅れて\nやってくる…\nあんたもそうッスね♪", 2, 6707, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "誰よりも早く\nあんたに見せたいッス\n一人前になった自分！", 2, 6708, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "うーん、今日も\nよく眠れたッス～！\n絶好調、間違いなし！", 2, 6709, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おお、もうお昼ッスか\nどうりでお腹が空くと\n思ったッス～えへへ", 2, 6710, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "パトロールのあとは\n歯みがきに宿題に…\n大忙しッスね、夜！", 2, 6711, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こんなにリラックス\nできるなんて…\n平和な証拠ッスね～", 3, 6713, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "か、かわいい…♪\nさあ、自分と握手…\nううん、抱っこッス♪", 3, 6714, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "優しい匂いッスね…♪\nこれくらいみんなを\n包み込めるように\nなりたいッス～", 3, 6715, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ひっくちゅ！　うー…\nちょっと冷えるッスね\nぬくぬくするッス～♪", 3, 6716, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "特訓した分、\nいっぱい食べるッス！\nでっかくなるッス！", 3, 6718, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "いつか自分の\nヒミツ図鑑が出たり\nして…いやいやいや", 3, 6719, 123901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "牢獄よりは\nマシな環境ね\n我慢してあげるわ", 1, 6721, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "退屈ね…\nキャルでもいじって\n暇をつぶそうかしら", 1, 6722, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここにいる連中\n私を天気予報士と\n勘違いしてない？", 1, 6723, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "音波情報が多いわね…\nここ、もう少し静かに\nならないの…？", 1, 6724, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "共同生活なんて\n久しぶりだわ\n…懐かしいわね", 1, 6725, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの子たちのギルド\n経営が雑すぎるわ…！\n教育が必要みたいね", 1, 6726, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "とどめを刺される\n準備はできているのに\nまだなのかしら…？", 1, 6727, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "私と戦う気になった？\nあら、まだなのね…\nその時を待ってるわよ", 2, 6728, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私というリソースは\n有効活用しなさい\n子守なんてごめんだわ", 2, 6729, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どうしてそんなに\n頭がいいか？\n生まれつきよ", 2, 6730, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "視力は権能に\n影響しないわよ\n当たり前じゃない", 2, 6731, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたまで天気を\n教えろですって…？\nぶっ殺すわよ？", 2, 6732, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "暇なら付き合いなさい\n好きなゲームでいいわ\nどうせ私が勝つもの", 2, 6733, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "人生朝露…\n悔いのない一日を\n過ごしなさい", 2, 6734, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午睡はいいわよ…\nふわぁ…眠りは思考に\n必要不可欠なの…", 2, 6735, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夙興夜寝なんて\nやめておきなさい\n休息は大切よ", 2, 6736, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私を満足させるなんて\n大したものね…晶に\n大量生産させるわ", 3, 6738, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キャルの代わりに\nズタズタにする物が\n欲しかったの…♪", 3, 6739, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りじゃない\n見たことのない調合ね\n誰が用意したの？", 3, 6740, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "パワーが足りないわね\nもっとよ、もっと私を\n寛がせなさい", 3, 6741, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "栄養価はともかく\n味のバランスは\n悪くないわね", 3, 6743, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "つまらない本は\n私が書き直すわ\nこれはどうかしら？", 3, 6744, 106901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今年はアカリと\nお姉ちゃんでサンタが\n二人…つまり幸せも\n二倍ですね♪", 1, 6746, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "クリスマスに向けての\nサックス練習…\nお兄ちゃんと一緒に\n猛特訓です！", 1, 6747, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クリスマスツリーの\n飾りつけ、完璧です♪\nお兄ちゃんお姉ちゃん\n喜んでくれるかな？", 1, 6748, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わあ、お外が真っ白！\n生クリームが\nいーっぱいの\nケーキみたいです♪", 1, 6749, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "煙突から入ると\nお洋服が汚れちゃう…\n玄関からじゃ\nダメなのかなぁ？", 1, 6750, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄ちゃんが来たら\nサンタのお洋服\nいっぱい褒めて\nもらおっと♪", 1, 6751, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "聖夜をお兄ちゃんと\n過ごせたら…\nアカリもちょっぴり\n大人になれるかも♪", 1, 6752, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今のアカリは\nサンタさんですから♪\nなんでもお願いして\nくださいね？", 2, 6753, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お外は寒いですから\nアカリとくっついて\nお出かけしましょ♪", 2, 6754, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お兄ちゃんは\nアカリのトナカイさん\nですから、ずーっと\nそばにいてください♪", 2, 6755, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄ちゃん、助けて！\nアカリのカラダで\nラッピング練習したら\n絡まっちゃいました…", 2, 6756, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "プレゼント、いっぱい\n準備できました♪\nお兄ちゃんの分は…\nまだヒミツでーす♪", 2, 6757, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "アカリ、プレゼントは\n大人っぽいのがいいな\n早くお兄ちゃんに\n追いつきたいから♪", 2, 6758, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\nふふ、アカリサンタは\nいい子のお手本なので\n早寝早起きなんです♪", 2, 6759, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "あれ、もうお昼？\nクリスマスナンバーの\n練習してたら\nもうこんな時間…", 2, 6760, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "冬の夜空は星が\nキレイですね～\nお兄ちゃん、一緒に\n見に行きませんか？", 2, 6761, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ、快適すぎて\nとろけちゃいそう…\nこういうプレゼントも\nいいかもです…", 3, 6763, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "やん、かわいいです♪\nえへへ、お兄ちゃんは\nどんなプレゼントが\n欲しいですか～？", 3, 6764, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わわ、大人な香り…\nロマンチックな\nクリスマスが\n過ごせそうです♪", 3, 6765, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これでカラダを温めて\nアカリの温もり…\nお兄ちゃんに\nおすそ分けしよっと♪", 3, 6766, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹がパンパンです…\nでもこれで\nちょっとサンタさんに\n近づけたかも…？", 3, 6768, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クリスマスイブの\n恋人との過ごし方…？\nはわわ、アカリには\nまだ早いかもです…！", 3, 6769, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "わっ、すごいすごい！\n不思議な絵本ですね♪\nこの本でお兄ちゃんに\nイタズラしちゃお♪", 3, 6771, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "アカリ、ホカホカに\nなっちゃいました～♪\n…ぎゅってしても\nいいですよ？", 3, 6772, 124001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "またエンジェルになる\nかもとは思ってたけど\n…サンタさん要素の\n追加は想定外だったわ", 1, 6773, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ラフィたちがいない\nときは私がなんとか\nしないとね\n一応…エンジェルだし", 1, 6774, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "部屋の飾りつけとか\nするのも…あり？\nふふ、浮かれすぎかな", 1, 6775, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "パーティーだったら\nみんなで大人数向けの\nボードゲームもできる\nかも…やったっ", 1, 6776, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この服のモコモコ…\n気づいたら触っちゃう\n…やるわね、ラフィ", 1, 6777, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アイツと一緒にいると\n人見知りとは違う\n緊張があるのよね…\nって今の聞いてたっ？", 1, 6778, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ぬいぐるみ…\nいじめてないわよね？\n…大事にしてるって？\nそれはそれで…あうぅ", 1, 6779, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いい子と悪い子って\nどう見分けるのかしら\n…まさか素直さとか？\nだったら困る！", 2, 6780, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "プレゼントといえば\nやっぱりゲーム！\n年末商戦サイコー♪", 2, 6781, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "サンタさんはお仕事を\n見られちゃ\nいけないのよね？\n…天職？", 2, 6782, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この服は汚れ対策も\nバッチリなのよね\n煙突に入れるように\n…いや私はNGよ！？", 2, 6783, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アンタのお願い…\n今なら一つくらい\n聞いてあげるわよ？\nほら、サンタ衣装だし", 2, 6784, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私たちって\nなぜかぬいぐるみと\n縁があるわよね\n…ふふ", 2, 6785, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お、おはよっ\n…ふぅ、寝ぐせを\n直すのが間に合って\nよかったぁ", 2, 6786, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "え…一緒にごはん？\nそ、そう…うん。OK\nまあ、せっかくだし？", 2, 6787, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "この時間のゲームって\n妙に楽しいのよね\n…ということで、\nちょっと遊ばない？", 2, 6788, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ああ～ダメになるぅ…\nもうここでずっと\nゲームしてた～い", 3, 6790, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "プレゼントのために\n研究は必要よね、うん\n…はぁ、かわいい～♪", 3, 6791, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "集中力を高める香りも\nあるのよね…\n勝負をするときには\n持ち歩こうかしら", 3, 6792, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なんだかまったり\nしちゃうわね…\n時間が溶けるわ…", 3, 6793, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹いっぱい\n食べられるのも\n幸せなことよね", 3, 6795, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ちっちゃいときは\nアカリと一緒に絵本を\n読んだなぁ…懐かしい", 3, 6796, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "飛び出す絵本…\nこれでゲームブックを\n作ったらおもしろく\nなる気がするわ…", 3, 6798, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "あったまる…\nモフモフ…ふわふわ…\nちょっと休憩しても…\nいいよね…？", 3, 6799, 124101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あら、どうしたの？\nもしかして、私と\n新しい実験を\n始めたくなった？", 1, 6800, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "調子が悪いときは\n診療所に来て\n君は特別に、じっくり\n診察してあげるわ♪", 2, 6801, 105101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "特別じゃなくても\nまったり過ごす\nクリスマスも\nいいものだね", 1, 6802, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ニットの帽子に\nマフラーに耳当て…\n素顔用の防寒対策を\n整えなければ", 1, 6803, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "靴下が\n見当たらなかったから\n枕元にはかわりに\n鎧を置いておこう", 1, 6804, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "聖女なんて言われる程\n素晴らしくはないけど\n心は聖くいたいものだ\n日々精進だね", 1, 6805, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "兜がないから\nイルミネーションが\nいつもよりまぶしく\n感じるよ", 1, 6806, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "皆の幸福を\n祈願して\nクリスマスリースを\n飾ろうか", 1, 6807, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私にはかわいすぎる\n衣装だが…開き直って\nクリスマス気分を\n楽しんでしまおう", 1, 6808, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ツリーの飾りつけ\n手伝ってくれるかい？\nセンスは少年に\nお任せするよ", 2, 6809, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "パーティーは\n用意してる時も楽しい\nねえ少年、この気持ち\n分かってくれるかい？", 2, 6810, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんでトナカイの鼻は\n赤いのかって？\n無灯ソリ運転は違反で\n取り締まられるからだ", 2, 6811, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "トモちゃんや\nマツリちゃんは\nいい子だから、きっと\nサンタさんに会えるね", 2, 6812, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒイラギの髪飾り\n実は気にいってるんだ\n少年にも\n褒めてもらいたいな", 2, 6813, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ねえ少年…そろそろ\n見慣れてほしい\nそんなにまじまじ\n見つめられると照れる", 2, 6814, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝日に照らされて\n街がキラキラ白銀に\n輝いてるよ", 2, 6815, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯を食べて\nちょっと散歩しようか\n祝祭に沸く街は\nとてもきれいだよ", 2, 6816, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "やっぱりクリスマスは\n夜が本番って感じだね\nキャンドルを灯して\n厳かに過ごそうか", 2, 6817, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "鎧姿では無縁だったが\nふかふかしていて\n気持ちいいな…\nふかふか…ふかふか…", 3, 6819, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふ、かわいいね\n抱きしめると\nあの雪の日に産まれた\n赤ちゃんを思い出す", 3, 6820, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "兜を脱いだおかげで\nこの香りに出会えた\n…クリスマスの魔法も\n悪くないかもね", 3, 6821, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "指先から体の芯まで\n暖まるね\nこれなら雪の日でも\n安心だよ", 3, 6822, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐ、もぐ…\nあまり食べるところ\n見ないでほしい", 3, 6824, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "素敵なレストランの\n特集記事が載ってる\n聖夜に予約が取れたら\n最高に幸せだろうね", 3, 6825, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "わっ！\n…………いや\n驚いてなどいない", 3, 6827, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "ふふ…頬に直接\nふかふかを感じられる\n温かくて気持ちいいよ", 3, 6828, 124201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ピアノに読書…\nグレアと一緒に\nなにをしようかな～♪", 1, 6829, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "元の世界へ戻った時\n授業に遅れないよう\nグレアと勉強しとこう", 1, 6830, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "街に魔物料理屋さんが\nあるんだ！　グレアと\n食べに行ってみよう♪", 1, 6831, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "せっかく新しい魔法を\n覚えたし、グレアにも\n見てもらいたいな！", 1, 6832, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "グレアも誘って\nランドソルをもっと\n探索したい！", 1, 6833, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私たちも\nあの人を見習って\nバイトとかしよう！", 1, 6834, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつかあの人を\n私たちの学院に\n招待したいな！", 1, 6835, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あのね！\nこれからグレアと\n魔法愛好会に\n行くんだ！", 2, 6836, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これからなにするの？\n私たちもついて行って\nいいかな！？", 2, 6837, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "グレアと一緒に\nあなたも魔法の練習\nしてみない？", 2, 6838, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "グレアとよく話すの\nマナリアの制服\nあなたに着せたいって", 2, 6839, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "グレアのそばって\n温かいんだ～！\nぬくぬくだよ～♪", 2, 6840, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたは\nグレアと私の友達！\nこれからもずっと！", 2, 6841, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！\n今朝はグレアと一緒に\n外を散歩してきたよ！", 2, 6842, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹空いたな…\nよし、グレアと一緒に\n魔物料理を作ろう！", 2, 6843, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間だね\n明日のために\nそろそろ寝ようかな！", 2, 6844, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ～この感触…\nグレアの尻尾みたいで\n安らぐ～", 3, 6846, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぬいぐるみって\nいいよね…私もよく\nグレアに抱き付くんだ", 3, 6847, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～…\nグレアもこういうの\n好きなんだよ！", 3, 6848, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいね～…\nグレアにくっついてる\n時を思い出すよ～…", 3, 6849, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "この世界にしかない\nおいしいものが\nたくさんあるよね！", 3, 6851, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "世界を繋ぐ魔法の\nヒント…本に書いて\nないかなぁ…", 3, 6852, 124301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ピアノに読書…\n今日のアンは\nなにをするのかな…", 1, 6855, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私はアンほど\n勉強はできないから\nちゃんと自習しないと", 1, 6856, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "一度始めたら\nとことん追求するのが\nアンなんだよね…", 1, 6857, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふふ…夢中になってる\nアンを眺めてるだけで\n一日があっという間…", 1, 6858, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ランドソルは広いね…\nアンと一緒にいろんな\n場所へ行ってみたい", 1, 6859, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "アンやあの人の笑顔を\n見てると、すごく\n安心するんだ…", 1, 6860, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もしあの人が私たちの\n学院に編入したら…\nふふ、楽しそうだね", 1, 6861, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "アンもあなたも\nすごいな…\nみんなとすぐに\n仲良くなっちゃうから", 2, 6862, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなたはこれから\nなにをするの？\nその…アンと一緒に\nついていってもいい？", 2, 6863, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "アンから魔法の練習に\n誘われた？　実は私も\n…一緒にどうかな？", 2, 6864, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたがマナリアに\n編入したら\n楽しいのになって\nアンとよく話すんだ…", 2, 6865, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "こっちの世界にも\nアンのように\n私を受け入れてくれる\n人たちがいるんだね…", 2, 6866, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "元の世界へ帰る日が\n来たとしても私たちは\n「さよなら」より\n「またね」がいいよね", 2, 6867, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう。さっき\nランドソルの朝日を\nアンと見てきたんだ", 2, 6868, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "私たちは\nこれからなんだけど\nあなたはお昼ごはん\n何を食べたの？", 2, 6869, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ\nアンが眠る時間だ…\nあなたもおやすみ", 2, 6870, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はぁ、疲れが取れる…\nこの尻尾…\nちょっと重いんだよね", 3, 6872, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "これ…\nアンに見せたら\n喜ぶだろうな…", 3, 6873, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り…\nアンの感想も\n聞いてみたいな", 3, 6874, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\nアンがここにいたら\n本を読みながら\n寝ちゃうんだろうな", 3, 6875, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おいしいからたくさん\n食べれちゃうけど\nまた尻尾…\n大きくなっちゃうかな", 3, 6877, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "アンがおススメ\nしてくれた本は\nこれかな…？", 3, 6878, 124401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "凶、凶、凶…大凶？\nなによこのおみくじ\n自宅用だからって\n排出率が適当すぎよ…", 1, 6881, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今年こそ最高の新薬が\nもはや偶然に近い\n最小限の手間で\n作れますように", 1, 6882, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "喉に詰まる前に\n溶けてなくなるお餅…\n最優先の研究課題だわ", 1, 6883, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "よし、完成♪\nミツキ特製…\n「新解釈おせち料理」\n医学的根拠が満載よ", 1, 6884, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お年玉を彼に…\nあげるべき…？\n色んな意味で微妙ね…", 1, 6885, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふふ、今年もまた一年\n彼のバイタルを\n記録できるのね♪", 1, 6886, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今年こそ\n私の薬で彼を魔改造…\nううん、大人の男に！", 1, 6887, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "コマ回しのコマを\n見てたら目が回った？\nそう…手当は不要よ…", 2, 6888, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私の顔で\n福笑いを作った？\nあら…隻眼まで\n再現度が高いわね♪", 2, 6889, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "門松よし、しめ縄よし\nこんなギルドでもね\n一応縁起を担ぐのよ", 2, 6890, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "本気の薬草を煮込んだ\n本気の七草粥よ\n色は気にしちゃダメ", 2, 6891, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君が今年も健康で\nつつがなく…実験台を\n務められますように", 2, 6892, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いくつ新年を迎えても\n俗世の垢にまみれない\nそんな君こそが…\n私には最高のお薬よ", 2, 6893, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お正月なんだから\nいつまでも寝てないで\nさぁ、実験開始よ♪", 2, 6894, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "カルタも双六もしたし\nあとは実験くらいしか\nやることがないわね", 2, 6895, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "日頃からたいがい\n意味深な夢を見るけど\n初夢はまた別かしら…", 2, 6896, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "さすがにこの格好で\n寝正月を敢行するのは\nためらわれるわね", 3, 6898, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "や、闇医者たる者\nこんな愛くるしい物に\n心奪われるわけには…", 3, 6899, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お雑煮のいい香り…\n食欲が増進されるわ\nアロマも立派なお薬ね", 3, 6900, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "胸元は閉じないわよ？\nでも時々ここで\nこっそり暖まるの…", 3, 6901, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "無から有が生まれてる\n新年早々物理の法則を\n無視してくるのね…", 3, 6903, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "どれもこれも読んだわ\n新しい婚活本の\n入荷はまだかしら…", 3, 6904, 124701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "彼が一生懸命\n書いてくれた年賀状\n気持ちがこもっていて\nすごくうれしいわ♪", 1, 6906, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "しっかり丁寧に\n大掃除したから\nとってもいい気持ちで\n新年を迎えられたわ♪", 1, 6907, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "彼の着物姿\nきっと凛々しいわよね\n想像しただけで\n笑顔になるわ～♪", 1, 6908, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お雑煮は地域によって\n違いがあるけれど\n愛情が隠し味なのは\nどこも一緒よね♪", 1, 6909, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "彼と凧揚げして\n遊びたいけど\n森では引っかかって\nできないかしら…？", 1, 6910, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今年も彼が素直に\n成長できるように\nたくさんいい子いい子\nしてあげましょう…♪", 1, 6911, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "絵馬に彼と\n書いた通り\n今年もみんなが笑って\n過ごせますように", 1, 6912, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "先生と初詣に\n行きましょう〜♪\n迷子にならないように\n手を繋いで、ね？", 2, 6913, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "初売りセールいいわね\nでも気を付けないと\nあれこれ欲しくなって\n買い過ぎちゃうかも…", 2, 6914, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "風邪をひかないように\n温かくするんですよ～\nえ？　先生、温めて？\nふふ、甘えん坊さんね", 2, 6915, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あなたのために\nちょっと豪華なおせち\n用意したのよ\nお口に合うかしら？", 2, 6916, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたも着物着たい？\nふふ、貫禄出ちゃって\n先生ドキドキ\nしちゃうかも…♪", 2, 6917, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたの成長は\nとってもうれしいけど\n今年もまだ、あなたの\n先生でいたいな…♪", 2, 6918, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "あら、起きたの？\nお雑煮できてるから\nちゃんとお顔\n洗ってらっしゃいね", 2, 6919, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯を\nしっかり食べて\nみんなでかるた大会\nしましょう〜♪", 2, 6920, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "は～い、良い子は\nもう寝る時間ですよ\n素敵な初夢が\n見られますように♪", 2, 6921, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このフカフカちゃんも\n天日干ししたいけど…\nその前にちょっと\n休憩しちゃおうかしら", 3, 6923, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うふふ、かわいい～\nアオイちゃんや\nハツネちゃんも\nきっと気に入るわね♪", 3, 6924, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お正月は空気も\n透き通ってるから\nいつも以上に\n素敵な香りに感じるわ", 3, 6925, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "火のぬくもりに\n抱かれていると\n不思議と眠気が…\nふああ…", 3, 6926, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "愛情のこもった料理は\nおいしいだけじゃなく\n心も満たされちゃう♪", 3, 6928, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "お正月のお作法も\nたくさんあるのね～\n先生も日々勉強だわ～", 3, 6929, 124601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "少年への感謝をどんな\n形で伝えるべきか…\n言葉よりも物の方が\n良いのだろうか？", 1, 6931, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "話し相手になって\nもらってもいいかな？\n少年と一緒にいると\nとても楽しいんだ", 2, 6932, 104701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お正月だからって\nギャングのボスは\n油断できないよ～？", 1, 6933, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "イノリちゃんがお年玉\n欲しいんだって♪\n悪い子だったし\n10ルピでいいかな☆", 1, 6934, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お正月だからお雑煮を\n作ったんだけど\nカヤちゃんには\n大好評だったよ♪", 1, 6935, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ラーゴがお餅を\n食べたがってるけど…\nこの子にあげるのは\nちょっと心配かな～？", 1, 6936, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お正月は晴れ着の子が\nやっぱり多いよね～\n今度、私の漫画でも\n出してみようかな？", 1, 6937, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君と二人っきりで\n神殿に初詣…\n行ってみたいな～♪", 1, 6938, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "君とお正月を\n過ごしていると\n面倒なことも\n全部忘れられそう…", 1, 6939, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この着物、どう思う？\n似合ってたら\nうれしいけどな～♪", 2, 6940, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "袖を引っ張ったり\nしないでね？\n着崩れしちゃうから♪", 2, 6941, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お正月ならではの\n漫画ネタってある？\n参考にしたいんだよね", 2, 6942, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "昔は凧あげとか\n駒回しとかしてたけど\n大人になるとそういう\n機会も減るよね…", 2, 6943, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君にもお年玉を\nあげようか？\n好きな額を言ってね☆", 2, 6944, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年も、再来年も…\nこうしてみんなで\n新年がお祝いできると\n素敵だね～♪", 2, 6945, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよ～♪\n朝ごはんは\n焼いたお餅とか\nどうかな？", 2, 6946, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼だね～\nおせちを用意したから\nみんなで食べよっか", 2, 6947, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間だね～\n一日中着物だったから\n肩が凝っちゃったよ", 2, 6948, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "このまま寝たら\nしわになるかな？\n着替えた方がいい？", 3, 6950, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうのって\nラーゴのおもちゃに\nちょうどいいかも♪", 3, 6951, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだけど\n着物に移らないように\n気をつけないとね", 3, 6952, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ちょうどいい\n火加減だね♪\nぽかぽかするよ～♪", 3, 6953, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "着物の時は\nほどほどにしないと…\n欲張ったら、お腹が\n苦しくなるからね～", 3, 6955, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふーん\nイノリちゃんは最近\nこんな漫画を\n読んでるんだ～♪", 3, 6956, 124501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "楽園の気配は…ナシ！\nみんな前を向いてるね\nそうこなくっちゃ！", 1, 6958, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "レッスンの成果も\nこの格好くらい\n目に見えたら\n分かりやすいのになぁ", 1, 6959, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "次の曲はワイルドで\n悪い感じもいいなぁ…\nカヤとムイミちゃん\nみたいなイメージで！", 1, 6960, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "私…服、着てるよね？\nうんうん、着てる！\nあんまり体が軽いと\n急に焦る瞬間あるな～", 1, 6961, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "最近ファンの年齢層が\n幅広くなってきたかも\nこれって私…国民的\nアイドルに近づいた？", 1, 6962, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "パティスリーとコラボ\nしたらどんな感じかな\n…ノゾミンマカロン♪\nとか？　…いけるかも", 1, 6963, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼と一緒にいると…\nうれしくって苦しいな\nでも両方諦められない\n…アイドルらしいや", 1, 6964, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この格好、チカと\nツムギも似合うと\n思うんだけどな～\nキミもそう思うよね？", 2, 6965, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "街を歩いてたらね？\nライブとか写真集の\n告知イベントだって\n思われちゃった！", 2, 6966, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私が持ってた剣に\n結んであったリボン…\n何か気づいてくれた？\nヒントは…色だよ♪", 2, 6967, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "キミの気配ってすごく\n分かりやすいんだよ\n近くにいたらすぐに\nピンとくるんだ♪", 2, 6968, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あ、それ…はじめて\nキミにあげた音響盤！\nね、一緒に聴こうよ", 2, 6969, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ぼうっとしてたら\nイタズラしちゃうよ♪\nもっともっと私のこと\n見てないとダーメ！", 2, 6970, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は今日のはじまり！\n昨日よりももっと\nいい一日にしようね♪", 2, 6971, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "レッスンがんばったし\nまだお昼だし…\nランチ大盛りにしても\nセーフだよね！", 2, 6972, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "寝る前に明日の予定を\n確認しておかないと！\nえっと、集合場所は…", 2, 6973, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "一休みのつもりが\nなが～い休憩になるの\nあるあるだよね～", 3, 6975, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ノゾミンの熱烈ハグ♪\n…ここだけ聞いたら\nスクープになっちゃう\nかも？　なーんて！", 3, 6976, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "香りってなんだか\n記憶に残るよねー\n…こういうの私だけ？\nみんなも同じだよね？", 3, 6977, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なんだかライブの\n熱気を思い出して\nきちゃった…！\nレッスンしよっと！", 3, 6978, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹が減ってたら\nいいパフォーマンスは\nできないもんね！\n…んー、おいし～♪", 3, 6980, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "いい歌詞を書くには\nしっくりくる言葉を\n知っておかないと！", 3, 6981, 124801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "うだうだ悩んでる\nヤツがいたら\nオレのとこ連れてこい\n背中押してやるからさ", 1, 6983, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "最近どことなく\nファミリーの連中が\n浮き足立ってんだよな\n…なんでだ？", 1, 6984, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "イノリのヤツ\nやたらと脇腹\nつついてきやがって…\nくすぐったいっての", 1, 6985, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "身軽になったのは\nいいが…くそっ\nどこもかしこも\nスースーする…", 1, 6986, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "思い出に浸るのも\n悪くはないが\nやっぱ人間\n未来に生きないとな！", 1, 6987, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "またムイミやノゾミと\nツルむのもいいな\nそこにカレもいたら\nなおいいぜ", 1, 6988, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "未来のことを考えると\nなぜかいつもカレが\n頭に浮かんじまう…\nええい、やめだやめ！", 1, 6989, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちょっくらオレと\n腕相撲しねえか？\nこの新しい力\n試させてくれ！", 2, 6990, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なあ、悪いが上着\n貸してくれないか？\nこのカッコ、割と\n肌寒いんだよ…", 2, 6991, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おっ、生まれ変わった\n喧嘩屋にご用命か？\nいいぜ、キミの\n依頼なら二つ返事だ！", 2, 6992, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんか悩みごとが\nあるなら、なんでも\n話してくれよな\nオレとキミの仲だろ？", 2, 6993, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "このカッコが\nきれいだって？\nや、やめろよ…\n照れくさいだろ…", 2, 6994, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミがいると、なにを\nするにも退屈しないぜ\nだから今日も\n付き合ってくれよな！", 2, 6995, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう！　新しい\n未来がやってきたぜ！\n一秒だって時間は\n無駄にするなよ？", 2, 6996, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "そろそろ昼飯に\nしないか？\n穴場のうまい店に\n案内してやるからさ", 2, 6997, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜更かしは\n未来の前借りだ\n体壊さないように\nほどほどにしとけよ？", 2, 6998, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お、いいなこれ\nファミリーの\nアジトにも\n置いときたいぜ", 3, 7000, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "べ、別にかわいいもん\nなんて、そんなに\n好きじゃないし…\n嫌いでもないけどさ", 3, 7001, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "嗅いだことない\n香りだな\nなかなか気に入った！", 3, 7002, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "薄着で暖を取るのって\n最高にぜいたくだよな\nへへっ、堪能させて\nもらうとするか", 3, 7003, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こいつはいいや\nこのカッコだと\n消耗が激しくて\nやたら腹が減るからな", 3, 7005, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "甘辛コーデ…\nへぇ、そんなのが\nあるのか…\nわ、悪くねえかもな", 3, 7006, 124901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "はぁ…\nもっともっと長い時間\n先輩と過ごせたらなぁ", 1, 7008, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "えへへ…♪\n先輩が、すぐそばに\nいてくれるなんて…\n幸せだなぁ…♪", 2, 7009, 105501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はーっはっは！\n強くてカッコいい\n大悪党、ここに参上！", 1, 7010, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "みんなおしゃれで\nカッコいいけど\n今のアタシも\n負けてないぞ！", 1, 7011, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ギャングのアジトも\nよかったけど\nここも賑やかで\n悪くないな！", 1, 7012, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "悪党にも休息は必要だ\nここならゆっくり\n休めそうだ！\n邪魔するぞ！", 1, 7013, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "いっぱい人がいるな…\nアタシの悪党っぷりを\n広めるチャンスだ！", 1, 7014, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ここにいれば\nいい思い出がたくさん\n作れそうだな！", 1, 7015, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつかアタシも\nオクトーと一緒に\nこんなアジトを手に\n入れてやるからな！", 1, 7016, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん？　アタシの格好が\n気になるのか？\nならもっと近くで\n見てもいいぞ！", 2, 7017, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おい、暇だから\nアタシと遊べ！\nカヤとノゾミも呼んで\n大騒ぎするぞ！", 2, 7018, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "オマエ、前より強く\nなってないか！？\nくっそー！　アタシも\n負けてらんないぞー！", 2, 7019, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日は特別にアタシの\n思い出話を聞かせて\nやる！　さーて、どの\n悪事から話そうか…", 2, 7020, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "オマエとの付き合いも\n結構長くなったよな？\nこれからも\nよろしく頼むぞ！", 2, 7021, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "オマエまでいなく\nなったらアタシが困る\n勝手にどっか\n行くんじゃないぞ！", 2, 7022, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "起きろ、起きろー！\n大悪党の朝は早いんだ\nさっさと\n顔洗ってこい！", 2, 7023, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯どうしようか…\nそうだ！　オマエの\nおススメに連れてけ！\nいい店期待してるぞ！", 2, 7024, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日を思い切り\n楽しむためにも\n早く寝とけよ！\nまた明日な！", 2, 7025, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こうやって座ると…\nおお！　すっごく悪党\nっぽいぞ！", 3, 7027, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "オマエ、仲間に\nなりたそうな目を\nしてるな！", 3, 7028, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うん、いい匂いだ！\n何の匂いかは全然\n分かんないけどな！", 3, 7029, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "炎ってなんだか\nカッコいいよな！\n見てるだけで心が\n燃えてくるぞ！", 3, 7030, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いっぱい食べれば\nちょっとは\n背が伸びるかな…？", 3, 7032, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ぐぬぅ…たまには\n本でもと思ったけど\nやっぱりアタシは\nバトル担当だな！", 3, 7033, 125001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お邪魔しまーす★\nなーんてもう\nすっかりくつろいで\nますけどー♪", 1, 7035, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "騎士さんの\nギルドハウス…★\nなんだかドキドキ\nしちゃいます♪", 1, 7036, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぺんぽこりんの\n置き場所はー…\nま、このへんで★", 1, 7037, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うーん、これは\n壊しがいがありそ…\nウソウソ、冗談です★", 1, 7038, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "オトモダチでも\n作ってみますかー\nくすっ★", 1, 7039, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "退屈ですねー\n騎士さん、構って\nくれないかなー", 1, 7040, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もっともっと早く\n騎士さんに逢えてたら\n…なんて、わたし\nらしくないですね", 1, 7041, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わたし一人にするの\n不安だったりします？\nちゃーんとイイコに\nしてますってー★", 2, 7042, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お出かけします？\nそれともおうちで\nまったりしますー？", 2, 7043, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "女の子をすぐ家に\nあげちゃうなんて…\nふふ、やっぱり隅に\n置けないですねー★", 2, 7044, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "騎士さん騎士さーん★\nウザ絡みしても\nいいですかー？\n騎士さんってばー★", 2, 7045, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "一緒にゴロゴロ\nしませんかー？\nコイビトっぽくて\n楽しそうですし♪", 2, 7046, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うふふ★\nこーやってあなたに\n優しくされると…\nときめいちゃいます♪", 2, 7047, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます★\nあれれー？\nまだおねむですかー？", 2, 7048, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "騎士さん、お昼は\nもう食べましたー？\nわたし、ラーメンが\n食べたいでーす★", 2, 7049, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "あ、夜更かししてちゃ\nダメですよー？\nほらほら、お布団に\nごーごー★", 2, 7050, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかのふわふわー\nついついまーったり\nしちゃいます★", 3, 7052, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かっわいー★\n名前はー、んー…\nぱんぱかぷんで★", 3, 7053, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん★\nうーん…\nたぶん素敵な香り♪", 3, 7054, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかーい★\n心も体も\nぽっかぽかですねー★", 3, 7055, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ★\nんー、おいしくって\n止まらないですねー★", 3, 7057, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "へー★\nほほー★\nふんふーん★", 3, 7058, 118201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さ～て時間もあるし\nラテアートの練習でも\nするかにゃ～♪", 1, 7060, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "カフェの猫たちも\n元気に働いてくれて\nお客さんからの評判も\n上々にゃ～♪", 1, 7061, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カフェのカウンターに\nファントムキャッツの\n目安箱を置こうかにゃ", 1, 7062, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あんこもコーヒーも\n原料は豆にゃ～\nそりゃ相性いいに\n決まってるにゃ♪", 1, 7063, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あいつの為に\nタマキ特製ブレンドを\n開発したいにゃ♪", 1, 7064, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつと働いてると\nなぜかあっという間に\n閉店時間が\n来ちゃうのにゃ～", 1, 7065, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつといると\n新しいアイデアが\n溢れるほど\n出てきちゃうのにゃ♪", 1, 7066, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "キミがコーヒーを\n淹れてくれたのにゃ？\nにゃはは、常温で\n猫舌にも優しいにゃ♪", 2, 7067, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "料理が上手くなったら\nカフェご飯メニューも\n充実させたいにゃ～", 2, 7068, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お店の経営は大変\nだけど、キミとなら\n乗り越えられるって\n確信してるにゃ！", 2, 7069, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん？　この制服\n似合ってるにゃ？\nにゃはは！　褒めても\n１ルピも出ないにゃ♪", 2, 7070, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あたしが好きなのは\n猫に好かれる人にゃ♪\n…ん、キミ猫に懐かれ\nまくってるにゃ…", 2, 7071, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミの制服姿\nけっこーイケてるにゃ\nあたしがお客さんなら\n通いつめちゃうにゃ♪", 2, 7072, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は一杯の\nコーヒーから始まる…\nにゃふふん♪\nシャレた朝だにゃ～♪", 2, 7073, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はたい焼きと\nコーヒーのセットで\nまったり休憩\nしようにゃ～♪", 2, 7074, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "コーヒー淹れたにゃ\n星空を見ながら\n二人で飲もうにゃ…♪", 2, 7075, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふにゃ～ん…ゴロゴロ\nコーヒーと同じくらい\n癒されるにゃ～…♪", 3, 7077, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こいつかわいいにゃ～\nうちの猫たちとも\nいい勝負なのにゃ！", 3, 7078, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～いい香りだにゃ～\nコーヒーもそうだけど\n香りの癒し効果は\n抜群にゃ～♪", 3, 7079, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "猫に暖かいものは\nまるまれと言ってる\nようなもんにゃ…♪\nまるまる…", 3, 7080, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "にゃは～うまいにゃ♪\nカフェの新メニューに\n採用しちゃおう\nかにゃ～♪", 3, 7082, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "にゃるほど…\n調べれば調べるほど\nコーヒーは\n奥が深いのにゃ…", 3, 7083, 125101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ワタシの手料理は\n坊やの口に合うらしい\n胃袋は討ち取ったぞ♪", 1, 7085, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "胸に再度触れると\n誓約は無効になるのか\n…だと？　鋭い質問だ\n安心しろ。ならん☆", 2, 7086, 107101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ようやくこの服にも\n慣れてきたかな？\nふふっ、たまには\nこういう服も悪くない", 1, 7087, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日も店は好調だが、\n私は軍人だからな\n当初の目的も\n忘れないようにしよう", 1, 7088, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "猫が近くに来ると\nついつい見てしまうな\n仕事が終わったら\n遊んでやるかな♪", 1, 7089, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "コーヒーの淹れ方が\nうまくなってきたな♪\nどうせならお菓子も\n研究してみるか！", 1, 7090, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "利益を考えると\n価格をあげるべきか？\n…いや、利益よりも\n皆の笑顔の方が大事だ", 1, 7091, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "またあいつを\n呼んでしまったな…\n今度、コーヒーでも\n淹れて労ってやるか♪", 1, 7092, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次に入荷するお菓子は\nあいつの意見を聞くか\nどんな味が好きか\n気になるしな", 1, 7093, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なに、コーヒーを\n淹れてほしい？\nふふっ♪\n仕方のない奴だな！", 2, 7094, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…そうだ。\nコーヒーと乾パンは\n合うのではないか？\n今度試してみよう！", 2, 7095, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "コーヒーもいいが、\nココアも悪くないぞ♪\n貴公も一緒にどうだ？", 2, 7096, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魔法少女に比べれば\n大人しい服だろう？\nだが、カフェには\nこの服でバッチリだ！", 2, 7097, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "貴公はコーヒーを\n飲めるのかっ？それは\nうらやましいな…", 2, 7098, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "貴公の働きぶりには\n目を見張るものがある\nその姿は、その…\n結構かっこいいぞっ！", 2, 7099, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さぁ、今日も一日、\n頑張るぞっ！\n気合いを入れて\n開店準備だっ！", 2, 7100, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼は稼ぎ時だからな！\n荒波を乗り切るため\n貴公も一緒に\n頑張ってくれるか？", 2, 7101, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふあぁ…もう夜か\n今日は頑張ったからな\nはやめに休むとしよう", 2, 7102, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はふぅ～…\nたまにはこうして\nゆったりするのも\n悪くないな…", 3, 7104, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "猫もかわいいが、\nこいつもなかなか…\n見ていると、\n撫でたくなるな♪", 3, 7105, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これは良い香りだな\nふむ、コーヒーも\nより香り高いものが\n作れるよう試すか！", 3, 7106, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふぅ～…\n体を温めなければ、\nすぐに動けないからな", 3, 7107, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これもうまいが、\n私はお菓子も…\nいや、食べすぎは\n体に良くないな", 3, 7109, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "…書物は参考になるな\n次はこのやり方を\n試してみるかな", 3, 7110, 125201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "愛と希望の魔法少女！\n弟くんの平和は\nお姉ちゃんが守るよ♪", 1, 7112, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "魔法少女の戦い方を\n見せてあげる！\nお姉ちゃんチョップ♪", 1, 7113, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "闇の力が高まってる…\n早く弟くんを\nギュ～ってしないと！", 1, 7114, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ミニ弟くんを\n部屋中に呼び出して\n弟くんハウスに～♪", 1, 7115, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "決めポーズの練習でも\nしよっかな…\nはい、ポーズ♪", 1, 7116, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "魔法少女の力で\n弟くんのそばに\n瞬間移動したいなぁ", 1, 7117, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "禁じられた必殺技\nその名も──\n闇のお姉ちゃん頭突き", 1, 7118, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔法少女な\nお姉ちゃんに\n興味津々だねっ？\n全部教えてあげるね♪", 2, 7119, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "闇のお姉ちゃんとして\n世界を弟くんのものに\n…な～んて冗談冗談♪", 2, 7120, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "弟くんって魔法少女に\nなりたがってたよね？\n…うん。応援するね！", 2, 7121, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "サインが欲しいの？\nふふっ、任せて！\n愛する弟くんへ、と♪", 2, 7122, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふんふふ～ん♪\n魔法少女お姉ちゃんの\nテーマソング完成っ♪", 2, 7123, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "えへへ、弟くんからの\n愛と希望を感じるよ…\n更に変身しちゃうぞ♪", 2, 7124, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "弟くんの朝を魔法で\n守りに来たよ！\n希望の朝だねっ♪", 2, 7125, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "弟くんのお昼を魔法で\n守りに来たよ！\n愛のお弁当をどうぞ♪", 2, 7126, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "弟くんの夜を魔法で\n守りに来たよ！\nここからは闇の時間♪", 2, 7127, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "魔法少女の一休み♪\n愛と希望と…闇の力が\n回復していくね～♪", 3, 7129, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいかわいい♪\nお姉ちゃんの魔法で\n増やしちゃうぞ…♪", 3, 7130, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…\n弟くんと同じ…\nくんくん、くんくん…", 3, 7131, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体を温めておいて…\nこの熱を、ぜ～んぶ\n弟くんに伝えるよ…！", 3, 7132, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ミニ弟くんを呼ぶには\nいっぱい食べないと…\n魔法ってお腹減るから", 3, 7134, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "弟くんの平和を守る…\nそのためには\nチェックチェック…♪", 3, 7135, 120001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この服も、最初は\n慣れなかったのですが\n今ではすっかり\n体に馴染んでおります", 1, 7137, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "自然を守るためにも\nお勉強は欠かせません\n日々精進でございます", 1, 7138, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "採取した薬草を\n調合しておきましょう\nいつ必要になるか\n分かりませんからね", 1, 7139, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "合宿は過酷でしたが\nおかげでちょっと\n力持ちになったような\n気がいたします…♪", 1, 7140, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "わんわんのほうの\n主さまに、ごはんを\nあげる時間ですね…", 1, 7141, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "もっともっと訓練や\nお勉強を重ねて\n主さまのお役に\n立たなくては…", 1, 7142, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おや、そろそろ\nわんわんのほうの\n主さまをお散歩に\n連れていく時間です", 1, 7143, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "主さま、よろしければ\nお散歩に行きませんか\n今日の森は穏やかで\n過ごしやすいかと", 2, 7144, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わんわんのほうの\n主さまも、今では\n【美食殿】の大切な\n仲間でございます", 2, 7145, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "森には危険が\nいっぱいでございます\nケガをなさらないよう\nお気をつけください", 2, 7146, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "もし森や動物のことで\n気になることがあれば\n気軽にお尋ねください", 2, 7147, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "森へ行く前には\n必ず装備の点検を\nお願いいたします\n約束ですよ、主さま？", 2, 7148, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "森の中で主さまたちと\nゆったり過ごす時間は\nわたくしにとって\n大切なひとときです", 2, 7149, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n朝ごはんをしっかり\n食べて、お勤めに\n備えましょう", 2, 7150, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "わんわんのほうの\n主さまにおやつを\nあげる時間です\nどうぞ、召し上がれ", 2, 7151, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "どれだけ野営に\n慣れたとしても\nベッドで眠れるなら\nそうしたいところです", 2, 7152, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こちらなのですが\nわんわんのほうの\n主さまもお気に入りの\nようです", 3, 7154, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わんわんのほうの\n主さまにも、こうした\n玩具を与えるべき\nでしょうか…？", 3, 7155, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "心地よい香りです\n次は、自然由来の\n香料も試しましょう", 3, 7156, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖をとるのは\n野営の時などに\nとても大事なことで\nございますね", 3, 7157, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べられる時に食べて\nおくのも、大自然では\n重要でございます", 3, 7159, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "より知識を蓄え\n自然の力を活用できる\nようにいたしましょう", 3, 7160, 125301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今回の「冥風戦記」も\nなかなかよく書けたぞ\nふふっ、シグルドも\n喜んでくれるかな？", 1, 7162, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "貴様のためならば\n我が真なる魔力\nいつでも\n解き放とうぞ！", 2, 7163, 100901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ニャットちゃんに\nブラッシングを\nしてあげようかな", 1, 7164, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふふ…\nこれがレンジャーの\n制服ですか", 1, 7165, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そろそろ\nパトロールの\n時間だ…", 1, 7166, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魔物について\nもっと知りたいな\n本を探しに行こう", 1, 7167, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "レンジャーになって\n体調を崩す日が\n減った気がします…", 1, 7168, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "本だけじゃわからない\n世界のことを、\nもっと知りたいです…", 1, 7169, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "こんな私にも\nできることはある…\nそう信じています", 1, 7170, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あの…良かったら\n一緒に見回りへ\n行きませんか？", 2, 7171, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "またあなたと一緒に\nレンジャーの仕事が\nできたらうれしいです", 2, 7172, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "けほっこほっ\n…だ、大丈夫です\nたまに出るだけなので", 2, 7173, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ニャットちゃん\nあなたにも\n懐いてきましたね", 2, 7174, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ニャットちゃんと\n散歩に出かけようかな\n…あの人も誘って", 2, 7175, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと肩を並べて\nレンジャーの仕事が\nできてうれしいです…", 2, 7176, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\nレンジャー・シオリ\n元気に出勤します", 2, 7177, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ニャットちゃんにも\nお昼ごはんを\n用意しなくちゃ", 2, 7178, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "明日は仕事だから\n早起きしなくちゃ\nおやすみなさい", 2, 7179, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…仕事で\n走り回ったので\n少し休憩します", 3, 7181, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "仕事が終わった後に\nこうして触れていると\n癒されますね…", 3, 7182, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "森の香りがします…\n今日はよく\n眠れそうです…", 3, 7183, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ニャットちゃんと\n同じぐらい\n暖かいです…", 3, 7184, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "レンジャーの仕事を\nしていると\nお腹が空きます", 3, 7186, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "どんなに忙しくても\n読書だけは\nやめられませんね", 3, 7187, 125401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "兄様のお留守の間\nわたくしが、兄様の\n御家を守ります！", 1, 7189, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "に、に、兄様の御家…\n招待いただいた以上は\n失礼のないよう\n振る舞わなくては…！", 1, 7190, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ…兄様の素敵な\nお人柄が、家中から\nにじみ出ています…♪", 1, 7191, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "靴を脱がずに\n御家に上がるのに\n慣れていなくて…あ！\n飛べばいいのでは…！", 1, 7192, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここに花を生けたら\n華やぎそうですね\n兄様はお花…\n好きでしょうか…？", 1, 7193, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ずっとここにいたい…\nなどと言ったら\n兄様を困らせて\nしまいますよね…", 1, 7194, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お料理などを作って\n兄様を出迎えられたら\nいいのに…料理の腕も\n磨かなくては…！", 1, 7195, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "このような姿で\n失礼しております…！\nネ、ネズミがいたので\nつい本気を…！", 2, 7196, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おかえりなさいませ\nお忙しい御身をどうぞ\n癒してくださいね", 2, 7197, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "兄様の話し相手…！？\nど、どうしましょう…\nわたくしには面白い\n話なんて…はうぅ…！", 2, 7198, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なぜか、動物などに\n好かれる体質で…\n迷い猫捜しのバイトの\nお役に立てますか？", 2, 7199, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "に、兄様の家に来たら\n『添い寝』をするのが\n礼儀とリアさんが…\n本当…でしょうか？", 2, 7200, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "わたくしはここに\nいて…よいのですね？\n『仲間』として…", 2, 7201, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は得意なんです\nもし兄様が苦手なら\nわたくしが起こして\n差し上げますよ", 2, 7202, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "兄様…昼餉を作って\nみたのですが、失敗\nしてしまいました…", 2, 7203, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふあぁ…\nはっ！　お…\nお恥ずかしい所を…！", 2, 7204, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こ、これは…！\n人様の御家なのに\nつい…駄目になって…\nしまいますぅ…！", 3, 7206, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "と、飛びかかっては\nこない…ですよね…？", 3, 7207, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すぅ…はぁ…\nこのかぐわしさ\n心が洗われます…", 3, 7208, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なんて暖かい…\n兄様の優しくお広い\n御心のようです…♪", 3, 7209, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "こんなに食べていたら\nはしたない…\nでしょうか？", 3, 7211, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "兄様の本棚はまるで\n知識の宝庫ですね\n己の世間知らずぶりを\n実感してしまいます", 3, 7212, 125801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "次の冒険に向けて\n騎空士弁当を作ろっと\nまずはおにぎりから！", 1, 7214, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "魔法の修行しなくちゃ\nもっともっと頼れる\n団長になりたいから！", 1, 7215, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ビカラちゃんを\n遊びに誘いたいけど…\nどういう場所が\n好きなんだろう？", 1, 7216, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "仕事を真面目に\nしっかりこなすことが\n騎空艇への\n一番の近道だよね", 1, 7217, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここにいる人の中で\n騎空団に興味ある人\nいたりしないかな…？", 1, 7218, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "これまでも想い出は\nいっぱいできたけど…\nこれからもたくさん\n想い出を作りたいな！", 1, 7219, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "仲間がいるから\n騎空士は限界だって\n超えられるんだね", 1, 7220, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この衣装\n魔法使いらしいでしょ\n服に着られないよう\n頑張らなくちゃね！", 2, 7221, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなたとなら\nどんな相手だって\n怖くなんてないよ！", 2, 7222, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カリンさんから\n新しい依頼が来たよ！\n一緒に頑張ろ！", 2, 7223, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "操舵士になるのは\nずいぶん難しそう…\nいつか頼れる仲間が\n見つかるといいな", 2, 7224, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "手合わせしたいの？\nいいよ、たまには\n団長らしいところ\n見せてあげるね！", 2, 7225, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "まだ二人きりだけど…\nこの騎空団は\n私の宝物だよ！", 2, 7226, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう～…\n昨日は遅くまで\n魔法の研究してて…\nふわぁ…眠いなぁ…", 2, 7227, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "さてと、お昼休み！\n紅茶淹れてくるから\n一緒に飲もうよ！", 2, 7228, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "遅くまでお疲れさま！\n無理しない程度に\nお互い頑張ろう！", 2, 7229, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "魔法の研究は\n一旦、休憩！\n頭を休めなくちゃ", 3, 7231, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魔法みたいに\nかわいい！\n騎空団に入る？\nなんてね！", 3, 7232, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂い…\nそれになんだか\n集中力が増したかも", 3, 7233, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体だけじゃなくて\n心までポカポカする…\nなんだか魔法みたい", 3, 7234, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いろいろ考え事したら\nお腹が空いちゃった！\nいただきまーす！", 3, 7236, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "『摂理の彼方へ\n至るには…』\n…この魔導書\n勉強になるなあ", 3, 7237, 125501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こちらの服を着ると\n冒険に出かけたく\nなっちゃいますね", 1, 7239, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "冒険者の心得その一\n準備はできる限り\nしっかりとこなすべし\nなんてどうでしょう？", 1, 7240, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "調合に必要な素材は\nあれとこれとそれと…\n時間があるとついつい\n考えちゃいますね", 1, 7241, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "せっかくですから\nより良い素材を\n自分で集めたいですね", 1, 7242, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "このポーションが\nみなさんの役に立つと\nうれしいですね", 1, 7243, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "冒険者の心得その二\n危なくなった時は\nまず逃げるべし！\n大事なことですね", 1, 7244, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人の冒険は\nいつも楽しそうで\n元気がもらえます", 1, 7245, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ぜひおすすめしたい\n依頼があるんです\nこちらをどうぞ♪", 2, 7246, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ほしいお薬があれば\n錬金術で作って\nさしあげますよ", 2, 7247, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "依頼で気になる\nところがあれば\n何でもご確認ください", 2, 7248, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このギルドハウスに\n錬金術の実験設備を…\nえ？　だめですか？", 2, 7249, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ポーションをどうぞ\n大丈夫、効果は\n確認済みですので♪", 2, 7250, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "次はどんな冒険に\n行かれるんですか？\nいつでもお供しますよ", 2, 7251, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "今日もいい一日に\nなりそうですね\n冒険日和といった\nところでしょうか", 2, 7252, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "いい時間ですし\nランチにしませんか？\n次の冒険の\n作戦会議も兼ねて♪", 2, 7253, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜も遅いですし\n明日の冒険のため\n今日は早く寝ましょう", 2, 7254, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふう…やはり冒険は\n事務仕事と違いますね\n少し休憩を…", 3, 7256, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "冒険は緊張の連続です\nかわいい物で\n心を癒しましょう", 3, 7257, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふむ、この香りは…\n素晴らしいバランスで\n調合されていますね", 3, 7258, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この火力…\n錬金術の調合に\n使えそうですね", 3, 7259, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "冒険の際は食べられる\n時に食べておく！\n…とペコリーヌさんも\nおっしゃってましたね", 3, 7261, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…なるほど\nこんな調合も\nあるのですね…\n奥が深いです", 3, 7262, 125701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "アイツどこ行った…？\n戦うならアタシも\n連れてけよなー！", 1, 7264, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今日も悪いヤツ退治…\nの前に腹ごしらえだ！\nなんか食べに行くぞ！", 2, 7265, 106101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みんなー！\nギルドハウスで\nぼくと握手！", 1, 7266, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "種族も年齢も違うけど\nみんな楽しそうだね！\nやっぱりここはぼくの\nゆ～とぴあさ！", 1, 7267, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハハッ！　まるで\nパーティー会場だね！\nこれは楽しませがいが\nあるってものだよ！", 1, 7268, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "やぁみんな！\nご利益満点のネズ耳は\nいかがかな？\nひとつ３ルピだよ！", 1, 7269, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここにいれば\n遊び相手に困らないね\nかしこみかしこみ～！", 1, 7270, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "どこか遊びに\n行こうかな♪\nそうだ、あの人にも\n声をかけてみよう！", 1, 7271, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人といると\nぼくまで楽しくなって\nくるんだよね！\n毎日パレード気分さ！", 1, 7272, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ネズ耳の在庫が\n切れたんだ！\n作るのを\n手伝ってくれるかい？", 2, 7273, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ん？　握手かい？\nいいとも！\nいつでも何度でも\nしてあげるよ！", 2, 7274, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この衣装に興味が\nあるのかい？\nきみ、なかなか\n見る目があるね！", 2, 7275, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "しばらくここに厄介に\nなるつもりなんだ\nあとで街を案内\nしてくれるかい？", 2, 7276, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "とっておきのチーズ\nきみと半分こだ！\nみんなには内緒だよ？", 2, 7277, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "きみはいてほしい時に\nいつもそばに\nいてくれるね\n本当にかしこみだよ！", 2, 7278, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "やぁ、おはよう！\n気持ちのいい朝だね\n今日も楽しくネズ耳\n売りにはげもうか！", 2, 7279, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼だね！\nおいしいチーズを\n持ってきたから\nぼくと半分こだ！", 2, 7280, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日も一日\n楽しかったね！\nいい夢が見られること\n間違いなしさ！", 2, 7281, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぼくにも休息は\n必要さ！\nリラックス〜\nリラックス〜♪", 3, 7283, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぼくのぬいぐるみも\n作って売ろうかな…\n修繕費も一気に\n集まるかもね！", 3, 7284, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだね！\nトーゴクのお香に\nよく似てるよ", 3, 7285, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はぁ…温まるねぇ…\nそうだ、この火で\nチーズでも炙って\nみようかな", 3, 7286, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うーん、この味…\nトーゴクを思い出すよ\nどれ、もう一つ\nいただこうか！", 3, 7288, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これはランドソルの\nガイド本だね！\nありがたく参考に\nさせてもらうよ！", 3, 7289, 125601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "まさか、わらわが\nこのような装束を\n纏う日がくるとはな…\n感慨深いものじゃ", 1, 7291, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わらわの美貌で\nこのギルドハウスも\nより華やかに\nなったようじゃな", 1, 7292, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "つまらぬ戦いで\n晴れ着を汚しとうない\n今日は一日\nゆっくりするかの", 1, 7293, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日はわらわが食事の\n準備をして、あやつの\n帰りを待ってやろう\n献立は何がよいかの…", 1, 7294, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ユキといったか…\n掴みどころのない\nやつじゃが、根性は\n認めてやるかの", 1, 7295, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "こうして、仲間と\nのんびり過ごす時間も\n悪くないのう♪", 1, 7296, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あやつを誘って\n月を見に行こうかの\n夜が楽しみじゃ♪", 1, 7297, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "いかなる衣装で\nあろうとも、わらわは\n完璧に着こなして\nしまうのじゃ♪", 2, 7298, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "なんじゃ？\nわらわの姿に\n見惚れておったとな？\nす、素直でよいのじゃ", 2, 7299, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "吸血鬼であるわらわに\n相応しい装束じゃろう\nあとは真っ赤な血を\n添えたいのう…", 2, 7300, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お主、疲れておるな？\nわらわが癒してやろう\nほれ、近う寄るのじゃ", 2, 7301, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お主がおるだけで\nギルドハウスが\n賑やかになるのう\nある種の才能じゃな♪", 2, 7302, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "眷属よ、風呂にするか\nご飯にするか\nそれとも、わらわに…\nいや、忘れるのじゃ", 2, 7303, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝一番、わらわに\n会いたかったとな…\n眷属よ\n褒めてつかわすぞ♪", 2, 7304, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "眷属よ、わらわが\n食事を用意したぞ\n忌々しい太陽に負けず\n頑張るのじゃ", 2, 7305, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "眠るには惜しい夜じゃ\n眷属よ、もうしばらく\nわらわの傍に\nおるがよい", 2, 7306, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふかじゃの♪\n今度あやつにも\n座らせてやろう", 3, 7308, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "愛いやつじゃ\n少しばかり、わらわが\n遊んでやろうかの", 3, 7309, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "気品ある香りじゃのう\nわらわの古城にも\n一つ欲しいところじゃ", 3, 7310, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "よいぬくもりじゃ…\n忌々しい太陽とは\n大違いじゃの", 3, 7311, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "味付けの参考に\nあと、もう一つだけ…\n止まらんのじゃ…", 3, 7313, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "吸血鬼の弱点について\n記されておるのか…\nふむ、眠気が\nさめてしもうたぞ", 3, 7314, 126201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "このままボクが美しく\nなり続けても、彼なら\nきっと隣にいてくれる\nはずだよね！", 1, 7316, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "もっとそばに来なよ\nボクの隣は\nキミのための\n特等席なんだから", 2, 7317, 100801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ドレスの影響かな…\n前より黒や赤が\n好きになったかも", 1, 7318, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ボクがいるだけで\nここがぐんっと\n華やかになったね♪", 1, 7319, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ボクを描いた絵画\n今度持ってきて\n飾ってあげようかな", 1, 7320, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ボクはボクに\n魅了されっぱなしさ♪\nまさに魔性の存在だよ", 1, 7321, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "美のアドバイスを\n聞きたい人いるかい？\nボクがもっともっと\n輝かせてあげるよ♪", 1, 7322, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの人、今度はボクを\nどう褒めるだろう？\nもし語彙が尽きても\n許してあげよっと♪", 1, 7323, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あの人に似合うコーデ\n考えてあげよっと\n案外、なんでも\n着こなしそうだよね♪", 1, 7324, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "吸血鬼になるなんて\nやっぱりゴメンだね！\n永遠の美よりも\n大事なことがあるのさ", 2, 7325, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お肌にいいものは\n大体好きだよ\nトマトジュースとかね", 2, 7326, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "銀のアクセサリーが\nボクは大好きでね\nいつでもプレゼント\n待ってるよ♪", 2, 7327, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "イリヤみたいにお城に\n住んでみたいんだ♪\n美を統べる者に\n相応しいでしょ？", 2, 7328, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今のボクがカップを\n触ると壊しちゃうんだ\nだからほら、キミが\nボクに紅茶を飲ませて", 2, 7329, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミも美を磨けば\nもっと輝けるはずさ！\nボクがメイクとか\nしてあげようか？", 2, 7330, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "んん、まだ眠い…\n美のためにも、\nもうひと眠りするよ…", 2, 7331, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ボクにぴったりな\n日傘を買ったんだ♪\n散歩にでも行こうよ！", 2, 7332, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜こそボクの時間！\nさぁ、あまねく人々へ\nボクの美を広めよう！", 2, 7333, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "リラックスは大事だよ\n心の余裕こそが\n美の秘訣だからね♪", 3, 7335, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "キミもボクの\n美の虜にしてあげる♪\nうれしいでしょ？", 3, 7336, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "人々を魅了するほどの\n魔性の香り…\nボクにふさわしいね♪", 3, 7337, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "冷えは美の大敵さ\nボクのように\n美しくなりたいなら\n体を温めるべきだよ", 3, 7338, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事をするボクの\nなまめかしさ…♪\n吸血鬼すらも\nドキッとするだろうね", 3, 7340, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "吸血鬼って\n美しい存在だよね…\nボクほどではないけど", 3, 7341, 126301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここがナイトさんの\nお家なんですねーっ！\n雰囲気そっくりっ！", 1, 7343, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ドアも壁もお菓子じゃ\nないんですよねっ？\n不思議ですねーっ♪", 1, 7344, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "失礼のないように\n気をつけないとっ！\nライラエルさまとも\n約束してますからっ！", 1, 7345, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "向こうに帰るころには\nお土産話がいっぱい\nできてるといいな～♪", 1, 7346, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "戦闘用のアームの他に\n観光用のアームも\nあったらいいのにな～", 1, 7347, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ナイトさんの充填と\nライラエルさまの充填\nどっちも違って\nどっちも大好きです♪", 1, 7348, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…ナイトさんが\nマスターになって\nくれたら…えへへっ\nなんでもないですっ！", 1, 7349, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お手伝いだったら\n任せてくださいっ！\nお家の移転とか\nしちゃいますかっ？", 2, 7350, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こっちに来るときは\nポポおじいさんが\nしっかりメンテして\nくれるんですよっ♪", 2, 7351, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お家の中にいるのも\nいいですけど、お外も\n気になります～っ！\nお出かけしましょう♪", 2, 7352, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ヴォルガーノさんに\nそっくりの子猫さんを\n見かけたんですっ！\nご親戚ですかねっ？", 2, 7353, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ここだけの話ですよ？\n…実はケーブルって\n触られると、ちょっと\nくすぐったいんですっ", 2, 7354, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "このお家の持ち主は\nナイトさんですよね？\nそれじゃここでは\nご主人さまですねっ", 2, 7355, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございますっ\n今日もフルパワーで\nがんばりましょうっ♪", 2, 7356, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼の時間ですねっ！\nランチの充填、\nお願いしまーすっ♪", 2, 7357, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ眠らなくて\n大丈夫ですかっ？\n夜ふかしさんなら\nお付き合いしますよ♪", 2, 7358, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "エネルギーの消費を\n抑えるのも大切\nですよね～っ", 3, 7360, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わたしが触っても\n平気なんて…！\nかわいくて頑丈っ！\n好きですっ！", 3, 7361, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "センサーによると…\nこの香りはいい香りに\n該当するみたいですっ\nなるほどーっ！", 3, 7362, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいのって\nいいですよねっ！\nみなさんうれしそう\nですしっ♪", 3, 7363, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これがこっちの世界の\nごはんなんですねっ\nおいしい気がします！", 3, 7365, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "そーっとそーっと…\n本を破かないように…\n書いてある内容より\n難しいです～っ！", 3, 7366, 126401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ウィスタリア家の\nプライベートビーチも\nご案内しますわね♪", 1, 7368, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "世界を巡る\nリゾートクルーズも\nご用意できますわよ", 1, 7369, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "避暑地に専用の\n別荘がありますの\n今度ご招待しますわね", 1, 7370, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "日焼けは乙女の\n天敵ですわね\n備えはしっかりと…", 1, 7371, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "線香花火だけでは\n物足りませんわね\nもっとドカーンと…", 1, 7372, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ギルド活動も全力で！\nバカンスも全力で！\nそれが私ですわ！", 1, 7373, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "私のセンスで選んだ\n特注の水着ですもの\n似合って当然ですわ♪", 1, 7374, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ご希望ならすぐにでも\n夏の飛空艇遊覧ツアー\nへご招待しますわ♪", 2, 7375, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏の賑やかな\n雰囲気は好きですが…\n暑さには参りますわね", 2, 7376, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "日の光を浴びるほどに\n輝きを増す夏の私！\n今日も絶好調ですわ♪", 2, 7377, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏祭りに協力するなら\n資金と人材、どちらも\n用意しないとですわね", 2, 7378, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたさま…その…\nそうも見つめられると\n照れてしまいます…", 2, 7379, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "タマキさんの働く\n海の家も訪れて\nみたいですわね♪", 2, 7380, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "港の市場が\n賑わう頃ですわね！\n私たちも参りますわよ", 2, 7381, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "冷たい飲み物でも\nご一緒にいかが？\nうちのシェフに用意\nさせてありますの", 2, 7382, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "まだもう少し…\nこの夏の夜を\nあなたさまと…", 2, 7383, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あなたさまも\n良ければこちらへ\nいらっしゃいな♪", 3, 7385, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "夏に合わせた装いに\n替えてみるのも\n楽しそうですわね♪", 3, 7386, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この夏めいた爽やかな\n香り…期間限定で\n売り出したいですわ", 3, 7387, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "く…我慢です…\nこの暑さに耐えてこそ\n美しさにも磨きが…", 3, 7388, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "暑い季節に働く\nみなさまへ差し入れも\n必要ですわね", 3, 7390, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏のトレンドを\n押さえておくのも\n大事ですわね", 3, 7391, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "上手くいけば\nヒット商品になる\nポテンシャルを\n感じますわね…！", 3, 7393, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "この極上の肌触り…\n言い値で買いますわ\n一体おいくらですの？", 3, 7394, 126701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "せっかくのバカンス…\n自由に羽を\n伸ばすとしましょう", 1, 7395, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たとえどのような\n秘密を持とうとも\n私には筒抜けですよ", 1, 7396, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "子供だましの怪談に\n関心はありませんが…\n霊には興味があります\n観察対象として、ね", 1, 7397, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "彼の絵日記…\nあとでゆっくりと\n読ませてもらいます", 1, 7398, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "セミの鳴き声に入道雲\nそしてクリームソーダ\nこれでこそ夏ですね", 1, 7399, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "夏休みの宿題でも\n作るとしましょうか\n彼の限界を少し超えた\n負荷を与えるには…", 1, 7400, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼と過ごす夏を\n特別なものにしたい…\nそれが私の望みです", 1, 7401, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夏だからといって\n浮かれすぎないように\n節度を持って\n楽しみなさい？", 2, 7402, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ああ見えてもマサキは\n私のプリンセスナイト\nあまり侮られては\n困りますよ？", 2, 7403, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私の秘密ですか？\nまんじゅうが怖い…\nというのはどうです？", 2, 7404, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ここは誰かの秘密を\n盗み聞くのに\n最適な場所ですね\n…ジョークですよ", 2, 7405, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "一緒に風鈴の音を\nのんびり楽しもう…？\n…別に構いませんよ\n貴方とならば", 2, 7406, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "貴方に約束しましょう\n決して忘れられない\n夏にしてあげますよ", 2, 7407, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "早起きとは感心ですね\nでは一緒に\n体操でもしましょうか", 2, 7408, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食は流しそうめん？\n非効率的ですね\n…食べないとは\n一言も言っていません", 2, 7409, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "…貴方が望むならば\nいくらでも怖い話を\nしてあげますが…\nいかがですか？", 2, 7410, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "七冠にも休息は\n必要なのです\nしばらくここで\n休ませてもらいますよ", 3, 7412, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なかなか気に入った…\nというのは\n誰にも秘密です", 3, 7413, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "薫風を思わせる\nこのさわやかな香り…\n悪くないセンスですね", 3, 7414, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "夏だからこそ\n冷え対策は\n重要なのです\n…とはいえ暑いですね", 3, 7415, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "私がどのような味が\n好きなのかは…\n当然秘密です", 3, 7417, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "夏を舞台にした\n小説は数多くあります\n彼が好きそうな本を\n何冊か見繕いましょう", 3, 7418, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "見た目も手触りも\n完璧に覚えました\nいつでも模倣できます", 3, 7420, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふむ…夏らしい\nクッションですね\nナイトプールに\n映えそうです", 3, 7421, 126601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "レイ様も格好良いけど\n騎士さんもなかなか…\nって、今の聞こえて\nませんよねっ？", 1, 7422, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "騎士さんはシンプルな\n服が似合いそうです！\n今度、一緒に\n見に行きましょう♪", 2, 7423, 105401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "最初はどうかな～って\n思ったけど…\n水着姿でも案外\n問題ないのよね…", 1, 7424, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "水着で飲みすぎると\nお腹が冷える、って\n言うけど…麦しゅわ\nなら問題ないわね！", 1, 7425, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "暑ければ暑いほど\nその後の麦しゅわは\nおいしくなるのよ…", 1, 7426, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "しっかりと仕事を\nこなしてから、\nしっかりと麦しゅわ！\nやっぱりこれね！", 1, 7427, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふふっ、デザインも\n着心地も最高ね\n奮発して用意して\n正解だったわ♪", 1, 7428, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "伝説の麦しゅわ、\n飲めるものなら\nまた飲みたいわね…", 1, 7429, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "二つ名に恥じない\n聖騎士として\n私…飲むわ！", 1, 7430, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この格好なら水に\n濡れても大丈夫！\nなんだけど、さすがに\n書類は濡らせないわね", 2, 7431, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そうやってじっと\n見られると…ちょっと\n恥ずかしいわ…", 2, 7432, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日もいい天気ね\nふふっ、あとで\nビーチに遊びに\n行きましょ♪", 2, 7433, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "水着姿も慣れると\n案外快適ね\nそうだ、キミも\n水着になっちゃう？", 2, 7434, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "例え水着姿であろうと\n聖騎士としての誇りは\n忘れてないわ！", 2, 7435, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミとだったら\n麦しゅわなしでも\n最高の夏のバカンスに\nなると思うわ♪", 2, 7436, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "仕事終わりの\n麦しゅわのために\n今日も一日\n頑張るわよ♪", 2, 7437, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今日のお昼は\nどうしようかしら…\nさ、さすがに昼からは\n自重してるわよ？", 2, 7438, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "さ、一日の疲れを\n洗い流すために…\n軽～く飲むわよ！", 2, 7439, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こうやって\n直に触れると\n肌触りの良さが\nよく分かるわ♪", 3, 7441, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今日もかわいいわね～\nどう？　今度\nお姉さんの一人飲みに\n付き合わない？", 3, 7442, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りね～…はっ！\n麦しゅわの匂いの\nアロマポットなんて\nあったらよくない？", 3, 7443, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こんな格好で火に\n当たってると焙られる\nスルメの気分が\nちょっと分かるわ…", 3, 7444, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…うん、\n結構おつまみにも\nむいてそうね～♪", 3, 7446, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "試験に使った参考書、\nたまには読み返して\nおかないとね", 3, 7447, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "ふふ♪\nいい手触りね～", 3, 7449, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "…はふう～…\nゴロゴロするのって\n最高ね～", 3, 7450, 126801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ん…やっぱり\nこの水着…\n大胆、なんじゃ…？", 1, 7451, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海でもお世話って、\nできるのかしら…？\n浮き輪代わりになる、\nとか…？", 1, 7452, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "～♪\nふふ…海に行く\n準備も、楽しい…かも", 1, 7453, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あうぅ…水着で\n歩いてると…お尻…\nすぐ食い込んじゃう…", 1, 7454, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "海では、はしゃいだ\nほうがいいのよね…\nわ、わー、い…♪\n…こうかしら？", 1, 7455, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたとなら…\n楽しい夏の思い出、\n作れる…気がするの…", 1, 7456, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "また来年も…\n再来年も…\nあなたと海へ\n行けますように…", 1, 7457, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "水着の着方を\n練習してるの…\n後ろ、変じゃない…？", 2, 7458, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海に行く支度…\n進んでるかしら…？\nお手伝い、する…？", 2, 7459, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ひ、日除けの準備は\n万全よ…\nずっと太陽の下に\nいたら…溶けちゃう…", 2, 7460, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "泳ぐ練習…\nこ、ここでするのは\n…さすがに変？", 2, 7461, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "人混みに入るのは\nまだ不安で…\nでも、あなたといれば\nきっと…大丈夫…", 2, 7462, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたのおかげで\n海の楽しいところを\nたくさん知ったわ…\nありがとう…♪", 2, 7463, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お出かけの日の朝は\n早い、のよね…？\nだから、ずっと\n起きていたわ…", 2, 7464, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "今頃ビーチの日差しは\n強いんでしょうね…\nそ、想像しただけで…\nめまいが…", 2, 7465, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ビーチの夜といえば\n花火って、聞いたわ…\nバン、って言わない\n花火…ある…？", 2, 7466, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "素肌にふわふわが…\n気持ちいい…♪", 3, 7468, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うふふ…\n一緒に海…行く？", 3, 7469, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふぅ…♪\n気分まで…\n晴れやかになるわ…", 3, 7470, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暑いような…\n寒いような…\n不思議な気持ちに\nなるわ…ね？", 3, 7471, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "泳いだ後には\nいっぱい食べたほうが\n体によさそう、ね…", 3, 7473, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ビーチの日陰で\n読書するのも…\n気持ちよさそう…♪", 3, 7474, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "これで合ってる…？\n遊び方わからなくて…", 3, 7476, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふわふわ…♪\n海の底にいるみたい…", 3, 7477, 126901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "恥ずかしい格好で\n室内を歩くこの快感\nクセになりそうです…", 1, 7478, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この水着…\nどうしてかポーズを\n決めたくなりますね…", 1, 7479, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海にはどんな生き物が\nいるのでしょう～\n胸が高鳴ります～♪", 1, 7480, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏は暑いですね…\nクウカの体が熱いのも\n夏のせい…ぐふふ…♪", 1, 7481, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ドＳさんと無人島に\n取り残されて…という\n妄想はかなりイイです", 1, 7482, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ドＳさんの\n欲望に満ちた眼差し…\nクウカ、受け止めます", 1, 7483, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "海に行くのが\n楽しみです…\nドＳさんと…ぐふふ♪", 1, 7484, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "「もっと過激な水着を\n見せてみろよ」なんて\nいけませんドＳさん…", 2, 7485, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "水着のままで\n踊ればいいのですね…\nドＳさんの望みなら！", 2, 7486, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ドＳさんの熱い視線を\n感じます…じゅるり…\nもっと見てください…", 2, 7487, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こんな格好のクウカを\n放っておくなんて…\nさすがですドＳさん！", 2, 7488, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海で水着といえば\n何かが起きる予感…！\nドＳさんの新たな攻め\n期待していますね…！", 2, 7489, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "恥ずかしいですけど\n頑張っちゃいました\nドＳさん…こういう\n水着、好きですか？", 2, 7490, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "こんな朝からクウカを\n水着に着替えさせて…\n本当にドＳさんは\n欲望に正直ですね！", 2, 7491, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "こんな昼間から\nドＳさんがヌルヌルの\n液体をクウカに～！\nえっ…日焼け止め？", 2, 7492, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ドＳさん…これから\nクウカと夜の海を\n見に行きませんか？\nきっと綺麗ですよ…♪", 2, 7493, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここなら妄想に\n集中できます～♪\nじゅるり～♪", 3, 7495, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こうもかわいいと\n妄想に登場させるのも\n気が引けます…", 3, 7496, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "クウカを昂らせる\nこの香り…！\nは！　ドＳさんの罠！", 3, 7497, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体を熱くさせて\n水着を脱がそうと！？\nテクニカルです…！", 3, 7498, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "クウカの口の中に\nたくさん…♪\n止まりません…！", 3, 7500, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "読書は心が穏やかに\nなりますね…！\nぐふふ…穏やかに…", 3, 7501, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "いい乗り心地です…♪\nあっ…普通に楽しんで\nしまいました…", 3, 7503, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "これは…\n妄想に役立ちそうな\n感触です…！", 3, 7504, 127001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "成長した自分に\nあわせて、もっと\nかっこいいポーズを\n研究するッス！", 1, 7505, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "これからも一緒に\n最高のヒーローを\n目指していくッスよ♪", 2, 7506, 100501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お父さん、娘の\n水着姿がそんなに\nうれしいの？", 1, 7507, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "怖い話を子どもたちに\n聞かせたら泣かれて\nしまいました…\n加減が難しいです…", 1, 7508, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海に行くと父が\n水着の女性ばかり\n追いかけて困ります…", 1, 7509, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "拾った貝殻で\n新しい占いでも\nはじめてみようかな", 1, 7510, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "貝殻を耳に当てると\n波の音が…あっ\nこれはダメです\nよくない声がします", 1, 7511, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この飲み物、スーッと\n体に沁み込んでくる…\nあの人にも\n教えてあげたいです", 1, 7512, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "強い日差しも騒がしい\n海も苦手なのに\nあの人となら不思議と\n楽しく思えるんです", 1, 7513, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "夏限定、水と氷を\n使った特別な占いは\nいかがですか？", 2, 7514, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "暑い日々にはやはり\n怪談ですね\n厳選フルコースで\nお聞かせします", 2, 7515, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "寒気がする？　それは\n霊ではなくかき氷の\n食べ過ぎですよ", 2, 7516, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日の占い、あなたの\nラッキーパーソンは…\n白い水着の女性です", 2, 7517, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あの、よければ\n日焼け止めを塗って\nもらえませんか？\n背中は届かなくて…", 2, 7518, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "海に行きませんか？\n二人きりで静かな\n砂浜を散歩したいです", 2, 7519, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "潮騒だけが響く朝の海\n心が落ち着きます\nこれから一緒に散歩に\n行ってみませんか？", 2, 7520, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "不思議です。どうして\n普通のご飯でも、海で\n食べると特別おいしく\n感じるのでしょう…", 2, 7521, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海に行きませんか\n今なら夜光虫が\n見られるかも\nしれませんよ", 2, 7522, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "夏は知らぬ間に体力を\n消耗しています\n適度に休息して\nいきましょう", 3, 7524, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "このぬいぐるみ…\n大丈夫です\n何も憑いては\nいませんよ", 3, 7525, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ほのかにお線香\nみたいな香り…\nなんだか\n落ち着きます", 3, 7526, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "人魂、鬼火\nセントエルモの火…\n炎を見ていると色々と\n連想してしまいます", 3, 7527, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹を壊さぬよう\n食い合わせには\nご注意ください", 3, 7529, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "これはいい\n怪談集ですね…\nつい読みふけって\nしまいます", 3, 7530, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "ふふ、こういうのに\n乗るとなんだか\n子どもに戻った\nみたいですね", 3, 7532, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "こ、これは…\nちょっとメルヘン\n過ぎて恥ずかしい\nですね…", 3, 7533, 127101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "本当に素敵なお家…♪\n騎士たちの人柄を\n感じられるようで…\n不思議と落ち着きます", 1, 7534, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "調度品をつい間食…\nという習慣がこちらの\n世界にはないのですね\n…気をつけないと", 1, 7535, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "手土産のお菓子は\nどちらに置けば\nよいでしょうか？", 1, 7536, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "まるでおとぎ話の中に\n入ってしまったかの\nよう…別世界とは\nよく言ったものです", 1, 7537, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お忍び…ふふっ♪\nときめく響きです\nなんだかお茶目で…\n密やかな印象が", 1, 7538, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ふわ…\nああ、ついあくびが…\n居心地がよすぎるのも\n困り物ですね…ふふ♪", 1, 7539, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士には不思議な力が\nあるだけでなく\n何者かの加護が\nあるようですね…", 1, 7540, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この『王家の装備』は\n少し気難しいのです\nわたし以外が触れると\nその…ビリビリっと", 2, 7541, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "子どもたちに新しい\n遊びを教わりました♪\nにーらめっこしましょ\nあっぷっ…ぷ～っ！", 2, 7542, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "実は憧れていたのです\n友人の家を訪ねると\nいう経験に…ふふっ", 2, 7543, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ぎるどはうす…\nぎるど活動の拠点だと\n管理協会？　の方に\nうかがいました", 2, 7544, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あなたは運命を\n信じますか？\nわたしは…信じます\nよい運命だけですが♪", 2, 7545, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もしわたしが本当に\n天使だったとしたら…\nどうされますか？\n…ふふ、冗談です♪", 2, 7546, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "パンケーキの香りで\n目覚める朝は\nとても良いものですよ\nぜひともお試しを♪", 2, 7547, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ひと休みの時間ですね\n食事にお昼寝…\nすべきことを行って\n英気を養いましょう", 2, 7548, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ休まれては？\n眠れないようであれば\n寝物語か子守歌でも\nふふ、遠慮は無用です", 2, 7549, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "すう………はっ！\n眠ってはいませんよ？\nいくら居心地が良い\nからといって…ふわぁ", 3, 7551, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "まあ、あいらしい…♪\nぜひわたしの寝室に\n招待させてください", 3, 7552, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんて、かぐわしい…\nオーブンからただよう\n焼き菓子の香りとは\nまた異なる魅力が…", 3, 7553, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "みなで暖をとりながら\n互いに語り笑い合う\n…心休まる時間ですね", 3, 7554, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食は心と体に\nゆとりを生みます\n…辛い食べ物の場合？\nそれは、その…", 3, 7556, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "こちらの世界の知識を\n蓄えておかなければ\nテーブルマナーに\nついてのページは…", 3, 7557, 126501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "新しい色の蛍光ペン\n買ったのよね\nこれで勉強が\n楽しくなるわ～♪", 1, 7559, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "学食のランチ、結構\nおいしいのよね～\n今度ペコリーヌに\n教えてやろうかしら？", 1, 7560, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふふ…扉に黒板消し\n仕掛けてるの…あいつ\n引っかかるかしら？", 1, 7561, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "部活するなら運動部も\n悪くないかもね～\n夕日に向かって\n突っ走ってやるわ！", 1, 7562, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "毎日窮屈な制服着て\n学生も大変ね～\n…ま、かわいいけど", 1, 7563, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつに貸したノート\n変な落書きとか\nしてなかったよね…？\n…その、相合傘とか…", 1, 7564, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "昨日の家庭科で\n作ったクッキー…\nあいつにどうやって\n渡そうかな…？", 1, 7565, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "宿題教えてって？\nしょうがないわね～\nじゃあ一緒に\nやりましょ", 2, 7566, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ、明日あたしたち\n日直当番よね？\nめんどい仕事は\nあんたに任せるわ～", 2, 7567, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "寮生活は楽しいけど\n就寝時間が早すぎよね\nいきなり消灯されると\nビックリするわ", 2, 7568, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "校則で禁止だけど、\nにけつでほうき通学\nとか青春っぽくない？", 2, 7569, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "制服って好きな人とも\n自然にお揃いになれて\nいいわよね…って別に\nあんたとって訳じゃ…", 2, 7570, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あんたネクタイ\n曲がってるわよ～？\nほら直したげるから\nこっち向いて？", 2, 7571, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよ～！\n今日も元気に登校よ！\n忘れ物ないようにね！", 2, 7572, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "午前の授業疲れたわ～\nしっかりお昼を食べて\n午後も頑張るわよ！", 2, 7573, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "うう…学校の怪談\n思い出しちゃった…\n…別に怖くないけど！", 2, 7574, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか～\n…気持ち良すぎて\n制服のまま\n寝ちゃいそうね…", 3, 7576, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいくて癒されるわ\n寮に持ち込んでも\n大丈夫かしら…？", 3, 7577, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "集中力の高まる香りで\n勉強の効率爆上がりね\n次のテストで\nいい点取るわよ～！", 3, 7578, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うう、ちょっと冷えて\n来たわね…\nスカートの下に\nジャージ穿こうかしら", 3, 7579, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐっ…もぐっ…\n食べとかないと教室で\nお腹なっちゃうわ～", 3, 7581, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "図書室で借りた本\n明日返却日なのよね…\n今日中に読むわよ！", 3, 7582, 127201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あいつに背中を\n預けるのもいい気分だ\nいつかは、全部…", 1, 7584, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "な、なんだよ？\nじっと見るんじゃねぇ\n尻尾が揺れちまうだろ", 2, 7585, 104301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "魔法の練習！\nむむむ～…\nそれっ…！", 1, 7586, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そだ！　これ着て\nルー学行こっかな？　\n制服自慢しちゃお♪", 1, 7587, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "赤点回避の魔法とか\nあったら最高じゃね？\n誰かうちに教えて～", 1, 7588, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "制服が一番映える\n場所ってどこだろ？\n教室？　遊園地？", 1, 7589, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ベンキョーつらたん…\n今度キャルっちに\n助けてもらお", 1, 7590, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "部活か…\nヒデサイと一緒に\nやったら楽し～かも♪", 1, 7591, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "男子の制服\nもにカワだった…\n今度ヒデサイに\n借りよっかな？", 1, 7592, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ちょすー、うちの\nさいきょー魔法で\nテンアゲしてあげる～", 2, 7593, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "九九って呪文ぽくね？\nほら、例えばヒチシ…\nヒチシ、なんだっけ？", 2, 7594, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ヒデサイセンセー\nうちにベンキョー\n教えて！", 2, 7595, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "学割マジ助かるー\nヒデサイ、一緒に\nどんどん使ってこー♪", 2, 7596, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今度ヒデサイに\nお弁当作ったげる\n屋上で一緒に食べよ♪", 2, 7597, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒデサイのバイブス\n上がる言葉教えてよ\nつらたんな時、うちが\nいっぱい言ったげるよ", 2, 7598, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ちょすちょす～\n今日も朝から\nバイブス十分♪", 2, 7599, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼どうしよっかな\nたまにはガッツリ\nいっちゃう系？", 2, 7600, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "やべ、宿題まだ\nできてないし…\nヒデサイ助けて～", 2, 7601, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "充電ちう～\n…ガッコーのイスも\nこれにして～", 3, 7603, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいし、\n癒されるし、キュン死\nしちゃうじゃん…！", 3, 7604, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "リフレッシュの\n魔法発見！\nいい香り～♪", 3, 7605, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ぽかぽかサイコー♪\n今日はもーずーっと\nここにいたいかも～", 3, 7606, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "超おいし～♪\n学食にあったら\n毎日リピする～", 3, 7608, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nねむみパない…\n続きはまた今度～", 3, 7609, 127301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今度は子どもたちも\nサラサリアに連れて\n行ってあげたいわ", 1, 7611, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "子どもたちから\nお姫さまみたいって\n言われちゃった♪", 1, 7612, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この剣…火を点けたり\nするのに便利なのよ\nコントロールも効くし", 1, 7613, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あのサラサリアの\nカラっとした暑さが\nちょっと恋しいわ…", 1, 7614, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "買ってきたお土産、\nお世話になってる\nみんなに配りましょ♪", 1, 7615, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたと一緒なら\nどこの国でだって\n暮らしていけそうね♪", 1, 7616, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今の事業を大きくして\nあんたと世界中の国を\n飛び回ったり…なんて\nすてきじゃない？", 1, 7617, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "サラサリアで食べた\n料理が恋しい…？\nもう…また今度\n作ってあげるわよ", 2, 7618, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今度旅行するなら\nどこに行こうかしら？\n希望があれば教えてね", 2, 7619, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "サラサリアの香辛料、\nランドソルでも\n人気が出そうよね\nいいビジネスの予感！", 2, 7620, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そんなにじっと\n見られるとさすがに\n恥ずかしいってば…", 2, 7621, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お嫁さんは憧れるけど\nお婿さんになって\nもらうのもありよね…\nあんたはどう思う？", 2, 7622, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "やっぱり、あんたには\nいつもあたしの隣に\n居てほしいな…", 2, 7623, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "陽射しが強くなる前に\n雑多な用事は\n片付けちゃいましょ", 2, 7624, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "サラサリアで食べた\n料理を再現してみたの\n味見してくれる？", 2, 7625, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "暑さに負けないように\n睡眠はちゃんと\n取っておかないと", 2, 7626, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こっちでもあっちでも\n忙しいのは変わらない\nわね…ちょっと休憩～", 3, 7628, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "サラサリアで見た\nぬいぐるみも\nかわいかったわね", 3, 7629, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お香って地域ごとの\n特色が出るわよね\nこの香りは…\nちょっと神秘的？", 3, 7630, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "砂漠地方も夜は冷える\nのよね。温かいものが\nあると安心するわ…♪", 3, 7631, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べ慣れた味って\nどうしてほっと\nするのかしら…", 3, 7633, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "今後の取引相手に\nなるかもしれないし\n向こうの文化も\n勉強しておかないと…", 3, 7634, 127501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "犯人はこの中にいる！\n探偵として一度は\n言ってみたいセリフさ", 1, 7636, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "助手くんの情報を\n仕入れておかないと…\n理想の私を、ずっと\n見ていてほしいからね", 2, 7637, 101401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "久々の長旅で\n里心がついちまったね\nしばらくランドソルで\nのんびりしようか", 1, 7638, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たまには違う服装\n違う得物を使うのも\n悪くないね", 1, 7639, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "サラサリアにいた時は\n砂まみれで大丈夫かと\n思ってたけど、今じゃ\n懐かしく感じるよ", 1, 7640, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "魔法の絨毯、あれは\n楽だし速いし便利\nだったねえ…土産に\n一枚欲しかったな", 1, 7641, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "砂上での戦いは\nなかなかいい鍛錬に\nなったね…今度は\n修行しに行くとしよう", 1, 7642, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "サラサリアの人たちも\n気のいい連中だったが\n元気にやってるかねえ", 1, 7643, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "旅の恥はかき捨てって\nいうけど、悪い旅じゃ\nなかったね。次は\nアイツとどこに行こう", 1, 7644, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この格好を冷やかしに\n来たのかい？\n生憎、もうすっかり\n慣れちまったよ", 2, 7645, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ギルドの連中に\n土産をわたしに\n行くところなんだ\n付き合っておくれよ", 2, 7646, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "久々に水場で\n釣りがしたいねえ…\nもちろんお前さんも\nくるんだろう？", 2, 7647, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おっと\nサラサリアの連中から\n便りが来てるよ\nさ、一緒に読もうか", 2, 7648, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "最近サラサリアの踊り\nを練習してるんだ\nあとで振付けを\n見ておくれよ", 2, 7649, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "なんだいお前さん？\n…なんだか若奥さん\nっぽいって？　まあ、\nそりゃあ、ねえ…", 2, 7650, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "いい時間だね\n日が昇りきる前に\nやることをすませ\nとかないと", 2, 7651, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼はどうしようかね\nサラサリア風の\n食事でもつくろうか", 2, 7652, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "さて、早めに寝ようか\n砂漠の夜は冷えるから\n…っと、まだ旅行中の\n気分でいたよ", 2, 7653, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "良い座り心地だ\nサラサリア宮殿の\n応接間を\n思い出すねえ…", 3, 7655, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ランプの魔神に\nあげたら喜ぶかねえ？\n次に会う時までに\n見繕ってみようか", 3, 7656, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この香り…\nサラサリア土産の\n香木かい？", 3, 7657, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "旅先での焚火を\n思い出すよ\nなんだかほっとするね", 3, 7658, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ふふ、慣れてる味も\nいいけど、むこうの\n味付けが懐かしく\nなっちまうね", 3, 7660, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\n千夜一夜物語か\nおもしろいもんだねえ", 3, 7661, 127601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "立派なギルドハウス♪\n帰る場所が素敵だと\n冒険に出るのも\n楽しくなりそうです♪", 1, 7663, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お掃除でも…と\n思いましたけど、\nさすがお兄さんのお家\nきれいにしてますね♪", 1, 7664, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わたしたちもいつか\n立派なギルドハウスが\n持てる冒険者に\nなりたいです…♪", 1, 7665, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わたし冒険者ですけど\n家を守ってお兄さんの\n帰りを待つのも\n悪くない…かも？", 1, 7666, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お菓子焼こうかな…♪\nちょっと多めに作って\nお兄さんにも\n食べてもらおうっと♪", 1, 7667, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "このお家、とっても\n大好きになりました♪\nだからその…もう少し\nいてもいいですか…？", 1, 7668, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄さんに\n感謝の手紙を書いて\n枕元に隠して\nおこうかな…♪", 1, 7669, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…お兄さん\nお暇なんですか？\nじゃあ一緒に冒険へ\n出かけましょう♪", 2, 7670, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お兄さんは苦手な食材\nとかありますか？\nあの、もしよければ\n今から手料理を…♪", 2, 7671, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "まったり過ごす\nお家時間もいいですね\n冒険者には羽休めも\n大事ですから♪", 2, 7672, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いつでもお兄さんを\n守れるように\nこの姿でいることに\n慣れておきますね…！", 2, 7673, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お兄さん眠そうです…\nちょっとお昼寝\nしちゃいましょうか♪\nはい、膝枕…♪", 2, 7674, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄さん怪我を…！？\nわたしが治療を…\nふー…ふー…", 2, 7675, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\n朝、元気に挨拶すれば\n幸せな一日が過ごせる\nそうですよ♪", 2, 7676, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはんの時間です\n…手がふさがってる？\nわかりました、じゃあ\nあ～んしますね♪", 2, 7677, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふわぁ…眠くなって\nきちゃいました…\nお兄さん…お泊りして\nいいですか…？", 2, 7678, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふにゃ～～…♪\nこんな姿、他の人には\n見せられません…♪\nもふもふ～～…♪", 3, 7680, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お兄さんこういうの\n好きなのかな～…\nふふっ、わたしも♪\nぎゅ～～～っ♪", 3, 7681, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アロマの癒し効果…\n上手くアレンジして\nみなさんの治療に\n活かせないかな～？", 3, 7682, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "は～気持ちいい～♪\n身体が暖まると\n心もぽかぽかです♪", 3, 7683, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うふふ、おいしい♪\nプレシアちゃんなら\n無限にぱくぱく～って\nしちゃいそうです…♪", 3, 7685, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本はわたしを\n知らない世界に\n連れていってくれる…\nまるでお兄さんです♪", 3, 7686, 126001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "話題の新刊…\nあの人も読んでるかな\n今度会う時、感想\n聞いてみたいな…♪", 1, 7688, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "うにゃっ…あ、熱を\n測ってくれたんですか\nありがとうございます\nバッチリ元気ですよ♪", 2, 7689, 103801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お兄の、けはい…\nん、みつけた\nぎゅ", 1, 7690, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "きょろきょろ\nここも\nぱとろる、するよ", 1, 7691, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "おうち\nにぎやか\nさみしく、ない", 1, 7692, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "きょだい、おにぎり\nきょだい、肉まん\nきょだい…お兄？", 1, 7693, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はっぴーちゃん\nどこ？\nお兄、たべた？", 1, 7694, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "くんくん…この、へや\nお兄の、におい\nすんでる\nすめる？", 1, 7695, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おそうじ、にがて\nでも\nれんしゅう\nきゅっきゅ", 1, 7696, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "みみ、さわり、たい？\nんー…だめ…\nむずむず\nなので", 2, 7697, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "くろぷれしあ\nかっこいい？\nん…あざます", 2, 7698, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お兄の、おうち\nきょうみ、ましまし\nたんけん\nするね", 2, 7699, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なでなで、される…と\nねむ…く…\nぶぅ…ぶぅ…ぶぅ…", 2, 7700, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "かみ、りぼん\nおてつだい\nよろ\nです", 2, 7701, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ここ\nすむ\nね？\nまいにち、いっしょ", 2, 7702, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ぐっもにん\nあさごはん\nあさごはん", 2, 7703, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お兄\nおつかれ？\nれっつ、まいぺーす", 2, 7704, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ひとりで、ねれる\nでも\nひとりじゃ、なくても\nねれる、よ…？", 2, 7705, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふかふか\nパパの、おなか\nみたい", 3, 7707, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こんにちは\nぷれしあ、です\nおともだち、なろ？", 3, 7708, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい、におい\nでも、お兄\nもっと、いい、におい", 3, 7709, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "とりま\nお肉、やこ", 3, 7710, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nむげん肉まん、も\nきぼう", 3, 7712, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ぜんぶ、よんだ\nもっと、ぶあついほん\nでも、いーよ？", 3, 7713, 126101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "幸せなクリスマスを\n過ごすため\nギルドハウスを\nきれいにしなくちゃ♪", 1, 7715, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "えへへ♪\n彼へのプレゼント…\n枕元にそっと\nおいておきましょう☆", 1, 7716, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "クリスマスといえば\n七面鳥の丸焼き…☆\nよだれを拭いて\nいざ準備です♪", 1, 7717, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "彼に用意した\nプレゼント…\n大きすぎて\nくつ下に入りません…", 1, 7718, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "プレゼントは\n貰う方も、贈る方も\nどちらも幸せを\n感じますね…☆", 1, 7719, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "夜景が見える\nレストランであの人と\nクリスマスデート…\n憧れちゃいますね☆", 1, 7720, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "プレゼントはわたし…\n恥ずかしいですけど\nこの贈り物、彼に\n喜んでほしいです…☆", 1, 7721, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "オーナメントを\nたくさん用意したので\n二人でツリーに\n飾りつけましょう☆", 2, 7722, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あはは、お腹\n空いちゃいました？\nパーティーまで\n我慢してください♪", 2, 7723, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ジングルベ～ル♪\nあなたも一緒に\nクリスマスソング\n歌っちゃいましょう♪", 2, 7724, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "サプライズプレゼント\nの用意をして…って\nあなた！？　い、今の\n聞いてませんよね…？", 2, 7725, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クリスマスの夜は\nパーティーしましょう\nできれば…その…\n二人っきりで…☆", 2, 7726, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなたと過ごした\n最高のクリスマス…\nずっとずっと心の奥に\nしまっておきますね", 2, 7727, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます！\n皆の願いが叶うような\n素敵な一日に\nしましょうね☆", 2, 7728, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ですね！\nディナーの買い出しが\n済んだら、少しお昼寝\nしちゃいましょうか☆", 2, 7729, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ就寝の\n時間ですね～\n枕元にくつ下の準備を\nお忘れなく～☆", 2, 7730, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふ～気持ちいい…☆\nお家でまったり過ごす\nクリスマスも\nいいですよね…♪", 3, 7732, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいですね～♪\nサンタさんからの\n贈り物でしょうか～？", 3, 7733, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "すう～…はあ～…\nすごく素敵な香り…\n炊き立てのご飯と\nいい勝負です…♪", 3, 7734, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かいですけど…\nあの日の山小屋を\n思い出して\n恥ずかしいですね…☆", 3, 7735, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "むしゃむしゃもぐもぐ\n止まりませんよ\nクリスマスですから\nむしゃむしゃもぐもぐ", 3, 7737, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "物語に出てくる\nサンタさんみたいに\nわたしも幸せを\n運びたいです…☆", 3, 7738, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "わっ！\nこ…これは素敵な\nサプライズプレゼント\nですね…☆", 3, 7740, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "これを着ればわたしも\n立派なサンタさんに\nなれますかね…？", 3, 7741, 127901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "ここが今のあたしの\n居場所ってやつです\nふふっ、なかなか\n悪くねー気分ですよ", 1, 7742, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "これからはボス代行\nとしてブイブイ\nいわせてやるです\nついてくるですよ！", 2, 7743, 106601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "陛下～♪\n貴女のクレジッタが\nおめかしして\nはせ参じましたわ～♪", 1, 7744, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "パーティーとは景気の\n良さを見せつける場…\n倹約などは\nもっての外でしてよ！", 1, 7745, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この天井の高さなら\n搬入できそうですわね\n陛下用の特注ケーキ♪", 1, 7746, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…ぶぇっくしゅ！\nふう…少し背中を\n開けすぎたかしら…？", 1, 7747, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ここは秘書の目も\n届きませんから\nチクりメモの心配も\nありませんのよね～♪", 1, 7748, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いくらでも二度見して\nよろしくてよ？\n本当にわたくしだと\n心から納得できるまで", 1, 7749, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "袖の下以外の贈り物も\nなかなかどうして…\n悪くないものですのね", 1, 7750, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こう見えてダンスの\nたしなみはありますの\nお相手してあげても\nよろしくってよ", 2, 7751, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ドレスはもちろん\n特注品ですわ♪\nもしや貸衣装だと\n思いまして？", 2, 7752, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "バッグの中身？\n仕事に必要なものと…\n心を潤わせるための\n宝石がいくつか♪", 2, 7753, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "やる気というものは\n仕事に必要な条件です\nいわばドレスコードの\nようなものですわね", 2, 7754, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "全ての仕事は自分の\n血となり肉となり\nお金にもなるもの\nなのです。経験談です", 2, 7755, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今年の教訓を活かして\n来年は更に素晴らしい\nクリスマスにして\n差し上げますわ！", 2, 7756, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます\n今日という稼ぎ時の\nはじまりですわよ！", 2, 7757, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "安くて早くておいしい\nそれがランチに必須の\n栄養素ですわ！", 2, 7758, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "宵越しの仕事は\n安眠の敵！\n熟睡したいのであれば\n今が勝負時ですわよ！", 2, 7759, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たまにはこうして\n休息を取ることも…\n…はっ！？\nドレスにシワが～っ！", 3, 7761, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…わたくしの勘が\n言っていますわ\nこの愛らしさ！\n爆売れ確・定！", 3, 7762, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りですわね…\nお金の匂いには\n敵いませんけれども♪", 3, 7763, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "……ハッ！？\n完全にボーッとして\nしまいましたわ…！\nぬくもり…恐ろしい！", 3, 7764, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "考えませんわ…\n考えませんわよ！\nカロリーのことはっ！", 3, 7766, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ビジネス本以外の本を\n読むのも、たまには\n悪くありませんわね…", 3, 7767, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "よくできていますわね\nこの絵本！\n子ども向けだと甘く\n見ていましたわ…！", 3, 7769, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "この視界の狭さ…\n思い出しますわね\nティッシュ配りの\nアルバイト時代を…", 3, 7770, 128001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふふふ…こっそり\nスイーツを食べる\nリノちゃん見～っけ♪", 1, 7771, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お姉ちゃんの抜き打ち\nお部屋チェック～♪\n…ケーキの食べこぼし\nこれはリノちゃんだね", 1, 7772, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この衣装は目立つから\nどこにいても弟くんに\n気付いてもらえるね！", 1, 7773, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "弟くん、協力して！\nリノちゃんにお勉強\nしなさいって圧を\nかけるんだよっ…♪", 1, 7774, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "絆の力を感じるよ\nこれならもっと万全な\n弟くんのお世話が\nできそうだねっ！", 1, 7775, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お姉ちゃんもたまには\nリノちゃんみたいに\n甘えてみようかな…", 1, 7776, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "弟くんとリノちゃん\nどっちも大切な\n私のきょうだいだよ", 1, 7777, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "分かってるよ♪\nお姉ちゃんの膝枕を\nご所望だねっ？　え？\n違う？　違わないよ？", 2, 7778, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "リノちゃんがね\nお姉ちゃんチョップを\n防ぐ妹白刃取りを\n訓練してるんだよね", 2, 7779, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お姉ちゃん頭突きは\n封印しないとね…\nだって、今使うと\n頭飾りで威力が…ね", 2, 7780, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふふっ♪\n目をつぶってても\n弟くんは見えてるよ\n…そこでしょ？", 2, 7781, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お姉ちゃんも\nリノちゃんみたいに\nかわいさいっぱいに\n振舞っちゃうぞ♪", 2, 7782, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "弟くんっ♪\nいつもお姉ちゃんの\n声が届く範囲にいてね\n…絶対だよ", 2, 7783, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう、弟くん！\nリノちゃんが起こして\nくれたんだね♪\n…先を越されちゃった", 2, 7784, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お姉ちゃんランチの\n時間だぞ♪\nさ、食べさせてあげる\nお口を開けて…♪", 2, 7785, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おやすみの時間だよ\n…弟くんは真ん中ね\n左右には私たち姉妹が\nいるから安心だよ♪", 2, 7786, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お姉ちゃんは全力で\nリラックスしてても\n弟くんの声一つで\nすぐにでも動けるよ♪", 3, 7788, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "リノちゃんこういうの\n好きそうだよね\n今度プレゼントして\nみようかな？", 3, 7789, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂いがするね～\nあれ？\nリノちゃんのケーキの\n甘い匂いも混ざってる", 3, 7790, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お姉ちゃんの\n弟くんへの愛も\n熱く燃えあがるね…！", 3, 7791, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "たくさん食べて\n栄養を補給して\nお姉ちゃん力に\n全て変換するよっ！", 3, 7793, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ことわざ辞典…\nリノちゃんにこれを\n読ませようかな", 3, 7794, 128101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "そろ～り、そろり…\nお姉ちゃんが居ぬ間に\nスイーツを～…♪", 1, 7797, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いつか\nお姉ちゃんに似合う服\n作ってみたいですね", 1, 7798, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あいたっ！？\nひらひらしたとこ\n踏んづけちゃいました", 1, 7799, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お姉ちゃんと\nお兄ちゃんの二人から\n勉強しろって圧力が～", 1, 7800, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "私の中にも秘めた力が\n眠っているはず…\nそう、妹パワーが", 1, 7801, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "私もお兄ちゃんを\n甘やかしてみたいです\n…お姉ちゃんみたいに", 1, 7802, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんの部屋を\nこっそり拝見～♪\nはっ！？　これは\nお姉ちゃんの視線…！", 1, 7803, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お姉ちゃん頭突きは\n大地を揺らす威力です\n私とお兄ちゃんは\n挨拶感覚で喰らいます", 2, 7804, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お姉ちゃんチョップは\n雲を裂く切れ味です\n早く妹白刃取りを\n完成させないと…", 2, 7805, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お姉ちゃんみたいに\n大人っぽく着こなす\nには一体どうしたら…", 2, 7806, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "弓のデザインも\nかわいいんですよっ♪\n常に持ち歩きたいです\nけど…危ないですよね", 2, 7807, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "きれいな服を着てると\nお姫さま気分に\nなれますね…あとは\n王子さまがいれば…♪", 2, 7808, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お兄ちゃんっ！\n私は褒められて伸びる\nタイプなのでもっと\nナデナデしてください", 2, 7809, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "妹モーニングコール♪\nお姉ちゃんより先に\n起こしに来れました！", 2, 7810, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ああっ、お姉ちゃん！\nお兄ちゃんにアーン\nするなんてずるいです\n私もしたいですっ！", 2, 7811, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おやすみの時間ですね\nえへへ、きょうだいで\n並んで寝るのって\n楽しいですよね！", 2, 7812, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "スイーツを食べた後は\nお腹を休めましょう～\n平気平気…ちゃぁんと\n運動もしますからぁ…", 3, 7814, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お姉ちゃんも\nこういうかわいいもの\n好きなんですかね", 3, 7815, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん…\nなんの匂いでしょうか\n新しいスイーツ？", 3, 7816, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "きょうだい３人\n肩を寄せて暖まるとか\nよくないですかっ？", 3, 7817, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "いつも元気な妹で\nいるためには\nよく食べるのが大事！", 3, 7819, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "なんか姉に関する本が\nちらほらと混ざって…\nこれお姉ちゃんの\n仕業ですね！？", 3, 7820, 128201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふんふんふ～ん\nお正月で世間は\n浮かれてるですねえ\nま、いいですけど♪", 1, 7823, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "は～、お正月は\nだらだらできて\n最高ですね\n…いつも通りですけど", 1, 7824, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ビッグな幹部は\nビッグなお年玉が\nもらえるはずです\n楽しみですね", 1, 7825, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度ドラちゃんに\nお年玉を持っていって\nやりたいですね", 1, 7826, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "そういえばアユアユと\n約束してたですよ…\nそろそろ出かける\nですかね", 1, 7827, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お年玉がもらえたら\n何に使うか…\n今のうちに\n考えとくです", 1, 7828, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "年神の報酬の駄菓子が\nたまってきたですね…\nガキどもにでも\n配っちまうですよ", 1, 7829, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あたしのレアな\n晴れ着姿、今のうちに\nしっかり目に焼き付け\nとくがいいですよ", 2, 7830, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お兄さんは今日も\nヒマそうですねぇ…\nしょうがないから\nかまってやるですよ", 2, 7831, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そういえばカヤぴぃ\n見なかったですか？\n喧嘩屋初売りセール\nとか言ってたですけど", 2, 7832, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お正月ならではの\n大きなシノギ…\nなにかないですかね？", 2, 7833, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いいとこに来たですよ\nさっき走ったら帯が\n曲がっちゃったです\n直すの手伝うです！", 2, 7834, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "年神の仕事ですか？\nこれからいくとこです\nお兄さんも一緒に\n来やがるですよ！", 2, 7835, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁあ…\nどうしたですか？\nお正月に早起きなんて\n無粋ってヤツですよ…", 2, 7836, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "小腹が減ったですね\n一緒におせちでも\nつつきにいくですよ！", 2, 7837, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜はあたしの時間\nと言いたいとこですが\n初夢のために早く\n寝とくですかね…", 2, 7838, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "正月は食っちゃ寝\nするのが仕事…\nって聞いたこと\nあるですよ", 3, 7840, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ふふっ、晴れ着の\nあたしの次くらいには\nかわいいですね", 3, 7841, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "なんかいい匂い…？\nよく知らんですけど\n晴れ着からも同じ\n匂いがしてるですね…", 3, 7842, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふ～あったまるです…\nお正月の唯一の弱点は\n寒いことですからね…", 3, 7843, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…正月太り？\nあたしには関係ない\n言葉ですね", 3, 7845, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あったあった…\nトーゴクには\nドラゴンの神宮も\nあるんですね", 3, 7846, 128301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お正月のトラブルも\nハツネちゃんが\nめでたく解決\nしてみせるのだ～！", 1, 7848, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そうだ、新年会に\nサプライズ大作戦を\nしかけちゃおう！", 1, 7849, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "イノリちゃんも\nカスミンも振袖姿が\nかわいかったな～", 1, 7850, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "シオリンに\nお年玉あげたいし\n彼にバイトを紹介\nしてもらおうかな？", 1, 7851, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "今度はどんな凧を\n飛ばそうかな？\nみんなが驚くような\n凧がいいよね～", 1, 7852, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ひらめいた！\n彼への年賀状は\nきらーんっ☆って\n感じにしよう！", 1, 7853, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "来年も彼の隣で\n初日の出が\n見られるといいな～", 1, 7854, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日はキミが\nギルドハウスに来る\n予知夢を見たんだよ～\nふふ、正夢になったね", 2, 7855, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この振袖どうかな？\nすっごくかわいいよね\nえへへ、ありがとう～", 2, 7856, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ハツネちゃんおみくじ\n開始！　きらーんっ☆\nキミは大吉なのだ～\nどう元気出たかな？", 2, 7857, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度エルフの森にある\n薬草を使って七草粥を\n作ろうと思うんだ～\nぜひ食べてほしいな♪", 2, 7858, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お正月っぽい遊びを\n色々と用意したのだ～\nたまにはギルドハウス\nでゆっくり過ごそうよ", 2, 7859, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もしかして眠たいの？\n…じゃあ、また膝枕\nしてあげてもいいよ？", 2, 7860, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "いっぱい寝たから\n元気いっぱいだよ～\n今日もがんばろう！", 2, 7861, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼だね～\nおせちがあるから\nキミも食べるでしょ？", 2, 7862, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "そろそろ寝る時間だね\n今日はどんな夢を\n見られるかな～", 2, 7863, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いい座り心地～\n寝正月で過ごすのも\n最高なのだ～", 3, 7865, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいな～\n癒されてぐっすり\n眠れそうだよ～", 3, 7866, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香り～\nリラックスすると\n眠たくなっちゃうよ…", 3, 7867, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポカポカいい気持ち～\n初日の出の温もりを\n思い出しちゃうな～♪", 3, 7868, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ、おいし～\nでもいっぱい食べたら\n眠くなっちゃった…", 3, 7870, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ\nお正月料理も\n色々あるんだね～\n今度作ってみようかな", 3, 7871, 128401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "最近カレを見てたら\n何故かおいしそうに\n思えてくるんだよな…", 1, 7873, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "手握っててくれるか？\nじゃないとオレ…\n力が抑えきれない…", 2, 7874, 106501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "つかの間の平和を享受\nしながらぬくぬくと\n読書に耽る…\nふふ、最高だね", 1, 7875, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お正月飾りなんて\n置いたらはしゃいでる\nように見えるかな…？", 1, 7876, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ま、まずい…\n一人遊びしすぎて\nお正月遊びをほぼ\n極めつつある…", 1, 7877, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ミステリーは\n時と場所を選ばない\nつまり…新年でも\n探偵は休まないよ！", 1, 7878, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お世話になった人に\n年賀状でも書こうかな\n助手くん、喜んで\nくれるかな…えへへっ", 1, 7879, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "絵馬に願い事を書こう\n助手くんと一緒に\nいられますように…♪\n…は、恥ずかしいな", 1, 7880, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "助手くんはもっと\n派手な着物のほうが\n好みだったかな…？\nき、気になる…", 1, 7881, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "やあ。助手くんも\nお正月休みを\n持て余してるのかい？\nふふ、似た者同士だね", 2, 7882, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "助手くん助手くん！\n凧あげしにいこう！\n…そ、捜査の一環で", 2, 7883, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "着物は転びそうで\n怖いんだよなあ…\nお、押さないでね？\nフリじゃないよ！？", 2, 7884, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ひ、人目を憚る\n本を読むなら\nみんなが帰省中の今！\nはっ！　助手くん！？", 2, 7885, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ね、ねえ…助手くん…\n一緒に初詣いかない？\nあ、いや！　深い\n意味はないんだけど！", 2, 7886, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あはは…助手くんと\n一緒だと家でごろごろ\nしてるだけでも\n楽しいや…♪", 2, 7887, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁ～…\nお正月休みのおかげで\n昼夜逆転中だよ…", 2, 7888, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お正月も依頼が\nひっきりなしだね\nさあ、街へ出よう！\nもちろん君も一緒にね", 2, 7889, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "も、もっと\n近くにきてもいいよ？\n冬の夜は…寒いからね", 2, 7890, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ううぅ～…！\nこのままじゃ\n寝正月だぁ…！", 3, 7892, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "みんなが帰省中でも\nこれがあれば\n寂しくない…かな", 3, 7893, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "うーん…♪\nお正月休みの\nリフレッシュに\nちょうどいいや♪", 3, 7894, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふぅ…あったまるな\n冬は寒いから\n助かるよ…", 3, 7895, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うーん、おいしい♪\n読書のお供に\nちょうどいい", 3, 7897, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "時間に余裕があると\n読書が進むよ\nいざ、本棚読破だ♪", 3, 7898, 128501);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "この新しい力…\nさらに使いこなせる\nようになるには…", 1, 7900, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "私に眠る属性の力…\n風の力以外には\nどんな力があるのかな", 1, 7901, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今の私なら\nどこまでいけるのか…\nやれるだけ\nやってみよう", 1, 7902, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "風の力の制御…\n段々とコツが\n掴めてきたな", 1, 7903, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "風の力か…\n応用の幅は広そうだ\n何ができそうか\n色々試してみよう", 1, 7904, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "今度、私とキミで\n料理対決でもする？\n簡単には負けないよ", 1, 7905, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この胸に溢れる\n温かな気持ちは…\nきっと彼への…", 1, 7906, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "一段と剣技が\n冴えてきたような…\nいや…油断禁物だ", 2, 7907, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "かっこいいって？\nありがとう…そんなに\n真っすぐ褒められると\n照れてしまうな…", 2, 7908, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "どれほど厚い壁が\n立ち塞がろうと\n打ち破ってみせる", 2, 7909, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "手が空いてるなら\n剣の稽古に少し\n付き合ってくれるかな", 2, 7910, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "試練を乗り越えて…\n私の中にあるものが\nはっきりと分かったよ", 2, 7911, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "キミから流れてくる\n力の温かさ…これが\n私たちの絆なんだ", 2, 7912, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝だよ、そろそろ\n起きる時間だ\nそれとも私に起こして\nほしいのかな？", 2, 7913, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼食は私が作るよ\nリクエストはある？\nできる範囲で応えるよ", 2, 7914, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おやすみ。また明日も\n一緒に冒険しよう\n約束だよ？", 2, 7915, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休める時は休む…\n戦い続けるには\n必要なことだからね", 3, 7917, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "心の安らぎの大切さ…\nそれを知れたのは\nキミたちのおかげだね", 3, 7918, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "気持ちが落ち着くな…\nこの香り、風の力で\n纏えたりしないかな", 3, 7919, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖まった空気の流れ…\n以前より風の変化に\n気づくようになったな", 3, 7920, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "この味付け…\n今度試してみようか\n味見は任せたからね", 3, 7922, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "心技体、すべてを\n鍛えるには座学も\n必要だからね", 3, 7923, 128801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "瞑想するのに\nいいところはあるかな\n集中できて…お昼寝は\n我慢できるところ", 1, 7925, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここにはあったかい\n空気が流れてるなぁ…\nみんなが受け入れて\nくれるおかげだね", 1, 7926, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "まるで心の中に\n光が満ちてるみたい…\nこの気持ち、みんなに\nおすそ分けしたいな♪", 1, 7927, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この衣装は属性の力を\n反映しやすいんだよね\nキラキラしてるのも\n納得だよ", 1, 7928, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "エルフの里のみなさん\n元気かなぁ…\nまた会いに行きたいな", 1, 7929, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "まだ変身できてる…\nわたしと騎士クンの\n修行の成果\n出てるなぁ…ふふっ♪", 1, 7930, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この服を脱いだら\nどうなるのかな…\nた、試す勇気は\nないけど…", 1, 7931, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふぅ…あ、騎士クン\nちょうど瞑想してたの\n一緒に…する？", 2, 7932, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "不思議だけど\nいつの間にか\n出たり消えたりするの\n…背中の輪っか！", 2, 7933, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この服って肌触りが\nとってもいいんだよ\nさ、触ってみる？\nスベスベだよ？", 2, 7934, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "アストラルの力…\nすごく持続できてるね\n修行の成果が出てるよ", 2, 7935, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この力があれば\n暗いところで\n落とし物をしても\n見つけやすいかも…？", 2, 7936, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "冒険の準備なら\nできてるよ\nいつでも声をかけてね\n…楽しみにしてる！", 2, 7937, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう騎士クン\n一緒にお散歩とか…\nどうかな？", 2, 7938, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯のあとの\n瞑想って難しいんだよ\n眠くなっちゃって…", 2, 7939, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜ふかしさんは\nほどほどにね？\n一日頑張った自分を\n休ませてあげないと", 2, 7940, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "のんびりしてたら\nケーキが食べたく\nなっちゃうなぁ…\nでも太る…よね…？", 3, 7942, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わあ、かわいい…！\n見てるだけで\nにやけちゃう…♪", 3, 7943, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これは…花の香りかな\n知ってる花かも…？\n当ててみようっ", 3, 7944, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかいと\nどうしてこんなに\n落ち着くんだろう…", 3, 7945, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べ過ぎたらお腹が\n目立っちゃうかもって\n分かってるのに…！\n止められないよ～っ！", 3, 7947, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "こ、恋の精霊とか\nいたりするのかな…？\nはっ！　ダメダメっ！\n実力で頑張らないと", 3, 7948, 128901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お部屋の中でも\n修行、修行っ♪\nでも燃やさないように\n注意しなきゃだね", 1, 7950, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うーん…この衣装\n厚着か薄着か\nどっちなんだろう…？", 1, 7951, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いつもの肉球がない分\nお片付けしやすいな♪\n騎士くんのお部屋\nピカピカにしとこー！", 1, 7952, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お休みは騎士くんと\nＢＢＱに行きたいなー\nあたしと一緒なら\n火の心配はいらないよ", 1, 7953, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "この姿ならもっと\n人を助けられる…！\nえへへっ！\n燃えてきたーーっ！", 1, 7954, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士くんが帰ったら\nアイラみたいな笑顔で\nお疲れさまさまって\nお出迎えしよっと…♪", 1, 7955, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この姿の時、いつも\n胸が熱く燃えてるのは\nずっと騎士くんのこと\n考えてるからかな…？", 1, 7956, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士くん騎士くん！\nあたしに触れると\nやけどしちゃうよ…？\nなんちゃってー♪", 2, 7957, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おっ、騎士くん\n修行に行きたいの？\nえへへっ、いいねー♪\n二人で燃えちゃおー！", 2, 7958, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そうだ騎士くん\nじゃんけんしよっか？\nグローブ外してるから\nチョキも出せるよっ♪", 2, 7959, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この姿でいられる時間\nすごく増えてきた…！\nえへへ！　あたしたち\n修行の成果出てるね！", 2, 7960, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "じっと見つめないでよ\n顔が真っ赤に…やば！\nほんとに顔から\n火噴いちゃいそう…！", 2, 7961, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "火には強くなれても\n騎士くんに触られた\nほっぺはずーっと\n熱くてたまんないや…", 2, 7962, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよー騎士くん！\n今日も一日\n燃え滾っていくよー！\nファイヤーッ！！", 2, 7963, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "騎士くんお昼だよ！\nちゃんとご飯食べて\n午後からの修行も\n乗り切ろうねー！", 2, 7964, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日もお疲れさま！\nそうだ、寝る前に\nキャンプファイヤー\n囲んじゃおっか♪", 2, 7965, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぼふーんっ！\nえへへ、気持ちいい…\n修行の前に\nちょっと休憩ー♪", 3, 7967, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいな～♪\nなでなでなでなでなで\nなでなでなでなでっ！\nあははっ、摩擦熱！", 3, 7968, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ん～いい香り♪\n少し熱したほうが\n香りが広がるね…って\n蒸発しちゃった！！！", 3, 7969, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "外でも自分の火で\nあったまれるけど\nお部屋でぬくぬく\nするのが一番だよね♪", 3, 7970, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐっ！\nお腹が減っては\n人助けはできずっ！\nもぐもぐもぐっ！", 3, 7972, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nなるほどなるほど…\n…これが上手な\nＢＢＱのやり方か…", 3, 7973, 128701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "…壁も扉も柱も\n全て記録で見たまま\n本当に…来ているのね", 1, 7975, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "…騒がしい場所\n騎士クンが受け入れて\nくれるのをいいことに", 1, 7976, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここが…騎士クンの\n守りたかった場所\n騎士クンの思い出が\n詰まった場所…ね", 1, 7977, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "視線を感じる…\nこちらの様子を\n探るような…心の動き\n取るに足らないけれど", 1, 7978, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…そこかしこで…\n言葉にもしたくない\n相手が過ごしていた\n記録を思い出す…", 1, 7979, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "人は多いけれど…\n雪深い山中よりは\n過ごしやすい…か", 1, 7980, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "自覚したことは\nあまりなかったけれど\nひどく…諦めの悪い女\nなのかもしれない", 1, 7981, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お招きありがとう\nそれで…何をして\nいればいい…かな？", 2, 7982, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここは…明るいね\nわたしの城と比べると\nなんだか眩しいくらい", 2, 7983, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "仮面はもう必要ないよ\nだって…わたしの顔を\n騎士クンに見て\nもらえなくなるから", 2, 7984, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "騎士クンさえよければ\nわたしの城に専用の\n部屋を用意するよ\n…いつでも", 2, 7985, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "…騎士クンのマント\nまた貸してほしいな\nきれいに使うから\n…だめ？", 2, 7986, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつか二人の願いが\n重なり合えるって…\n信じているね\n…いつまでだって…", 2, 7987, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはよう、騎士クン\n…昨日は夢の中で\nお話ししすぎちゃって\nごめんね。ふふっ", 2, 7988, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お腹は…空いてない？\n食べ物はないけれど\n空腹を忘れる魔法なら\nかけてあげられるよ", 2, 7989, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "騎士クン…\nまだ、眠らないの？\n…そう。それなら…\nわたしも起きているね", 2, 7990, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "肩の力を抜くには…\nまだ時間がかかりそう\nきっと…騎士クンと\n二人きりなら別なのに", 3, 7992, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぺんぽこりん…\nそう、確かあれも\nこんな感じだった…", 3, 7993, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "花の香りは…好き\nつかの間\n心を穏やかに\nしてくれるから", 3, 7994, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あたたかい…けれど\n騎士クンの優しさに\n比べれば、まだまだ", 3, 7995, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "おい、しい…？\nこの感覚が、それ？\nなぜか…納得できる", 3, 7997, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "情報を入手するには\nわざわざ本を開く\n必要があるだなんて…\nプレイヤーは面倒ね", 3, 7998, 129001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "メルクリゾートか…\n良い記憶はないな\nよし忘れよう", 1, 8000, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "知性の戦士ユニ！\nその恐るべき筋力！\nふおお！　うにゃー！", 1, 8001, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぽーん！\n石用の水着ください！\nセクシーロゼッタが、\n渚の視線を独占です！", 1, 8002, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "学院から奨学金を\n勝ち取るより某財団を\nだまくらかした方が\n早い気がしてきたな…", 1, 8003, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "わんつぅ、わんつぅ…\nんぎゃあ足攣ったー！\nおのれカルミナとやら\n絶対に許さん！", 1, 8004, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ところで…なぜぼくは\nプールでもないのに\n水着のままなんだ…\nおのれ世界め！", 1, 8005, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼と二人で撮った動画\nうう、凝視に耐えん…\nなんだこのムズ痒さは", 1, 8006, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なに？　水着姿で\n寒くないのかだと？\n普段からもっと薄着の\n娘が沢山いるだろう", 2, 8007, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "シノブ君にメリゾの\n招待状を送ったのだが\n御尊父の暴走を\n心配していたな…", 2, 8008, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミミ君らにメリゾの\n招待状を送ったのだよ\n迎える準備をせねば…\nおしゃぶり持ってる？", 2, 8009, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "本質の賢者…？\nいや元気にしているが\nなぜ君がぼくの身内を\n知っているんだ…？", 2, 8010, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "水着が似合ってる？\nな、なんだね突然…\nやめたまえよふひひ…", 2, 8011, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "今度は夏にメリゾへ\n行きたいものだ\nむろん君も一緒だぞ", 2, 8012, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ぐああっ、朝陽が…！\n朝陽が昇っている…！\n夜行性ユニ死んじゃう", 2, 8013, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "はぁ…もう昼か…\nそろそろ寝ないとな\n規則正しい生活を\nしないと不健康だ…", 2, 8014, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ひゃっはー、夜だー！\nオレたちの時間だぜ！\nふおおブチ上がり～！", 2, 8015, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これは…ぼくにここで\n寝ろということか？\n一向に構わんが…", 3, 8017, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "きゃっきゃっ！\nこれかわい～！\n…よし、今日も\n子供の擬態完璧だな", 3, 8018, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふむ、良い香りだ\nだがそれだけか…\nとくに精神高揚効果は\nないのか…ちぇー", 3, 8019, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "火を見ていると…\n魔導罐を思いだすな…\nかに座、元気かな…", 3, 8020, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ええい、\n固形食物はいらん！　\nポーションを出せ！", 3, 8022, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "やはり書は文系に限る\nなんと心地よい筆致…\nぐああ突然理系文が！\nひぃ目が理系になる！", 3, 8023, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "ほああ～！\n知性の海上騎士ユニ！\nこれは新たな可能性！", 3, 8025, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "これは…なんだ？\n何が面白いんだ？\n難しいな…", 3, 8026, 129301);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "大切な人と過ごす\n正月の思い出、か…\n昔の私だったら\n考えられなかったな", 1, 8027, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "叶えたい願いなら\nたくさんあるよ\nそれでも一番を選ぶ\nなら、やはりキミと…", 2, 8028, 108901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "神殿にあった\n恋愛おみくじ…\n引いてみようかな…", 1, 8029, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "騎士クン。来年も\nまた一緒におみくじ\n結ぼうね。約束だよ", 2, 8030, 108801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "今度は騎士くんと\n一緒にうつった写真、\nおばあちゃんに\n送ろうっと♪", 1, 8031, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あ、騎士くん！\n今年も…ううん\nこれからも、よろしく\nおねがいします♪", 2, 8032, 108701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "旧校舎の地下牢…\n真冬のサマー計画…\n等身大のＰＲ…\nうッ、頭が…！", 1, 8033, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "暇だし鏡でも見るか。\nお、いい腹筋育って…\nあ？　何見てんだコラ", 1, 8034, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "オレは金色の疾風！\nんん…なんか違うな。\n我が名は金色の…\nあ？　何見てんだコラ", 1, 8035, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "モニカとユニ先輩って\n口調と身長似てるけど\n子供扱いに対する\n反応は真逆だよね…", 1, 8036, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "シオリン元気かな…\n昔くちゃくちゃに\n撫でくり回して\n嫌がられたっけなァ…", 1, 8037, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "べつにいんだけどさ…\nあんたの知り合いって\n普段から水着みたいな\nカッコの女多くない？", 1, 8038, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "そだ、弟らがあんたに\n会いたがってたンだ。\n暇だったらいつでも\nウチ来てやってよ", 1, 8039, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "特別講座は色々あった\nけど…メリゾ自体は\nまあ悪くなかったよね", 2, 8040, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "水着と合わせる小物に\nセンス出るよね、\nって話をミィコ先輩が\nしててマジわかりみ", 2, 8041, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "水着のミフユねえさん\nやっぱ仕上がってたね\nあれが竜殺しの体か…\nバリかっけーな…", 2, 8042, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "はにょんっ！？\nや、だからさ…\n後ろから声かけんな、\nつってンじゃん…", 2, 8043, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "メリゾの特別講座が\n上手くいったのも\n敏腕カメラマンがいた\nお陰だよ。ありがとね", 2, 8044, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あ？　この水着が？\n似合っ…え、なんて？\nごめ、聞こえんくて。\nもっかい言ってみて", 2, 8045, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "もう朝とかマジないわ\n昨日二人に付き合って\nオールでカラオケだよ", 2, 8046, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "はぁ授業行かなきゃ…\n真っ昼間から勉強とか\nマジつらたん過ぎ…", 2, 8047, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日これから夜勤で…\nいやバイトちゃーくて\nボランティアの話よ？\n校則違反よくない", 2, 8048, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "うわ、ふっかふか…\nオニほど安らぐわ…\nやば、ユニってくる…", 3, 8050, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "うちも妹いりゃ\nこーゆーのもなァ…\nま自分用でもいいか", 3, 8051, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふーん…\nいいじゃんこの香り\n抜群に嗅げるわ", 3, 8052, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "うちン家のルーツの森\n大火災でなくなった\nらしンだよね…\n生まれる前の話だけど", 3, 8053, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "何コレありがてぇー\n食料ほくほく過ぎて草\n米ガチで尊いわァ…", 3, 8055, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "いいけど、なんでうち\n水着で本読んでンだよ\nどーゆープレイだよ", 3, 8056, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "金色の海上騎士クロエ\n推して参る！　覇ァ！\nあ？　何見てんだコラ", 3, 8058, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "何コレ、貝の椅子？\nどーやって遊ぶんだ…\nいや座って終わりか…\nまァそりゃそーか…", 3, 8059, 129401);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さてと…\n明日の訓練メニュー\n考えねえとな", 1, 8060, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "また新入りの女子に\n弁当もらっちまった…\nありがたく食うけどよ", 1, 8061, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "種族なんて関係なく\nみんなが力を合わせて\nランドソルを守る…\nいい時代になったよな", 1, 8062, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "誰にだって長所はある\n新入りのいいところを\n見つけてやるのも\n教官の仕事だ", 1, 8063, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "厳し過ぎても\n甘過ぎてもダメ…\n教官ってのは難しいぜ", 1, 8064, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "戦いが苦手な新入りを\nどうフォローするか…\n後であいつと\n相談してみるか", 1, 8065, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あいつは優し過ぎて\n戦いに向いてねえ\n…そういう甘さ\n嫌いじゃねえけどな", 1, 8066, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "強くなる近道はねえ\n地道な鍛錬あるのみだ\nさ、訓練始めるぞ！", 2, 8067, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "新入りにも\nいつも言ってるが…\n装備の手入れは\n念入りにしろよな？", 2, 8068, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "座学も受けてえのか？\nいい心がけだな！\nなんでも教えてやるよ\n…魔法以外ならな", 2, 8069, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新入りたちがよく\n恋バナしててな…\nお、おまえは…誰か\n気になるやついるか？", 2, 8070, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なあ、ストレッチ\n手伝ってくれねえか？\n訓練前にしっかり\n筋肉ほぐさねえと…", 2, 8071, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ずいぶん頑張って\n鍛えたよな、おまえ\nよし！　ご褒美に\nお菓子作ってやるよ♪", 2, 8072, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "訓練日和だな！\nさぁて…まずは\n走り込みといくか！", 2, 8073, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "昼飯はしっかり食えよ\nでなきゃ、\nこの後もたねえぜ？", 2, 8074, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "とっくに消灯時間だ\nさっさと寝な？\n明日も早いんだからよ", 2, 8075, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休むのも訓練のうちだ\n今はのんびり\nさせてもらうぜ", 3, 8077, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "いい面構えだ\n気に入ったぜ！\nあたしの班に入るか？\n…なんてな♪", 3, 8078, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "…いやされる匂いだな\n新入りたちにも\nすすめてみるか…", 3, 8079, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったけえからって\n寝ないようにしねえと\n教官としての\n威厳に関わるからな…", 3, 8080, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事も訓練の一環だ\nとはいえ食い過ぎには\n気をつけねえと…", 3, 8082, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "トーゴクの剣術…か\nなにか訓練に\n活かせるかもしれねえ", 3, 8083, 129801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あのおかたに近付く\n不埒な輩には、特別な\n訓練で地獄を見て\nいただきましょう", 1, 8085, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これだけ広ければ\n多少派手に\n動き回っても\n問題なさそうですね", 1, 8086, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…今誰か私を\n「鬼」教官と\n呼びませんでしたか？", 1, 8087, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "新しく開発したこの薬\n誰か試してくれる人は\nいませんか？", 1, 8088, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "厳しくすれば投げ出し\n優しくすればサボる\n人というのはどこまで\n度し難いのでしょう", 1, 8089, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "はじめましょう\nあのおかたの心を\n射貫くための\nシミュレーションを", 1, 8090, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あらゆる苦難と\n忌々しい女から守る\nためにも、私自身も\n鍛えておかねば", 1, 8091, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あなた様、そんなに\n見つめられると…え？\nエリコはカッコいい？\nええ、当然ですとも", 2, 8092, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "不調があればすぐ\n報告してください\n体のケアも教官の\n大事な役目ですので", 2, 8093, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しい訓練器具の\n使い心地はどう…え？\n重すぎる？　これでも\n軽くしたのですが…", 2, 8094, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "運動後には特製の\n栄養ドリンクをどうぞ\nクスクス、何も\n入れたりしてませんわ", 2, 8095, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "よくがんばりました\nあなた様。あぁ…\nお疲れになったお顔も\n素敵ですわ", 2, 8096, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "あなた様、二人だけの\n遠征訓練へ\nまいりましょう。\n既に準備万端ですわ", 2, 8097, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "まだ眠いですか？\nならばストレッチで\n体を痛めつ…ではなく\nほぐしていきましょう", 2, 8098, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼はお弁当をご用意\nいたしました。量も\nスタミナも増し増し\n残さず食べてください", 2, 8099, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "よい睡眠こそ健やかな\n体に不可欠。ですので\n私が寝ずの番をさせて\nいただきますわ", 2, 8100, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休憩用に使おうと思い\nましたが、心地よくて\n立てなくなって\nしまいますわ…", 3, 8102, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "中に重しを詰めれば\n愛でながら運動が\n可能ですわ", 3, 8103, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "香りでリラックスさせ\n同時に暗示を\nかけてみましょうか", 3, 8104, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "…くっ、眠気を誘う\nこの暖かさ…\n油断も隙もありません", 3, 8105, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "主食はこちらで十分\nまかなえますわね\nそれでは私はおかずを\n作りましょう", 3, 8107, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "まあ、実用書の類も\n揃っているのですね\nとても助かりますわ", 3, 8108, 129901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "……（そわそわ）", 1, 8110, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここに寄らずの花陣…\n作ったらダメですよね", 1, 8111, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "部屋の隅が\n落ち着きます\nそれか、陽の当たる所", 1, 8112, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "身を隠せる場所が\nあると…\n助かるんですけど", 1, 8113, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "複雑な造りの家ですね\n触って壊れたり─\nしませんか？", 1, 8114, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "出入りするひと\nみんな、笑顔…\n…変わった家ですね", 1, 8115, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この家なら安全─\nかもしれません\n魔物が出ないので", 1, 8116, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "これも、視察の一環\n遊びに来たわけじゃ\nないです", 2, 8117, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "長話─苦手です\n疲れるので…\nふぅ…", 2, 8118, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ここで友達を作れと\nネアさんが…\nそう、言われても…", 2, 8119, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "世話をするのは\n得意です\n…花の、ですよ？", 2, 8120, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "媛へのお土産を\n探してるんですけど…\n…貴方のおすすめ、\n聞いておきます", 2, 8121, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "平和でのんきで…\n貴方らしい家です\n一応、褒めてます", 2, 8122, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "花に、お水─？\n…いりません", 2, 8123, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "日が高いうちは\nむやみに外へ出ません\n面倒事、多いので…", 2, 8124, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜番。私がします\nあまり眠らない\n性質なので…", 2, 8125, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここなら根を張れる\nかもしれません\n…張りませんけど", 3, 8127, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こんなにやわな体じゃ\n身を守れませんよ─\n…あ。生き物じゃ\nないんですね", 3, 8128, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "花みたいに─\nいい匂い、です", 3, 8129, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "火を見てると、\nジオ・ゲヘナを\n思い出します…ふぅ", 3, 8130, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食事も立派な戦支度\n媛が言ってました", 3, 8132, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "知識も武器の一つだと\n媛が…でも、\nこれでどうやって…？", 3, 8133, 129601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "天気もいいしお花畑に\nピクニックでも\n行こうかな♪", 1, 8135, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ、どこからか\nお花の匂いが…\nいい香りですね", 1, 8136, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "新しいシャベルとか\nじょうろもほしいなぁ\nお小遣いしっかり\nためないとね", 1, 8137, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お花飾りたいけど\n花瓶はどこかな…\nあとであの人に\n聞いてみよっと", 1, 8138, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お花の観察日記\n書かなきゃ\n日々勉強は\n欠かせませんよ", 1, 8139, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "衣装にお花を足して\nみたけど、あの人\n気付いてくれるかな？", 1, 8140, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この花冠、上手に\n作れたかも…\n日頃のお礼にあの人に\nあげようかな…", 1, 8141, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あなたは何のお花が\n好きですか？　ほら、\n一応知っておいたら\n役に立つかもですし", 2, 8142, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "そのお花、乱暴に\n扱っちゃダメですよ\n花粉が服について\nとれなくなりますから", 2, 8143, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "土いじりしたから\n服が汚れてますよ\nはたいてあげますから\nじっとしててください", 2, 8144, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そんなにすぐに芽は\n出ませんよ\nまあ、楽しみなのは\n私も同じですけど…", 2, 8145, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この衣装、そんなに\n気になります？　なら\nこうしてお花を\n着ければおそろいです", 2, 8146, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お花の種を私に？\nありがとうございます\nせっかくなので一緒に\nお世話しませんか？", 2, 8147, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お花にお水をあげるの\n手伝ってもらえます？\nお水は朝にあげるのが\nいいんですよ", 2, 8148, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "とっておきのお花見\nスポットに\nご案内しますよ\nお弁当も忘れずに！", 2, 8149, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "もうこんな時間\n早く寝ましょう\n草木も眠るなんとか\nって言いますからね", 2, 8150, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お花のお手入れって\nけっこう疲れますね…\nここでちょっと一息\nしちゃおっと", 3, 8152, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "耳にお花を着ければ…\nえへへ、すっごく\nかわいくなったね！", 3, 8153, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "これはラベンダー\nこっちはミモザ\nフローラル系の香り\nっていいですねぇ", 3, 8154, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ポカポカしますね～\nまるで春の陽気\nみたいです～", 3, 8155, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お花を一輪さすだけで\nご飯の時間がとても\n華やかになりますね", 3, 8157, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "お花の本が\nいっぱいある！\n今日はこれで\nお勉強です！", 3, 8158, 130701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ふんふ～ん♪\n華やかな服を着ると\n心がウキウキします♪", 1, 8160, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "花祭りで出会った\nみなさん…\nお元気でしょうか？\nまたお会いしたいです", 1, 8161, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はっ！　そうでした\nこの服の時は\nメイドのお仕事は\nお休みでした…", 1, 8162, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この服は替えが\nありませんから\n大きなドジには\n気を付けないと…", 1, 8163, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "目立ったほつれもなし\n…うん、いい感じに\n補修できました♪", 1, 8164, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "メイド姿でなくても\n心はいつでも\nお嬢さまの\nメイドです♪", 1, 8165, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この服を着ると心が\n浮き立つのはあのかた\nと一緒にいる気持ちに\nなるからでしょうか？", 1, 8166, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "はい、今日は一日\nこの服で過ごそうと\n思います\n変じゃないですよね？", 2, 8167, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "花祭りのおかげで\n少しだけお花に\n詳しくなった…\nような気がします！", 2, 8168, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "花祭り、今度は\nお嬢さまと救護院の\nみんなと一緒に\n行ってみたいですね", 2, 8169, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今度キョウカちゃんと\n花祭りの服でお花を\n見にお出かけ\nするんです", 2, 8170, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "メイド服を全部洗濯\nしちゃうなんて…\nドジっちゃいましたぁ", 2, 8171, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "花祭りの服は私たちの\n思い出の服ですから…\nこれからも\n大切にします♪", 2, 8172, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "はう、そうでした\nお花にお水を\nあげる時間です！", 2, 8173, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯は\nバスケットを持って\nお花畑に食べ\nに行きませんか？", 2, 8174, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "ふぁあ…繕い物を\nしていたらこんな時間\nになってしまいました\n早く寝ないと…", 2, 8175, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわふわしてて\nきもちいいです～\nどんな生地を\nつかってるんだろ～？", 3, 8177, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "かわいいですね～\nぬいぐるみさんにも\n服をつくって\nあげたいです♪", 3, 8178, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りです～\nあれ？　もしかして\n私の服についてる花と\n同じ香りが…？", 3, 8179, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "暖かいですけど\nあまり近づいちゃうと\n頭の花飾りが乾燥\nしちゃいそうですね…", 3, 8180, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…\nいい花を咲かせるには\nしっかりとした栄養が\n必要だそうです！", 3, 8182, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "なるほどなるほど…\nお花のお手入れは\n奥が深いですね…", 3, 8183, 130801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "マホマホ王国にも\nサーカス団設立や\n夢と希望を届けますえ", 1, 8185, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "せっかくの晴れ舞台や\nかっこいいポーズも\nできるようにしたいわ", 1, 8186, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "むむむむ～っ。うーん\nクルルはんみたいに\n胸から宝石を出すんは\n難しいみたいやわ", 1, 8187, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あむっ…んん～♪\nやっぱり練習のあとは\n甘いものに限るわぁ", 1, 8188, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "アーサーたちの衣装も\n今のうちに考えんと…\n生地、足りるやろか", 1, 8189, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "王子はんとなら\nどんなアイデアも\n見つけられます♪", 1, 8190, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "うちの晴れ姿が\n王子はんの目に一等\n輝いて見えますように", 1, 8191, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "キリっとしたうちも\nかっこいい？\nもう、上手やなぁ", 2, 8192, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "新しい演目考えたんよ\nなぁ王子はん、意見\n聞かせてもらえます？", 2, 8193, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "聞いてや王子はん\n動物さんたちとさらに\n息が合うてきたんよ\nみんな頑張り屋さんや", 2, 8194, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "演技の感想なら\n大歓迎どすえ♪\nたんと聞かせてや～", 2, 8195, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "王子はん、本番当日は\n最前席で見たってな\nそしたらうち、もっと\n頑張れますさかい♪", 2, 8196, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この技をあなたに\n捧げます…なんて♪\n驚いたやろ？\nどっきり作戦成功や♪", 2, 8197, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "素敵なショーのためや\n今日も焦らず一歩ずつ\n成長していきまひょ\nな、王子はん♪", 2, 8198, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お弁当、王子はんも\n一緒にいかがどす？\nみんなで食べて団結や", 2, 8199, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜のサーカスも\n幻想的でとっても\n魅力的なんよ\n一緒にいきまひょか♪", 2, 8200, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "練習が終わったあとは\nの～んびりして\n体力を回復せな…", 3, 8202, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子たちとなら\n空中ブランコや\n玉乗りもええなぁ", 3, 8203, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りやなぁ\n本番前の緊張も\n和らげてくれそうやわ", 3, 8204, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "このあったかい感じ…\nスポットライトの熱を\n思い出すわぁ", 3, 8205, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ちゃんと食べへんと\nいい演技はできまへん\n団長はんも言うてたわ", 3, 8207, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "動物さんたちのことも\nもっと勉強せな\n大事な仲間やさかい", 3, 8208, 131001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "器用じゃないが、\n情には厚いよ\nこういう女を「一途」\nってそう言うんだろ？", 1, 8210, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "斬れないものはないと\n思ってきたさ。だけど\n…この気持ちだけは\n斬れないね、絶対に", 2, 8211, 105601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "んしょ、んしょっ…！\n日頃の感謝を込めて\nヒーローさんのお家を\nきれいにしますです♪", 1, 8212, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふむふむ…\n新アトラクションは\nこのギルドハウスを\nモチーフに…", 1, 8213, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ごそごそ、こそこそ…\nヒーローさんに内緒で\nどこかにお礼の宝石を\n隠しておきましょう…", 1, 8214, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "パークの運営が\n落ち着いたら\nわたしもギルド活動？\nしてみたいですます♪", 1, 8215, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こんなすてきな\nおうちに住めたら…\nいえ！　うさぎ小屋で\n十分です～っ", 1, 8216, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒーローさんのおうち\nだって意識したら\nアトラクションよりも\nドキドキしてきます…", 1, 8217, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒーローさんのことを\n考えると顔が赤く…\nこれってもしかして\nひょっとして…？", 1, 8218, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あっ、ヒーローさん！\n話しかけてくれた記念\nということで、宝石\n受け取ってください♪", 2, 8219, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "元気がない時は\n語尾にぴょんですっ！\nさあヒーローさんも\nやってみるぴょん♪", 2, 8220, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ヒーローさんへのご恩\nおばあちゃんうさぎに\nなるまでに、お返し\nできるでしょうか…？", 2, 8221, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ヒーローさん！\n二人で一緒に\nパレードの練習\nしませんか～♪", 2, 8222, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あはは♪\nヒーローさんは\n人を笑顔にする力が\nありますです♪", 2, 8223, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ヒーローさんに\n一日一恩返しですっ！\n返し終わるまで\nやめませんですます♪", 2, 8224, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます♪\nんしょ、んしょっ…！\n気持ちよく起きられた\n記念に宝石どうぞ♪", 2, 8225, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼にフードコートで\nかばばん君バーガー\n買ってきましたよ！\n一緒に食べますです♪", 2, 8226, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日も一日\nお疲れさまですっ♪\nマッサージしますから\n寝そべってください♪", 2, 8227, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "はふぅ～…♪\nお仕事の疲れも\nぴょんぴょ～んって\n飛んでっちゃいます♪", 3, 8229, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わぁっ、とっても\nかわいいですますっ！\nギルドハウスの\nマスコットですね♪", 3, 8230, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ヒーローさんの好きな\n香り…これを宝石に\nつければ、受け取って\nもらえるでしょうか？", 3, 8231, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はあ、気持ちいい♪\nヒーローさんの\n好きな温度に\n調整しときますです♪", 3, 8232, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "支配人は体が資本っ！\nたくさん食べ…すぎて\n動けなくなっちゃい\nましたぁ～…！", 3, 8234, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "パークの\nガイドブックとか\nあったらいいですね♪", 3, 8235, 130901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "外あつすぎ溶けるわ～\nやっぱ部屋ん中で\n水着がラクだねー", 1, 8237, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ン～\nカリザきゅんどこー？\nもしかして逃げた？", 1, 8238, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミソラちゃんと\nリリちゃん誘って\nそろそろイイコト\nしよっかなー？", 1, 8239, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "おねえちゃんに\n頼まれたシゴトは\nまた今度にすっかー\n夏休みだしー♪", 1, 8240, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "騎士きゅんの\nプリンセスフォームも\n見てみたいんだよなー\nンフ♡", 1, 8241, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "スライムを\nこーしてあーしたら\n騎士きゅんの泳ぐ\n練習に使えるっぽ？", 1, 8242, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "おかえり～♡\nって水着で迎えたら\n騎士きゅん喜んで\nくれるかなー？", 1, 8243, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士きゅん\nこのサングラス\nかけてみる？\nぜってー似合うよー", 2, 8244, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "日焼け痛かったら\nいつでも言ってねー\nスライムでひんやり\nしてあげるよ～♪", 2, 8245, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "今から外で\n焼いてこっかなー\n騎士きゅんもどー？", 2, 8246, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "スライムマッサージ\nしてあげよっかー\nほーれ、もみもみ～♡", 2, 8247, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士きゅんが選んだ\n水着も着てみたーい\nネアおねえちゃんに\nどんなの着てほしい？", 2, 8248, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士きゅ～ん\n尻相撲しよっかー♪\nおねえちゃんに\n勝てたらご褒美だぞ～", 2, 8249, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "暑すぎてムダに\n早起きしちった～\n二度寝すっか～\n…ふぁあ…", 2, 8250, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "夏バテしても\nスイカとかかき氷なら\n全然ウェルカム\nなんだよなー", 2, 8251, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日はこのまま\n水着で寝るかー\n夢ん中で泳ごー", 2, 8252, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "いったんキューケイ…\nンー…よし\n充電カンリョ～♪", 3, 8254, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "仲間になりたそうに\nこっち見てんねー\nきゃわいいしおっけ～", 3, 8255, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ン～いいニオーイ\nお日様あたった\n騎士きゅんの\n次くらいかな～", 3, 8256, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "カラダ冷えてきたから\nたすかるーおかげで\nまだまだ水着イケるわ", 3, 8257, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "うめ～\nとまんねぇ～\n夏バテどこいった～？", 3, 8259, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ふむふむ…\nこれは意外と\nぬるっと読めるっぽー", 3, 8260, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "ンフフ～\n海の戦士ってカンジ？\nアリよりのアリだね～", 3, 8262, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "あーやべ\n一瞬で寝そー\nヤバだわ～", 3, 8263, 131101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "服や紙が易々と\n燃えぬとは\nランドソルとはまこと\n住み易き国で候", 1, 8264, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "どの世界にあっても\n民は活力に溢れ\n街は賑わうもの…\n善哉、善哉", 1, 8265, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "食べ歩きに世界征服…\nギルドとはかくも\n自由気儘な徒党に\nありんすなぁ", 1, 8266, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "連絡は…今日もなし\n我が妹子は相変わらず\n放埓なことよ喃", 1, 8267, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "モネは相変わらず\n警戒しきりなれど…\nそのようなところも\n愛らしくあり申す", 1, 8268, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "なんと長閑な世にや\nありけむ…この平和は\n騎士殿たちの努力の\n賜物にありんす喃", 1, 8269, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "『王家の装備』は\n使わぬのかと？\n…フフ。すでに\n用いており申す", 1, 8270, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今ばかりは媛という\n立場は置いて\nこの地の者らと\n歓談したく候", 2, 8271, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "強さの秘密？　…フフ\n女子の秘密を暴くのは\n野暮にござんす\nご寛恕いただきたく候", 2, 8272, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "此方の家屋、\n見目以上に\n堅牢であり申す\n何ぞ仕掛けがありや？", 2, 8273, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "心地よい時間とは\n疾く過ぎ去りゆくもの\n此処で過ごすと改めて\n実感できる喃", 2, 8274, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "視線が気になる？\nこれはすみませぬ\nなにぶん、お前さまは\n見ていて飽きませぬ故", 2, 8275, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お前さまの前では\n誰もが心を開く…\nなんとまぁ罪作りな\n色男にありんすな？", 2, 8276, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "よく眠れましたかの？\n寝る子は良く育つ、と\n古くより申します由", 2, 8277, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "美食殿の作法に倣い\n皆で共に昼餉を頂くと\n致しんしょう", 2, 8278, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "逢魔ヶ時は望まぬ客も\n参るもの…お前さまも\n気をつけなんし", 2, 8279, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "わっちの蛇に\n勝るとも劣らぬ\n座り心地で候", 3, 8281, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "魂、万物に宿る\nとの云いあらば\n情愛を注いでやるのが\nよかろうの", 3, 8282, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いと香しき哉…\n騎士殿は香の道にも\n詳しくあられるか", 3, 8283, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ジオ・ゲヘナの\n灼熱と比ぶれば\nそよ風と変わり\nござんせん", 3, 8284, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "美味なる哉…この味\nぺコリーヌ姫が好むも\n道理にありんす", 3, 8286, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "トーゴクに、オーマ…\n書で見るだけでも\n心惹かれる土地よの", 3, 8287, 129701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "暑い日には\n冷たいものですよねー\nかき氷とか食べて\nすっきりしたいです★", 1, 8289, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海への行き来は\nテレポーテーションに\nお任せです★", 1, 8290, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "トロピカルジュースが\n飲みたいでーす♪\n海の家で見たんですよ\nカップル用ジュース★", 1, 8291, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ご飯どうしようかなー\nあ、海鮮ラーメンとか\n美味しそうかも★", 1, 8292, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水鉄砲、普通に撃つと\n少し物足りないかも…\nどるるるる～ん★って\n感じが欲しいですよね", 1, 8293, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "コイビトっぽいこと\nアオハルっぽいこと\nいっぱいしたいです★\n修羅場とかも♪", 1, 8294, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士さんが溺れたら\n絶対助けに行きますね\n人工呼吸でもなんでも\nしてあげますから★", 1, 8295, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士さーん\n日焼け止めの塗り直し\nお願いします★\n優しくしてくださいね", 2, 8296, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "海で食べたフルーツ？\nはい、まだありますよ\nこっちでもあーんして\n食べさせましょうか★", 2, 8297, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ぺんぽこりんは\nどうしたのかって？\nどうしたんでしょうね\nどーでもいいです★", 2, 8298, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "今日はどんな\nイイコトしましょうか\n思い出作り？\n人助けもいいですね★", 2, 8299, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヒモを引っ張ったら…\n「セ・キ・ニ・ン」\n取ってもらいますよ？\nなーんてウソですけど", 2, 8300, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "みんなでイイコトも\n楽しいですけど～\n…二人でイイコト\nしちゃいますか？", 2, 8301, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝ですよー！\n今日も一日、\nイイコト日和ですね♪", 2, 8302, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "日差しにご注意ですね\n日焼け止め…誰かに\n塗ってほしいなー？\n…ちらっ★", 2, 8303, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜の海って\n惹かれちゃいますよね\n…ロマンチックです★", 2, 8304, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "う～ん、まったり～\nこれぞ新ジャンル\nおうちバカンス★", 3, 8306, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "よーしよーし★\nわたしとイイコト\n一緒にしましょうねー", 3, 8307, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りですねー\nリラックスタイムに\nちょうどよさそう★", 3, 8308, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水遊びのあとは\nしっかり体を\n温めないとですよね★", 3, 8309, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "栄養補給もバッチリ★\n遊びもイイコトも\nお腹が減ってたら\nできませんからねー？", 3, 8311, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "今だと海関連の本とか\n興味あるんですよねー\n魚とか海難救助とか★", 3, 8312, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "かっこいー★\n名前はー…\nぷんぷくぽんとか？", 3, 8314, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "映えますねー\n写真撮ったら\n素敵な思い出に\nなりそうです★", 3, 8315, 131201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "海でもないのに\nこの姿でいるのは…\nやはり、場違いでは\nありませんか…？", 1, 8316, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "スイカとは割ることと\n見つけたり！\n…ですが目隠しすれば\n見当たらないもの…", 1, 8317, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "まぁ、膝に砂が…\n気がつきませんでした\nまるでわんぱくな\nお子様のよう…ふふっ", 1, 8318, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "家の中でスイカを割る\nわけにはまいりません\nここは潔く包丁で\n切りましょう", 1, 8319, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ミソラ様やネア様の\n大胆さを見習って…\nき、騎士きゅーん…★\n難しいですね…", 1, 8320, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "きゅ、急に暗く…！？\n…失礼しました\n鉢巻きが下がってきた\nだけでした…ううぅ", 1, 8321, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "わたくしに剣の才は\nあるのでしょうか…\nいえ、何事もまずは\nやってみなくては", 1, 8322, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "なにか羽織った方が\nよろしいですよね…？\nそのままでいい？\nそれはそれで…その…", 2, 8323, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あの、兄様…？\nスイカの種を飛ばす\n遊びもあるというのは\n…本当なのでしょうか", 2, 8324, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "強くなるための修行は\nまだ始まったばかり\nまずは己の目指すべき\n道を見定めなくては", 2, 8325, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "同じ薄着であっても\n黒い天使の姿より…\n気が楽です", 2, 8326, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "はい、ただいまー！\n…あっ！\n海の家でのお手伝いの\nくせが、つい…", 2, 8327, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "兄様さえよろしければ\nまた一緒に海へ…\nあ…申し訳ありません\n浮ついてしまいました", 2, 8328, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "本日もイイコトをして\n清々しい一日を\n過ごしたいものです\nまさに一日一善ですね", 2, 8329, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼時になると\n海の家の料理を\n思い出してしまいます\n焼きそばにかき氷…♪", 2, 8330, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "兄様…よろしければ\n浜辺を歩きませんか？\nきっと、月が\nきれいでしょうから", 2, 8331, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふわふわ心地よすぎて\n眠くなってしまいます\n水着姿では\nいけません…ふぁ…", 3, 8333, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "なんてよい手触り…\n癖になってしまいます\nふふ、よしよし…♪", 3, 8334, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "爽やかな香り…♪\n日焼け止めクリームを\n思い出してしまいます", 3, 8335, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "冷たい水で冷えた体が\n温まります…♪\nまるで兄様のようです", 3, 8336, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "お腹が空いては\n修行ができません…！\n動きに障りない程度に\n栄養の補給を…！", 3, 8338, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "剣術とスイカ割りが\n上達する指南書…\n見つかりませんね…", 3, 8339, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "さあ、ともに大海原を\n参りましょう！\nなんて…ふふっ♪", 3, 8341, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "まるでおとぎ話の\n登場人物になった\nような心持ちです…♪", 3, 8342, 131601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あたしはなんで水着で\n室内をうろついてるの\nかしら…不思議だわ", 1, 8343, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ、天井が汚れてる\n仕方ないわね\nひとっ飛びしますか", 1, 8344, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はい、お疲れさま♪\n出迎えの言葉は\nやっぱこれよね♪", 1, 8345, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "そういえばあたしって\n羽があるけど\n泳げるのかしら…", 1, 8346, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あいつのために\n浮き輪も用意したし\n抜かりはないわよ", 1, 8347, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海までのガイド計画も\nまとまったわね\nふふっ…楽しみだわ", 1, 8348, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "この水着、あいつが\n選んでくれたのよね\n…大事にしないと", 1, 8349, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ネビアは最近どう？\n迷惑かけてない？\n…かけてるのね", 2, 8350, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あんた…部屋の片付け\nくらい自分でしなさい\n散らかってたわよ？\n…片付けておいたけど", 2, 8351, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "もしかして暇なの？\nだったら記憶でも\n見せましょうか？\n凄く恥ずかしいやつ♪", 2, 8352, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏ってこんなに\n暑いのね…\n海にばかり行く\n気持ちが分かったわ", 2, 8353, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あんたの水着って\n新しいの買わないの？\nなんならあたしが\n選んであげるわよ♪", 2, 8354, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "気軽に触れ合える\n距離にいる…\nあたしにとって\nとても大事なことよ", 2, 8355, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "あらおはよう\n夏の朝は暑いわね\nシャワーでも浴びて\nさっぱりしなさい", 2, 8356, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼は何を食べるの？\nガイド妖精として\n提案しましょうか？", 2, 8357, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜更かしは厳禁よ\n無理やり眠らせて\nあげましょうか？", 2, 8358, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "アメスさまだって\nゴロゴロするときは\nあるのよ～", 3, 8360, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "…ふふっ♪\n何よ、あたしが\nかわいいものを\n愛でちゃだめなの？", 3, 8361, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "こういういい香り…\n塔の中じゃなかなか\n楽しめないのよね", 3, 8362, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "水着を着てるのに\n温まるのって\n矛盾してない？\n気にしすぎかしら", 3, 8363, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "あんたと行動するなら\n沢山食べられるように\nならなきゃね…！", 3, 8365, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "文字を読むのと\nデータを読むのは\nまったく違うわ", 3, 8366, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "へぇ、面白いじゃない\nこういう経験、昔じゃ\nできなかったわ", 3, 8368, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "面白いクッションね\nところであんた…\nあたしで遊んでない？\n気のせいならいいけど", 3, 8369, 131701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "また新しい悪戯\n思いついちゃった♪\n誰に仕掛けようかしら", 1, 8370, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あ～あ、退屈…\nフィオでもからかって\nこようかしら♪", 1, 8371, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ミソギの悪戯って\nレベル高いのよね…\n負けてらんないわ！", 1, 8372, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "家事ニガテなのよね～\nコッコロたちには\n感謝しないとね", 1, 8373, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "私も魔物料理に\n慣れてきちゃった…\n毒されてるわね…", 1, 8374, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "あいつに仕掛ける\n次の悪戯は～…♪\nこれ…ううん…\nやっぱこっちかしら？", 1, 8375, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "結局ギルドハウスが\n一番落ち着くわね\n…私たちの家だもの", 1, 8376, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "悪戯のコツでも\n教えてあげよっか？\n…え～興味ないの？", 2, 8377, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これからもずーっと\n退屈しない毎日に\nしてあげる♪\n私の悪戯でね♪", 2, 8378, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ちょうど退屈してたの\nたーっぷりと\n構ってもらうわよ♪", 2, 8379, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "案内が必要なら\n頼ってくれていいわよ\n一応は私だって\nガイド妖精だし！", 2, 8380, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "冒険のガイドなら\n私に任せなさい♪\nある意味忘れられない\n旅にしてあげる♪", 2, 8381, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "妖精がいる家は\n栄えるのよ♪　だから\nずっといてあげる\nあんたのそばにね♪", 2, 8382, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "きゃははっ！\n寝ぐせついてるわよ？\nこのままにしましょ！\nだって面白いし！", 2, 8383, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "自由に外へ行けるって\nすっごく幸せなことよ\nさ、散歩行きましょ♪", 2, 8384, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "安心していいわ\n寝てるあんたに\n悪戯しないから\n…あんたにはね♪", 2, 8385, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "悪くはないけど…\nあいつの頭の方が\n座り心地いいかも", 3, 8387, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子を使った\n悪戯は…\n…止めとこっと\nこんなにかわいいし♪", 3, 8388, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "このギルドハウスに\nピッタリな匂いね♪\n一言で言えば…\nカオスって感じ？", 3, 8389, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "なんていうか…\n心があたたかいわ\n…変な感じ！", 3, 8390, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ガイド妖精にも\n食事の機能があって\nよかったのかも\nしれないわね…もぐ…", 3, 8392, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "じれったい物語ね…\nこんなの霧を使えば\n一瞬で終わるのに！", 3, 8393, 118601);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わる～い子は\nトゥンヌス漁船に\n乗ってもらおうかな～", 1, 8395, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "たまにはファミリーの\nみんなにもお休みを\nあげないとね～☆", 1, 8396, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "海辺に素敵な\nバーがあるんだ～\n彼が大人になったら\n一緒に行きたいな♪", 1, 8397, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夏の風を肌で\n感じるの好きかも～\nラーゴはどう？", 1, 8398, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "海岸線を\nのんびり散歩もいいね\n砂や貝殻に紛れた\nお宝探しの旅だよ～☆", 1, 8399, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "みんなで集まって\nビーチパーティーでも\n開いちゃおっかな～♪", 1, 8400, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "さて、この水着…\n彼は気に入って\nくれてるかな～？", 1, 8401, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "心ゆくまで夏を\n楽しんじゃお～☆\nほら君も♪", 2, 8402, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "水着似合ってるって？\nふふ♪　うれしいこと\n言ってくれるね～☆", 2, 8403, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "熱中症には\n気を付けないと\nだめだよ～？", 2, 8404, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "海の家ならうちの\nファミリーでやってる\nとこにしよっか☆\n豪遊しちゃお～♪", 2, 8405, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "君と一緒なら\nどんな夏になるのか\n楽しみだね～♪", 2, 8406, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "君といると子供心を\nくすぐられちゃうな～\n大人だって思いっきり\n遊んでいいんだよね♪", 2, 8407, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "さ、今日は何をして\n過ごそっかな～…\nねえ、君は何したい？", 2, 8408, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふふ♪\n波音が心地良い\n時間だね～☆", 2, 8409, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今夜は星空の下で\n乾杯しよっか～☆\n飲み物取ってくるね♪", 2, 8410, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここ涼しい～♪\nちょっと一休み\nしていこっか☆", 3, 8412, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうのも良いけど\nやっぱりラーゴの方が\nかわいいかな～♪", 3, 8413, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "爽やかな香りだね～\nこういう感覚も絵で\n表現してみたいな～", 3, 8414, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "続きを描く前に\n原稿を乾かさないとね\nインクがにじむと\n直すの大変なんだよ～", 3, 8415, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "今日は水着だし…\n食べるのは控えめに\nしておこっかな", 3, 8417, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "話題の作品は\nチェックしないとね～\nあっ、この作家さん\n新刊出すんだ～", 3, 8418, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "うちの出店の客引きに\nこういう乗り物系を\n使うのもアリかな～☆", 3, 8420, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "これ、背景用の\n参考資料に\n一つ欲しいかも♪", 3, 8421, 131801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここに帰るのも\n久しぶり…あれから\n変わったところは\nあるかしら？", 1, 8422, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "バイトも復帰しなきゃ\nうちのギルドにとって\n食費は重要だもの…！", 1, 8423, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "コッコロマ…っ\n…うぅ…\nこの癖は\n直らないのね…", 1, 8424, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この世界はまだまだ\n知らないことだらけね\n『裏世界』とか…", 1, 8425, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "必ずみんなを\n助け出してみせるわ\n…もちろん、兄さんも", 1, 8426, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "またみんなと\n暮らせるなんて…\n夢じゃ、ないのよね", 1, 8427, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "たくさんの人が\n私に優しくしてくれる\n…だからこそ、私も\n頼れる人になりたいわ", 1, 8428, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "次はランドソルの\n街の外にも行きたいわ\nあの…よかったらまた\n一緒に回ってくれる？", 2, 8429, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "独りぼっちで眠るのは\nやっぱり寂しかったわ\n…みんなで雑魚寝？\nそんなの…絶対やるわ", 2, 8430, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "ネビアってば大泣きで\n私を出迎えてくれたの\n…すごく嬉しかったわ", 2, 8431, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "この翼、陽に当たると\n本当に綺麗よね…\n自分のだけれど、つい\nずっと見ちゃうもの", 2, 8432, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "おにーたんっ♪\n…呼びたくなっただけ\n本当にそれだけよっ？", 2, 8433, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "どうしたの？\n…ふふっ、安心して\nこれからもずっと\n私はここにいるわ", 2, 8434, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "みんな起きだす時間ね\n街が活気づいてく感じ\n嫌いじゃないわ", 2, 8435, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "【美食殿】のお昼は\nいつも美味しいから\nまた太っちゃいそうね", 2, 8436, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おやすみなさい\n明日も、その先も\n一緒に冒険しましょう", 2, 8437, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "休憩も大事…よね\nじゃあ遠慮なく…\nふぅ～…♪", 3, 8439, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "はぁ…ふわふわ…♪\nこのかわいさには\nもう抗えないわ…", 3, 8440, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "落ち着く香り…\nこの匂いを嗅いでると\n帰ってきたなって\n思うわね", 3, 8441, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "みんなで野宿した時も\n焚火の明かりを見て\nすごく安心したのよね", 3, 8442, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ペコリーヌさんには\n負けるけど…\n美味しくって手が\n止まらないわ…！", 3, 8444, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "プリンセスフォーム…\n一体どういう仕組みで\n発動するのか、文献に\n書いてないかしら…", 3, 8445, 181201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "すごーく暑いけど、\nこの暑さをどうやって\n乗り越えるかって\n考えるのも楽しいかも", 1, 8447, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "氷で彫刻を作るの？\nそれは楽しそうだけど\nすぐに溶けちゃわ\nないかしら？", 1, 8448, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "お日様の下で遊ぶのも\n部屋の中で涼むのも\nどっちも夏ならではの\n楽しみ方なのね", 1, 8449, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "生き物の観察日記、\n私も書いてみたいな\nパックのお昼寝日記\nなんてどうかしら？", 1, 8450, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "さまぁばけぇしょんは\n計画を立てるもの\nなんだって\n私も挑戦してみるわね", 1, 8451, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "この世界のことを\nもっと知って\nアーラム村のみんなに\nお話ししてあげるの", 1, 8452, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "いつルグニカに帰るか\nわからないからこそ\n毎日頑張らなきゃね", 1, 8453, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日はどこに行くの？\n私は、えーと…\nかき氷が食べたいわ！", 2, 8454, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ここにも精霊が\n住んでたりするの？\n…精霊じゃなくて\nがいど妖精？", 2, 8455, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "パックったら、\n近所の子にいっぱい\nなでなでされてたわ\nすごーく人気者ね！", 2, 8456, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "実は…線香花火の\n特訓をしてたの！\n次は負けないんだから", 2, 8457, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "昨日、みんなの\n似顔絵も絵日記に\n描いてみたんだけど…\n笑っちゃダメよ？", 2, 8458, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "何気ない時間だって\n後で思い返せば\nずっと忘れない\n素敵な思い出になるの", 2, 8459, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "気持ちよく起きて、\nいい一日を過ごしたい\nそんなときには\nラジーオタイソーね！", 2, 8460, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ごはんの時間ね\n暑さに負けないように\nしっかり食べましょう", 2, 8461, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "外は涼しいみたいだし\n夜の散歩に行ってみる\nのはどうかしら？", 2, 8462, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "遊び疲れたら\nここでひとやすみ…\nふわぁ…\n眠くなっちゃった…", 3, 8464, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "細かいところまで\nすごーく丁寧に\n作られてる…", 3, 8465, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "わっ、なんだか\nすーっとする香りね\nちょっぴり涼しく\nなったみたい", 3, 8466, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "海で遊ぶと\n体が冷えるから\nあったかいのも\nすごーく嬉しい…", 3, 8467, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これも美味しい…！\nペコリーヌが\nどんどん食べちゃう\n気持ちが分かるかも", 3, 8469, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "このお話も面白い…！\nあっという間に時間が\n過ぎちゃったわ…\n…ね、寝てません！", 3, 8470, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "この子と一緒に海に\nいったら楽しそうね！\nどこに行けば\n会えるのかしら？", 3, 8472, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "ふかふかね！\nこうしてると波の音が\n聞こえてきそう…", 3, 8473, 131901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "こちらでは水着姿で\n過ごすのも\n珍しくないようですね", 1, 8474, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "メイド服ではなく\n姉様と色違いの水着…\nレムは嬉しいです", 1, 8475, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "少し室温が高いかも\nしれませんね…\nいくつか氷を配置して\nおきましょうか", 1, 8476, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "清涼感があるとはいえ\n鉄球をビーチバレーの\nボールに代用するのは\n危ないでしょうか…", 1, 8477, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふぅー…ふぅー…\nようやく浮輪が\n膨らみました\n姉様にお渡ししないと", 1, 8478, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "海のことをもっと\n教えていただけますか\n…スバルくんと海の\n話をしたいんです", 1, 8479, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "もし海に行く機会が\nあればレムにも…\nお声がけくださいね\nぜひ、お願いします", 1, 8480, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "何を着ていても\nメイドはメイド\n掃除も料理も\nなんでもござれです", 2, 8481, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "スバルくんとあなたは\n兄弟のように\n仲がいいですね\n姉様とレムと一緒です", 2, 8482, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この姿で子どもたちと\n遊ぶのは…さすがに\nはばかられますね\nやはり着替えてきます", 2, 8483, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ナンパ…というものが\n海にはあるそうです\nスバルくんがとても\n警戒していました", 2, 8484, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "魚釣りでしたら\nレムもご一緒します\n氷漬けの魚の備蓄を\n補充したかったので", 2, 8485, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "子どもたちと砂遊びの\n約束をしているんです\nあなたもご一緒に\nいかがですか？", 2, 8486, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ラジーオタイソーは\nもうされましたか？\n体がほぐれますよ", 2, 8487, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ですね。では\n姉様に焼きそばを…\nもちろん皆様の分も\n用意してありますよ", 2, 8488, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "熱帯夜であっても\nお休みの際はお腹を\n冷やさないように\n気をつけてくださいね", 2, 8489, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "とても気持ちよさそう\nです…！\nさっそく姉様に\nお教えしないと", 3, 8491, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "季節に合わせた\n着せ替えができれば\n子どもたちも\n楽しめそうです", 3, 8492, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふむふむ…この香りは\n疲れを癒やしてくれ\nますね。エミリア様に\nお持ちします", 3, 8493, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "身も心もほぐれます\n思っていたよりも\n体が冷えていたみたい\nですね…ふう…", 3, 8494, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "もぐもぐ…んうっ！？\nこのすっぱさは…\n梅干し、ですか…\nくせになりますね…！", 3, 8496, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "海に関する詩文なども\nあるのでしょうか…\n気になります", 3, 8497, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "地竜とは違った\n乗り心地です…\n本物にも乗ってみたい\nものですね", 3, 8499, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "この大きさで\n本物の貝であれば…\nどんな料理にするか\n想像が膨らみます", 3, 8500, 132101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "これがこの世界の\n居住環境か…\n面白い構造だね", 1, 8501, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "暇を持て余していてね\n誰か話し相手に\nなってくれないかな", 1, 8502, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "目新しいものが\nたくさんあるね\n胸が躍るよ", 1, 8503, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "頑丈そうな建物だ\nここなら彼女たちが\n暴れても大丈夫かな？", 1, 8504, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "力が制限されていて\n良かった面もある\n君も吐かずにすんだし", 1, 8505, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "悪さなんてするわけ\nないじゃないか\n傷つくなぁ", 1, 8506, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "普段と違う格好で\n歩き回るのも\n悪くない経験だ", 1, 8507, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ボクに聞きたいことが\nあるなら遠慮なく\n質問するといい", 2, 8508, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "気軽に魔女に\n話しかけるなんて\n君は物好きだね", 2, 8509, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この世界においては\nボクは異物だからね\n大人しくしているさ", 2, 8510, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ボクの反応を\n見たいのかい？\n君の好奇心には\n恐れ入るよ", 2, 8511, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ボクの手を借りたい？\nもちろん構わないさ\n対価はいただくけどね", 2, 8512, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ボクと海を見たい？\nふふ、魅力的な\nお誘いだね", 2, 8513, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "お目覚めかな？\nさて、君の見た夢を\n教えてくれないかな？", 2, 8514, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "食後のお茶を\n一緒にどうだろうか？\nさあ、席に座ってよ", 2, 8515, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おや、お休みかな？\n魔女の前で無防備だね\n…無論、何もしないさ", 2, 8516, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "こういう椅子は\n茶会には向かないね\nつい気が緩んでしまう", 3, 8518, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうものを好きな\n女の子がいいのかな？\n君の嗜好を知りたいな", 3, 8519, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい香りだ\nこれにはどんな\n効能があるんだろう？", 3, 8520, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "火の点け方に\nボクのいた世界との\n違いはないのかな？", 3, 8521, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これもまた未知の味だ\n存分に味わわせて\nもらうとしよう", 3, 8523, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "素晴らしいね\nここには叡智が\n詰まっている", 3, 8524, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 10, 0, 1, 0, "魔物を模倣した\nぬいぐるみか…\n実物を見たくなるね", 3, 8526, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 11, 0, 1, 0, "いい気持ちだ…ボクと\nしたことが、何も考え\nられなくなりそうだ", 3, 8527, 132001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "願わずにいられません\nどうかこちらの\n世界には…悲劇が\n生まれませんようにと", 1, 8528, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "食事のご希望があれば\nなんなりと。お腹が\nいっぱいになるまで\n沢山ご用意しますね", 2, 8529, 109701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "あの男、これからも\n観察が必要ね\nラムの目の届く範囲に\n置く必要があるわ", 1, 8530, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "素直なところは\nあの男の美点ね\n癪だけど、偶然にも\nラムと同じだわ", 2, 8531, 109801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "迷惑かけちゃったけど\n雪遊びは楽しかったわ\nまたやりたい…なんて\n言ったら怒られるかも", 1, 8532, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 103, 0, 12, 0, "数えきれないくらいの\n思い出を、みんなで\n作りましょう！", 2, 8533, 109901);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "わわっ、今すごく\nいい香りがしたけど…\n誰の香水かな\n教えてほしいな…♪", 1, 8534, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "錬金術用の釜、\n置くならどこかな？\n自分専用の錬金釜、\n憧れちゃうよね♪", 1, 8535, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この匂い…誰か\n唐揚げ食べたみたい\nうぅ…お腹空いて\nきちゃうよ", 1, 8536, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "次の新曲のタイトルは\n『恋の錬金術』！\nうーん、ちょっと\nベタ過ぎるかな…", 1, 8537, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あ、錬金の素材\n切らしてたんだ…\n彼を誘って採集に\n行ってこようかな", 1, 8538, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "瞬時に着替えができる\n薬とかできないかな？\n舞台で衣装チェンジ！\nなーんて、楽しそう♪", 1, 8539, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "彼が遊びに来た後は\n部屋の空気がほんのり\n彼の匂いなんだ…\nなんだか幸せだな♪", 1, 8540, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日もバイト？\nそれならこれ飲んで\n私のお手製ポーション\nがんばってきてね！", 2, 8541, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "新しくできたカレー屋\n行ってみない？\n時々スパイスの香りが\n流れてくるんだよ", 2, 8542, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "私のフィギュア\nそっくりでしょ！\nルイちゃんが作って\nくれたんだ", 2, 8543, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "あれ、シャンプー\n変えた？　私と同じの\nだよ！　どうしよう\nドキドキしちゃう…", 2, 8544, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "いらっしゃいませ♪\n何を作りますか？\nなーんてね。錬金堂で\nまた一日店長したいな", 2, 8545, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "クンクン…彼の\nハンカチ…いい匂い♪\n私だけの秘密のお守り\nにしてるんだ", 2, 8546, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ねえねえ、天気も\nいいし一緒に錬金の\n素材集めに行こうよ！", 2, 8547, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯、用意したよ\nあはは、さすがに\nランチは錬成しないよ\n私の手作りだよ♪", 2, 8548, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "今日も一日お疲れさま\nこれ飲んでゆっくり\n休んで。薬じゃないよ\nホットミルクだよ？", 2, 8549, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "昨日、遅くまで\n錬金術の勉強してた\nから眠くって…\nちょっと一休みっと", 3, 8551, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この子にちょっとだけ\n香水かけて、と…\nんー！　だっこした時\nすっごくいい匂い♪", 3, 8552, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "花みたいな、\nお菓子みたいな\nいい香り。気持ちが\n穏やかになるね♪", 3, 8553, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "外でもこの暖かさを\n感じられる道具、\n作れたりしないかな？", 3, 8554, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "素材集めに行くと\nお腹が空くんだよね\nイロハちゃんも\nこの味好きそう", 3, 8556, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "錬金術にはたくさんの\n知識が必要だからね\nさあ、今日も調合書を\n読まなくちゃ", 3, 8557, 132201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ここが騎士さんたちの\n住んでる場所…！\n粗相がないように\n気をつけなきゃ", 1, 8559, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ジオ・テオゴニアの\nみんな、私がいない間\nちゃんとお仕事\nしてればいいけど…", 1, 8560, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "コッコロさんも\n従者として長いって\n聞いたような…\nあの年ですごい…！", 1, 8561, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "自分がもてなされる\n側になるのって\nやっぱりちょっと\n落ち着かないかも…", 1, 8562, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "今度のお休みの日は\n何しよう…？\nあっ、最近できたお店\nヴルムと行こうかな？", 1, 8563, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "お買い物したら\nかわいいからって\nたくさんおまけして\nもらっちゃった…♪", 1, 8564, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ここにいると、つい\nぼんやりしちゃう…\nこれも騎士さんの力…\nなのかな", 1, 8565, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "お手伝いできることは\nありませんか？\nお世話でもなんでも\n任せてくださいっ", 2, 8566, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ランドソルに初めて\n来たときは驚きました\n砂糖の山と思ったら…\nあんなに寒いなんて！", 2, 8567, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あの、ヴルムを\n見ませんでしたか？\nもう…あの子ってば\nまた仕事をサボって…", 2, 8568, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "家具や家が壊れても\n食べられないなんて\nなんだかもったいない\nですね", 2, 8569, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "とっておきの紅茶を\n手に入れたんです\n一杯いかがですか？\nその、日頃のお礼です", 2, 8570, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "頑張ってて偉いって…\nほ、褒めてもなんにも\n出ませんからね！？\n…えへへ♪", 2, 8571, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "おはようございます！\nモーニングティーは\nいかがですか？\n私、準備しますねっ", 2, 8572, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ライラエルさまも\nお昼寝はお好きです\nけど…だからって\n寝すぎはダメですよ！", 2, 8573, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "おやすみなさい\nくれぐれも寝不足には\n気をつけてくださいね", 2, 8574, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "しっかりしないと…\nメイドの私が\n気を抜くなんて…\nそんな…ふぅ…", 3, 8576, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "わぁ、かわいい…♪\nってダメダメ！\nメイドなんだから\n落ち着かないと…！", 3, 8577, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂い…♪\nこの香り、\nライラエルさまも\n好きそうです！", 3, 8578, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ランドソルの環境に\n触れると、この光の\nありがたみが\n身に沁みますね…", 3, 8579, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "甘くない食べ物が\n一般的なのも\n慣れてきました\nあむ…おいひぃ…♪", 3, 8581, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "ランドソルの文字、\n私たちのところと\nちょっと違いますね…\n覚えられるかなぁ", 3, 8582, 127701);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "甘い匂いがしない…\nジオ・テオゴニアとは\n別の世界なんですね", 1, 8584, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "掃除めんど…\nん…このくらいで\nまー十分でしょ", 1, 8585, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "そろそろ食事の\n用意もしなきゃ…\nあーやる事多い…", 1, 8586, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "秘密の隠れ場所、\nまた姉さんにバレた…\n次のを探さないと", 1, 8587, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "知らない間に仕事が\n終わったり…しないか\nしてくれたらいいのに", 1, 8588, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "きちんともてなすには\n騎士さんの好みも\n覚えてかないと…", 1, 8589, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "ご主人サマに\nご奉仕します～♪\n…キャラじゃないか\nやめやめ、恥ずかし…", 1, 8590, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "居心地いいっすね…\n今日からここに\n住んでもいいですか", 2, 8591, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "あの、ちょっと姉さん\n怒らせちゃったんで\n匿ってくれません？", 2, 8592, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "羽と尻尾が格好いい？\n意外と邪魔ですよ\n仰向けで寝にくいし", 2, 8593, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ワークライフバランス\nっていい言葉ですね\nぜひライフ多めで", 2, 8594, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士さんって\n働き者ですね\nそのままあたしの\n仕事も…いえなんでも", 2, 8595, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "熱心に見てても\n尻尾は触らせて\nあげませんってば\n角？　角なら…まぁ", 2, 8596, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "寝ても寝ても\n寝足りない…ふぁ…\nあー…眠たい…", 2, 8597, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "アフタヌーンティーの\n準備は得意ですよ\nつまみ食いとか\n…つまみ食いとか", 2, 8598, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "よく休んでください\n布団は干しといたんで\n…姉さんが", 2, 8599, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふー…\nこのままずーっと\nここに居たい…", 3, 8601, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "あんたも一緒に\nサボっちゃうか～\n…なんて", 3, 8602, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "落ち着く匂い…\n騎士さんの好み\nなんですかね", 3, 8603, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "こういうとこの\n掃除って面倒だし…\n今度でいっか", 3, 8604, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ご飯の前に\nこんな食べたら\n姉さんきっと怒るな…", 3, 8606, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "食に関する本が\nやけに多い…\nお国柄ですかね", 3, 8607, 127801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "すんすん…\nお兄さんの匂いが\nぷんぷんする～♡\nザコくっさぁ♡", 1, 8609, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ぴこーん！\nいひひっ、新作メカの\n面白いアイデア、\n思いついちった～♡", 1, 8610, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "メカもいじりたいし\n服もアクセもほしー…\nあ～、おこづかい\n足んないよ～！", 1, 8611, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お勉強でもしよっかな\nザコお兄さんには\n絶対わかんない\nよーなやつ♡", 1, 8612, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "お兄さんの部屋って\nどこどこぉ？\nメカの実験室に\n使えそうだよね～♡", 1, 8613, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "次のデートコースは\nどんなのかなー？\n…いや、むしろ次は\nぼくが決めちゃうっ？", 1, 8614, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "強奪計画は念入りに♡\nお兄さんのハートも\n全力でザコザコにする\n計画、立てないとね♡", 1, 8615, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "ねー、ヒマヒマヒマ～\nかまってかまってー♡\nどっか連れてけー♡", 2, 8616, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "今日はこっちで\nご飯食べたいなー♡\n…帰っても５日連続の\nバカナ姉カレーだし…", 2, 8617, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "依頼行くならぼくも\n連れてってよー♡\nお兄さんのザコっぷり\n見ててあげる～♡", 2, 8618, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "お兄さんはぼくより\nオトナだもんね～♡\nじゃあオモテナシ、\n期待してるから～♡", 2, 8619, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "ヤマ姉になんかお土産\n持って帰ろうかなー？\nザコお兄さん、選ぶの\n付きあって～♡", 2, 8620, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "遊びにいくときは\nザコお兄さんも\n誘ってあげるよ♡\nどうせヒマでしょ～？", 2, 8621, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "ふぁ～、ねむぅ～…\n夜更かしぶん寝るから\nあとで起こして～♡\nあ、変なこと禁止～♡", 2, 8622, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "おなかすいたぁ～\nなんか食べ行こ♡\n甘いのおごって～♡", 2, 8623, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "えー、もう寝る時間？\nじゃあ…添い寝して\nあげよっか？\nなーんて、ウッソー♡", 2, 8624, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "おお～ふわっふわ～♪\nバンディシャーク号の\n座席に使いたーい！", 3, 8626, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "カワイイ～♡\n改造したらもっと\nカワイくなるかな～？", 3, 8627, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "くんくん…いい匂い♡\nザコお兄さんって\nこーゆー香りが\n好きなのかなぁ～", 3, 8628, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "はー、あったかーい♡\nバンディシャーク号\nにも欲しいかもー♪", 3, 8629, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "食べれるときに\n食べるのが大事って\nヤマ姉言ってたしね～", 3, 8631, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "あ、この本読んだよ♡\n参考文献リストが\nしっかりしてて\n勉強になったなー♪", 3, 8632, 130201);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "部屋は多少ゴチャつい\nてる方が落ち着くのさ\nバンディシャーク号\nみたいにね♪", 1, 8634, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "呆けてるのもいいが\nちいと物足りないねぇ\n麦しゅわもブドウ朱も\n無いなんてさ", 1, 8635, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この家セキュリティが\nなってないねぇ…\n盗賊目線でちょっくら\n指南でもしてやるか", 1, 8636, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "不思議だねぇ\nここで飲むと、酔いが\n回るのが早い気が\nするよ…ヒック", 1, 8637, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ふむ…\nクルマが壊れた時は\nアジト代わりに\n使えそうだ♪", 1, 8638, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "カカッ、いい部屋だ！\n妹を迎える準備は\nできてるみたいだねぇ", 1, 8639, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "…っと、油断したら\n落ち着いちまうね\nボーヤの甘っちょろい\n雰囲気のせいだよ", 1, 8640, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "さすがにこの家から\n盗みはしないさ\nいずれは妹たちの\n共有財産になるからね", 2, 8641, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ボーヤ、暇なら\n博打でもやるかい？\nアタシが負けたら\n掃除でもしてやるよ", 2, 8642, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "立派な家じゃないか！\n一国一城の主とは\nちょっとボーヤのこと\n見くびってたかもねぇ", 2, 8643, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "かわいい義弟のためだ\nアタシが盗ってきた\nお宝をくれてやるよ\n好きな場所に飾りな！", 2, 8644, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "妹と結ばれる前に\n他の女との関係は\n清算しとくように\nわかったね、ボーヤ？", 2, 8645, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "お、ヤシオーリかい？\nフフン、義弟からの\nお酌とあっちゃあ\n断れないねぇ♪", 2, 8646, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "うう…清々しい朝だが\n頭がいてぇ…\nちっと昨日は\n飲みすぎたか…？", 2, 8647, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ほらこれ、ワカナに\n作らせた弁当だ\nこれで昼からも\nバリバリやりな！", 2, 8648, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "まだまだ夜はこれから\n…と言いたいとこだが\n早寝して立派に育ちな\nそれが妹たちの為だよ", 2, 8649, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "中々いい座り心地だが\n盗賊が腑抜ける訳には\nいかないね…が…\nもう少しだけ座るか…", 3, 8651, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうのの中に\n実はレアなブツが\n隠されてるとか\nありがちだねぇ", 3, 8652, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "ふうん、ボーヤは\nこういう匂いが\n好きなのかい？\n妹たちに教えてやろう", 3, 8653, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "体を温めんにゃ\n酵露をカッとやるのが\n一番だが、これも存外\n悪くないねぇ…♪", 3, 8654, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "ガツガツ…\nん、悪くねェ味だ\nこれにヤシオーリでも\nありゃ文句はないね", 3, 8656, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "本にも載ってない\nレアもんのお宝か…\nフッ、想像しただけで\n血沸き肉躍るねぇ…！", 3, 8657, 130001);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "今日の買い物は\nいつものお野菜と…\nあっ、確か特売が\nあったはず…！", 1, 8659, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "お掃除、お掃除…♪\nきゅっきゅっ…\nよいしょ、っと…", 1, 8660, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "洗濯ものも\nたまらないうちに\nやっちゃわないと…", 1, 8661, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "夕飯のメニュー…\n何にしよう？\n期限の早い食材は…", 1, 8662, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "色々お菓子も\n作ってみたいけど…\n予算…足りるかなぁ…", 1, 8663, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士さん…どんな\n料理が好きなんだろ？\n前に作ったコロッケは\n評判よかったけど…", 1, 8664, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "騎士さんと\nおしゃべりすると、\n胸があたたかくなる…\nなんでだろ…？", 1, 8665, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "あっ、騎士さん\nどうかしましたか？\n御用ならいつでも…♪", 2, 8666, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "削っても削っても\n家計簿は赤字…\n騎士さ～ん…\n助けてください～！", 2, 8667, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "手が空いてたら\n日用品の買い出し、\n手伝ってもらっても\nいいですか…？", 2, 8668, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "やっと一息つけそう…\nあっ、わたし\nお茶を淹れてきますね", 2, 8669, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "困りごとがあったら\n言ってくださいね\nわたし…騎士さんの\n力になりたいです", 2, 8670, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "助けてもらった分は\n必ず返しますから…\nそれまでわたしのこと\n見ててくださいね…♪", 2, 8671, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "忘れ物はないですか？\n今日のお仕事も\n頑張りましょうね…！", 2, 8672, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "お昼ご飯できてますよ\n大したものじゃなくて\n恐縮ですけど…", 2, 8673, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜更かしはだめですよ\nわたしも家事を\n終わらせたら寝ないと", 2, 8674, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "これ…割れ物防止の\nクッションに\n使えるかも…？", 3, 8676, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "こういうのいいなぁ…\nけど…フブキちゃんに\n絶対改造されちゃう…", 3, 8677, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "いい匂い…でも\n切れかけてるかも？\nえっと補充するには…", 3, 8678, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "あったかい…\nちょっとだけなら\n休んでも…いいよね", 3, 8679, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "これがあったら\nもうお料理を\n作らなくて済むかも？", 3, 8681, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "新しい節約レシピは…\nあ、この草って\n食べられるんだ…", 3, 8682, 130101);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "愛溢れるランドソルの\nクリスマス…ですか\nいけませんね、つい\n胸が躍ってしまいます", 1, 8684, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ツリーの飾りと\nわたしの髪…\nくるくるしていて\n似ているかも…くすっ", 1, 8685, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "この姿で傲慢な\nわたしになったら…\nいつもより怖がらせて\nしまうでしょうね…", 1, 8686, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "悪魔として、人を\nドキドキさせなくては\nい、イオから教わった\n…投げキスの練習を…", 1, 8687, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "ジオ・テオゴニアの\nお菓子は、ツリーの\n飾りに向いていそう\nですね…ふふっ", 1, 8688, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "騎士のギルドハウス…\nクリスマスの時期も\n暖かいのですね…", 1, 8689, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "城の皆と過ごす宴も\n楽しいですが…\n騎士と二人の宴も\n幸せです…", 1, 8690, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 1, 0, "騎士、あなたの\nもてなしに感謝します\nクリスマスの何たるか\n教えてくださいね", 2, 8691, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "この黒い羽は\nどう手入れすれば？\nイオなら知っている\nでしょうか…", 2, 8692, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "城の皆も連れてきたい\nほど、クリスマスは\n楽しい行事ですね\nお土産も迷います", 2, 8693, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "クリスマスの晩餐に\n招待されたのですが…\nその…辛いものは\nありませんよね…？", 2, 8694, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 101, 0, 4, 0, "クリスマスと言わず…\nいつでも星に祈って\nいますよ？　騎士達に\n幸せがあるように、と", 2, 8695, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 102, 0, 8, 0, "悪魔として騎士を\nドキドキさせる…？\nそ、そのようなこと\nわたしには…うぅ…", 2, 8696, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 1, 1, 0, "朝は寒いですね…\n雪…積もっている\nでしょうか？", 2, 8697, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 2, 1, 0, "ふあぁ…いけません\n公務の滞在先で\nお昼寝など…", 2, 8698, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 3, 1, 0, "夜は悪魔として\n夢を見せましょう\n騎士はどんな夢が\n見たいですか？", 2, 8699, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 1, 0, "ふぅ…落ち着きます…\n家でゆっくりと過ごす\nクリスマスも\n良いものですね", 3, 8701, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 1, 0, "リンドのプレゼントに\nぬいぐるみは…？\n…子ども扱いすると\n落ち込むでしょうか…", 3, 8702, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 4, 0, 1, 0, "暖かいお部屋に\nこの香りを漂わせたら\nふふっ…素敵な時間を\n過ごせそうです", 3, 8703, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 5, 0, 1, 0, "これがあれば、\n寒い冬も安心ですね\n暖かくて…このまま\n眠ってしまいそうです", 3, 8704, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 7, 0, 1, 0, "悪魔の力を使ったら\nお腹が空いてきて\nしまって…\n恥ずかしいです…", 3, 8706, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 8, 0, 1, 0, "クリスマスには多くの\n伝承があるのですね…\n天使の伝承まで\nありましたし…", 3, 8707, 132801);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 14, 0, 1, 0, "まぁ…！\nよくできていますね\nサプライズプレゼント\n…でしょうか。ふふ♪", 3, 8709, 132803);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 15, 0, 1, 0, "ど、どうでしょう…？\n親善交流の催しに\nなりそうでしょうか…", 3, 8710, 132804);
